(363, 'Xerox PhaserÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® 740 Color Printer', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Phaser%C2%AE+740+Color+Printer%22+%22printer+named%3A+%22&btnG=Search', 1494, '2004-07-22', 'This product is supported but no longer sold by Xerox in the United States. Replacement Product: PhaserÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ 6250.Configuration pages are password protected.', '2004-07-22', NULL, NULL),
(364, 'Xerox Phaser 8200', 'http://www.google.com/search?q=%22Phaser+8200%22+%22%C2%A9+Xerox%22+%22refresh%22+%22+Email+Alerts%22&filter=0', 1882, '2004-07-22', 'Brochure info: "The Phaser 8200 uses solid ink, an alternative technology to laser printing. Unlike typical laser printers, solid ink doesn''t require throwaway cartridges to get ink in the printer." Using the Internet, your printer can send performance information to our computers. PhaserSMART, our diagnostic system, examines the information, diagnoses the issue, and immediately walks you through a proposed solution. Automatic alerts minimize printer management problems. Alerts notify you via email when it''s time to replace supplies, or when service is required."Moderator note: you may not be able to connect to the links Google gives if the printers are turned off when not in use.', '2004-07-22', NULL, NULL),
(365, 'Xerox PhaserÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® 840 Color Printer', 'http://www.google.com/search?q=%22Phaser%C2%AE+840+Color+Printer%22+%22Current+Status%22+%22printer+named:%22', 1400, '2004-07-22', 'This product is supported but no longer sold by Xerox in the United States. Support and supplies for this product continue to be available online. Replacement Product: PhaserÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ 8400This search finds the PhaserLinkTM Printer Management Software for the PhaserÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® 840 Color Printer. It seems at least the "Print DEMO" page works without authentication.', '2004-07-22', NULL, NULL),
(367, '"adding new user" inurl:addnewuser -"there are no domains"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22adding+new+user%22+inurl%3Aaddnewuser+-%22there+are+no+domains%22&btnG=Search', 4474, '2004-07-20', 'Allows an attacker to create an account on a server running Argosoft mail server pro for windows with unlimited disk quota (but a 5mb per message limit should you use your account to send mail).', '2004-07-20', NULL, NULL),
(368, 'intitle:"index of" +myd size', 'http://www.google.com/search?num=100&&q=intitle%3A%22index+of%22+%2Bmyd+%2Bsize&btnG=Search', 1668, '2004-07-21', 'The MySQL data directory uses subdirectories for each database and common files for table storage. These files have extensions like: .myd, .myi or .frm. An attacker can copy these files to his machine and using a tool like ''strings'' possibly view the contents of the database.', '2004-07-21', NULL, NULL),
(369, 'filetype:cnf my.cnf -cvs -example', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Acnf+my.cnf+-cvs+-example&btnG=Search', 1553, '2004-07-21', 'The MySQL database system uses my.cnf files for configuration. It can include a lot of information, ranging from pathes, databasenames up to passwords and usernames.Beware this search still gives false positives (examples, templates).', '2004-07-21', NULL, NULL),
