(376, 'intitle:"Index Of" cookies.txt size', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22Index+Of%22+cookies.txt+%22size%22&btnG=Search', 3884, '2004-07-26', 'searches for cookies.txt file. On MANY servers this file holds all cookie information, which may include usernames, passwords, but also gives an attacker some juicy information on this users surfing habits.', '2004-07-26', NULL, NULL),
(377, 'intext:(password | passcode) intext:(username | userid | user) filetype:csv', 'http://www.google.com/search?q=intext:(password+%7C+passcode)+intext:(username+%7C+userid+%7C+user)+++filetype:csv&hl=en&lr=&ie=UTF-8&start=0&sa=N', 1998, '2004-07-26', 'CSV formatted files containing all sorts of user/password combinations. Results may vary, but are still interesting to the casual attacker..', '2004-07-26', NULL, NULL),
