(697, '"Powered by PowerPortal v1.3"', 'http://www.google.com/search?hl=en&lr=&c2coff=1&q=%22Powered+by+PowerPortal+v1.3%22', 1001, '2004-11-18', 'PowerPortal is reported vulnerable to remote SQL injection. This issue is due to a failure of the application to properly validate user-supplied input prior to including it in an SQL query. PowerPortal 1.3 is reported prone to this vulnerability, however, it is possible that other versions are affected as well. An example URI sufficient to exploit this vulnerability has been provided: http://www.example.com/pp13/index.php?index_page=and 1=1http://www.securityfocus.com/bid/11681', '2004-11-18', NULL, NULL),
(698, '"Microsoft (R) Windows * (TM) Version * DrWtsn32 Copyright (C)" ext:log', 'http://www.google.com/search?q=%22Microsoft+%28R%29+Windows+*+%28TM%29+Version+*+DrWtsn32+Copyright+%28C%29%22+ext%3Alog', 1522, '2004-11-23', 'This file spills a lot of juicy info... in some cases, passwords in the raw dump, but not in any I''ve found this time around. However, with a computer name, a user name, and various other nuggets of info, this one file seems to sketch the system pretty well.', '2004-11-23', NULL, NULL),
(700, '"powered by minibb" -site:www.minibb.net -intext:1.7f', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&q=%22powered+by+minibb%22+%2Dsite%3Awww%2Eminibb%2Enet+%2Dintext%3A1%2E7f', 967, '2004-11-19', 'miniBB is reported vulnerable to remote SQL injection. This issue is due to a failure of the application to properly validate user-supplied input prior to including it in an SQL query. miniBB versions prior to 1.7f are reported prone to this issue.http://www.securityfocus.com/bid/11688', '2004-11-19', NULL, NULL),
(701, '"powered by ducalendar" -site:duware.com', 'http://www.google.com/search?num=100&q=%22powered+by+ducalendar%22+-site%3Aduware.com', 1565, '2004-11-23', 'Most duware products use Microsoft Access databases in default locations without instructing the users to change them. The plain text admin passwords are just a click away for any attacker who knows how to type an URL. For Ducalendar it''s: /ducalendar/_private/ducalendar.mdb', '2004-11-23', NULL, NULL),
(702, '"Powered by Duclassified" -site:duware.com', 'http://www.google.com/search?num=100&q=%22Powered+by+Duclassified%22+-site%3Aduware.com', 1588, '2004-11-23', 'Most duware products use Microsoft Access databases in default locations without instructing the users to change them. The plain text admin passwords are just a click away for any attacker who knows how to type an URL. For Duclassified it''s: /duclassified/_private/duclassified.mdb', '2004-11-23', NULL, NULL),
