(708, 'intitle:"ipcop - main"', 'http://www.google.com/search?q=intitle:%22ipcop+-+main%22&filter=0', 1525, '2004-11-23', 'IPCop Firewall is a Linux firewall for home and SOHO users. IPCop can be managed from a simple web interface (which can be found and managed by Google Hackers ;)', '2004-11-23', NULL, NULL),
(709, 'intitle:"Smoothwall Express" inurl:cgi-bin "up * days"', 'http://www.google.com/search?q=intitle%3A%22Smoothwall+Express%22+inurl%3Acgi-bin+%22up+*+days%22', 1365, '2004-11-24', 'smoothwall is a firewall operating system distribution based on Linux. (Not many results for this search at the moment).', '2004-11-24', NULL, NULL),
(711, 'inurl:coranto.cgi intitle:Login (Authorized Users Only)', 'http://www.google.com/search?hl=en&lr=&c2coff=1&q=inurl%3Acoranto.cgi+intitle%3ALogin+%28Authorized+Users+Only%29', 1169, '2004-11-28', 'Coranto is one of the most powerful Content Management System (CMS) available on the market. It is a freeware product written in Perl and it can help the development and streamlining of your site(s). It is written to be a multiuser environment for posting news articles on a web site, it supports multiple browsers, multiple operating systems, produces standard compliant html, has a huge variety of excellent features and is fully extendible via addons. It is free for use on any site, personal or commercial!', '2004-11-28', NULL, NULL),
(714, 'ext:txt "Final encryption key"', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&c2coff=1&client=firefox-a&rls=org.mozilla%3Aen-US%3Aofficial&q=ext%3Atxt+%22Final+encryption+key%22+&btnG=Search', 1309, '2004-11-28', 'IPSec debug/log data which contains user data and password hashes.Can be used to crack passwords.', '2004-11-28', NULL, NULL),
(717, 'inurl:testcgi xitami', 'http://www.google.com/search?hl=en&lr=&c2coff=1&q=inurl%3Atestcgi+xitami&btnG=Search', 1186, '2004-11-28', 'Testpage / webserver environmentThis is the test cgi for xitami webserver. It shows the webserver''s complete environment. Contains very interesting information which can be used a first step into the server.', '2004-11-28', NULL, NULL),
(718, 'intitle:"DocuShare" inurl:"docushare/dsweb/" -faq -gov -edu', 'http://www.google.com/search?q=intitle%3A%22DocuShare%22+inurl%3A%22docushare%2Fdsweb%2F%22+-faq+-gov+-edu', 1364, '2004-11-28', 'some companies use a Xerox Product called DocuShare. The problem with this is by default guest access is enabled and it appears a lot of companies either don''t care or don''t know.', '2004-11-28', NULL, NULL),
(719, 'intext:"Powered By: TotalIndex" intitle:"TotalIndex"', 'http://www.google.com/search?hl=en&q=intext%3A%22Powered+By%3A+TotalIndex%22+intitle%3A%22TotalIndex%22', 1882, '2004-11-28', 'TotalIndex v2.0 is an open source script that is designed to replace the simple, and boring default index page of a site which lists the files in an indexed folder. It''s not PW protected so an attacker can browse the files and take what they want.', '2004-11-28', NULL, NULL),
(720, 'inurl:"GRC.DAT" intext:"password"', 'http://www.google.com/search?q=inurl%3A%22GRC.DAT%22+intext%3A%22password%22', 1692, '2004-11-28', 'symantec Norton Anti-Virus Corporate Edition data file containing encrypted passwords.', '2004-11-28', NULL, NULL),
(721, 'inurl:php.exe filetype:exe -example.com', 'http://www.google.com/search?q=inurl%3Aphp.exe+filetype%3Aexe+-example.com', 1823, '2004-11-28', 'It is possible to read any file remotely on the server with PHP.EXE (assuming a script alias for it is enabled), even across drives. (Note: The GHDB has another search for this file based on directorly listings, try them both)', '2004-11-28', NULL, NULL),
