(724, '"Output produced by SysWatch *"', 'http://www.google.com/search?num=200&q=%22Output+produced+by+SysWatch+*%22', 1999, '2004-11-28', 'sysWatch is a CGI to display current information about your UNIX system. It can display drive partitions, disk or drive usage, as well as resource hogs (running processes) and last but not lease it shows what current users are doing online (including sh scripts etc..).', '2004-11-28', NULL, NULL),
(725, 'PHPKonsole PHPShell filetype:php -echo', 'http://www.google.com/search?q=PHPKonsole+PHPShell++filetype%3Aphp+-echo', 4986, '2004-11-28', 'PHPKonsole is just a little telnet like shell wich allows you to run commands on the webserver. When you run commands they will run as the webservers UserID. This should work perfectly for managing files, like moving, copying etc. If you''re using a linux server, system commands such as ls, mv and cp will be available for you...', '2004-11-28', NULL, NULL),
(726, '"Phorum Admin" "Database Connection" inurl:forum inurl:admin', 'http://www.google.com/search?num=20&q=%22Phorum+Admin%22+%22Database+Connection%22+inurl%3Aforum+inurl%3Aadmin', 1587, '2004-11-28', 'Phorum admin pagesThis either shows Information leakage (path info) or it shows Unprotected Admin pages.', '2004-11-28', NULL, NULL),
(727, '"Warning: mysql_query()" "invalid query"', 'http://www.google.com/search?hl=en&c2coff=1&client=firefox-a&rls=org.mozilla%3Aen-US%3Aofficial&q=%22Warning%3A+mysql_query%28%29%22+%22invalid+query%22&btnG=Search', 4516, '2004-11-28', 'MySQL query errors revealing database schema and usernames.', '2004-11-28', NULL, NULL),
(729, 'inurl:"ipp/pdisplay.htm"', 'http://www.google.com/search?q=inurl%3A%22ipp%2Fpdisplay.htm%22', 1384, '2004-11-30', 'Providing a standout printing solution, Novell iPrint offers secure print services that extend across multiple networks and operating systemsÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€šÃ‚Âbringing the power of the Net to your business environment. This search locates various online printers.', '2004-11-30', NULL, NULL),
(731, 'intitle:"View Img" inurl:viewimg.php', 'http://www.google.com/search?q=intitle:%22View+Img%22+inurl:viewimg.php', 838, '2004-11-30', 'It is reported that the ''viewing.php'' script does not properly validate user-supplied input in the ''path'' variable. A remote user can submit a specially crafted URL to view a list of files within an arbitrary directory. See http://securitytracker.com/alerts/2004/Nov/1012312.html  for more information.', '2004-11-30', NULL, NULL),
(733, 'intext:"Storage Management Server for" intitle:"Server Administration"', 'http://www.google.com/search?q=intext:%22Storage+Management+Server+for%22+intitle:%22Server+Administration%22', 1361, '2004-11-30', 'These pages can reveal information about the operating system and patch level, as well as providing a login portal for hackers to attack. "As part of the IBM TotalStorageÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® Open Software Family, IBM Tivoli Storage (ADSM) Manager protects your organization''s data from hardware failures and other errors by storing backup and archive copies of data on offline storage."', '2004-11-30', NULL, NULL),
(735, 'site:ups.com intitle:&quot;Ups Package tracking&quot; intext:&quot;1Z ### ### ## #### ### #&quot;', 'http://www.google.com/search?hl=en&lr=&safe=off&q=site%3Aups.com+intitle%3A%22Ups+Package+tracking%22+intext%3A%221Z+%23%23%23+%23%23%23+%23%23+%23%23%23%23+%23%23%23+%23%22&btnG=Search', 8882, '2004-11-25', 'Ever use the UPS Automated Tracking Service?? Wanna see where packages are going? Want to Man-in-the-middle their delivery? Well, then here it is.-Digital Spirit', '2004-11-25', NULL, NULL),
(736, 'intitle:"twiki" inurl:"TWikiUsers"', 'http://www.google.com/search?q=intitle%3A%22twiki%22+inurl%3A%22TWikiUsers%22', 1258, '2004-12-02', 'TWiki has many security problems, depeding on the version installed. TWiki, is a flexible, powerful, and easy to use enterprise collaboration platform. It is a structured Wiki, typically used to run a project development space, a document management system, a knowledge base, or any other groupware tool, on an intranet or on the internet. Web content can be created collaboratively by using just a browser. Developers can create new web applications based on a Plugin API.', '2004-12-02', NULL, NULL),
(737, '+"Powered by Invision Power Board v2.0.0..2"', 'http://www.google.com/search?num=100&q=%2B%22Powered+by+Invision+Power+Board+v2.0.0..2%22', 925, '2004-12-01', 'A remote SQL injection vulnerability affects Inivision Power Board. This issue is due to a failure of the application to properly validate user-supplied input prior to using it in an SQL query.http://www.securityfocus.com/bid/11719', '2004-12-01', NULL, NULL),
(738, 'ext:gho gho', 'http://www.google.com/search?q=ext%3Agho+gho', 1250, '2004-12-03', 'Norton Ghost allows administrators to create hard rive images for lots of purposes including backup, migration, etc. These files contain the hard drive images which can be restored to create an exact duplicate of a hard drive, which could contain just about anything!', '2004-12-03', NULL, NULL),
(739, 'ext:pqi pqi -database', 'http://www.google.com/search?q=ext%3Apqi+pqi+-database', 1275, '2004-12-03', 'PQ DriveImage allows administrators to create hard rive images for lots of purposes including backup, migration, etc. These files contain the hard drive images which can be restored to create an exact duplicate of a hard drive, which could contain just about anything!', '2004-12-03', NULL, NULL),
(740, 'ext:vmdk vmdk', 'http://www.google.com/search?q=ext:vmdk+vmdk&num=100&filter=0', 1326, '2004-12-03', 'VMWare allows PC emulation across a variety of platforms. These files are VMWare disk images which essentially contain a copy of an entire PC, which could contain almost anything.', '2004-12-03', NULL, NULL),
(741, 'ext:vmx vmx', 'http://www.google.com/search?q=ext:vmx+vmx&num=100&filter=0', 1333, '2004-12-03', 'VMWare allows PC emulation across a variety of platforms. Theseconfiguration files describe a virtual PC, and reveal information about that PC''s hardware settings.', '2004-12-03', NULL, NULL),
(742, 'inurl:filezilla.xml -cvs', 'http://www.google.com/search?hl=en&lr=&c2coff=1&q=inurl%3Afilezilla.xml+-cvs', 2374, '2004-12-02', 'filezilla.xml contains Sites,Logins and crypted Passwords of ftp connections made with the open source programm filezilla.', '2004-12-02', NULL, NULL),
(743, '+"Powered by phpBB 2.0.6..10" -phpbb.com -phpbb.pl', 'http://www.google.com/search?num=100&q=+%2B%22Powered+by+phpBB+2.0.6..10%22+-phpbb.com+-phpbb.pl', 1282, '2004-12-01', 'phpbb is vulnerable to SQL Injection, allowing people to minipulate the query into pulling data (such as passwords). Arbituary EXEC allows an attacker (if they get on to a new line), to execute their own PHP, which can be fatal.', '2004-12-01', NULL, NULL),
