(759, 'ext:cfg radius.cfg', 'http://www.google.com/search?q=ext:cfg+radius.cfg&hl=en&lr=&filter=0', 1343, '2004-12-06', '"Radiator is a highly configurable and flexible Radius server that supports authentication by nearly 60 different types of authentication methods"This search finds configuration files for this server, revealing its behaviour, methods for authenticating users, etc.', '2004-12-06', NULL, NULL),
(761, 'intext:"powered by Web Wiz Journal"', 'http://www.google.com/search?q=intext:%22powered+by+Web+Wiz+Journal%22&hl=en&lr=&c2coff=1&start=10&sa=N', 2516, '2004-12-13', 'Web Wiz Journal ASP Blog. The MDB database is mostly unprotected and can be downloaded directly. The DB contains administrative acccountsfilename: journal.mdbadmin login: admin.html', '2004-12-13', NULL, NULL),
(762, 'intitle:"vhost" intext:"vHost . 2000-2004"', 'http://www.google.com/search?hl=en&c2coff=1&client=firefox-a&rls=org.mozilla%3Aen-US%3Aofficial&q=intitle%3A%22vhost%22+intext%3A%22vHost+.+2000-2004%22&btnG=Search', 1312, '2004-12-13', 'vHost is a one-step solution for all virtual hosting needs. It enables a Linux/BSD server with single or multiple IP addresses to function as unlimited virtual hosts with HTTP, FTP, SMTP, POP3, IMAP, and other virtual services extentable via modules. It comes with both command-line and web-based graphical user interfaces, which give maximum control to a domain''s owner, while relieving the system administrator of most routine administration tasks.', '2004-12-13', NULL, NULL),
(763, 'intitle:"start.managing.the.device" remote pbx acc', 'http://www.google.com/search?q=intitle%3A%22start.managing.the.device%22+remote+pbx+access+&sourceid', 1808, '2004-12-10', 'MCK Communications, Inc.PBXgatewayIIHigh density central site gateway for remote PBX access(MCK Communications is now known as VESO.)', '2004-12-10', NULL, NULL),
(764, 'allintext:"Powered by LionMax Software" "WWW File Share"', 'http://www.google.com/search?hl=en&c2coff=1&q=allintext%3A%22Powered+by+LionMax+Software%22+%22WWW+File+Share%22&btnG=Zoeken&lr=', 1603, '2004-12-13', 'WWW File Share Pro is a small HTTP server that can help you share files with your friends. They can download files from your computer or upload files from theirs. Simply specify a directory for downloads and a directory for uploads. All servers can be accessed anonymously', '2004-12-13', NULL, NULL),
(765, 'inurl:":631/printers" -php -demo', 'http://www.google.com/search?num=100&hl=en&lr=&newwindow=1&q=inurl%3A%22%3A631%2Fprinters%22+-php+-demo&btnG=Search', 1948, '2004-12-13', 'CUPS provides a portable printing layer for UNIXÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â®-based operating systems. It has been developed by Easy Software Products to promote a standard printing solution for all UNIX vendors and users. CUPS provides the System V and Berkeley command-line interfaces. CUPS uses the Internet Printing Protocol ("IPP") as the basis for managing print jobs and queues. The Line Printer Daemon ("LPD") Server Message Block ("SMB"), and AppSocket (a.k.a. JetDirect).', '2004-12-13', NULL, NULL),
