(781, 'intitle:"Cayman-DSL.home"', 'http://www.google.com/search?q=intitle%3A%22Cayman-DSL.home%22&btnG=Search', 1734, '2004-12-19', 'Cayman DSL modems. Many Cayman units have a weakness where even if remote administration is disabled, some older firmwares will still allow validation if proper login credentials are supplied. In many cases, simply hitting enter will be enough to authenticate. It''s worth noting, many of the vulnerable devices also support telnet right out of the box, as opposed to the linksys models which require a firmware patch.', '2004-12-19', NULL, NULL),
(782, 'intitle:"Index of /CFIDE/" administrator', 'http://www.google.com/search?q=intitle%3A%22Index+of+%2FCFIDE%2F%22+administrator&btnG=Search', 2547, '2004-12-19', 'With ColdFusion, you can build and deploy powerful web applications and web services with far less training time and fewer lines of code than ASP, PHP, and JSP.The search that pulls up directory listings we probably shouldn''t be seeing.. entering the ''administrator'' directory brings up a ColdFusion login screen', '2004-12-19', NULL, NULL),
(783, 'intitle:"Athens Authentication Point"', 'http://www.google.com/search?q=intitle%3A%22Athens+Authentication+Point%22&btnG=Search', 1211, '2004-12-19', 'Athens is an Access Management system for controlling access to web based subscription services. It offers:    * secure single username access to multiple web-based access controlled services    * devolved administration facilities at organisation level    * remote access user accounts    * encrypted account bulk upload facilities    * scalable services with 3 million accounts    * replication facilities at several separate physical locations, offering a resilient authentication service', '2004-12-19', NULL, NULL),
