(789, 'intitle:"welcome.to.squeezebox"', 'http://www.google.com/search?q=intitle%3A%22welcome.to.squeezebox%22+', 1474, '2004-12-19', 'squeezebox is the easiest way for music lovers to enjoy high-quality playback of their whole digital music collection. Stream music from your computer to anywhere in your home. Works with iTunes and provides a powerful web interface for control from any computer on your network.This is neat, on top of giving out all sorts of enumeration information, it also allows one to paruse the music collection on the box, as well as listen if you install the aplet. Way cool.', '2004-12-19', NULL, NULL),
