(798, 'intitle:"Azureus : Java BitTorrent Client Tracker"', 'http://www.google.com/search?hl=en&q=intitle%3A%22Azureus+%3A+Java+BitTorrent+Client+Tracker%22&btnG=Google+Search', 2043, '2004-12-30', 'This query shows machines using the Azureus BitTorrent client''s built-in tracker - the pages are quite simple in the information they give out, simply a list of active torrents.This information may be useful for people wanting to find active BitTorrent trackers for downloading .torrent files from, or for people wanting to find these trackers to shut them down :)', '2004-12-30', NULL, NULL),
(799, 'intitle:"BNBT Tracker Info"', 'http://www.google.com/search?hl=en&q=intitle%3A%22BNBT+Tracker+Info%22&btnG=Google+Search', 2049, '2004-12-30', 'This query shows pages which summarise activity on BNBT-powered BitTorrent trackers - including all the torrents currently being "tracked", the BNBT software version, links to user-lists and ''admin'' pages, etc.This is useful to people who want to find active BitTorrent trackers for downloading - including ones which aren''t ''public''. It is also useful for people wanting to gain some clues into a tracker''s/site''s setup. Some versions of BNBT are also vulnerable to a DOS attack. People targetting BitTorrent trackers because of the questionable legality of their general usage may also find this query useful!', '2004-12-30', NULL, NULL),
(800, 'intitle:"PHPBTTracker Statistics" | intitle:"PHPBT Tracker Statistics"', 'http://www.google.com/search?hl=en&q=intitle%3A%22PHPBTTracker+Statistics%22+%7C+intitle%3A%22PHPBT+Tracker+Statistics%22&btnG=Google+Search', 2089, '2004-12-30', 'This query shows pages which summarise activity on PHPBT-powered BitTorrent trackers - all the torrents currently being "tracked".This is useful to people who want to find active BitTorrent trackers for downloading - including ones which aren''t ''public''. It is also useful for people wanting to gain some clues into a tracker''s/site''s setup. People targetting BitTorrent trackers because of the questionable legality of their general usage may also find this query useful!Often, the URL involved can be changed to access the configuration / installation / deletion script.. which are obviously *not* intended for public access, even if the statistics page is.', '2004-12-30', NULL, NULL),
