(830, 'inurl:citrix/metaframexp/default/login.asp? ClientDetection=On', 'http://www.google.com/search?hl=en&q=inurl%3Acitrix%2Fmetaframexp%2Fdefault%2Flogin.asp%3FClientDetection%3DOn&btnG=Google+Search', 1142, '2005-01-20', 'Citrix (http://citrix.com) is a web application that allows remote access via a client for companies, institutions, and government agencies to "published" folders, files, drives, and applications on the server and often the attached network. There is a XSS vulnerability in a widely used version of their Web Interface. As reported on Securiteam.com:http://www.securiteam.com/securitynews/6X0020K8VW.html A simple test is inlcluded in the advisory.', '2005-01-20', NULL, NULL),
(831, 'ext:txt inurl:dxdiag', 'http://www.google.com/search?q=ext%3Atxt+inurl%3Adxdiag&sourceid=mozilla-search&start=0&start=0&ie=utf-8&oe=utf-8&client=firefox-a&rls=org.mozilla:en-GB:official', 1240, '2005-01-22', 'This will find text dumps of the DirectX Diag utility. It gives an outline of the hardware of the computer, and goes into quite a bit of detail listing driver versions and such. I can''t think of any serious security implacations of this data, but I''ll leave it to your imagination.', '2005-01-22', NULL, NULL),
(832, 'inurl:"usysinfo?login=true"', 'http://www.google.com/search?q=inurl%3A%22usysinfo%3Flogin%3Dtrue%22', 1374, '2005-01-25', 'Dell OpenManage enables remote execution of tasks such as system configuration, imaging, application installation and support. It also used to track hardware and software inventory, to update configurations, drivers, OS and applications and to proactively monitor and correct fault conditionsDell OpenManage standards include the Common Information Model (CIM), Desktop Management Interface (DMI), Simple Network Management Protocol (SNMP), and Wired for Management (WfM).Another possible search for this is:"Log in." inurl:1311/servlet/', '2005-01-25', NULL, NULL),
(834, '"Netware * Home" inurl:nav.html', 'http://www.google.com/search?hl=en&q=%22Netware+*+Home%22+inurl%3Anav.html', 2495, '2005-01-26', 'Rather than submitting various searches for all kinds of NetWare related pages, Novell NetWare''s Home Page is a good place to start for profiling the services available on a NetWare powered system. The results will often include all (or at least some) of the following links to different services on a system - including Server Certificates, iFolder, iManager, NetStorage, Enterprise Web Server Management and the Web Search Manager!', '2005-01-26', NULL, NULL),
(835, 'intext:"Error Message : Error loading required libraries."', 'http://www.google.com/search?hl=en&q=intext%3A%22Error+Message+%3A+Error+loading+required+libraries.%22', 2418, '2005-01-26', 'This throws up pages which contain "CGI ERROR" reports - which include the file (and line number) of the errors occurence, the version of Perl being used, detailed server information (of the form "Apache/1.3.27 (Unix) (Red-Hat/Linux) mod_ssl/2.8.12 OpenSSL/0.9.6b DAV/1.0.3 PHP/4.3.2 mod_perl/1.26"), usernames, setup file names, form / query information, port and path information, etc.. perfect for system-profiling!', '2005-01-26', NULL, NULL),
(836, 'ext:reg "username=*" putty', 'http://www.google.com/search?num=50&q=ext%3Areg+%22username%3D*%22+putty', 1600, '2005-01-27', 'Putty registry entries. Contain username and hostname pairs, as well as type of session (sftp, xterm, etc).', '2005-01-27', NULL, NULL),
(837, 'allinurl:index.htm?cus?audio', 'http://www.google.com/search?&q=allinurl%3Aindex.htm%3Fcus%3Faudio', 2083, '2005-01-27', 'This will find webcams made by Sweex, Orite and others. Supports motion detection, ftp, smtp and save to .avi. Needs ActiveX so works for IE/win only ..', '2005-01-27', NULL, NULL),
(838, 'intitle:"edna:streaming mp3 server" -forums', 'http://www.google.com/search?q=intitle%3A%22edna%3Astreaming+mp3+server%22+-forums', 1513, '2005-01-27', 'Edna allows you to access your MP3 collection from any networked computer. This software streams your MP3s via HTTP to any MP3 player that supports playing off a remote connection (e.g. Winamp, FreeAmp, Sonique, XMMS).Stats pages were found (by klouw) with:"edna:*" intitle:"edna: Site Statistics"', '2005-01-27', NULL, NULL),
(839, 'intitle:"ePowerSwitch Login"', 'http://www.google.com/search?q=intitle%3A%22ePowerSwitch+Login%22&btnG=Search', 1803, '2005-01-27', 'With ePowerSwitch D4 Guard, up to four devices can be individually switched on and off, also with programmed switching states. The activated Guard function ensures exceptionally high equipment availability: continually monitors whether the connected IP-based devices are still active, it can automatically, without user input, reboot any crashed device.', '2005-01-27', NULL, NULL),
(840, 'ext:ini Version=4.0.0.4 password', 'http://www.google.com/search?q=ext%3Aini+Version%3D4.0.0.4+password', 1876, '2005-01-27', 'The servU FTP Daemon ini file contains setting and session information including usernames, passwords and more. This is a more specific search for ServU passwords base on a previous dork by Cybercide.', '2005-01-27', NULL, NULL),
(842, 'inurl:oraweb -site:oraweb.org', 'http://www.google.com/search?hl=en&q=inurl%3Aoraweb+-site%3Aoraweb.org&btnG=Search', 2756, '2005-01-27', 'Oracle administrators tend to naming their servers ora* - maybe because they forget the name of their database all the time.So the Oracle webserver is very often named oraweb.', '2005-01-27', NULL, NULL),
(845, 'intitle:"EverFocus.EDSR.applet"', 'http://www.google.com/search?q=intitle%3A%22EverFocus.EDSR.applet%22', 2176, '2005-01-27', 'The new EDSR-1600 (16-channel), EDSR-900 (9-channel) and EDSR-600 (6-channel) digital video recorders offer all digital video recording benefits and are easy to install and operate like a custom VCR.  Moreover, the 16 &amp; 9 channel devices are the first Digital Video Recorders with an integrated 16x4 basic matrix function.  Existing multiplexers can be connected via a switch output.  Alarms are managed via external alarm inputs and outputs.', '2005-01-27', NULL, NULL),
(847, 'inurl:netscape.hst', 'http://www.google.com/search?q=inurl%3Anetscape.hst+', 1239, '2005-01-27', 'Netscape Bookmark List/History: So an attacker would be able to locate the bookmark and history list', '2005-01-27', NULL, NULL),
(848, 'inurl:"bookmark.htm"', 'http://www.google.com/search?q=inurl%3A%22bookmark.htm%22', 1389, '2005-01-27', 'Bookmarks for Netscape and various other browsers.', '2005-01-27', NULL, NULL),
(849, 'inurl:netscape.hst', 'http://www.google.com/search?q=inurl%3Anetscape.hst+', 1336, '2005-01-27', 'History for Netscape -  So an attacker can read a user''s browsing history.', '2005-01-27', NULL, NULL),
(850, '"powered | performed by Beyond Security''s Automated Scanning" -kazaa -example', 'http://www.google.com/search?q=%22powered+%7C+performed+by+Beyond+Security%27s+Automated+Scanning%22+-kazaa+-example', 2155, '2005-02-03', 'This search finds Beyond Security reports. Beyond Security sells a box which performs automated testing (the product is based on Nessus). The Beyond Security report will help an attacker find vulnerabile services at the attackees site.This dork was found by Jamuse. A cleanup was done by Wolveso. Please note: Both current (feb 2005) results are verifiable as samples - they''re linked from pages on the sites they belong to, as sample reports. But you never know when Google might find some real one''s to play with ?!', '2005-02-03', NULL, NULL),
(851, 'intitle:"EpsonNet WebAssist Rev"', 'http://www.google.com/search?q=intitle%3A%22EpsonNet+WebAssist+Rev%22', 1406, '2005-01-28', 'This reveals the Epson Web Assist page (internal to the machine)', '2005-01-28', NULL, NULL),
(852, '"SquirrelMail version 1.4.4" inurl:src ext:php', 'http://www.google.com/search?q=%22SquirrelMail+version+1.4.4%22+inurl%3Asrc+ext%3Aphp', 905, '2005-01-30', 'date :Jan 30 2005 this search reveal the src/webmail.php which would allow acrafted URL to include a remote web page. This was assigned CAN-2005-0103by the Common Vulnerabilities and Exposures.-what can possibly be done :*A possible cross site scripting issue exists in src/webmail.php that isonly accessible when the PHP installation is running with register_globalsset to On.*A possible local file inclusion issue was uncovered by one of ourdevelopers involving custom preference handlers. This issue is onlyactive if the PHP installation is running with register_globals set to On.', '2005-01-30', NULL, NULL),
(853, 'inurl:na_admin', 'http://www.google.com/search?q=inurl%3Ana_admin', 1768, '2005-02-01', 'This searches for the admin pages for a "Network Appliance" box. An authenticated user could get access to a their data - all of it, in fact up to 100''s Tb of it. This is also part of cgi scanning tools like:  http://www.cirt.net/nikto/UPDATES/1.34/scan_database.db', '2005-02-01', NULL, NULL),
(854, 'intitle:&quot;Connection Status&quot; intext:&quot;Current login&quot;', 'http://www.google.com/search?q=intitle%3A%22Connection+Status%22+intext%3A%22Current+login%22', 1359, '2005-02-02', 'This is an intriguing way of finding various ''5861 DMT Routers'' - the presence of a web-interface to the router also indicates the presence of a telnet interface to the router!', '2005-02-02', NULL, NULL),
(855, 'intitle:"welcome to netware *" -site:novell.com', 'http://www.google.com/search?q=intitle%3A%22welcome+to+netware+*%22+-site%3Anovell.com', 1162, '2005-02-03', 'Novell login portals offering various services storage, printing, email or LDAP access', '2005-02-03', NULL, NULL),
(856, 'intitle:&quot;Brother&quot; intext:&quot;View Configuration&quot; intext:&quot;Brother Industries, Ltd.&quot;', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&rls=GGLD,GGLD:2004-50,GGLD:en&q=intitle%3A%22Brother%22+intext%3A%22View+Configuration%22+intext%3A%22Brother+Industries%2C+Ltd%2E%22', 1405, '2005-02-04', 'Finds a real bunch of Brother printers', '2005-02-04', NULL, NULL),
(857, 'filetype:inc mysql_connect OR mysql_pconnect', 'http://www.google.com/search?q=filetype%3Ainc+mysql_connect+OR+mysql_pconnect', 2216, '2005-02-09', 'INC files have PHP code within them that contain unencrypted usernames, passwords, and addresses for the corresponding databases.  Very dangerous stuff.  The mysql_connect file is especially dangerous because it handles the actual connection and authentication with the database.', '2005-02-09', NULL, NULL),
(858, '"IceWarp Web Mail 5.3.0" "Powered by IceWarp"', 'http://www.google.com/search?q=%22IceWarp+Web+Mail+5.3.0%22+%22Powered+by+IceWarp%22', 1012, '2005-02-07', 'IceWarp Web Mail 5.3.0Multiple cross-site scripting and HTML injection vulnerabilities.http://www.securityfocus.com/bid/12396/', '2005-02-07', NULL, NULL),
(859, '&quot;Powered by DUpaypal&quot; -site:duware.com', 'http://www.google.com/search?q=%22Powered+by+DUpaypal%22+-site%3Aduware.com&btnG=Search&hl=en&lr=&c2coff=1', 2294, '2005-02-07', 'Here is another DUware product, DUpaypal. Once you get hold of the database it contains the admin username and password. The default by the way is admin/passwordThe default location for the database is ../_private/DUpaypal.mdb', '2005-02-07', NULL, NULL),
(860, '-site:php.net -"The PHP Group" inurl:source inurl:url ext:pHp', 'http://www.google.com/search?q=-site%3Aphp.net+-%22The+PHP+Group%22+inurl%3Asource++inurl%3Aurl+ext%3ApHp', 1528, '2005-02-15', 'scripts to view the source code of PHP scripts running on the server. Can be very interesting if it is also allowed to open  configuration files ;-)', '2005-02-15', NULL, NULL),
(861, '"Microsoft CRM : Unsupported Browser Version"', 'http://www.google.com/search?q=%22Microsoft+CRM+%3A+Unsupported+Browser+Version%22', 1647, '2005-02-15', 'Microsoft CRM Login portal.MS says:Microsoft CRM integrates with Microsoft Office, Microsoft Business Solutions for Financial Management, and other business systems to give employees a complete view of customer information. The ease of integration with Microsoft Office is of particular valueÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€šÃ‚Âenabling staff to access Microsoft CRM information from Microsoft Office Outlook and work online or offline with access to sales functionality.', '2005-02-15', NULL, NULL);
