(862, 'intitle:"switch login" "IBM Fast Ethernet Desktop"', 'http://www.google.com/search?num=100&hl=en&lr=&c2coff=1&q=intitle%3A%22switch+login%22+%22IBM+Fast+Ethernet+Desktop%22&btnG=Search', 1788, '2005-02-15', 'IBM 8275 Model 416 High Performance Ethernet Workgroup Switch', '2005-02-15', NULL, NULL),
(863, '"Powered by Link Department"', 'http://www.google.com/search?q=%22Powered+by+Link+Department%22', 2129, '2005-02-15', 'Link management script with advanced yet easy to use admin control panel, fully template driven appearance, static HTML front-end and email notifications.Below the link list a folder ''ld'' exists which contains various juicy information like encrypted admin passwords and session data.', '2005-02-15', NULL, NULL),
(864, '"Powered by MercuryBoard [v1"', 'http://www.google.com/search?hl=en&lr=&c2coff=1&q=%22Powered+by+MercuryBoard+%5Bv1%22&btnG=Search', 1031, '2005-02-09', 'Exploit for MercuryBoard:http://www.securityfocus.com/archive/1/389881/2005-02-06/2005-02-12/0Enter the following search:"Powered by MercuryBoard [v1"And the exploit does work!', '2005-02-09', NULL, NULL),
(865, 'intitle:"Index of" sc_serv.conf sc_serv content', 'http://www.google.com/search?q=intitle%3A%22Index+of%22+sc_serv.conf+sc_serv++content', 1804, '2005-02-10', 'This dork lists sc_serv.conf files. These files contain information for Shoutcast servers and often contain cleartext passwords.Original dork: filetype:conf sc_serv.confCleaned by: c0wzClean date: 2005-04-26', '2005-02-10', NULL, NULL),
(867, 'intitle:"DEFAULT_CONFIG - HP"', 'http://www.google.com/search?q=intitle%3A%22DEFAULT_CONFIG+-+HP%22', 1693, '2005-02-15', 'High scalable Ethernet switches by HP running in the default configuration', '2005-02-15', NULL, NULL),
(868, 'intitle:"web server status" SSH Telnet', 'http://www.google.com/search?q=intitle:%22web+server+status%22+SSH+Telnet', 2031, '2005-02-15', 'simple port scanners for most common ports', '2005-02-15', NULL, NULL),
(870, 'intitle:Linksys site:ourlinksys.com', 'http://www.google.com/search?num=100&hl=en&lr=&c2coff=1&q=intitle%3ALinksys+site%3Aourlinksys.com+&btnG=Search', 1456, '2005-02-15', 'Ourlinksys.com DDNS entries pointing to Linksys web enabled cameras', '2005-02-15', NULL, NULL),
(871, 'intitle:"supervisioncam protocol"', 'http://www.google.com/search?q=intitle:%22supervisioncam+protocol%22', 3300, '2005-02-22', '"SupervisionCam captures and compares images from video cameras, (internet) image files or the computer screen at intervals you define. It starts optional activities when a movement is detected."', '2005-02-22', NULL, NULL),
(872, '+"HSTSNR" -"netop.com"', 'http://www.google.com/search?hl=en&q=%2B%22HSTSNR%22+-%22netop.com%22&btnG=Google+Search', 1407, '2005-02-28', 'This search reveals NetOp license files. From the netop website: "NetOp Remote Control is the most comprehensive, effective and security-conscious way to maintain your IT operations. Designed to fit into all environments, NetOp lets you access users running virtually any operating system, including Windows, Linux, Mac OS X and Solaris. Location isnÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¾Ãƒâ€šÃ‚Â¢t terribly important either. The program offers unrivalled connectivity, supporting all standard communication protocols. Finally, NetOp is also the ideal way to manage and administrate your servers. The system contains a sweeping range of remote management tools, all available on one easy-to-use console."', '2005-02-28', NULL, NULL),
(873, 'inurl:getmsg.html intitle:hotmail', 'http://www.google.com/search?q=inurl:getmsg.html+intitle:hotmail&ie=UTF-8&oe=UTF-8', 2014, '2005-03-02', 'These pages contain hotmail messages that were saved as HTML. These messages can contain anything from personal data to cleartext passwords.', '2005-03-02', NULL, NULL),
(874, 'intext:"Please enter correct password for Administrator Access. Thank you" "Copyright ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â© 2003 SMC Networks, Inc. All rights reserved."', 'http://www.google.com/search?q=intext%3A%22Please+enter+correct+password+for+Administrator+Access%2E+Thank+you%22+%22Copyright+%C2%A9+2003+SMC+Networks%2C+Inc%2E+All+rights+reserved%2E%22', 2228, '2005-02-12', 'Finds SMC Routers.', '2005-02-12', NULL, NULL),
(875, '"delete entries" inurl:admin/delete.asp', 'http://www.google.com/search?q=%22delete+entries%22+inurl%3Aadmin%2Fdelete.asp', 876, '2005-02-17', 'As described in OSVDB article #13715:"AspJar contains a flaw that may allow a malicious user to delete arbitrary messages. The issue is triggered when the authentication method is bypassed and /admin/delete.asp is accessed directly. It is possible that the flaw may allow a malicious user to delete messages resulting in a loss of integrity."The company supporting this software is no longer in business and the software is no longer being updated. Therefore, versions should not matter in this dork.', '2005-02-17', NULL, NULL),
(876, 'inurl:camctrl.cgi', 'http://www.google.com/search?q=inurl%3Acamctrl.cgi', 2157, '2005-03-05', 'Vivotec web cams', '2005-03-05', NULL, NULL),
(877, 'allintitle:Brains, Corp. camera', 'http://www.google.com/search?q=allintitle:Brains,+Corp.+camera', 4092, '2005-03-05', 'mmEye webcam / cam servermmEye is a multifunction multimedia server equipped with 32bit RISC CPU SH-3, and runs UNIX operating system (NetBSD).It has video input ports (1 S signal port, 2 composite signal ports) and PCMCIA Type II slots built in.', '2005-03-05', NULL, NULL),
(878, '"Traffic Analysis for" "RMON Port * on unit *"', 'http://www.google.com/search?num=100&hl=en&lr=&c2coff=1&q=%22Traffic+Analysis+for%22+%22RMON+Port+*+on+unit+*%22&btnG=Search', 2497, '2005-03-05', 'List of RMON ports produced by MRTG which is a network traffic analysis tool. See also #198', '2005-03-05', NULL, NULL),
(879, 'allintitle:aspjar.com guestbook', 'http://www.google.com/search?q=allintitle:aspjar.com+guestbook', 994, '2005-02-18', '"An input validation vulnerability was reported in the ASPJar guestbook. A remote user can gain administrative access and can delete guestbook messages.The ''/admin/login.asp'' script does not properly validate user-supplied input in the password field. A remote user can supply the following characters in password field to inject SQL commands and be authenticated as the administrator:"'' or ''''=''I also found another vulnerability that hasn''t been documented anywhere. Using the above search to find aspjar guestbooks, appending the guestbook directory with /data/guest.mdb will give you a database containing the plaintext username and password for the guestbook admin and all entries in the guestbook, including IP addresses of users.(This company is no longer in business and the software is no longer being updated so versions shouldn''t matter)', '2005-02-18', NULL, NULL),
(880, 'filetype:sql ("values * MD5" | "values * password" | "values * encrypt")', 'http://www.google.com/search?num=100&q=filetype%3Asql+%28%22values+%2A+MD5+%2A%22+%7C+%22values+%2A+password+%2A%22+%7C+%22values+%2A+encrypt+%2A%22%29', 2001, '2005-02-23', 'Locate insert statements making use of some builtin function to encrypt a password. PASSWORD(), ENCRYPT() and MD5() are searched.', '2005-02-23', NULL, NULL),
(883, 'inurl:WCP_USER', 'http://www.google.com/search?q=inurl%3AWCP_USER', 1154, '2005-03-05', 'WebConnect is client-server based software that provides secure browser based emulation to mainframe, midrange and UNIX systems', '2005-03-05', NULL, NULL),
(884, 'intitle:"Dell Laser Printer" ews', 'http://www.google.com/search?q=intitle%3A%22Dell+Laser+Printer%22+ews', 1926, '2005-03-04', 'Finds Dell''s printers with EWS.EWS : Embedded Web Server technology enables the usage of a standard web browser to manage many aspects of the printer, for example, view consumable life, configure network parameters, view serial number information, printer usage etc..', '2005-03-04', NULL, NULL),
(885, 'intitle:"Kurant Corporation StoreSense" filetype:bok', 'http://www.google.com/search?hl=en&q=filetype%3Abok+intitle%3A%22Kurant+Corporation+StoreSense%22&filter=0', 1122, '2005-03-15', 'These are Kurant StoreSense admin logon pages.', '2005-03-15', NULL, NULL),
(886, 'intitle:"active webcam page"', 'http://www.google.com/search?q=intitle%3A%22active+webcam+page%22', 3403, '2005-02-15', 'searches for "Active Webcam" feeds on websites, a popular USB webcam interface.', '2005-02-15', NULL, NULL),
(887, '"powered by CubeCart 2.0"', 'http://www.google.com/search?num=100&hl=en&lr=&newwindow=1&safe=off&c2coff=1&as_qdr=all&q=+%22powered+by+CubeCart+2.0%22', 829, '2005-02-16', 'This search reveals an alarming number of servers running versions of Brooky CubeCart that are reported to be prone to multiple vulnerabilities due to insufficient sanitization of user-supplied data....susceptible to a remote directory traversal vulnerability...cross-site scripting vulnerability may allow for theft of cookie-based authentication credentials or other attacks.An exploit is not required.The following proof of concept examples are available:http://www.example.com/index.php?&amp;language=../../../../../../../../etc/passwdhttp://www.example.com/index.php?&amp;language=var%20test_variable=31337;alert(test_variable); Vulnerability was published 2-14-2005http://www.securityfocus.com/bid/12549/', '2005-02-16', NULL, NULL),
(888, 'filetype:ora tnsnames', 'http://www.google.com/search?hl=en&lr=&safe=off&c2coff=1&q=filetype%3Aora+tnsnames', 1374, '2005-02-15', 'This searches for tns names files.  This is an Oracle configuration file that sets up connection strings for someone''s Oracle client to contact the various databases it is managing.  This file contains ports, IP''s and server names of these database machines.  What I think is more telling is that in most cases, this file is stored in Oracle''s installation directory which can probably be more telling.', '2005-02-15', NULL, NULL),
(890, 'intitle:"SuSE Linux Openexchange Server" "Please activate JavaScript!"', 'http://www.google.com/search?hl=en&q=intitle%3A%22SuSE+Linux+Openexchange+Server%22+%22Please+activate+JavaScript%21%22', 1217, '2005-03-12', 'Another way to find the web administration portal of linux open exchange servers.', '2005-03-12', NULL, NULL),
(891, 'inurl:"suse/login.pl"', 'http://www.google.com/search?hl=en&q=inurl%3A%22suse%2Flogin.pl%22', 1230, '2005-02-20', 'More Suse login portals, mostly Open Exchange.', '2005-02-20', NULL, NULL),
(892, 'intitle:HomeSeer.Web.Control | Home.Status.Events.Log', 'http://www.google.com/search?num=100&q=intitle%3AHomeSeer.Web.Control+%7C+Home.Status.Events.Log', 1840, '2005-03-18', 'HomeSeer (http://www.homeseer.com/) provides a well known home automation solution (software + hardware)This dork will find web interfaces of homeseer.', '2005-03-18', NULL, NULL),
(893, 'Powered.by.RaidenHTTPD intitle:index.of', 'http://www.google.com/search?num=100&q=Powered.by.RaidenHTTPD+intitle%3Aindex.of', 2525, '2005-03-18', 'RaidenHTTPD ( http://www.raidenhttpd.com/en ) is a full featured web server software for Windows', '2005-03-18', NULL, NULL),
