(962, '"Powered by DWMail" password intitle:dwmail', 'http://www.google.com/search?q=%22Powered+by+DWMail%22+password+intitle%3Adwmail&btnG=Search', 1154, '2005-05-02', 'What is DWmailÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢?: DWmailÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ is an ''intelligent'' Web based email application written in the scripting language, PHP. DWmailÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢ allows you and your visitors to access, manage and send email using any POP3 or IMAP4 compliant email account. Simply enter your email address and password to check your email.', '2005-05-02', NULL, NULL),
(963, 'inurl:gnatsweb.pl', 'http://www.google.com/search?q=inurl%3Agnatsweb.pl', 1139, '2005-05-02', 'GNU GNATS is a set of tools for tracking bugs reported by users to a central site. It allows problem report management and communication with users via various means. GNATS stores all the information about problem reports in its databases and provides tools for querying, editing, and maintenance of the databases.', '2005-05-02', NULL, NULL),
(966, 'intitle:open-xchange inurl:login.pl', 'http://www.google.com/search?q=intitle:open-xchange+inurl:login.pl', 1157, '2005-05-02', 'Open-Xchange 5 is a high performance substitute for costly and inflexible Microsoft Exchange deployments -- with the full functionality of a mature collaboration platform. OX 5 will not only manage appointments and tasks, it will take care of email, calendar, contacts, to do''s, projects, documents, search and forums. With OX, you can manage information using bookmarks that are linked to a wide variety of data objects, such as emails, spreadsheets and/or presentations. Open-XchangeT 5 allows you to connect to Microsoft Outlook and devices using the Palm OS. Based on proven open source technologies, OX 5 offers best-of-class security through anti-virus and anti-spam utilities.', '2005-05-02', NULL, NULL),
(968, 'intitle:"WorldClient" intext:"ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â© (2003|2004) Alt-N Technologies."', 'http://www.google.com/search?q=intitle%3A%22WorldClient%22+intext%3A%22%C2%A9+%282003%7C2004%29+Alt-N+Technologies.%22', 1164, '2005-05-02', 'MDaemon , Windows-based email server software, contains full mail server functionality and control with a strong emphasis on security to protect your email communication needs.', '2005-05-02', NULL, NULL),
(969, 'intitle:"Freifunk.Net - Status" -site:commando.de', 'http://www.google.com/search?q=intitle%3A%22Freifunk.Net+-+Status%22+-site%3Acommando.de', 1574, '2005-05-02', 'Hacked WRT54G Freifunk firmware. The router is based on Linux so after the GPL the source code must be published. some guys from freifunk.net have modified it for their needs.', '2005-05-02', NULL, NULL),
