(977, 'inurl::2082/frontend -demo', 'http://www.google.com/search?q=inurl%3A%3A2082%2Ffrontend+-demo', 1637, '2005-05-11', 'This allows you access to CPanel login dialogues/screens.', '2005-05-11', NULL, NULL),
(978, 'intitle:"osTicket :: Support Ticket System"', 'http://www.google.com/search?q=intitle%3A%22osTicket+%3A%3A+Support+Ticket+System%22+&btnG=Search', 824, '2005-05-14', 'osTicket is a widely-used open source support ticket system. It is a lightweight support ticket tool written mainly using PHP scripting language. There are several vulnerabilities in the osTicket software that may allow for an attacker to take control of the affected web server, disclose sensitive data from the database, or read arbitrary files. These issues have been reported to the developers and a new updated version of osTicket is available for download. All affected users should upgrade their osTicket installations immediately.http://www.addict3d.org/index.php?page=viewarticle&amp;type=security&amp;ID=3882', '2005-05-14', NULL, NULL),
(979, 'intext:"Powered by: Adobe PrintGear" inurl:admin', 'http://www.google.com/search?q=intext%3A%22Powered+by%3A+Adobe+PrintGear%22+inurl%3Aadmin+&btnG=Search', 1331, '2005-05-14', 'Printers equipped with Adobe''s PrintGear technologyAdobe''s PrintGear technology is a new printing architecture designed specifically for low-cost, high-quality output. At the core of this architecture is a custom chip, the PrintGear Imaging Processor (or PrintGear processor for short). This processor supplies the performance required for high-resolution output, yet helps keep the overall cost of the output device low.', '2005-05-14', NULL, NULL),
(981, 'inurl:start.htm?scrw=', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&rls=DVXA,DVXA:2005-16,DVXA:en&q=inurl%3Astart%2Ehtm%3Fscrw%3D', 1774, '2005-05-14', 'VPON (Video Picture On Net) is a video surveillance setup which seems to be used by a lot of businesses.  In the FAQ posted on their site (http://www.aegismicro.com/navigation/indexsuppfaq.htm) they show a default username/password of webmonitor/oyo.=)', '2005-05-14', NULL, NULL),
