(986, '(intitle:"502 Proxy Error")|(intitle:"503 Proxy Error") "The proxy server could not handle the request" -topic -mail -4suite -list -site:geocrawler.co', 'http://www.google.com/search?q=%28intitle%3A%22502+Proxy+Error%22%29%7C%28intitle%3A%22503+Proxy+Error%22%29+%22The+proxy+server+could+not+handle+the+request%22+-topic+-mail+-4suite+-list+-site%3Ageocrawler.com+-site%3Aelitesecurity.org&btnG=Search', 3334, '2005-05-30', 'A reverse proxy is a gateway for servers, and enables one web server to provide content from another transparently. These are often implemented to improve security or performance.', '2005-05-30', NULL, NULL),
(987, 'intitle:"Dell *" inurl:port_0', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=intitle%3A%22Dell+*%22+inurl%3Aport_0&btnG=Google+Search', 1383, '2005-05-31', 'oA few Online Dell Printers, status, paper, toner levels, ips macs, the usual.. (Lexmark and Dell seem to share the same embedded webserver it seems, try changing the vendor name.)', '2005-05-31', NULL, NULL),
(988, 'intext:"powered by Hosting Controller" intitle:Hosting.Controller', 'http://www.google.com/search?hl=en&q=intext%3A%22powered+by+Hosting+Controller%22+intitle%3AHosting.Controller+&filter=0', 8091, '2005-05-29', 'Description:==============Hosting Controller is a complete array of Web hosting automation tools for the Windows Server family platform. It is the only multilingual software package you need to put your Web hosting business on autopilot.The HC has its own complete billing solution which is tightly integrated within Control Panel &amp; does all the invoicing &amp; billing.Vuln:======A remote authenticated user can invoke ''resellerdefaults.asp'' to view reseller add-on plans and then load the following type of URL to view the details of a target reseller''s plans:The ''resellerresources.asp'' script does not properly validate user-supplied input in the ''resourceid'' parameter. A remote authenticated user can supply specially crafted parameter values to execute SQL commands on the underlying database. This can be exploited, for example, to delete a reseller add-on plan.More on Vuln/Exploit====================http://securitytracker.com/alerts/2005/May/1014071.html', '2005-05-29', NULL, NULL),
(989, 'intitle:"PacketShaper Customer Login"', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=intitle%3A%22PacketShaper+Customer+Login%22+&btnG=Google+Search', 1290, '2005-05-19', 'PacketShaper Login.Provides login access for PacketShaper Customers.', '2005-05-19', NULL, NULL),
