(993, 'inurl:/SUSAdmin intitle:"Microsoft Software Update Services"', 'http://www.google.com/search?q=inurl%3A%2FSUSAdmin+intitle%3A%22Microsoft+Software+Update+Services%22&btnG=Search', 1218, '2005-05-23', 'Microsoft SUS Server is a Patch Management Tool for Windows 2000, XP and 2003 systems.It can be used to gain access to a Patch Deployment server. If you successfully login to that server you can possibly compromise all the other network servers.', '2005-05-23', NULL, NULL),
(994, 'intitle:"Netopia Router (*.)""to view this site"', 'http://www.google.com/search?q=intitle:%22Netopia+Router+(*.)%22%22to+view+this+site%22&filter=0', 1495, '2005-06-03', 'Web admin for netopia routersThis Web tool provides access to information about the current status of your router and connections.', '2005-06-03', NULL, NULL),
(995, 'intitle:"VisNetic WebMail" inurl:"/mail/"', 'http://www.google.com/search?q=intitle:%22VisNetic+WebMail%22+inurl:%22/mail/%22&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 1122, '2005-06-06', 'VisNetic WebMail is a built-in web mail server that allows VisNetic Mail Server account holders to access their email messages, folders and address books from any standard web browser on an Internet enabled computer.', '2005-06-06', NULL, NULL),
(996, 'inurl:perform.ini filetype:ini', 'http://www.google.com/search?q=inurl:perform.ini+filetype:ini', 1611, '2005-06-06', 'mIRC Passwords For Nicks &amp; Channels in channel\\[chanfolder] section of mirc.ini you can find 2 type of "private" information - secret channels (that is +ps is not listed everythere) and password protected channels - passwords stored in plaintext)', '2005-06-06', NULL, NULL),
(997, '(cam1java)|(cam2java)|(cam3java)|(cam4java)|(cam5java)|(cam6java) -navy.mil -backflip -power.ne.jp', 'http://www.google.com/search?q=(cam1java)%7C(cam2java)%7C(cam3java)%7C(cam4java)%7C(cam5java)%7C(cam6java)+-navy.mil+-backflip+-power.ne.jp&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 1857, '2005-06-01', 'Kpix Java Based Traffic Cameras. Based at CBS broadcasting for  San Fransisco, Oakland, and San Jose.', '2005-06-01', NULL, NULL),
(998, 'allintitle:"Welcome to the Cyclades"', 'http://www.google.com/search?hl=en&q=allintitle%3A%22Welcome+to+the+Cyclades%22&btnG=Google+Search&meta=', 1462, '2005-06-02', 'This search reveals the login page for the Cyclades TS1000 and TS2000 Web Management Service. The Cyclades TS1000 and TS200 devices are Console servers, based on a cut down Linux version. These lovely devices sit on the network with console cables attached to them, so that you then gain access to this device, and then have console access to any of the hosts connected to the console ports. :-)The default username and password for these devices is, root/tslinux.This query currently only returns pages available in Google''s cache (but in the future more devices may be returned).', '2005-06-02', NULL, NULL),
(1000, 'intext:"Powered by X-Cart: shopping cart software" -site:x-cart.com', 'http://www.google.com/search?hl=en&lr=&safe=off&c2coff=1&q=intext%3A%22Powered+by+X-Cart%3A+shopping+cart+software%22+-site%3Ax-cart.com&btnG=Search', 20872, '2005-06-03', 'X-Cart (version 4.0.8) has multiple input validation vulnerabilities. There doesn''t seem to be any way to search for specific versions of the software with Google. See http://www.securitytracker.com/alerts/2005/May/1014077.html for more information.', '2005-06-03', NULL, NULL),
(1001, 'intitle:"PowerDownload" ("PowerDownload v3.0.2 ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â©" | "PowerDownload v3.0.3 ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â©" ) -site:powerscripts.org', 'http://www.google.com/search?q=intitle:%22PowerDownload%22+(%22PowerDownload+v3.0.2+%C3%83%C6%92%C3%A2%E2%82%AC%C5%A1%C3%83%E2%80%9A%C3%82%C2%A9%22+%7C+%22PowerDownload+v3.0.3+%C3%83%C6%92%C3%A2%E2%82%AC%C5%A1%C3%83%E2%80%9A%C3%82%C2%A9%22+)+-site:powerscripts.org', 797, '2005-06-03', 'The PowerDownload program (version 3.0.2 and 3.0.3) contains a serious vulnerability. Vulnerability discovery: SoulBlack - Security Research (http://soulblack.com.ar)Date: 05/31/2005Severity: High. Remote Users Can Execute Arbitrary Code.Affected version: v3.0.2 &amp; v3.0.3vendor: http://www.powerscripts.org/* Fix *Contact the Vendor* References *http://www.soulblack.com.ar/repo/papers/advisory/powerdownload_advisory.txt', '2005-06-03', NULL, NULL),
(1002, 'intitle:"PHPstat" intext:"Browser" intext:"PHPstat setup"', 'http://www.google.com/search?hl=en&lr=&safe=off&q=intitle%3A%22PHPstat%22+intext%3A%22Browser%22+intext%3A%22PHPstat+setup%22&btnG=Search', 1442, '2005-06-03', 'Phpstat shows nice statistical informatino about a website''s visitors. Certain versions are also contain vulnerabilities: http://www.soulblack.com.ar/repo/papers/advisory/PhpStat_advisory.txt', '2005-06-03', NULL, NULL);
