(1003, '"portailphp v1.3" inurl:"index.php?affiche" inurl:"PortailPHP" -site:safari-msi.com', 'http://www.google.com/search?q=%22portailphp+v1.3%22+inurl:%22index.php%3Faffiche%22+inurl:%22PortailPHP%22+-site:safari-msi.com&filter=0', 803, '2005-06-03', 'Vulnerability has been found in parameter "id". If this variableAny value it is possible to replace it with a sign '' is transferredSince this parameter is involved in all modules, all of themAre vulnerable.It occurs because of absence of a filtration of parameter id.Exampleshttp://example/index.php?affiche=News&amp;id=''[SQL inj]http://example/index.php?affiche=File&amp;id=''[SQL inj]http://example/index.php?affiche=Liens&amp;id=''[SQL inj]http://example/index.php?affiche=Faq&amp;id=''[SQL inj]The conclusionVulnerability is found out in version 1.3, on other versionsDid not check. Probably they too are vulnerable.', '2005-06-03', NULL, NULL),
(1004, '+intext:"powered by MyBulletinBoard"', 'http://www.google.com/search?q=%2Bintext%3A%22powered+by+MyBulletinBoard%22&btnG=Search&hl=en&lr=&safe=off&c2coff=1&client=firefox-a&rls=org.mozilla%3Aen-US%3Aofficial', 914, '2005-06-03', 'MyBB is a powerful, efficient and free forum package developed in PHP and MySQL. There is an SQL Injection Exploit available for MyBulletinBoard (MyBB)', '2005-06-03', NULL, NULL),
(1005, 'inurl:"S=320x240" | inurl:"S=160x120" inurl:"Q=Mobile"', 'http://www.google.com/search?q=inurl%3A%22S%3D320x240%22+%7C+inurl%3A%22S%3D160x120%22+inurl%3A%22Q%3DMobile%22', 2381, '2005-06-07', 'Mobile cameras? Not sure what camera type this is for but they are all from Asia and no password is required to view them.. multiple cams and camera views. The &amp;N=* at the end of the URL changes the language of the camera control links, &amp;N=0 is english.This is a slightly modified version of WarChylde''s query, which gives more results.', '2005-06-07', NULL, NULL),
(1006, 'inurl:XcCDONTS.asp', 'http://www.google.com/search?q=inurl%3AXcCDONTS.asp', 2054, '2005-06-07', 'This query reveals an .asp script which can often be used to send anonymous emails from fake senders. When combined with a proxy, the usefulness of these scripts is obvious!', '2005-06-07', NULL, NULL),
(1008, 'inurl:"CgiStart?page="', 'http://www.google.com/search?hl=en&lr=&rls=GGLG%2CGGLG%3A2005-22%2CGGLG%3Aen&q=inurl%3A%22CgiStart%3Fpage%3D%22&btnG=Search', 2369, '2005-06-08', 'This search reveals even more Panasonic IP cameras!', '2005-06-08', NULL, NULL),
(1009, 'intext:"Powered by flatnuke-2.5.3" +"Get RSS News" -demo', 'http://www.google.com/search?q=intext%3A%22Powered+by+flatnuke-2.5.3%22+%2B%22Get+RSS+News%22+-demo', 799, '2005-06-10', 'Description of VulnerabilitiesMultiple vulnerabilities in FlatNuke have been reported, which can be exploited by remote users to trigger denial of service conditions, execute arbitrary PHP code, conduct Cross-Site Scripting attacks and disclose arbitrary images and system information.If the "/flatnuke/foot_news.php" script is accessed directly a while() call is made that enters an infinite loop, leading to full CPU utilisation.[..]User-supplied input passed to the "image" parameter in the "thumb.php" script is not correctly validated. This can be exploited to disclose arbitrary images from external and local resources via directory traversal attacks, or to disclose the installation path.It is also possible to disclose the system path by accessing certain scripts directly or specially formed parameters.', '2005-06-10', NULL, NULL),
(1010, 'inurl:pass.dat', 'http://www.google.com/search?q=filetype%3Adat+inurl%3Apass.dat&btnG=Search', 2209, '2005-06-04', 'Accesses passwords mostly in cgibin but not all the timeCan find passwords + usernames (sometimes username), some unecrypted some not', '2005-06-04', NULL, NULL),
