(1253, '"Powered by Midmart Messageboard" "Administrator Login"', 'http://www.google.com/search?q=%22Powered+by+Midmart+Messageboard%22+%22Administrator+Login%22&sourceid=mozilla-search&start=0&start=0&ie=utf-8&oe=utf-8&client=firefox-a&rls=org.mozilla:en-US:official', 1684, '2006-01-16', 'Midmart Messageboard lets you run a highly customizable bulletin board with a very nice user interface (similar to Yahoo Clubs) on your web site in few minutes. Many other features included. Rar found it murfie cleaned it up.', '2006-01-16', NULL, NULL),
