(1257, 'filetype:reg reg +intext:ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚ÂWINVNC3ÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡Ãƒâ€šÃ‚Â¬ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â', 'http://www.google.com/search?hl=en&lr=lang_en&q=filetype%3Areg+reg+%2Bintext%3A%E2%80%9DWINVNC3%E2%80%9D&lr=lang_en', 3103, '2006-02-05', 'This can be used to get encoded vnc passwords which can otherwise be obtained by a local registry and decoded by cain &amp; abel. The query find registry entries which can otherwise be found can locally in:\\HKEY_CURRENT_USER\\Software\\ORL\\WinVNC3\\Password or\\HKEY_USERS\\.DEFAULT\\Software\\ORL\\WinVNC3\\PasswordIf you are a cain and abel user you''ll and have used this feature before you will know how useful this query is. Other than decoded passwords you can also find other useful information on the VNC server and its security. I have successfully gained access to many VNC servers.', '2006-02-05', NULL, NULL),
(1259, 'intext:"Fill out the form below completely to change your password and user name. If new username is left blank, your old one will be assumed." -edu', 'http://www.google.com/search?q=intext:%22Fill+out+the+form+below+completely+to+change+your+password+and+user+name.+If+new+username+is+left+blank,+your+old+one+will+be+assumed.%22+-edu+-gov+-mil&hl=en&lr=&start=180&sa=N&filter=0', 1505, '2006-02-08', 'The page to change admin passwords. Minor threat but the place to start an attack.', '2006-02-08', NULL, NULL),
