(1261, 'intext:"Welcome to Taurus" "The Taurus Server Appliance" intitle:"The Taurus Server Appliance"', 'http://www.google.com/search?q=intext:%22Welcome+to+Taurus%22+%22The+Taurus+Server+Appliance%22+intitle:%22The+Taurus+Server+Appliance%22&hl=en&lr=&client=firefox-a&rls=org.mozilla:en-US:official&filter=0', 1698, '2006-02-08', 'Celestix Networks, Inc., the premier supplier of network server appliance, announces the Taurus(TM) Server Appliance, the all-in-one networking solution for the small to midsize business. The Taurus(TM) Server Appliance offers no compromise on functionality and scalability, and provides optimum efficiency at a lower price than traditional servers.With a single purchase, up to 250 users have integrated file and peripheral sharing, high-speed Internet access, email, scheduled back-up, VPN and secure firewall, anti-virus engine, and Intranet. Standard with built-in networking software and optimized applications, the Taurus(TM) supplies up to 40-GB of Internal storage. Seperate Admin and root password. Root password must be changed from the command prompt which means most Sysadmins won''t change it from Default. Manuel hosted by the device no password needed.', '2006-02-08', NULL, NULL),
(1263, 'inurl:setdo.cgi intext:"Set DO OK"', 'http://www.google.com/search?q=inurl:setdo.cgi+intext:%22Set+DO+OK%22&hl=en&hs=hLE&lr=&client=firefox-a&rls=org.mozilla:en-US:official&filter=0', 2410, '2006-02-08', 'Dcs-2100 camerasBy removing "intext:Set DO OK" you will get more hits but they will require a login. Set DO OK is almost always admin access, you will need to go to the root of the URL to use the camera.', '2006-02-08', NULL, NULL),
