(1276, 'intitle:"Joomla - Web Installer"', 'http://www.google.com/search?q=intitle:%22Joomla+-+Web+Installer%22&num=100&hl=en&lr=&safe=off&filter=0', 3105, '2006-03-18', 'Joomla! is a Content Management System (CMS) created by the same team that brought the Mambo CMS. This dork finds the Web Installer page. On newer versions, after you install, joomla asks to delete installation dir before to be functional.The Webinstaller gives an attacker information about the php configuration and rgod has even found a way to inject data into the configuration.php file, resulting in a DoS attack (see the forums for more info).The admin logon can be found searching: intitle:"- Administration [Joomla]" but there are no default passwords.', '2006-03-18', NULL, NULL),
