(3668, 'allintext:"fs-admin.php"', 'http://www.google.com/search?q=allintext:fs-admin.php', 13197, '2011-01-09', 'A foothold using allintext:"fs-admin.php" shows the world readable <br/>\r\ndirectories of a plug-in that enables Wordpress to be used as a forum. Many <br/>\r\nof the results of the search also show error logs which give an attacker the <br/>\r\nserver side paths including the home directory name. This name is often also <br/>\r\nused for the login to ftp and shell access, which exposes the system to <br/>\r\nattack. There is also an undisclosed flaw in version 1.3 of the software, as <br/>\r\nthe author has mentioned in version 1.4 as a security fix, but does not tell <br/>\r\nus what it is that was patched.<br/>\n<br/>\n<br/>\r\nAuthor: DigiP<br/>', '2011-01-09', NULL, NULL),
