(3782, '"mailing list memberships reminder"', 'http://www.google.com/search?q=%22mailing%20list%20memberships%20reminder%22', 7114, '2012-05-15', 'Hi,<br/>\n<br/>\r\nBy default, while subscribing to a mailing list on a website, running<br/>\r\nMailman (GNU) for mailing list management, the user has got options to<br/>\r\nmanage his/her subscription options.<br/>\r\nThere is an option of getting password reminder email for this list<br/>\r\nonce in a month.<br/>\r\nAnd, by default, this option is set to Yes.<br/>\r\nAlong with sending the password reminder mail in *plain text* to the<br/>\r\nusers, it gets archived on the sites too.<br/>\n<br/>\r\nThanks,<br/>\r\nSagar Belure<br/>', '2012-05-15', NULL, NULL),
