(3787, 'inurl:Settings.aspx intitle:Beyond TV', 'http://www.google.com/search?q=inurl:Settings.aspx%20intitle:Beyond%20TV', 10121, '2012-05-15', 'Beyond TV gives you the capability to turn your PC into a high quality,<br/>\r\ndigital video recorder (DVR). Most people use it for cable TV so that<br/>\r\nthey don''t have to spend rent money on a low end quality hardware DVR<br/>\r\nfrom their cable company. It''s default config has no password or<br/>\r\nusername enabled. Very bad for people who connect their PCs directly to<br/>\r\ntheir modems. I have Beyond TV and I was curious on how secure it is.<br/>', '2012-05-15', NULL, NULL),
