(3933, 'intitle:"pChart 2.x - examples" intext:"2.1.3"', 'http://www.google.com/search?q=intitle:%22pChart%202.x%20-%20examples%22%20intext:%222.1.3%22', 1484, '2014-02-05', 'The web application is vulnerable to Directory Traversal and XSS.<br/>\r\nThe version number can be omitted, all prior versions prior than 2.1.4<br/>\r\nare vulnerable.<br/>\r\nAdvisories and Vulnerabilities<br/>\r\nhttp://www.exploit-db.com/exploits/31173/<br/>\r\nhttp://www.pchart.net/advisory<br/>', '2014-02-05', NULL, NULL),
