(14, 'IIS 4.0', 'http://www.google.com/search?q=intitle:%22Welcome+to+IIS+4.0%22&num=100&hl=en&lr=&ie=UTF-8&filter=0', 1861, '2003-06-24', 'Moving from personal, lightweight web servers into more production-ready software, we find that even administrators of Microsoft''s Internet Information Server (IIS) sometimes don''t have a clue what they''re doing. By searching on web pages with titles of "Welcome to IIS 4.0" we find that even if they''ve taken the time to change their main page, some dorks forget to change the titles of their default-installed web pages. This is an indicator that their web server is most likely running, or was upgraded from, the now considered OLD IIS 4.0 and that at least portions of their main pages are still exactly the same as they were out of the box. Conclusion? The rest of the factory-installed stuff is most likely lingering around on these servers as well. Old code: FREE with operating system.Poor content management: an average of $40/hour. Factory-installed default scripts: FREE with operating system.Getting hacked by a script kiddie that found you on Google: PRICELESS.For all the things money can''t buy, there''s a googleDork award.', '2003-06-24', NULL, NULL),
(27, 'config.php', 'http://www.google.com/search?sourceid=navclient&q=intitle%3A%22Index+of%22+config%2Ephp', 2026, '2003-06-24', 'This search brings up sites with "config.php" files. To skip the technical discussion, this configuration file contains both a username and a password for an SQL database. Most sites with forums run a PHP message base. This file gives you the keys to that forum, including FULL ADMIN access to the database. Way to go, googleDorks!!', '2003-06-24', NULL, NULL),
(34, 'private', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=intitle%3Aindex%2Eof%2Eprivate', 3792, '2003-06-27', 'What kinds of things might you find in directories marked "private?" let''s find out....', '2003-06-27', NULL, NULL),
(38, 'protected', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&q=inurl%3Aindex.of.protected&btnG=Google+Search', 2957, '2003-06-27', 'What could be in a directory marked as "protected?" Let''s find out...', '2003-06-27', NULL, NULL),
(48, 'auth_user_file.txt', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=allinurl%3Aauth_user_file.txt', 2795, '2003-07-11', 'DCForum''s password file. This file gives a list of (crackable) passwords, usernames and email addresses for DCForum and for DCShop (a shopping cart program(!!!). Some lists are bigger than others, all are fun, and all belong to googledorks. =)', '2003-07-11', NULL, NULL),
(52, 'aboutprinter.shtml (More Xerox printers on the web!)', 'http://www.google.com/search?hl=en&ie=UTF-8&oe=UTF-8&q=aboutprinter.shtml&btnG=Google+Search', 1923, '2003-08-11', 'More Xerox printers on the web! Google found these printers. Should their management interface be open to the WHOLE INTERNET? I think not.', '2003-08-11', NULL, NULL),
(63, '"YaBB SE Dev Team"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22YaBB+SE+Dev+Team%22', 1955, '2004-03-04', 'Yet Another Bulletin Board (YABB) SE (versions 1.5.4 and 1.5.5 and perhaps others) contain an SQL injection vulnerability which may allow several attacks including unauthorized database modification or viewing. See http://www.securityfocus.com/bid/9674for more information. Also see http://www.securityfocus.com/bid/9677for information about an information leakage vulnerability in versions YaBB Gold - Sp 1.3.1 and others.', '2004-03-04', NULL, NULL),
(108, 'intitle:"Test Page for Apache" "It Worked!"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3A%22Test+Page+for+Apache%22+%22It+Worked%21%22', 1999, '2004-03-04', 'This is the default web page for Apache 1.2.6 - 1.3.9. Hackers can use this information to determine the version of the web server, or to search Google for vulnerable targets. In addition, this indicates that the web server is not well maintained.', '2004-03-04', NULL, NULL),
(121, 'inurl:footer.inc.php', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Afooter.inc.php', 1489, '2004-03-14', 'From http://www.securityfocus.com/bid/9664, the AllMyPHP family of products (Versions 0.1.2 - 0.4) contains several potential vulnerabilities, som elalowing an attacker to execute malicious code on the web server.', '2004-03-14', NULL, NULL),
(132, 'allintitle:Netscape FastTrack Server Home Page', 'http://www.google.com/search?q=allintitle:Netscape+FastTrack+Server+Home+Page&ie=UTF-8&oe=UTF-8', 1610, '2004-03-18', 'This finds default installations of Netscape Fasttrack Server. In many cases, default installations can be insecure especially considering that the administrator hasn''t gotten past the first few installation steps.', '2004-03-18', NULL, NULL),
(134, 'intitle:"Index of c:\\Windows"', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&safe=off&q=intitle%3A%22Index+of+c%3A%5CWindows%22', 4426, '2004-02-10', 'These pages indicate that they are sharing the C:\\WINDOWS directory, which is the system folder for many Windows installations.', '2004-02-10', NULL, NULL),
(156, 'index.of perform.ini', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=index%2Eof+perform%2Eini', 4423, '2004-04-13', 'This file contains information about the mIRC client and may include channel and user names.', '2004-04-13', NULL, NULL),
(178, 'intitle:Snap.Server inurl:Func=', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=intitle%3ASnap.Server+inurl%3AFunc%3D', 1394, '2004-04-23', 'This page reveals the existance of a SNAP server (Netowrk attached server or NAS devices) Depending on the configuration, these servers may be vulnerable, but regardless the existance of this server is useful for information gathering.', '2004-04-23', NULL, NULL),
(188, 'inurl:ojspdemos', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Aojspdemos', 1511, '2004-04-28', 'This directory contains sample Oracle JSP scripts which are installed on the server. These programs may have security vulnerabilities and can be used by an attacker to footprint the server.', '2004-04-28', NULL, NULL),
(205, '"index of" inurl:recycler', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22index+of%22+inurl%3Arecycler', 2361, '2004-05-04', 'This is the default name of the Windows recycle bin. The files in this directory may contain sensitive information. Attackers can also crawl the directory structure of the site to find more information. In addition, the SID of a user is revealed also. An attacker could use this in a variety of ways.', '2004-05-04', NULL, NULL),
(217, 'filetype:mbx mbx intext:Subject', 'http://www.google.com/search?q=filetype:mbx+mbx+intext:Subject&hl=en&lr=&ie=UTF-8&oe=UTF-8&start=20&sa=N', 1586, '2004-05-11', 'These searches reveal Outlook v 1-4 or Eudora mailbox files. Often these are made public on purpose, sometimes they are not. Either way, addresses and email text can be pulled from these files.', '2004-05-11', NULL, NULL),
(234, 'intitle:intranet inurl:intranet +intext:"human resources"', 'http://www.google.com/search?ie=utf-8&oe=utf-8&q=intitle%3Aintranet+inurl%3Aintranet+%2Bintext%3A%22human+resources%22', 2603, '2004-05-13', 'According to whatis.com: "An intranet is a private network that is contained within an enterprise. [...] The main purpose of an intranet is to share company information and computing resources among employees [...] and in general looks like a private version of the Internet."This search allows you to not only access a companies private network, but also provides employee listings and other sensitive information that can be incredibly useful for any social engineering endeavour', '2004-05-13', NULL, NULL),
(262, '"Index Of /network" "last modified"', 'http://www.google.com/search?q=%22Index+Of+%2Fnetwork%22+%22last+modified', 2119, '2004-06-01', 'Many of these directories contain information about the network, though an attacker would need  a considerable amount of patience to find it.', '2004-06-01', NULL, NULL),
(290, 'allinurl:".nsconfig" -sample -howto -tutorial', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=active&q=allinurl%3A%22.nsconfig%22+-sa', 1505, '2004-06-18', 'Access to a Web server''s content, CGI scripts, and configuration files is controlled by entries in an access file. On Apache and NCSA Web servers the file is .htaccess, on Netscape servers it is .nsconfig.These files associate users, groups, and IP addresses with various levels of permissions: GET (read), POST (execute), PUT (write), and DELETE. For example, a FrontPage author would have permission to use HTTP POST commands (to save new content), and a user with browse permissions would be permitted to use HTTP GET commands (to read content).', '2004-06-18', NULL, NULL),
(311, 'Panasonic Network Cameras', 'http://www.google.com/search?hl=en&ie=UTF-8&q=inurl%3A%22ViewerFrame%3FMode%3D%22&btnG=Google+Search', 2353, '2004-07-10', 'Panasonic Network Cameras can be viewed and controlled from a standard web browser. These cameras can be placed anywhere to   keep an eye on things, with no PC required on the location. Check for more information: http://www.panasonic.com/netcam/There is a htaccess protected admin page at "http://[target-ip]/config.html" on the target device. Admin logins have no defaults, but created during setup.', '2004-07-10', NULL, NULL),
(344, '"sets mode: +k"', 'http://www.google.com/search?q=%22sets+mode:+%2Bk%22&ie=UTF-8&oe=UTF-8', 7003, '2004-07-19', 'This search reveals channel keys (passwords) on IRC as revealed from IRC chat logs.', '2004-07-19', NULL, NULL),
(350, '"MaXX/3.1" intitle:index.of', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22MaXX%2F3.1%22+intitle%3Aindex.of&btnG=Search', 1310, '2004-07-19', 'The version of a particular web server can be detected with a simple query like this one. Although the same thing can be accomplished by browsing the web site, this method offers another layer of anonymity. Armed with this information an attacker can plan an attack with more precision.', '2004-07-19', NULL, NULL),
(354, '"Microsoft-IIS/6.0" intitle:index.of', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Microsoft-IIS%2F6.0%22+intitle%3Aindex.of&btnG=Search', 2773, '2004-07-19', 'The version of a particular web server can be detected with a simple query like this one. Although the same thing can be accomplished by browsing the web site, this method offers another layer of anonymity. Armed with this information an attacker can plan an attack with more precision.', '2004-07-19', NULL, NULL),
(358, '"Red Hat Secure/3.0 server at"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Red+Hat+Secure%2F3.0+server+at%22&btnG=Search', 1396, '2004-07-19', 'The version of a particular web server can be detected with a simple query like this one. Although the same thing can be accomplished by browsing the web site, this method offers another layer of anonymity. Armed with this information an attacker can plan an attack with more precision.', '2004-07-19', NULL, NULL),
(366, '"index of" / picasa.ini', 'http://www.google.com/search?hl=en&ie=UTF-8&q=%22index+of%22+%2F+picasa.ini+&btnG=Google+Search', 12960, '2004-07-20', 'Picasa is an ''Automated Digital Photo Organizer'' recently aquired by Google. This search allows the voyer to browse directories of photos uploaded using the picasa software.', '2004-07-20', NULL, NULL),
(372, 'Powered by INDEXU', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%2B%22Powered+by+INDEXU%22+inurl%3A%28browse%7Ctop_rated%7Cpower_search%7Chot%7Cbrowse%7Ccreate_admin_user%29+filetype%3Aphp&btnG=Sea', 26730, '2004-07-22', 'From the sales department: "INDEXU is a portal solution software that allows you to build powerful Web Indexing Sites such as yahoo.com, google.com, and dmoz.org with ease. It''s ability to allow you and your members to easily add, organize, and manage your links makes INDEXU the first choice of all webmasters."(Moderator note: don''t believe the marketing talk..)Some of these servers are not protected well enough. It has been reported that on (rare) occosions this page -&gt;http://[indexu server]/recovery_tools/create_admin_user.phpindicates admin login is possible by the appearance of three text lines:Create Administrator LoginDelete old administrator user ....okCreate new administrator user ....okAn attacker can then change the URL tohttp://[target]/admin/index.php and enter:user=adminpass=adminBut that''s if you find them..', '2004-07-22', NULL, NULL),
(389, '"powered by" "shoutstats" hourly daily', 'http://www.google.com/search?q=%22powered+by%22+%22shoutstats%22+hourly+daily&num=100&filter=0', 1439, '2004-07-29', 'shoutstats is a fast, free Shoutcast server statistic analysis program. It produces instant and dynamic usage reports in HTML format, for viewing in a standard browser. Shoutstats is a bunch of php scripts and a RRDtool database. It has been written under a Debian GNU/Linux.http://www.glop.org/projects/shoutstatsThis search can be used to find Shoutcast servers.', '2004-07-29', NULL, NULL);
INSERT INTO `dorks` (`dork_id`, `title`, `link`, `hits`, `date`, `description`, `dateSubmission`, `vulnSoftVersion`, `exploitID`) VALUES
(429, 'ext:cgi inurl:ubb6_test', 'http://www.google.com/search?q=ext%3Acgi+inurl%3Aubb6_test.cgi', 1439, '2004-08-13', 'The UBB trial version contains files that are not safe to keep online after going live. The install files clearly state so:CAUTIONS Do not leave pathto.asp or ubb6_test.cgi on your server. Delete them from the server when you are done. Leaving them in place poses a security risk."This is the UBB6 Permissions &amp; Paths Diagnostic Script.Example:UBB Version  	6.1.0.3  Perl Version 	5.006 Server Type 	Apache/1.3.27 (Unix) (Red-Hat/Linux) mod_fastcgi/2.2.10 mod_jk/1.2.0 mod_perl/1.24_01 PHP/4.2.2 FrontPage/5.0.2 mod_ssl/2.8.12 OpenSSL/0.9.6b  check path: 	1. 	check permission to write new files in this directory2. 	check for the ''required'' files in both the CGI and this directory3. 	check my read/write permissions on all the variables files4. 	check my absolute paths in general settings if available  	version 2.1 	ÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â© 2001 Infopop Corporation All Rights Reserved', '2004-08-13', NULL, NULL),
(453, 'intitle:index.of /AlbumArt_', 'http://www.google.com/search?hl=de&ie=ISO-8859-1&q=intitle%3Aindex.of+%2FAlbumArt_&btnG=Google-Suche&meta=', 2692, '2004-08-26', 'Directories containing commercial music.AlbumArt_{.*}.jpg are download/create by MS-Windows Media Player in music directory.', '2004-08-26', NULL, NULL),
(458, 'inurl:"plog/register.php"', 'http://www.google.com/search?q=inurl%3A%22plog%2Fregister.php%22', 1792, '2004-09-06', 'pLog is a popular form of bloggin software. Currently there are estimated about 1450 sites running it. The installation documents clearly warn about removing files after installation for security purposes:"If you are not planning to allow internet users to create new blogs in this server, then you should also remove register.php."This search finds that register.php form of course :)Below is some more general information about pLog.Vendor site: hxxp://www.plogworld.org/Admin portals http://sitename/plog/admin.phpInstallation wizard: http://sitename/plog/wizard.phpConfig file (mysql db pass): http://sitename/plog/config/config.properties.phpTemp files: http://sitename/plog/tmp/Gallery files: http://sitename/plog/gallery/Blog search engine: http://www.plogworld.org/ploogle/', '2004-09-06', NULL, NULL),
(508, '"Powered By Elite Forum Version *.*"', 'http://www.google.com/search?q=%22Powered+By+Elite+Forum+Version+*.*%22', 3128, '2004-09-24', 'Elite forums is one of those Microsoft Access .mdb file based forums. This one is particularly dangerous, because the filename and path are hardcoded in the software. An attacker can modify index.php for ./data/users/userdb.dat, open the file and see something like this:42administrat4571XXX367b52XXXb33b6ce74df1e0170(data was xx''d)These are MD5 digests and can be brute forced (with enough time) or dictionary cracked by a malicious user, thus giving adminstrator access to the forum.', '2004-09-24', NULL, NULL),
(524, 'inurl:cgi.asx?StoreID', 'http://www.google.com/search?hl=de&ie=ISO-8859-1&q=inurl%3Acgi.asx%3FStoreID+%0D%0A+%0D%0A&btnG=Google-Suche&meta=', 1607, '2004-10-05', 'BeyondTV is a web based software product which let you manage your TV station. All you need is to install a TV tuner card on your PC and Connect your TV source (i.e. television antenna) to your TV tuner card. With a installed BeyondTV version you can now administrate your TV with your browser even over the internet.', '2004-10-05', NULL, NULL),
(538, 'intitle:"Object not found" netware "apache 1.."', 'http://www.google.com/search?q=intitle:%22Object+not+found%22+netware+%22apache+1..%22&hl=en&lr=&filter=0', 1309, '2004-10-09', 'This search will show netware apache webservers as the result.', '2004-10-09', NULL, NULL),
(556, 'intitle:"Lotus Domino Go Webserver:" "Tuning your webserver" -site:ibm.com', 'http://www.google.com/search?q=intitle:%22Lotus+Domino+Go+Webserver:%22+%22Tuning+your+webserver%22+-site:ibm.com&hl=en&lr=&ie=UTF-8&filter=0', 1528, '2004-10-12', 'Domino Go Webserver is a scalable high-performance Web server that runs on a broad range of platforms. Domino Go Webserver brings you state-of-the-art security, site indexing capabilities, and advanced server statistics reporting. With Domino Go Webserver, you can speed beyond your competition by exploiting the latest advances in technology, such as Java, HTTP 1.1, and Web site content rating. Get all this and more in a Web server that''s easy to install and maintain. --From the Lotus Domino Go Webserver web pag', '2004-10-12', NULL, NULL),
(568, 'intitle:mywebftp "Please enter your password"', 'http://www.google.com/search?q=intitle:mywebftp+%22Please+enter+your+password%22&hl=en&lr=&ie=UTF-8&client=firefox-a&filter=0', 3952, '2004-10-14', 'MyWebFTP Free is a free lite version of MyWebFTP Personal - a PHP script providing FTP client capabilities with the user interface in your browser. Install it on a remote server and easily connect to your FTP servers through a firewall or a proxy not allowing FTP connections. No PHP built-in FTP support is required. Perform actions on many files at once. Password protected from casual surfers wasting your bandwidth. Nice look and feel is easy customizable.', '2004-10-14', NULL, NULL),
(576, 'ezBOO "Administrator Panel" -cvs', 'http://www.google.com/search?q=ezBOO+%22%3E%3E+Administrator+Panel+%3C%3C%22+-cvs&hl=en&lr=&start=10&sa=N', 1801, '2004-10-16', 'ezBOO WebStats is a high level statistical tool for web sites monitoring.  It allows real time access monitoring on several sites.  Based on php and mySQL it is easy to install and customization is made easy.  It works on Unix, Linux and Windows', '2004-10-16', NULL, NULL),
(652, 'inurl:aol*/_do/rss_popup?blogID=', 'http://www.google.com/search?hl=en&lr=&c2coff=1&q=inurl%3Aaol*%2F_do%2Frss_popup%3FblogID%3D&btnG=Search', 1691, '2004-11-06', 'AOL Journals BlogID Incrementing Discloses Account Names and Email AddressesAOL Journals is basically "America Online''s version of a blog (weblog) for AOL members/subscribers. A vulnerability in AOL Journals BlogID allows an attacker to numbers provided to the program and enumerate a list of AOL members/subscribers and their corresponding email.', '2004-11-06', NULL, NULL),
(658, '"About Mac OS Personal Web Sharing"', 'http://www.google.com/search?q=%22About+Mac+OS+Personal+Web+Sharing%22&hl=en&lr=&c2coff=1&client=firefox-a&filter=0', 1992, '2004-11-07', 'Mac OS Personal Web Sharing allows Mac OS users to share Folders over the Web.If you open this page you will shown the system''s major version as requirement.', '2004-11-07', NULL, NULL),
(677, 'ext:asp "powered by DUForum" inurl:(messages|details|login|default|register) -site:duware.com', 'http://www.google.com/search?hl=en&q=ext%3Aasp+%22powered+by+DUForum%22+inurl%3A%28messages%7Cdetails%7Clogin%7Cdefault%7Cregister%29+-site%3Aduware.com', 1586, '2004-11-16', 'DUForum is one of those free forum software packages. The database location is determined by the config file "connDUforumAdmin.asp", but the installation instructions don''t recommend changing it. Ouch..Database location is: http://server/duforum/_private/DUforum.mdb', '2004-11-16', NULL, NULL),
(704, '"Powered by Duclassified" -site:duware.com "DUware All Rights reserved"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=%22Powered+by+Duclassified%22+-site%3Aduware.com+%22DUware+All+Rights+Reserved%22&btnG=Search', 2046, '2004-11-23', 'Most duware products use Microsoft Access databases in default locations without instructing the users to change them. The plain text admin passwords are just a click away for any attacker who knows how to type an URL. For Duclassified it''s: /duclassified/_private/duclassified.mdb', '2004-11-23', NULL, NULL),
(728, 'inurl:"/cgi-bin/loadpage.cgi?user_id="', 'http://www.google.com/search?hl=en&ie=ISO-8859-1&q=inurl%3A%22%2Fcgi-bin%2Floadpage.cgi%3Fuser_id%3D%22&btnG=Google-Suche&meta=', 843, '2004-11-29', 'Description:EZshopper is a full-featured shopping cart program. loadpage.cgi of EZshopper allows Directory Traversal http://www.securityfocus.com/bid/2109', '2004-11-29', NULL, NULL),
(732, 'intitle:"Resin Default Home Page"', 'http://www.google.com/search?q=intitle%3A%22Resin+Default+Home+Page%22', 1355, '2004-11-30', 'Resin provides a fast standalone web server. This search locates those servers based on the title of the default page.', '2004-11-30', NULL, NULL),
(748, 'axis storpoint "file view" inurl:/volumes/', 'http://www.google.com/search?q=axis+storpoint+%22file+view%22+inurl%3A%2Fvolumes%2F', 1691, '2004-12-04', 'The Axis Storpoint device turns a SCSI or ATA box with lots of cdrom players (or writers) into a cd tower which can be browsed through any browser. The default admin password combo = root/pass. CD access can be password restricted like in Apache. Axis uses it''s own server software. Many vulnerabilities can be found in the security databases like SF.', '2004-12-04', NULL, NULL),
(754, 'intitle:"index of" "parent directory" "desktop.ini" site:dyndns.org', 'http://www.google.com/search?hl=en&q=intitle%3A%22index+of%22+%22parent+directory%22+%22desktop.ini%22+site%3Adyndns.org&btnG=Google+Search', 3944, '2004-12-05', 'This search uses desktop.ini to track users with a webserver running on their desktop computers. It can easily be extended to find specific documents.', '2004-12-05', NULL, NULL),
(827, 'XAMPP "inurl:xampp/index"', 'http://www.google.com/search?client=safari&rls=en&q=XAMPP+%22inurl:xampp/index%22&ie=UTF-8&oe=UTF-8', 2833, '2005-01-21', 'XAMPP is an easy to install Apache distribution containing MySQL, PHP and Perl. XAMPP is really very easy to install and to use - just download, extract and start. At the moment there are three XAMPP distributions.-allows you to write emails (mercury Mail)-some phpmyadmin are unprotected-security details of the server-maybe some more things  ;-)', '2005-01-21', NULL, NULL),
(833, 'inurl:"/NSearch/AdminServlet"', 'http://www.google.com/search?q=inurl:%22/NSearch/AdminServlet%22&filter=0', 1819, '2005-01-26', 'This search brings up results for Novell NetWare''s Web Search Manager.. at best the sites will be password protected, at worst the site will require no authentication - allowing full control over a site''s ''virtual search servers''.', '2005-01-26', NULL, NULL),
(881, 'filetype:sql (&quot;passwd values&quot; | &quot;password values&quot; | &quot;pass values&quot; )', 'http://www.google.com/search?num=100&q=+filetype%3Asql+%28%22passwd+values+%2A%2A%2A%2A%22+%7C+%22password+values+%2A%2A%2A%2A%22+%7C+%22pass+values+%2A%2A%2A%2A%22+%29', 1709, '2005-02-23', 'Find insert statements where the field (or table name) preceding the operator VALUES will be  ''password'' or ''passwd'' or ''pass''. The rest of the statement should contain encrypted or plaintext password.An attacker can use these files to acquire database permissions that normally would not be given to the masses.', '2005-02-23', NULL, NULL),
