(1172, 'intitle:"CJ Link Out V1"', 'http://www.google.com/search?num=100&hl=en&lr=&c2coff=1&q=intitle%3A%22CJ+Link+Out+V1%22&btnG=Search', 3114, '2005-10-26', 'A cross site scripting vunerability has been discovered in CJ linkout version 1.x. CJ linkout is a free product which allows you to easily let users connect to a different site with a frame at the top which links back to your site.  The vulnerability report can be found at http://secunia.com/advisories/16970/ .', '2005-10-26', NULL, NULL),
