(1306, 'inurl:updown.php | intext:"Powered by PHP Uploader Downloader"', 'http://www.google.com/search?hl=it&q=inurl%3Aupdown.php+%7C+intext%3A%22Powered+by+PHP+Uploader+Downloader%22+&btnG=Cerca+con+Google&meta=&num=100', 10233, '2006-02-28', 'this (evil ) script lets you to upload a php shell on target server, in most cases not password protected dork: inurl:updown.php | intext:"Powered by PHP Uploader Downloader" a note: sometimes you don''t see a link to a list of uploaded files... just switch to http://[target]/[path]/updown.php?action=download', '2006-02-28', NULL, NULL),
(1309, 'allintitle:"FirstClass Login"', 'http://www.google.com/search?num=100&hl=en&lr=&q=allintitle%3A%22FirstClass+Login%22+&filter=0', 4943, '2006-02-28', 'allintitle:"FirstClass Login" this is for firstclass directory listingsgo to http://[target]/[path]/Search type just '' in search field and you have a list of downloadable files, you don''t see all files on server but you can search for a robots.txt with some folders path or other info for site scructure, crawling in this way you have unauthorized access on all files on the target server', '2006-02-28', NULL, NULL),
(1336, 'intitle:"MvBlog powered"', 'http://www.google.com/search?hl=en&q=intitle%3A%22MvBlog+powered%22&btnG=H%C4%BEada%C5%A5&meta=&num=100', 2732, '2006-04-25', 'MvBlog is prone to multiple input-validation vulnerabilities. These issues are due to a failure in the application to properly sanitize user-supplied input.The application is prone to HTML-injection and SQL-injection vulnerabilities. A successful exploit could allow an attacker to compromise the application, access or modify data, or exploit vulnerabilities in the underlying database implementation. Arbitrary script code may also be executed in the browser of an unsuspecting user in the context of the affected site; this may help the attacker steal cookie-based authentication credentials and launch other attacks.http://www.securityfocus.com/bid/17481/discuss', '2006-04-25', NULL, NULL),
(1392, 'intitle:"Live View / - AXIS" | inurl:view/view.shtml OR inurl:view/indexFrame.shtml | intitle:"MJPG Live Demo" | "intext:Select preset position"', 'http://www.google.com/search?q=intitle:%22Live+View+/+-+AXIS%22+%7C+inurl:view/view.shtml+OR+inurl:view/indexFrame.shtml+%7C+intitle:%22MJPG+Live+Demo%22+%7C++%22intext:Select+preset+position%22&num=100&filter=0', 7357, '2006-06-25', 'No one search will reveal all Axis cameras. This is my mod of one of the queries. It usualy returns 990-1000 of the 1000 results google allows.', '2006-06-25', NULL, NULL),
(1408, '"login: *" "password: *" filetype:xls', 'http://www.google.com/search?hl=en&q=%22login%3A+*%22+%22password%3A+*%22+filetype%3Axls', 28168, '2006-09-06', 'This returns xls files containing login names and passwords. it works by showing all the xls files with password:(something)so a downside is that u do get stuff like "password protected", "password services" etc. (and the same for login)But...most of the decent ones have the login and password in the text given to you by google, so its easy to seperate the useful ones from the others.', '2006-09-06', NULL, NULL),
(1412, 'inurl:"simplenews/admin"', 'http://www.google.com/search?hl=en&q=inurl%3A%22simplenews%2Fadmin%22', 7912, '2006-09-13', 'hxxp://evuln.com/vulns/94/summary.html', '2006-09-13', NULL, NULL),
(16, 'OpenBSD running Apache', 'http://www.google.com/search?sourceid=navclient&q=%22powered+by+openbsd%22+%2B%22powered+by+apache%22', 1732, '2003-06-24', 'I like the OpenBSD operating system. I really do. And I like the Apache web server software. Honestly. I admire the mettle of administrators who take the time to run quality, secure software. The problem is that you never know when security problems will pop up. A BIG security problem popped up within the OpenBSD/Apache combo back in the day.Now, every administrator that advertised this particular combo with cute little banners has a problem. Hackers can find them with Google. I go easy on these folks since the odds are they.ve patched their sites already. Then again, they may just show up on zone-h..', '2003-06-24', NULL, NULL),
(36, 'winnt', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&safe=off&q=intitle%3Aindex.of.winnt', 2129, '2003-06-27', 'The \\WINNT directory is the directory that Windows NT is installed into by default. Now just because google can find them, this doesn''t necessarily mean that these are Windows NT directories that made their way onto the web. However, sometimes this happens. Other times, they aren''t Windows NT directories, but backup directories for Windows NT data. Wither way, worthy of a nomination.', '2003-06-27', NULL, NULL),
(50, 'inurl:tech-support inurl:show Cisco', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&oe=UTF-8&q=inurl%3Atech%2Dsupport+inurl%3Ashow+Cisco', 1616, '2003-08-07', 'This is a way to find Cisco products with an open web interface. These are generally supposed to be user and password protected. Google finds ones that aren''t. Be sure to use Google''s cache if you have trouble connecting. Also, there are very few results (2 at the time of posting.)', '2003-08-07', NULL, NULL),
(88, 'supplied argument is not a valid PostgreSQL result', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22Supplied+argument+is+not+a+valid+PostgreSQL+result%22', 1299, '2004-03-04', 'An PostgreSQL error message, this message can display path names, function names, filenames and partial code, all of which are very helpful for hackers...', '2004-03-04', NULL, NULL),
(130, 'inurl:backup intitle:index.of inurl:admin', 'http://www.google.com/search?hl=en&lr=lang_en&ie=UTF-8&oe=UTF-8&q=inurl%3Abackup+intitle%3Aindex.of+inurl%3Aadmin&btnG=Google+Search', 2432, '2004-03-16', 'This query reveals backup directories. These directories can contain various information ranging from source code, sql tables, userlists, and even passwords.', '2004-03-16', NULL, NULL),
(138, '"Select a database to view" intitle:"filemaker pro"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=%22Select+a+database+to+view%22+intitle%3A%22filemaker+pro%22', 2869, '2004-03-29', 'An oldie but a goodie. This search locates servers which provides access to Filemaker pro databases via the web. The severity of this search varies wildly depending on the security of the database itself. Regardless, if Google can crawl it, it''s potentially using cleartext authentication.', '2004-03-29', NULL, NULL),
(180, 'eggdrop filetype:user user', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=eggdrop+filetype%3Auser+user', 1570, '2004-04-26', 'These are eggdrop config files. Avoiding a full-blown descussion about eggdrops and IRC bots, suffice it to say that this file contains usernames and passwords for IRC users.', '2004-04-26', NULL, NULL),
(242, 'inurl:domcfg.nsf', 'http://www.google.com/search?q=DOMCFG.NSF&hl=en&lr=&ie=UTF-8&start=0&sa=N', 1720, '2004-05-17', 'This will return a listing of servers running Lotus Domino.  These servers by default have very descriptive error messages which can be used to obtain path and OS information.  In addition, adding "Login Form Mapping" to the search will allow you to see detailed information about a few of the servers that have this option enabled.', '2004-05-17', NULL, NULL),
(348, '"CERN httpd 3.0B (VAX VMS)"', 'http://www.google.com/search?q=%22CERN+httpd+3.0B+(VAX+VMS)%22&ie=UTF-8&oe=UTF-8', 1391, '2004-07-19', 'The version of a particular web server can be detected with a simple query like this one. Although the same thing can be accomplished by browsing the web site, this method offers another layer of anonymity. Armed with this information an attacker can plan an attack with more precision.', '2004-07-19', NULL, NULL),
(356, '"OpenSA/1.0.4" intitle:index.of', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22OpenSA%2F1.0.4%22+intitle%3Aindex.of&btnG=Search', 1311, '2004-07-19', 'The version of a particular web server can be detected with a simple query like this one. Although the same thing can be accomplished by browsing the web site, this method offers another layer of anonymity. Armed with this information an attacker can plan an attack with more precision.', '2004-07-19', NULL, NULL),
(370, '("Indexed.By"|"Monitored.By") hAcxFtpScan', 'http://www.google.com/search?hl=en&ie=UTF-8&q=hAcxFtpScan&btnG=Google+Search', 1900, '2004-07-26', 'hAcxFtpScan - software that use ''l33t h@x0rz'' to monitor their file stroz on ftp. On the ftp server usualy it is a directory like:/Monitored.By.hAcxFtpScan//Indexed.By.hAcxFtpScan/These are tagged, hacked, rooted and filled servers, in wich pplz from forums or irc channels (in most cases, usuasly private) share filez (yes yes p2p suxz)And again thnxz goo 4 help us to find it.', '2004-07-26', NULL, NULL),
(395, 'filetype:wsdl wsdl', 'http://www.google.com/search?num=100&q=filetype%3Awsdl+wsdl&btnG=Search', 1566, '2004-08-01', 'The XML headers are called *.wsdl files.they can include data, functions or objects. An attacker with knowledge of XML coding can sometimes do evil things with this stuff.', '2004-08-01', NULL, NULL),
(425, 'intext:"Warning: * am able * write ** configuration file" "includes/configure.php" -Forums', 'http://www.google.com/search?q=intext:%22Warning:+*+am+able+*+write+**+configuration+file%22+%22includes/configure.php%22+-Forums&num=100&hl=en&lr=&ie=UTF-8&safe=off&start=0&sa=N', 1636, '2004-08-13', 'OsCommerce has some security issues, including the following warning message: "Warning: I am able to write to the configuration file". Additional information on this can be found at http://www.fluxforums.com/showthread.php?p=14883#post14883With this search an attacker can find vulnerable OsCommerce servers and can build his attack from there.', '2004-08-13', NULL, NULL),
(454, 'inurl:robpoll.cgi filetype:cgi', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&safe=off&q=inurl%3Arobpoll.cgi+filetype%3Acgi&btnG=Search', 1448, '2004-08-30', 'robpoll.cgi is used to administrate polls.The default password used for adding polls is ''robpoll''.  All of the results should look something like this: "http://www.example.com/robpoll.cgi?start". An attacker may change robpoll.cgi pointing to admin  like this: "http://www.example.com/robpoll.cgi?admin".', '2004-08-30', NULL, NULL),
(510, 'intitle:"webadmin - /*" filetype:php directory filename permission', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22webadmin+-+%2F*%22+f', 2822, '2004-09-24', 'Webadmin.php is a free simple Web-based file manager. This search finds sites that use this software. If left unprotected an attacker files can be modified or added on the server.More info and screenshot at: http://cker.name/webadmin/', '2004-09-24', NULL, NULL),
(575, 'ext:ini intext:env.ini', 'http://www.google.com/search?hl=en&lr=&q=ext%3Aini+intext%3Aenv.ini&btnG=Search', 1304, '2004-10-16', 'This one shows configuration files for various applications. based on the application an attacker may find information like passwords, ipaddresses and more.', '2004-10-16', NULL, NULL),
(654, 'inurl:newsdesk.cgi? inurl:"t="', 'http://www.google.com/search?q=inurl:newsdesk.cgi%3F+inurl:%22t%3D%22&hl=en&lr=&ie=UTF-8&c2coff=1&client=firefox-a&start=10&sa=N', 1910, '2004-11-07', 'Newsdesk is a cgi script designed to allow remote administration of website news headlines.Due to a failure in the sanitization of parameters a remote user can reveal the contents of any file. This allows the attacker to download user and password data.It is furthermore known that it is possible to run system commands remotely.', '2004-11-07', NULL, NULL),
