(154, '"index of" / lck', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22index+of%22+%2F+lck', 5624, '2004-04-13', 'These lock files often contain usernames of the user that has locked the file. Username harvesting can be done using this technique.', '2004-04-13', NULL, NULL),
(177, '"index of cgi-bin"', 'http://www.google.com/search?&ie=UTF-8&oe=UTF-8&q=%22index+of+cgi%2Dbin%22', 1921, '2004-04-23', 'CGI directories contain scripts which can often be exploited by attackers. Regardless of the vulnerability of such scripts, a directory listing of these scripts can prove helpful.', '2004-04-23', NULL, NULL),
(191, 'inurl:/pls/sample/admin_/help/', 'http://www.google.com/search?q=inurl:/pls/sample/admin_/help/&hl=en&lr=&ie=UTF-8&oe=UTF-8&filter=0', 1610, '2004-04-28', 'This is the default installation location of Oracle manuals. This helps in footprinting a server, allowing an attacker to determine software version information which may aid in an attack.', '2004-04-28', NULL, NULL),
(200, 'filetype:pdf "Assessment Report" nessus', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=filetype%3Apdf+%22Assessment+Report%22+nessus', 1794, '2004-05-03', 'These are reports from the Nessus Vulnerability Scanner. These report contain detailed information about the vulnerabilities of hosts on a network, a veritable roadmap for attackers to folow.', '2004-05-03', NULL, NULL);
INSERT INTO `dorks` (`dork_id`, `title`, `link`, `hits`, `date`, `description`, `dateSubmission`, `vulnSoftVersion`, `exploitID`) VALUES
(224, 'filetype:url +inurl:"ftp://" +inurl:"@"', 'http://www.google.com/search?num=100&hl=en&lr=&q=filetype%3Aurl+%2Binurl%3A%22ftp%3A%2F%2F%22++%2Binurl%3A%22@%22', 2582, '2004-05-12', 'These are FTP Bookmarks, some of which contain plaintext login names and passwords.', '2004-05-12', NULL, NULL),
(279, 'Axis Network Cameras', 'http://www.google.com/search?hl=en&ie=UTF-8&q=inurl%3AindexFrame.shtml+Axis&btnG=Google+Search', 2735, '2004-06-06', 'The AXIS 2400 is a Web server of its own. This means that the server is secured like any other Internet host. It is up to the network manager to restrict access to the AXIS Web Cameras camera server. AXIS Network cams have a cam control page called indexFrame.shtml wich can easily be found by searching Google. An attacker can look for the ADMIN button and try the default passwords found in the documentation. An attacker may also find that the directories are browsable. Additional security related information was found on the Internet.Securityfocus(www.securityfocus.com):----------------------------------------------------"It has been reported that the Axis Video Servers do not properly handle input to the ''command.cgi'' script. Because of this, an attacker may be able to create arbitrary files that would result in a denial of service, or potentially command execution." Core Security Technologies Advisory (http://www.coresecurity.com):---------------------------------------------------"We have discovered the following security vulnerability: by accessing http://camera-ip//admin/admin.shtml (notice the double slash) the authentication for "admin" is bypassed and an attacker gains direct access to the configuration.', '2004-06-06', NULL, NULL),
(284, 'intitle:"Index of /" modified php.exe', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22Index+of+%2F%22+modified+php.exe&btnG=Search', 2624, '2004-06-10', 'PHP installed as a cgi-bin on a Windows Apache server will allow an attacker to view arbitrary files on the hard disk, for example by requesting "/php/php.exe?c:\\boot.ini."', '2004-06-10', NULL, NULL),
(292, 'OWA Public folders & Address book', 'http://www.google.com/search?q=inurl:root.asp%3Facs%3Danon&num=100&hl=en&lr=&ie=UTF-8&safe=off&output=search', 8685, '2004-06-19', 'This search jumps right to the main page of Outlook Web Access Public Folders and the Exchange Address Book:.An attacker can use the addressbook to  enumerate usernames anonymously without having to logon. These usernames can then be used to guess the mailbox passwords. An attacker can also browse the public folders to gather extra information about the organisation.', '2004-06-19', NULL, NULL),
(343, '"sets mode: +p"', 'http://www.google.com/search?q=%22sets+mode:+%2Bp%22&ie=UTF-8&oe=UTF-8', 1745, '2004-07-19', 'This search reveals private channels on IRC as revealed by IRC chat logs.', '2004-07-19', NULL, NULL),
(352, '"Microsoft-IIS/4.0" intitle:index.of', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%22Microsoft-IIS%2F4.0%22+intitle%3Aindex.of&btnG=Search', 1830, '2004-07-19', 'The version of a particular web server can be detected with a simple query like this one. Although the same thing can be accomplished by browsing the web site, this method offers another layer of anonymity. Armed with this information an attacker can plan an attack with more precision.', '2004-07-19', NULL, NULL),
(387, 'inurl:"index.php? module=ew_filemanager"', 'http://www.google.com/search?q=inurl%3A%22index.php%3Fmodule%3Dew_filemanager%22', 2231, '2004-07-29', 'http://www.cirt.net/advisories/ew_file_manager.shtml:Product: EasyWeb FileManager Module - http://home.postnuke.ru/index.phpDescription: EasyWeb FileManager Module for PostNuke is vulnerable to a directory traversal problem which allows retrieval of arbitrary files from the remote system. Systems Affected: EasyWeb FileManager 1.0 RC-1Technical Description: The PostNuke module works by loading a directory and/or file via the "pathext" (directory) and "view" (file) variables. Providing a relative path (from the document repository) in the "pathext" variable will cause FileManager to provide a directory listing of that diretory. Selecting a file in that listing, or putting a file name in the "view" variable, will cause EasyWeb to load the file specified. Only files and directories which can be read by the system user running PHP can be retrieved.Assuming PostNuke is installed at the root level:/etc directory listing:/index.php?module=ew_filemanager&amp;type=admin&amp;func=manager&amp;pathext=../../../etc/etc/passwd file:/index.php?module=ew_filemanager&amp;type=admin&amp;func=manager&amp;pathext=../../../etc/&amp;view=passwdFix/Workaround:Use another file manager module for PostNuke, as the authors do not appear to bemaintaining EW FileManager.Vendor Status: Vendor was contacted but did not respond.Credir: Sullo - cirt.netNOTE: mitigating factor, an attacker needs to be registred and logged on to have access rights to this module.', '2004-07-29', NULL, NULL),
(410, 'intext:"d.aspx?id" || inurl:"d.aspx?id"', 'http://www.google.com/search?q=intext%3A%22d.aspx%3Fid%22+%7C%7C+inurl%3A%22d.aspx%3Fid%22', 3235, '2004-08-05', '"The YouSendIt team was formed to tackle a common problem: secure transmission of large documents online without the use of clumsy client software, mail servers with limited storage space, and sharing passwords. By eliminating the size constraints and security risks of sending files by email, YouSendIt has turned the most common form of communication on the Internet into the best method of secure document transimssion."This search shows the files that were transmitted. A malicious user could download them from these pages. This company tends to hold the users responsible for content, while at the same time exposing their pages to Google.. way to go guys..', '2004-08-05', NULL, NULL),
(435, 'intext:"404 Object Not Found" Microsoft-IIS/5.0', 'http://www.google.com/search?q=intext%3A%22404+Object+Not+Found%22+Microsoft-IIS%2F5.0', 1626, '2004-08-16', 'This search finds IIS 5.0 error pages = IIS 5.0 Server', '2004-08-16', NULL, NULL),
(470, 'Gallery configuration setup files', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3Agallery+inurl%3Asetup+%22Gallery+configuration%22&btnG=Search', 1955, '2004-09-10', 'Gallery is a popular images package for websites. Unfortunately, with so many users, more bugs will be found and Google will find more installations. This search finds Gallery sites that seem to have left more or less dangerous files on their servers, like resetadmin.php and others.We call it Gallery in Setup mode :)', '2004-09-10', NULL, NULL),
(488, 'intitle:index.of (inurl:fileadmin | intitle:fileadmin)', 'http://www.google.com/search?q=intitle%3Aindex.of+%28inurl%3Afileadmin+%7C+intitle%3Afileadmin%29', 2428, '2004-09-21', 'TYPO3 is a free Open Source content management system for enterprise purposes on the web and in intranets, featuring a set of ready-made interfaces, functions and modules.The fileadmin directory is the storage for all user data like website templates, graphics, documents and so on.  Normally no sensitive data will be stored here except the one made available in restricted areas.Unprotected fileadmin directories can be found by an attacker using this query.Vendor: http://www.typo3.com/', '2004-09-21', NULL, NULL),
(502, 'ext:ldif ldif', 'http://www.google.com/search?hl=en&ie=UTF-8&q=ext%3Aldif+ldif&btnG=Google+Search', 1322, '2004-09-23', 'www.filext.com says LDIF = LDAP Data Interchange Format.LDAP is used for nearly everything in our days, so this file may include some juice info for attackers. They can add INTEXT:keyword to get more specific targets.', '2004-09-23', NULL, NULL),
(558, 'intitle:"error 404" "From RFC 2068 "', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&client=firefox-a&q=intitle%3A%22error+404%22+%22From+RFC+2068+%22&btnG=Search', 1584, '2004-10-12', 'WebLogic Server Process Edition extends the functionality of the Application Server by converging custom app development with powerful Business Process Management (BPM) capabilities to provide an industrial strength, standards-based framework that enables the rapidly assembly of composite services, transforming existing infrastructure to a service oriented architecture-in a manageable phased approach.', '2004-10-12', NULL, NULL),
(596, '"VHCS Pro ver" -demo', 'http://www.google.com/search?q=%22VHCS+Pro+++ver%22+-demo&num=100&hl=en&lr=&newwindow=1&c2coff=1&safe=off&filter=0', 1123, '2004-10-19', 'VHCS is professional Control Panel Software for Shared, Reseller, vServer and Dedicated Servers.No vulnerabilities are reported to security focus.', '2004-10-19', NULL, NULL),
(614, 'index.of.dcim', 'http://www.google.com/search?q=index.of.dcim&sourceid=mozilla-search&start=0&start=0&ie=utf-8&oe=utf-8', 4631, '2004-10-25', 'The DCIM directory is the default name for a few brands of digital camers. This is not a big network security risk, but like netcams it can reveal juicy details if found on corporate intranets.', '2004-10-25', NULL, NULL),
(616, 'intitle:"index of" -inurl:htm -inurl:html mp3', 'http://www.google.com/search?q=intitle%3A%22index+of%22+-inurl%3Ahtm+-inurl%3Ahtml+mp3', 6351, '2004-10-20', 'Yes!  I probably have should have told you guys earlier, but this is how ive been getting 100% of my mp3s.  It fricken rocks, use it and abuse it.  Downfalls to it...  a)sometimes you shouldnt include mp3 in the query and getting what you want takes several different methods of searching b)a lot of the time google gives you results and they are not there thanks to good old friend 404 c)finding stuff takes a lot of practice.  Goods...  a)ive found whole albums b)ive mass downloaded directories of hundreds of songs that i have intrest in c)its exciting seeing the results, like fining treasure.', '2004-10-20', NULL, NULL),
(628, '"File Upload Manager v1.3" "rename to"', 'http://www.google.com/search?hl=en&lr=&ie=ISO-8859-1&q=%22File+Upload+Manager+v1.3%22+%22rename+to%22&btnG=Search', 2914, '2004-10-27', 'thepeak file upload manager let you manage your webtree with up and downloading files.', '2004-10-27', NULL, NULL),
(634, 'intitle:"index of" intext:"content.ie5"', 'http://www.google.com/search?sourceid=navclient&ie=UTF-8&q=intitle%3A%22index+of%22+intext%3A%22content%2Eie5%22', 2616, '2004-10-31', 'This dork indicates the "Local settings" dir in most cases, and browseble server directories in general.', '2004-10-31', NULL, NULL),
(642, 'natterchat inurl:home.asp -site:natterchat.co.uk', 'http://www.google.com/search?hl=en&lr=&c2coff=1&client=firefox-a&q=natterchat+inurl%3Ahome.asp+-site%3Anatterchat.co.uk+&btnG=Search', 2072, '2004-11-05', 'NatterChat is a webbased chat system written in ASP.An SQL injection vulnerability is identified in the application that may allow attackers to pass malicious input to database queries, resulting in the modification of query logic or other attacks. This allows the attacker to gain admin access...', '2004-11-05', NULL, NULL),
(672, '"intitle:Index.Of /" stats merchant cgi-* etc', 'http://www.google.com/search?q=%22intitle%3AIndex.Of+%2F%22+stats+merchant+cgi-*+etc', 2439, '2004-11-07', 'This search looks for indexes with the following subdirectories: stats, merchant, online-store and cgi-local or cgi-bin. These servers have a shopping cart application called softcart in their cgi-local or cgi-bin directory. Reportedly, it is possible to execute arbitrary code by passing a malformed CGI parameter in an HTTP GET request. This issue is known to affect SoftCart version 4.00b.', '2004-11-07', NULL, NULL),
(710, 'filetype:php HAXPLORER "Server Files Browser"', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&c2coff=1&q=filetype%3Aphp+HAXPLORER+%22Server+Files+Browser%22&btnG=Search', 4305, '2004-11-28', 'Haxplorer is a webbased filemanager which enables the user to browse files on the webserver. You can rename, delete, copy, download and upload files. As the script''s name says it is mostly installed by hackers', '2004-11-28', NULL, NULL),
(713, 'intext:"Videoconference Management System" ext:htm', 'http://www.google.com/search?q=intext:%22Videoconference+Management+System%22+ext:htm&hl=en&lr=&c2coff=1&start=0&sa=N', 1560, '2004-11-28', 'Tandberg video conferencing appliancesThe webinterface enables you to drop calls and to browse the internal phonebook', '2004-11-28', NULL, NULL),
(716, 'intitle:"Welcome To Xitami" -site:xitami.com', 'http://www.google.com/search?hl=en&q=intitle%3A%22Welcome+To+Xitami%22+-site%3Axitami.com&btnG=Google+Search', 1312, '2004-11-28', 'Default Xitami installationAdditionally every default installation of Xitami webserver has a testscript which provides a lot of information about the server.It can be run by entering the following urlhttp://server/cgialias/testcgi.exe(cgialias = is usually /cgi-bin/)', '2004-11-28', NULL, NULL),
(734, 'filetype:pl -intext:"/usr/bin/perl" inurl:webcal (inurl:webcal | inurl:add | inurl:delete | inurl:config)', 'http://www.google.com/search?num=100&q=filetype%3Apl+-intext%3A%22%2Fusr%2Fbin%2Fperl%22+inurl%3Awebcal+%28inurl%3Awebcal+%7C+inurl%3Aadd+%7C+inurl%3Adelete+%7C+inurl%3Aconfig%29', 1637, '2004-12-01', 'WebCal allows you to create and maintain an interactive events calendar or scheduling system on your Web site. The file names explain themselves, but don''t abuse the faulty admins.', '2004-12-01', NULL, NULL),
(809, 'inurl:servlet/webacc', 'http://www.google.com/search?num=100&hl=en&lr=&c2coff=1&q=inurl%3Aservlet%2Fwebacc', 1885, '2005-01-06', 'I was playing around on the net when I found a small problem with Novell''s WebAcces. With User.lang you can give in you''re language as parameter I tried some different stuff there and when I tried so that the URL would be hxxp://www.notsohappyserver.com/servlet/webacc?User.Lang="&gt; this link appeared I clicked it and so I found unprotected dirs.In hxxp://www.notsohappyserver.com/com/novell/webaccess/ is a file called WebAccessUninstall.ini and this file contains info like servernames installationpaths and servers context', '2005-01-06', NULL, NULL),
(894, 'filetype:ini Desktop.ini intext:mydocs.dll', 'http://www.google.com/search?num=100&hl=en&lr=&c2coff=1&as_qdr=all&q=filetype%3Aini+Desktop.ini+intext%3Amydocs.dll&btnG=Search', 5110, '2005-02-17', 'This dork finds any webshared windows folder inside my docs. You can change the end bit "intext:mydocs.dll" by looking inside any of your your own folders on your pc, looking for the desktop.ini file and add some of the information to the query. For Anouther example - Shell Folders (Favourite etc) filetype:ini Desktop.iniintext:shell32.dllEnjoy', '2005-02-17', NULL, NULL),
(967, 'intitle:"Document title goes here" intitle:"used by web search tools" " example of a simple Home Page"', 'http://www.google.com/search?q=intitle:%22Document+title+goes+here%22+intitle:%22used+by+web+search+tools%22+%22+example+of+a+simple+Home+Page%22&hl=en&lr=&c2coff=1&filter=0', 3306, '2005-05-02', 'IBM Http Server (AS/400)', '2005-05-02', NULL, NULL),
(1045, 'filetype:mdb "standard jet"', 'http://www.google.com/search?q=filetype%3Amdb+%22standard+jet%22+%28password+%7C+username+%7C+user+%7C+pass%29&btnG=Search', 2123, '2005-07-26', 'These Microsoft Access Database files may contain usernames, passwords or simply prompts for such data.', '2005-07-26', NULL, NULL),
(1064, 'intitle:MyShell 1.1.0 build 20010923', 'http://www.google.com/search?hl=en&lr=&client=firefox-a&rls=org.mozilla%3Aen-US%3Aofficial&q=intitle%3AMyShell+1.1.0+build+20010923&btnG=Search', 6113, '2005-08-15', 'Basicly MyShell is a php program that allows you to execute commands remotely on whichever server it''s hosted on.', '2005-08-15', NULL, NULL),
(1110, '"e107.org 2002/2003" inurl:forum_post.php?nt', 'http://www.google.com/search?q=%22e107.org+2002/2003%22+inurl:forum_post.php%3Fnt&hl=en&lr=&c2coff=1&start=0&sa=N', 3039, '2005-09-13', 'e107 is prone to an input validation vulnerability. This issue is due to a failure in the application to properly sanitize user-supplied input.Successful exploitation of this issue will permit an attacker to create arbitrary forum message posts.http://www.securityfocus.com/bid/14699', '2005-09-13', NULL, NULL),
(1146, '"powered by my little forum"', 'http://www.google.com/search?hl=it&q=%22powered+by+my+little+forum%22&btnG=Cerca&meta=', 4327, '2005-09-26', 'My Little Forum 1.5 / 1.6beta SQL Injectionsoftware:site: http://www.mylittlehomepage.net/my_little_forumsoftware: "A simple web-forum that supports classical thread view (message tree)as well as messagebord view to display the messages.Requires PHP &gt; 4.1 and a MySQL database."1) look at the vulnerable code at line 144 inside search.php:... $result = mysql_query("SELECT id, pid, tid, DATE_FORMAT(time + INTERVAL ". $time_difference." HOUR,''".$lang[''time_format'']."'') AS Uhrzeit, DATE_FORMAT(time + INTERVAL ".$time_difference." HOUR, ''".$lang[''time_format'']."'') AS Datum, subject, name, email, hp, place, text, category FROM ".$forum_table." WHERE ".$search_string." ORDER BY tid DESC, time ASC LIMIT ".$ul.", " .$settings[''search_results_per_page''], $connid);...now goto the search page, select "phrase", and type:[whatever]%'' UNION SELECT user_pw, user_pw, user_pw, user_pw, user_pw, user_pw,user_pw, user_pw, user_pw, user_pw, user_pw, user_pw FROM forum_userdata whereuser_name=''[username]'' /*if magic quotes are off you will have (guess?...) any admin/user password hash''cause $searchstring var is not filtered...u can fin my poc exploit here:http://rgod.altervista.org/mylittle15_16b.html2) 1.6beta is vulnerable even, we have:...$result = mysql_query("SELECT id, pid, tid, UNIX_TIMESTAMP(time + INTERVAL ".$time_difference." HOUR) ASUhrzeit, subject, name, email, hp, place, text, category FROM ".$db_settings[''forum_table'']."WHERE ".$search_string." ORDER BY tid DESC, time ASC LIMIT ".$ul.", ".$settings[''search_results_per_page''],$connid);...you have same results, deleting a statement in injection string:[whatever]%'' UNION SELECT user_pw, user_pw, user_pw, user_pw, user_pw, user_pw,user_pw, user_pw, user_pw, user_pw, user_pw FROM forum_userdata whereuser_name=''[username]'' /*', '2005-09-26', NULL, NULL),
(1176, '"This page is for configuring Samsung Network Printer" | printerDetails.htm', 'http://www.google.com/search?hl=en&q=%22This+page+is+for+configuring+Samsung+Network+Printer%22+%7C+printerDetails.htm', 2000, '2005-11-11', 'several different samsung printers', '2005-11-11', NULL, NULL),
(1194, 'inurl:nnls_brand.html OR inurl:nnls_nav.html', 'http://www.google.com/search?q=inurl:nnls_brand.html+OR+inurl:nnls_nav.html&num=100&hl=en&lr=&c2coff=1&safe=off&filter=0', 2750, '2005-11-16', 'Novell Nterprise Linux Services detection dork. Some of the features are:* iFolder* Samba* NetStorage* eDirectory Administration* Linux User Management* NMAS 2.3* NetMail 3.5* GroupWise 6.5* iPrint* Virtual Office', '2005-11-16', NULL, NULL),
(1209, '"Welcome to the directory listing of" "NetworkActiv-Web-Server"', 'http://www.google.com/search?hl=en&q=%22Welcome+to+the+directory+listing+of%22+%22NetworkActiv-Web-Server%22&btnG=Google+Search', 4623, '2005-11-28', 'this is for NetworkActiv-Web-Server directory listing', '2005-11-28', NULL, NULL),
