(1430, 'intitle:index.of ios -site:cisco.com', 'http://www.google.com/search?q=intitle%3Aindex.of+ios+-site%3Acisco.com+-inurl&hl=en&num=10&lr=&ft=i&cr=&safe=images', 8074, '2010-11-10', 'Google search for Cisco IOS images<br/>\n<br/>\r\nAuthor: fdisk', '2010-11-10', NULL, NULL),
