(1270, '"index of /" ( upload.cfm | upload.asp | upload.php | upload.cgi | upload.jsp | upload.pl )', 'http://www.google.com/search?hl=en&q=%22index+of+%2F%22+%28+upload.cfm+%7C+upload.asp+%7C+upload.php+%7C+upload.cgi+%7C+upload.jsp+%7C+upload.pl+%29&btnG=Google+Search', 9276, '2006-03-06', 'searches for scripts that let you upload files which you can then execute on the server.', '2006-03-06', NULL, NULL),
(1399, 'site:extremetracking.com inurl:"login="', 'http://www.google.com/search?num=100&hl=en&lr=&safe=off&q=site%3Aextremetracking.com+inurl%3A%22login%3D%22+', 25291, '2006-07-31', 'The search reveals usernames (right in the URL in green) and links to the sites that are signed up with extremetracking.com. From here an attacker can view any of the sites stats, including all the visitors to the site that is being tracked, including their IP adresses.', '2006-07-31', NULL, NULL),
