(133, '"Welcome to phpMyAdmin" " Create new database"', '', 5677, '2003-08-12', 'phpMyAdmin is a widly spread webfrontend used to mantain sql databases. The default security mechanism is to leave it up to the admin of the website to put a .htaccess file in the directory of the application. Well gues what, obviously  some admins are either too lazy or don''t know how to secure their directories.  These pages should obviously not be accessable to the public without some kind of password ;-)', '2003-08-12', NULL, NULL),
(152, 'allinurl:install/install.php', '', 1923, '2004-04-06', 'Pages with install/install.php files may be in the process of installing a new service or program. These servers may be insecure due to insecure default settings. In some cases, these servers may allow for a new installation of a program or service with insecure settings. In other cases, snapshot data about an install process can be gleaned from cached page images.', '2004-04-06', NULL, NULL),
(252, 'inurl:"wvdial.conf" intext:"password"', '', 2640, '2004-05-24', 'The wvdial.conf is used for dialup connections.it contains phone numbers, usernames and passwords in cleartext.', '2004-05-24', NULL, NULL),
(278, '"ttawlogin.cgi/?action="', '', 1562, '2004-06-04', 'Tarantella is a family of enterprise-class secure remote access software products. This Google-dork lists the login page for remote access to either the site server or another server within the target company. Tarantella also has a few security issues for a list of possible things that a malicous user could try to do, have a look at - http://www.tarantella.com/security/index.html An example of a malicous user could try is http://www.tarantella.com/security/bulletin-03.html the exploit isn''t included in the User-Notice, but I''ve worked it out to be something like install directory/ttawebtop.cgi/?action=start&amp;pg=../../../../../../../../../../../../../../../etc/passwd', '2004-06-04', NULL, NULL),
(288, 'filetype:cfg ks intext:rootpw -sample -test -howto', '', 2099, '2004-06-14', 'Anaconda is a linux configuration tool like yast on suse linux. The root password is often encrypted - like md5 or read from the shadow. Sometimes an attacker can also get a cleartext password.There are more ks configs then you might expect and with a bit of searching through the result list an attacker can find the root password and own that system.', '2004-06-14', NULL, NULL),
(505, 'inurl:/_layouts/settings', '', 1457, '2004-09-23', 'With the combined collaboration features of Windows SharePoint Services and SharePoint Portal Server 2003, users in an organization can create, manage, and build collaborative Web sites and make them available throughout the organization. More information is available at : http://www.microsoft.com/sharepoint/Loads of company info can be gained by an attacker when the URL''s are unprotected. Furthermore unprotected sharepoint sites give full "Edit, Add and Delete access" to the information, which in case of malicious users may cause loss of important data.', '2004-09-23', NULL, NULL),
(530, '"Powered by Megabook *" inurl:guestbook.cgi', '', 15485, '2004-10-05', 'MegaBook is a web-based guestbook that is intended to run on Unix and  Linux variants. MegaBook is prone to multiple HTML injection vulnerabilities. http://www.securityfocus.com/bid/8065', '2004-10-05', NULL, NULL),
(542, '"Active Webcam Page" inurl:8080', '', 2182, '2004-10-09', 'Active WebCam is a shareware program for capturing and sharing the video streams from a lot of video devices. Known bugs: directory traversal and cross site scripting', '2004-10-09', NULL, NULL),
(544, 'filetype:ini inurl:flashFXP.ini', '', 1893, '2004-10-10', 'FlashFXP offers the easiest and fastest way to transfer any file using FTP, providing an exceptionally stable and robust program that you can always count on to get your job done quickly and efficiently. There are many, many features available in FlashFXP.The flashFXP.ini file is its configuration file and may contain usernames/passwords and everything else that is needed to use FTP.', '2004-10-10', NULL, NULL),
(545, 'inurl:shopdbtest.asp', '', 9017, '2004-10-10', 'shopdbtest is an ASP page used by several e-commerce products. A vulnerability in the script allows remote attackers toview the database location, and since that is usually unprotected, the attacker can then download the web site''s database by simly clicking on a URL (that displays the active database).   The page shopdbtest.asp is visible to all the users and contains the full configuration information. An attacker ca therefore download the MDB (Microsoft Database file), and gain access to sensitive information about orders, users, password, ect.', '2004-10-10', NULL, NULL),
(633, '"powered by YellDL"', '', 1661, '2004-10-31', 'Finds websites using YellDL (or also known as YellDownLoad), a download tracker written in PHP. Unfortunately this downloader downloads everything you want to, like its own files too:http://xxxxxxxxxx/download.php?f=../download&amp;e=phpBy guessing some could download information which shoudln''t get out of the server (think of ../phpMyAdmin/config.php or other stuff - no need to say that lazy people use same passwords for their DB- and FTP-login.Another search to find this software is:"You are downloading *" "you are downloader number * of this file"', '2004-10-31', NULL, NULL),
(640, '"please visit" intitle:"i-Catcher Console" Copyright "iCode Systems"', '', 3147, '2004-11-03', 'CCTV webcams by ICode.', '2004-11-03', NULL, NULL),
(687, '"Obtenez votre forum Aztek" -site:forum-aztek.com', '', 990, '2004-11-18', 'Atztek Forum is a french forum system. Aztek Forum is reported prone to multiple input validation vulnerabilities. These issues may allow an attacker to carry out cross-site scripting and possibly other attacks.http://www.securityfocus.com/bid/11654', '2004-11-18', NULL, NULL),
(699, 'inurl:report "EVEREST Home Edition "', '', 1364, '2004-11-20', 'Well what can be said about this one, I''ve added it to the DB under Juicy info, however it could have easilly gone under virtually any of the lists as it just give out Soooo much info. I can for instance find out the admin username (not just the adin every user) and also if it password protected and if the password ever expires plus is it a current user account, also do the same for any guest accounts, Ok nice and easy how about the O/S and all the Mapped Drive locations all there along with installed software and even currently running applications and processes. Site admins would have to be mad to leave this stuff open, but as we all know from the GHDB Site admins do weird and funny stuff. This one just gives out to much to list, so go have a look and see what you can find.', '2004-11-20', NULL, NULL),
(712, 'filetype:log intext:"ConnectionManager2"', '', 1278, '2004-11-28', 'ISDNPM 3.x for OS/2-Dialer log files.These files contain sensitive info like ip addresses, phone numbers of dial in servers, usernames and password hashes - Everything you need to dial in....', '2004-11-28', NULL, NULL),
(715, 'filetype:log "See `ipsec --copyright"', '', 1321, '2004-11-28', 'BARF log filesMan page:Barf outputs (on standard output) a collection of debugging information (contents of files, selections from logs, etc.) related to the IPSEC encryption/authentication system. It is primarily a convenience for remote debugging, a single command which packages up (and labels) all information that might be relevant to diagnosing a problem in IPSEC.', '2004-11-28', NULL, NULL),
(752, 'intitle:"Multimon UPS status page"', '', 1449, '2004-12-04', 'Multimon provide UPS monitoring services', '2004-12-04', NULL, NULL),
(760, 'intitle:"VitalQIP IP Management System"', '', 1212, '2004-12-07', 'The VitalQIP Web Client Interface provides a World Wide Web interface for the VitalQIP IP Management software. The purpose of the VitalQIP Web Client Interface is to allow users to add, modify, and delete IP addresses; create configuration and data files; and generate reports. It is not a fully functional user interface, such as the VitalQIP Windows or VitalQIP UNIX Clients. Certain options, such as infrastructure or policy management, are not provided. The VitalQIP Web Client Interface software is based on HTML and Perl, so your organization can customize it to meet your requirements. Vendors site: http://www.lucent.com/products/solution/0,,CTID+2020-STID+10438-SOID+1456-LOCL+1,00.html', '2004-12-07', NULL, NULL),
(779, 'intitle:"Novell Web Services" intext:"Select a service and a language."', '', 1106, '2004-12-19', '"NovellÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â® GroupWise is an enterprise collaboration system that provides secure e-mail, calendaring, scheduling, and instant messaging. GroupWise also includes task management, contact management, document management, and other productivity tools. GroupWise can be used on your desktop on Linux, Windows*, or Macintosh; in a Web browser anywhere you have an Internet connection; and even on wireless devices. Your GroupWise system can be set up on NetWareÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â®, Linux, Windows, or any combination of these operating systems."', '2004-12-19', NULL, NULL),
(791, '', '', 1380, '2004-12-08', 'some of the sites are very, very interesting - try a search substituting site:gov instead of site:com, or try site:edu or site:org or site:fm.  Anyway, camera servers made by Axis Video, you can look up administrator manuals online via the following search string (guess what you might find there?):site:com inurl:axis video server manualsCan you say default UID and PW?What''s really interesting is if you look hard enough; you can find cameras within government and educational labs; airport surveillance; even some stretches of I65 in the US (for those of you close to the Ohio River area).Anyway this search string gets you into the server; from there you can have many controls or few controls over the cameras (including zoom, pan, and iris).  There is much to see and most of the cameras have easy acccess to admin profile via click of a button - of course from there you have to provide a UID &amp; PW.  But read up on the manuals any you may get lucky.Bottom line, if you can control the camera (via admin priv.) you can control what and when the camera &amp; server view as well as what &amp; when they record.  Just a small seed for a possibly big idea - your ambitions may vary.Rate it!  Give me feedback!  I will not learn without some form of criticism...yet despite how insignificant that criticism may make me feel...i enjoy the search for the unseen/unknown knowledge nonetheless...it was worth it.', '2004-12-08', NULL, NULL);
