(796, 'intitle:"index.of" .diz .nfo last modified', '', 1593, '2004-12-30', 'File_id.diz is a description file uploaders use to describe packages uploaded to FTP sites. Although rooted in legitimacy, it is used largely by software piracy groups to describe their ill gotten goods. Systems administrators finding file_id.diz in directory listings on their servers may discover their boxes have been hacked and are being used as a distroubtion site for pirated software. .nfo''s often contain info on which piracy group the files have passed through on their way to their final resting place. This helps weed out false positives.', '2004-12-30', NULL, NULL),
(804, 'intitle:"HFS /" +"HttpFileServer"', '', 3492, '2005-01-05', '"The HttpFileServer is a Java based mechanism for providing web access to a set of files on a server. This is very similar to Apache Directory Indexing but provides the ability to upload files as well." http://johnny.ihackstuff.com/index.php?name=PNphpBB2&amp;file=viewtopic&amp;t=1516', '2005-01-05', NULL, NULL),
(810, '"Web File Browser" "Use regular expression"', '', 4666, '2005-01-07', 'This will ask google to search for a php script used to manage files on a server. The script "Web File Browser" enables users to change files on the server. The script comes un-protected, which means that anyone who knows the exact path of the php file can have admin access to files on that server.', '2005-01-07', NULL, NULL),
(814, '"Index of" rar r01 nfo Modified 2004', '', 5507, '2005-01-09', 'New Warez Directory Lists', '2005-01-09', NULL, NULL),
(826, 'uploadpics.php?did= -forumintext:Generated.by.phpix.1.0? inurl:$mode=album', '', 884, '2005-01-21', 'Product: PHPix Version:  1.0Vuln: Directory traversalPHPix is a Web-based photo album viewer written in PHP. It features automatic generation of thumbnails and different resolution files for viewing on the fly. Synnergy Labs has found a flaw within PHPix that allows a user to successfully traverse the file system on a remote host, allowing arbitrary files/folders to be read. http://www.securiteam.com/unixfocus/6G00K0K04K.html', '2005-01-21', NULL, NULL),
(828, 'intitle:"Browser Launch Page"', '', 2364, '2005-01-21', 'An ActiveX based webcam - so use MS IE', '2005-01-21', NULL, NULL),
(841, 'inurl:orasso.wwsso_app_admin.ls_login', '', 1418, '2005-01-27', 'Oracle provides a Single Sign-On solution which is quite widely spread as it integrates quite seemlessly into exisitng appllications (as Oracle says).If the link itself shows an empty page, try the directory below.', '2005-01-27', NULL, NULL),
(843, 'intitle:Group-Office "Enter your username and password to login"', '', 1404, '2005-01-27', 'Group-Office is a Groupware suite containing a base system and different modules. The modules are designed in a way that groups of people can collaborate online.', '2005-01-27', NULL, NULL),
(844, 'inurl:"8003/Display?what="', '', 1511, '2005-01-27', 'Norton AntiVirus for GatewaysEasily administered from anywhere via an HTML interface, it scans compressed and encoded files at the SMTP gateway, including a nearly unlimited number of file extensions in ZIPÃƒÆ’Ã†â€™ÃƒÂ¢Ã¢â€šÂ¬Ã…Â¡ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â®, UUENCODE, and MIME formats. Administrators have flexible options for handling infected files, scheduling virus definition updates via LiveUpdateÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¢ÃƒÆ’Ã‚Â¢ÃƒÂ¢Ã¢â‚¬Å¡Ã‚Â¬Ãƒâ€¦Ã‚Â¾ÃƒÆ’Ã¢â‚¬Å¡Ãƒâ€šÃ‚Â¢, and generating reports.', '2005-01-27', NULL, NULL),
(846, 'inurl:netscape.ini', '', 1335, '2005-01-27', 'There''s a bunch of interesting info in netscape.ini1. Viewers: which multimedia viewers the firm or people are using2.Cookies3.Address Book4.Mail- If pop3 is used you will see login and password. 5.Java - will tell the attacker if his victim has Java enabled.6.URL History - The last sites visitedURL_1=http://edtech.xxxx.fi/URL_2=C:\\Tx\\ixxx_t3.htmURL_3=http://www.xxx.com/welcome/URL_4=http://xxx.netscape.com7.User Trusted External Applications', '2005-01-27', NULL, NULL),
(869, 'intitle:opengroupware.org "resistance is obsolete" "Report Bugs" "Username" "password"', '', 2045, '2005-02-15', 'Open groupware is a comprehensive open source groupware project running on all major platforms.', '2005-02-15', NULL, NULL),
