(897, 'intitle:asterisk.management.portal web-access', '', 3533, '2005-03-20', 'Coalescent Systems Inc. launched The Asterisk Management Portal project to bring together best-of-breed applications to produce a "canned" (but fully functional) turn-key small business phone system based on The Asterisk Open Source PBX.', '2005-03-20', NULL, NULL),
